INSERT INTO `consult_college_require` VALUES (1, 2, 1, '美国TOP30院校', '&k-topic-s&【学术要求】&k-topic-e&GPA 3.7+；GMAT 705+ 或 GRE 325+&K&&k-topic-s&【英语语言要求】&k-topic-e&托福 110+ 或 雅思 7.5+&K&&k-topic-s&【学术/实习背景】&k-topic-e&专业相关高质量科研项目（建议≥2项）专业相关高质量企业实习项目（建议≥2项）', 'admin', '2024-12-30 13:32:08', 'admin', '2025-02-08 18:27:48', 0, 0);
INSERT INTO `consult_college_require` VALUES (2, 2, 1, '美国TOP30-60院校', '&k-topic-s&【学术要求】&k-topic-e&GPA3.5+；GMAT655+ 或 GRE320+&K&&k-topic-s&【英语语言要求】&k-topic-e&托福105+ 或 雅思7.0+&K&&k-topic-s&【学术/实习背景】&k-topic-e&专业相关高质量科研项目专业相关高质量企业实习项目', 'admin', '2024-12-30 13:35:18', 'admin', '2025-02-12 15:48:22', 0, 0);
INSERT INTO `consult_college_require` VALUES (3, 3, 1, '常春藤联盟&HYPSM', '&k-topic-s&【学术要求】&k-topic-e&GPA：3.9+； SAT/ACT：1550+/35+； AP：8门以上、或IB：41+（42）、或A-level：4A*&K&&k-topic-s&【语言要求】&k-topic-e&托福：110+ 或 雅思：8.0+&K&&k-topic-s&【学术背景】&k-topic-e&名校夏校、专业相关科研项目（建议≥2项）&K&&k-topic-s&【活动背景】&k-topic-e&亮眼的个人特色活动、体现社会领导力的项目、体现社会影响力的项目、高含金量国际竞赛获奖', 'admin', '2024-12-17 17:10:11', 'admin', '2025-02-13 16:04:48', 0, 0);
INSERT INTO `consult_college_require` VALUES (4, 3, 1, '美国TOP30院校', '&k-topic-s&【学术要求】&k-topic-e&GPA：3.7+；SAT/ACT：1480+/33+；AP：5门以上、或IB：39+（42）、或A-level：2A*A&K&&k-topic-s&【语言要求】&k-topic-e&托福：105+ 或 雅思：7.0+&K&&k-topic-s&【学术背景】&k-topic-e&名校夏校、科研项目&K&&k-topic-s&【活动背景】&k-topic-e&个人特色活动、体现专业兴趣与探索的实训项目、体现领导力的项目、国际竞赛项目', 'admin', '2024-12-17 17:10:46', 'admin', '2025-02-13 16:05:21', 0, 0);
INSERT INTO `consult_college_require` VALUES (5, 3, 1, '美国TOP50院校', '&k-topic-s&【学术要求】&k-topic-e&GPA：3.5+；SAT/ACT：1400+/31+；AP：0-3门以上、或IB：36+（42）、或A-level：AAB&K&&k-topic-s&【语言要求】&k-topic-e&托福：90+ 或 雅思：6.5+&K&&k-topic-s&【学术背景】&k-topic-e&科研项目&K&&k-topic-s&【活动背景】&k-topic-e&实训项目、竞赛项目', 'admin', '2024-12-17 17:51:20', 'admin', '2025-02-13 16:05:58', 0, 0);
INSERT INTO `consult_college_require` VALUES (6, 2, 1, '美国TOP60-100院校', '&k-topic-s&【学术要求】&k-topic-e&GPA3.0+；GMAT615+ 或 GRE315+&K&&k-topic-s&【英语语言要求】&k-topic-e&托福100+ 或 雅思6.5+&K&&k-topic-s&【学术/实习背景】&k-topic-e&专业相关科研项目专业相关企业实习项目', 'admin', '2024-12-30 13:36:27', 'admin', '2025-02-12 15:50:06', 0, 0);
INSERT INTO `consult_college_require` VALUES (7, 3, 50, '牛剑入学要求', '&k-topic-s&▲国际课程生&k-topic-e&&K&&k-topic-s&【学术要求】&k-topic-e&A-level（AAA至A*A*A，具体要求取决于所选课程）；IB（38至45分，包括核心课程分数，高级别科目分数要求通常为6至7分）&K&&k-topic-s&【语言要求】&k-topic-e&雅思总分7.0以上，单项不低于6.5。&K&&k-topic-s&【入学测试】&k-topic-e&需要参加特定的入学测试，如ELAT、STEP等。&K&&k-topic-s&【面试】&k-topic-e&通过初步筛选后，申请者将被邀请参加面试。&K&&k-topic-s&▲高考生&k-topic-e&&K&&k-topic-s&&k-topic-e&牛津不直接接受中国高考成绩申请；剑桥大学接受高考成绩，要求高考各省TOP 0.1%，鼓励学生参加奥林匹克竞赛，SAT、AP等考试。', 'admin', '2024-12-30 13:48:38', 'admin', '2025-02-13 19:13:35', 0, 0);
INSERT INTO `consult_college_require` VALUES (8, 3, 50, 'G5其他院校（帝国理工学院、伦敦政治经济学院、伦敦大学学院）入学要求', '&k-topic-s&▲国际课程生&k-topic-e&&K&&k-topic-s&【学术要求】&k-topic-e&A-level：A*AA，具体要求取决于所选课程；IB：38至42分，包括核心课程分数，高级别科目分数要求通常为6至7分。&K&&k-topic-s&【语言要求】&k-topic-e&雅思总分6.5至7.5，具体要求因课程而异。&K&&k-topic-s&【入学测试】&k-topic-e&部分课程要求参加额外的入学测试，如UCAT、ESAT或LNAT等。&K&&k-topic-s&▲高考生&k-topic-e&&K&&k-topic-s&&k-topic-e&LSE接受用高考成绩+AST申请本科，成绩换算后等同于A-Level申请者。', 'admin', '2024-12-30 13:49:13', 'admin', '2025-02-13 19:19:52', 0, 0);
INSERT INTO `consult_college_require` VALUES (9, 3, 50, '王爱曼华、布里斯托入学要求', '&k-topic-s&▲国际课程生&k-topic-e&&K&&k-topic-s&【学术要求】&k-topic-e&A-level成绩在AAB至AAA之间；IB成绩要求通常在32至38分之间。&K&&k-topic-s&【语言要求】&k-topic-e&雅思总分要求通常在6.0至7.0之间，具体要求因课程而异。&K&&k-topic-s&【入学测试】&k-topic-e&部分课程可能要求参加入学测试。&K&&k-topic-s&【面试】&k-topic-e&部分课程可能要求面试。', 'admin', '2024-12-30 13:50:21', 'admin', '2025-02-13 19:25:42', 0, 0);
INSERT INTO `consult_college_require` VALUES (10, 3, 50, 'QS排名前100的英国大学入学要求', '&k-topic-s&▲国际课程生&k-topic-e&&K&&k-topic-s&【学术要求】&k-topic-e&A-level成绩在ABB至AAA之间；IB成绩要求通常在30至38分之间。&K&&k-topic-s&【语言要求】&k-topic-e&雅思总分要求通常在6.0至7.0之间，具体要求因课程而异。&K&&k-topic-s&【入学测试】&k-topic-e&部分课程可能要求参加入学测试。&K&&k-topic-s&【面试】&k-topic-e&部分课程可能要求面试。&K&&k-topic-s&▲高考生&k-topic-e&&K&&k-topic-s&&k-topic-e&越来越多的英国大学开始接受高考成绩，如格拉斯哥大学、杜伦大学、伯明翰大学等的部分专业（基本要求高考成绩达到总分的80%-85%以上）。具体要求因大学而异。', 'admin', '2024-12-30 13:51:00', 'admin', '2025-02-13 19:28:12', 0, 0);
INSERT INTO `consult_college_require` VALUES (11, 2, 50, '牛剑入学要求', '1）学术要求：\r\n通常要求申请者拥有英国一等或二等一荣誉学位，或国际同等学历。\r\n对于内地申请者，通常要求来自211或985高校的申请者平均分在85%-90%以上，非211/985高校的申请者可能需要90%以上。\r\n2）语言要求：雅思总分7.0以上，单项不低于6.5。部分专业可能要求更高。\r\n3）入学测试：部分课程可能要求参加特定的入学测试。\r\n4）面试：牛津和剑桥的许多课程都要求申请者参加面试。', 'admin', '2025-01-02 13:39:10', 'admin', '2025-01-02 13:40:22', 0, 0);
INSERT INTO `consult_college_require` VALUES (12, 2, 50, 'G5其他院校入学要求', '1）学术要求：\r\n通常要求申请者拥有英国二等一荣誉学位，或国际同等学历。\r\n对于内地申请者，通常要求来自211或985高校的申请者平均分在80%-85%以上，非211/985高校的申请者可能需要85%-90%以上。\r\n2）语言要求：雅思总分通常要求6.5至7.5，具体要求因课程而异。\r\n3）入学测试：部分课程要求参加额外的入学测试。\r\n4）面试：部分课程都要求申请者参加面试。', 'admin', '2025-01-02 13:39:30', 'admin', '2025-01-02 13:40:22', 0, 0);
INSERT INTO `consult_college_require` VALUES (13, 2, 50, '王爱曼华、布里斯托入学要求', '1）学术要求：\r通常要求申请者拥有英国二等一荣誉学位，或国际同等学历。\r对于内地申请者，通常要求来自211或985高校的申请者平均分在75%-85%以上，非211/985高校的申请者可能需要80%-90%以上。\r2）语言要求：雅思总分通常要求6.5至7.0，具体要求因课程而异。\r', 'admin', '2025-01-02 13:39:49', 'admin', '2025-01-02 13:40:22', 0, 0);
INSERT INTO `consult_college_require` VALUES (14, 2, 50, 'QS排名前100的英国大学入学要求：', '1）学术要求：\r\n通常要求申请者拥有英国二等二荣誉学位或以上，或国际同等学历。\r\n对于内地申请者，通常要求来自211或985高校的申请者平均分在75%-80%以上，非211/985高校的申请者可能需要80%-85%以上。\r\n2）语言要求：雅思总分通常要求6.0至7.0，具体要求因课程而异。', 'admin', '2025-01-02 13:40:12', 'admin', '2025-01-02 13:40:22', 0, 0);
INSERT INTO `consult_college_require` VALUES (15, 3, 57, '1.澳洲八大（五星大学）入学要求', '学术要求：\r\n针对高考生\r\n1）直入本科课程：高考成绩达到各省总分的60-91%，或高中在校成绩平均分80-92%\r\n2）国际大一课程：高三完成，在校成绩平均分70-85%\r\n3）本科预科课程：高二或高三完成，在校成绩平均分65-80%\r\n\r\n针对国际课程学生\r\n直入本科课程\r\nIB课程体系：获IB文凭证书，成绩24-45分，各专业要求不等\r\nA-Level课程体系：按A*=6，A=5，B=4，C=3，D=2，E=1计分\r\n最好的3门课成绩总分5-18分，各专业要求不等\r\n美高课程体系：SAT成绩1000-1570分，各专业要求不等\r\n部分学校接受AP成绩，要求2-4门AP\r\n部分学校要求提供美高毕业证书\r\n*若申请者为其他课程体系，需达到相应入学要求。\r\n\r\n语言要求：\r\n1）直入本科课程：雅思6.5-7.0\r\n2）国际大一课程：雅思5.5-6.0\r\n3）本科预科课程：雅思5.0-6.0\r\n或根据自身语言成绩搭配语言班', 'admin', '2025-01-02 13:46:01', 'admin', '2025-01-02 14:33:24', 0, 0);
INSERT INTO `consult_college_require` VALUES (16, 3, 57, '2.澳洲四星大学入学要求', '学术要求：\r\n针对高考生\r\n1）直入本科课程：高考成绩达到各省总分60-80%或达到二本线以上，或高中在校成绩平均分80%\r\n2）国际大一课程：高三完成，在校成绩平均分65-75%\r\n3）本科预科课程：高二或高三完成，在校成绩平均分60-70%\r\n\r\n若申请者为国际课程体系学生，需达到相应入学要求\r\n\r\n语言要求：\r\n1）直入本科课程：雅思6.5-7.0\r\n2）国际大一课程：雅思5.5-6.0\r\n3）本科预科课程：雅思5.0-6.0\r\n或根据自身语言水平搭配语言班', 'admin', '2025-01-02 13:46:25', 'admin', '2025-01-02 14:33:24', 0, 0);
INSERT INTO `consult_college_require` VALUES (17, 2, 57, '1.澳洲八大(五星大学)入学要求', '学术要求：\r\n1）985/211背景：在校成绩平均分60-75%\r\n2）双非背景：在校成绩平均分65%-85%\r\n\r\n语言要求：\r\n雅思6.5(6.0)-7.0(6.0)\r\n或根据自身语言成绩搭配语言班', 'admin', '2025-01-02 14:01:32', 'admin', '2025-01-06 13:16:33', 0, 0);
INSERT INTO `consult_college_require` VALUES (18, 2, 57, '2.澳洲四星大学入学要求', '学术要求：\r\n在校成绩平均分达到70%\r\n\r\n语言要求：\r\n雅思6.0(5.5)-6.5(6.0)\r\n或根据自身语言水平搭配语言班', 'admin', '2025-01-02 14:01:52', 'admin', '2025-01-02 14:33:24', 0, 0);
INSERT INTO `consult_college_require` VALUES (19, 3, 56, '1.“港前五”入学要求', '针对高考生：\r\n 学术要求：\r\n 高考成绩：建议达到省排名前500-1000名，或超一本线/特殊控制线120以上\r\n 高考英语成绩：建议高考英语120以上\r\n\r\n针对国际课程体系学生：\r\n 学术要求：\r\n IB课程体系：获得IB文凭证书，总成绩达到30-40分\r\n A-Level课程体系：三门A-Level课程成绩E以上，建议AAA及以上\r\n 美高体系：SAT 1190-1400/ACT 24-27，至少三门AP 3分或以上，建议5分\r\n 英语语言要求：\r\n 雅思6.5+ 或 托福93+', 'admin', '2025-01-02 14:09:19', 'admin', '2025-01-02 14:33:24', 0, 0);
INSERT INTO `consult_college_require` VALUES (20, 3, 56, '2.亚洲排名前300院校入学要求', '针对高考生：\r\n 学术要求：\r\n 高考成绩：建议超一本线/特殊控制线以上\r\n 高考英语成绩：建议高考英语110-120分\r\n\r\n针对国际课程体系学生：\r\n 学术要求：\r\n IB课程体系：获得IB文凭证书\r\n A-Level课程体系：至少三门A-Level 或两门A-Level+两门AS成绩E或以上；\r\n（备注：英文和中文通常不计算在内）。\r\n 美高体系：SAT 1190+/ACT23-24或以上，至少两门AP 3分及以上\r\n 英语语言要求：\r\n 雅思6.0+ 或 托福79+', 'admin', '2025-01-02 14:09:46', 'admin', '2025-01-02 14:33:24', 0, 0);
INSERT INTO `consult_college_require` VALUES (21, 3, 56, '3.亚洲排名前600院校入学要求', '针对高考生：\r\n 学术要求\r\n 高考成绩：建议超二本线/本科线以上\r\n 高考英语成绩：建议高考英语100分\r\n\r\n针对国际课程体系学生：\r\n 学术要求：\r\n IB课程体系：总成绩达到24分以上\r\n A-Level课程体系：至少两门A-Level 或一门A-Level+两门AS成绩E或以上；\r\n（备注：英文和中文通常不计算在内）。\r\n 美高体系：SAT1190+/ACT23-24或以上，至少两门AP成绩3分及以上\r\n 英语语言要求：\r\n 雅思5.5+ 或 托福79+', 'admin', '2025-01-02 14:10:08', 'admin', '2025-01-02 14:33:24', 0, 0);
INSERT INTO `consult_college_require` VALUES (22, 2, 56, '1.“港前五”入学要求', '学历与学术要求\r\n毕业于受认可大学相关领域学士学位或同等学历\r\n通常成绩要求不低于二等荣誉，或平均成绩不低于“B”\r\n学术成绩建议：\r\n国内985/211院校：GPA不低于80分\r\n国内一本院校（通常指软科排名前350院校）：GPA不低于85分\r\n热门专业如商科需更高成绩\r\n\r\n英语语言要求\r\n雅思6.0-6.5分及以上 或 托福80分及以上\r\n香港城市大学部分专业接受大学六级英语考试成绩', 'admin', '2025-01-02 14:21:59', 'admin', '2025-01-02 14:33:24', 0, 0);
INSERT INTO `consult_college_require` VALUES (23, 2, 56, '2.亚洲排名前300院校入学要求', '学历与学术要求\r\n毕业于受认可大学相关领域学士学位或同等学历\r\n学术成绩建议：\r\n985/211院校：GPA不低于75分\r\n一本院校（通常指软科排名前350院校）：GPA不低于80分\r\n二本/独立学院/民办本科：GPA不低于85分\r\n热门专业如商科需更高成绩\r\n\r\n英语语言要求\r\n雅思6.0-6.5分及以上 或 托福79分及以上\r\n部分专业接受大学六级英语考试成绩，部分专业无需提供语言成绩申请', 'admin', '2025-01-02 14:22:38', 'admin', '2025-01-02 14:33:24', 0, 0);
INSERT INTO `consult_college_require` VALUES (24, 2, 56, '3.亚洲排名前600院校入学要求', '学历与学术要求\r\n毕业于受认可大学相关领域学士学位或同等学历\r\n学术成绩建议：\r\n一本院校（通常指软科排名前350院校）：GPA不低于75分\r\n二本/独立学院/民办本科：GPA不低于75-80分\r\n\r\n英语语言要求\r\n雅思6.0-6.5分及以上 或 托福79分及以上', 'admin', '2025-01-02 14:23:03', 'admin', '2025-01-02 14:33:24', 0, 0);
INSERT INTO `consult_college_require` VALUES (25, 3, 45, '1.顶尖公立大学入学要求', '学术要求：\r\n针对高考生\r\n高考成绩建议达到83%及以上\r\n部分专业设有面试\r\n\r\n若申请者为国际课程体系（IB/A-Level/美国高中等），需达到相应入学要求。\r\n\r\n语言要求：\r\n雅思6.0分以上（写作单项6.0分以上）或 托福90分以上', 'admin', '2025-01-02 14:25:58', 'admin', '2025-01-02 14:33:24', 0, 0);
INSERT INTO `consult_college_require` VALUES (26, 3, 45, '2.私立大学入学要求', '学术要求：\r\n高中三年成绩达到70%-80%以上\r\n低于标准可单独评估\r\n\r\n语言要求：\r\n雅思5.0-6.5分，大部分院校可直入专业课\r\n如无英语成绩，学校可配语言班', 'admin', '2025-01-02 14:26:21', 'admin', '2025-01-02 14:33:24', 0, 0);
INSERT INTO `consult_college_require` VALUES (27, 2, 45, '1.顶尖公立大学入学要求', '学术要求：\r\n 正规院校相关领域学士学位或同等学历\r\n 在校成绩平均分达到80-85%\r\n\r\n语言要求：\r\n 雅思6.0-7.0分 或 托福85-100分', 'admin', '2025-01-02 14:32:56', 'admin', '2025-01-02 14:33:24', 0, 0);
INSERT INTO `consult_college_require` VALUES (28, 2, 45, '2.私立大学入学要求', '学术要求：\r\n在校成绩平均分达到75%\r\n\r\n语言要求：\r\n雅思5.0-6.5分，大部分院校可直入专业课\r\n如无英语成绩，学校可配语言班', 'admin', '2025-01-02 14:33:14', 'admin', '2025-01-02 14:33:24', 0, 0);
INSERT INTO `consult_college_require` VALUES (29, 7, 55, '标题', '&k-topic-s&11&k-topic-e&22&K&&k-topic-s&&k-topic-e&22&K&&k-topic-s&111&k-topic-e&222', 'admin', '2025-01-21 10:23:47', 'admin', '2025-01-24 16:19:30', 1, 1);
