INSERT INTO `consult_college_require` VALUES (31, 1, 1, '厕所', '&k-topic-s&1&k-topic-e&2', 'admin', '2025-02-05 13:52:12', 'admin', '2025-02-05 15:13:49', 1, 1);
INSERT INTO `consult_college_require` VALUES (32, 1, 55, '1223', '&k-topic-s&1&k-topic-e&2', 'admin', '2025-02-05 16:03:08', 'admin', '2025-02-05 16:03:13', 1, 1);
INSERT INTO `consult_college_require` VALUES (33, 3, 125, '日语授课项目', '&k-topic-s&&k-topic-e&完成12年基础教育，正规高中或同等学历。&K&&k-topic-s&&k-topic-e&大多需提供留考成绩。', 'admin', '2025-02-13 11:27:18', 'admin', '2025-02-13 11:31:46', 0, 0);
INSERT INTO `consult_college_require` VALUES (34, 3, 125, 'SGU项目', '&k-topic-s&&k-topic-e&完成12年基础教育，正规高中或同等学历。&K&&k-topic-s&&k-topic-e&大多需要提供高考/SAT/ACT等标化成绩、托福/雅思成绩。', 'admin', '2025-02-13 11:28:37', 'admin', '2025-02-13 11:29:04', 0, 0);
INSERT INTO `consult_college_require` VALUES (35, 3, 124, '澳门大学（QS世界前300）', '&k-topic-s&【高考成绩】&k-topic-e&需达到本科一批录取分数线，择优录取&K&&k-topic-s&【英语成绩】&k-topic-e&需达到110分以上（满分150分）&K&&k-topic-s&【材料要求】&k-topic-e&需提交高考成绩、身份证、英语成绩证明等材料', 'admin', '2025-02-13 13:43:25', 'admin', '2025-02-13 16:05:15', 0, 0);
INSERT INTO `consult_college_require` VALUES (36, 3, 124, '澳门科技大学（QS世界前500）', '&k-topic-s&【高考成绩】&k-topic-e&达一本线以上&K&&k-topic-s&【部分专业要求】&k-topic-e&（如中药学、药学）需有理科综合或化学成绩', 'admin', '2025-02-13 13:44:47', 'admin', '2025-02-13 16:06:32', 0, 0);
INSERT INTO `consult_college_require` VALUES (37, 3, 124, '其他大学', '&k-topic-s&【高考成绩】&k-topic-e&达本科线以上&K&&k-topic-s&【部分专业要求】&k-topic-e&英语单科成绩达到相应要求', 'admin', '2025-02-13 13:46:26', 'admin', '2025-02-13 16:06:55', 0, 0);
INSERT INTO `consult_college_require` VALUES (38, 3, 138, '圣三一大学（2025QS世界排名87）', '&k-topic-s&【学术要求】&k-topic-e&&K&&k-topic-s&&k-topic-e&根据不同专业，学生需达到所在省份高考满分的68%、72%、80%，且高中平时成绩达到80%、85%、90%。&K&&k-topic-s&&k-topic-e&同时，学生还需满足部分专业对具体科目的分数要求 (临床、牙医、哥大双学位除外)；或者其他考试（SAT等）。&K&&k-topic-s&&k-topic-e&未参加高考或高考不理想的学生，可通过AST考试申请，600分可申请band3专业，700分可申请band2，750分可申请band1。&K&&k-topic-s&【语言要求】&k-topic-e&&K&&k-topic-s&&k-topic-e&雅思：总分不低于 6.5 分，小分不低于 6 分；&K&&k-topic-s&&k-topic-e&托福：总分不低于 90 分，写作不低于 21 分；&K&&k-topic-s&&k-topic-e&多邻国：总分 120/160 分，小分不低于 105 分；&K&&k-topic-s&&k-topic-e&PTE：总分 63，口语单项不低于 59。&K&&k-topic-s&&k-topic-e&注：本科计算机专业名额有限，申请时需提交合格的语言成绩。', 'admin', '2025-02-13 13:56:40', 'admin', '2025-02-14 11:37:27', 0, 0);
INSERT INTO `consult_college_require` VALUES (39, 3, 138, '都柏林大学（2025QS世界排名126）', '&k-topic-s&【学术要求】&k-topic-e&中国高考成绩总分65%—90% (根据专业而定)；A-level/IB/美国高中成绩+SAT/ACT+AP，或其它认可的国际性考试学历均认可。&K&&k-topic-s&【语言要求】&k-topic-e&文科类要求‌托福100或‌雅思6.5（小分不低于6.0）；理工类要求托福80或雅思6.0（小分不低于6.0）。PTE 63 ( 各项不低于59)', 'admin', '2025-02-13 14:01:32', 'admin', '2025-02-13 16:08:58', 0, 0);
INSERT INTO `consult_college_require` VALUES (40, 3, 138, '科克大学（2025QS世界排名273）', '&k-topic-s&【学术要求】&k-topic-e&无需高考或会考成绩，高中均分至少不低于80分(不同等级专业要求不同，另部分专业对数学、Lab Science学科等有单科成绩要求)；或我校认可的其它高中课程类型对等成绩，如A-Level, IB, SAT等。&K&&k-topic-s&【申请材料要求】&k-topic-e&申请人如高中在读，申请时提供高一至高三上学期5个学期成绩单与在读证明；如申请人已高中毕业，需提供完整成绩单与高中毕业证明。&K&&k-topic-s&【最低语言要求】&k-topic-e&雅思6.5(6.0)或其它英语考试类型对等成绩。&K&&k-topic-s&【护理（专升本）要求】&k-topic-e&接受全日制专科护理相关背景申请，均分不低于75%，具有注册护士资格，且具有不少于6个月注册后工作经验，语言要求雅思6.5(单项不低于6.5)或其它英语考试类型对等成绩。', 'admin', '2025-02-13 14:05:27', 'admin', '2025-02-13 16:09:25', 0, 0);
INSERT INTO `consult_college_require` VALUES (41, 3, 138, '高威大学（2025QS世界排名273）', '&k-topic-s&【学术要求】&k-topic-e&无需提供高考成绩，高中三年成绩单(平均分最好达80%)，但申请人必须在进入就读本科学习前获得高中毕业证书。&K&&k-topic-s&【语言要求】&k-topic-e&文科/商学/法律/理工/工程：雅思总分不低于6.5分，单项不低于5.5分；医学相关：雅思总分不低于6.5分，单项不低于6.5分。', 'admin', '2025-02-13 14:08:40', 'admin', '2025-02-13 16:09:43', 0, 0);
INSERT INTO `consult_college_require` VALUES (42, 3, 138, '其他大学', '&k-topic-s&【学术要求】&k-topic-e&无需提供高考成绩，高中三年均分75%-80%，视所申院校及专业而定。&K&&k-topic-s&【语言要求】&k-topic-e&雅思6-6.5分，部分院校有单项要求。', 'admin', '2025-02-13 14:09:39', 'admin', '2025-02-13 16:09:58', 0, 0);
INSERT INTO `consult_college_require` VALUES (43, 2, 124, '澳门大学（QS世界前300）', '&k-topic-s&【学历要求】&k-topic-e&需持有本科学位，部分专业要求相关背景&K&&k-topic-s&【学术要求】&k-topic-e&本科平均学分绩点≥2.3（4分制），或70%，择优录取&K&&k-topic-s&【语言要求】&k-topic-e&提供雅思6（5.5）分，或托福80分，或大学英语六级430分，或专四/专八语言成绩', 'admin', '2025-02-13 14:34:07', 'admin', '2025-02-13 16:05:43', 0, 0);
INSERT INTO `consult_college_require` VALUES (44, 2, 124, '其他大学', '&k-topic-s&【学历要求】&k-topic-e&需本科学位&K&&k-topic-s&【部分专业要求】&k-topic-e&相关背景/需联系导师', 'admin', '2025-02-13 14:34:55', 'admin', '2025-02-13 16:07:08', 0, 0);
INSERT INTO `consult_college_require` VALUES (45, 2, 138, '圣三一大学（2025QS世界排名87）', '&k-topic-s&商学院学术要求：&k-topic-e&国内211/985以及上海软科排名前200大学，均分82%以上。其他大学优秀学生申请case by case。&K&&k-topic-s&计算机学院学术要求：&k-topic-e&国内211/985以及上海软科排名前200大学，均分82%以上； 若为非以上排名大学，需有优异的专业课成绩，优秀的PS和推荐信(奖学金或获奖经历也对申请有帮助)； Computer Science专业需要参加在线编程测试(C，C++或Java)。&K&&k-topic-s&非商学院与计算机学院：&k-topic-e&国内985大学均分78%以上，国内211/双一流大学均分80%以上，其他大学：建议82分以上，最低不低于80分。&K&&k-topic-s&语言要求：&k-topic-e&雅思总分6.5分，单项不低于6分；雅思6.5(6)-7分； 托福总分88-100分；PTE总分63分，单项不低于59分。计算机学院不接受学前语言课程，必须达到直入要求。部分专业语言要求会有所不同。&K&&k-topic-s&其他要求：&k-topic-e&如作品集，研究计划和面试情况，根据课程官网要求为准。', 'admin', '2025-02-13 14:41:07', 'admin', '2025-02-13 16:08:24', 1, 0);
INSERT INTO `consult_college_require` VALUES (46, 2, 130, '基本要求', '&k-topic-s&【GPA】&k-topic-e&80+&K&&k-topic-s&【语言要求】&k-topic-e&雅思（6.5小分不低于6）；C1（雅思7小分不低于6.5），具体要求取决于申请专业。&K&&k-topic-s&【其他标化】&k-topic-e&部分专业需要提供GRE或者GMAT成绩', 'admin', '2025-02-13 15:16:02', 'admin', '2025-02-13 16:09:20', 0, 0);
INSERT INTO `consult_college_require` VALUES (47, 3, 55, '测试标题', '&k-topic-s&我是主题A&k-topic-e&我是主题A&K&&k-topic-s&&k-topic-e&我是主题A1&K&&k-topic-s&&k-topic-e&我是主题A2&K&&k-topic-s&我是主题B&k-topic-e&我是主题B', 'admin', '2025-02-13 23:30:23', 'admin', '2025-02-15 21:35:31', 0, 1);
