INSERT INTO `consult_lang` VALUES (1, '雅思', 'IELTS', 'http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202412311733/IELTS.png', 'International English Language Testing System', '考试形式分为机考或纸笔考，由听说读写四部分构成，每部分1-9分，最终得出平均总分。\n总时长约2小时45分钟，成绩有效期2年。\n机考场次较多，纸笔考每周末安排。机考考后3天出分，纸笔考考后10天出分。\n建议参加雅思A类或UKVI A类，部分院校接受单项重考。\n', 'admin', '2024-12-27 16:40:31', 'admin', '2025-02-11 13:26:35', 0, 0);
INSERT INTO `consult_lang` VALUES (2, '托福', 'TOEFL', 'http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202412311733/tofel.png\n', 'Test of English as a Foreign Language', '由美国教育考试服务中心（ETS）开发，新托福网考（托福iBT）形式为机考，由听说读写4个部分构成，4个单项各30分，总分满分120分。考试总时长为2小时以内，成绩有效期为2年。每月安排多场考试，考试结束后4-8天内出分。', 'admin', '2024-12-27 16:40:31', 'admin', '2025-02-11 10:58:55', 0, 0);
INSERT INTO `consult_lang` VALUES (3, 'PTE', 'PTE', 'http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202412311733/PTE.png\n', 'Pearson Tests of English', '全球广泛认可，考试形式为机考，由口语写作、阅读、听力3个部分构成，考试分数范围为10-90。考试总时长2小时左右，成绩有效期为2年。全年每天都设有考位，提前24小时报名即可，考试结束后2-5个工作日出分。', 'admin', '2024-12-27 16:40:31', 'admin', '2025-01-08 10:59:57', 0, 0);
INSERT INTO `consult_lang` VALUES (4, '多邻国', 'Duolingo', 'http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202412311732/duolingo.png', 'Duolingo English Test', '全球广泛认可，考试形式为自适应机考，由听力、口语、阅读、写作、面试五部分组成，考试分数范围在10-160分，5分为计分单位。考试时长约为1小时，成绩有效期为2年。考试场次多，可随时报考，考试结束后48小时内出分。', 'admin', '2024-12-27 16:40:31', 'admin', '2025-01-02 14:35:39', 0, 0);
INSERT INTO `consult_lang` VALUES (5, 'A-level', 'A-level', 'http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202501081103/image.jpeg', 'General Certificate of Education Advanced Level', '英国高中课程，被广泛认可为全球范围内的大学入学资格认证之一。A-Level提供广泛的科目选择，学制为两年。在中国由CIE、AQA和爱德思考试局设计并组织，分别于每年5-6月和10-11月在全球统一组织，成绩分别在8月和次年2月公布。', 'admin', '2024-12-27 16:40:31', 'admin', '2025-01-08 11:03:43', 0, 0);
INSERT INTO `consult_lang` VALUES (6, 'GRE', 'GRE', 'http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202412311732/GRE.png', 'Graduate Record Examination', '广泛用于研究生院和商学院的入学评估，考试包含分析性写作、文字推理和数量推理三部分，成绩分别计分，总分范围130-170分，分析性写作为0-6分。考试时间约2小时，成绩有效期为五年。考试结束后8-10天出正式成绩。', 'admin', '2024-12-27 16:40:31', 'admin', '2025-01-02 14:36:01', 0, 0);
INSERT INTO `consult_lang` VALUES (7, 'GMAT', 'GMAT', 'http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202412311732/GMAT.png', 'Graduate Management Admission Test', '由美国管理专业研究生入学考试委员会（GMAC）主办，被全球超过6000商学院项目认可。考试包含定量推理、文本推理和数据洞察三部分，考试时长为2小时15分钟，成绩有效期为五年。考试结束后10天内出正式成绩。', 'admin', '2024-12-27 16:40:31', 'admin', '2025-01-02 14:36:15', 0, 0);
INSERT INTO `consult_lang` VALUES (8, 'ACT', 'ACT', 'http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202412311731/ACT.png', 'American College Testing', '美国广泛使用的大学入学标准化考试之一，考试形式为机考，包含英语、数学、阅读和科学推理四部分，总时长为2小时55分钟（不含写作）。考试总分为36分，各科单独计分后取平均值，成绩有效期为5年。全年提供7个考试时间，出分时间为考试结束后两周。', 'admin', '2024-12-27 16:40:31', 'admin', '2025-06-25 10:12:47', 0, 0);
INSERT INTO `consult_lang` VALUES (9, 'SAT', 'SAT', 'http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202412311731/SAT.png', 'Scholastic Assessment Test', '广泛用于美国及全球大学的本科入学评估。考试形式为机考，包含阅读与语法、数学。总分为1600分，其中阅读和语法800分，数学800分。总时长约为2小时14分钟。考试成绩无官方有效期限制。全年提供7个考试时间，出分时间为考试结束后两周(中国内地暂无考点)。', 'admin', '2024-12-27 16:40:31', 'admin', '2025-02-11 10:58:18', 0, 0);
INSERT INTO `consult_lang` VALUES (10, 'AP', 'AP', 'http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202412311731/AP.png', 'Advanced Placement', '高中阶段开设的具有大学水平的课程，分为7个大类38个学科，每年5月举行全球统一考试，考试采用5分制评分，大多数大学接受3分以上的成绩以换取学分或跳过基础课程。每年5月考试，成绩在7月公布。', 'admin', '2024-12-27 16:40:31', 'admin', '2025-06-25 10:12:45', 0, 0);
INSERT INTO `consult_lang` VALUES (11, 'IBDP', 'IBDP', 'http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202412311729/IB.png\n', 'International Baccalaureate Diploma Programme (IBDP)', '面向高中生的课程，为期两年，被全球广泛认可用于大学入学申请。包含六个学科组和三个核心课程，六个学科每门最高7分，三个核心课程最多可得3分，总分45分。分别于每年4-5月和10-11月进行，成绩分别在7月和12月公布。', 'admin', '2024-12-27 16:40:31', 'admin', '2025-01-24 12:54:25', 0, 0);
INSERT INTO `consult_lang` VALUES (13, '测试语言1', 'Test2', 'http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202501211138/%E7%88%B1%E5%BF%83.png', '我是副标题3', '我是详情4', 'admin', '2025-01-21 11:25:49', 'admin', '2025-01-21 11:41:09', 1, 0);
INSERT INTO `consult_lang` VALUES (14, '测试语言2', 'Test ENG2', 'http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202501241119/Bee_JE1.gif', '副标题2', '详情2', 'admin', '2025-01-24 11:13:32', 'admin', '2025-01-24 11:19:53', 1, 0);
INSERT INTO `consult_lang` VALUES (15, 'EJU留考', 'EJU', 'http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202502111132/EJU.jpg', 'Examination for Japanese University Admission for International Students', '全部的日本国立、公立大学和超过半数的私立大学都要求外国留学生在申请入读大学本科时，首先要提交参加EJU留考成绩，作为基本审查条件。私立艺术类大部分需要EJU日语单科成绩。另外，留学生进入大学后如要申请政府奖学金或国公立大学的学费减免，是否参加过EJU和EJU成绩也是重要评定标准。\n该考试由独立行政法人日本学生支援机构实施，每年6月、11月举行两次。', 'admin', '2025-02-11 11:32:25', 'admin', '2025-02-11 11:36:34', 0, 0);
INSERT INTO `consult_lang` VALUES (16, '日本语能力测试', 'JLPT', 'http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202502111201/JLPT.jpg', 'The Japanese-Language Proficiency Test', '日语能力测试（JLPT）是对日本国内及海外以母语非日语学习者为对象进行的日语能力测试和认定。\n（1）语言等级：N5、N4、N3、N2、N1\n（2）考试地点：日本和国内均设有考点\n（3）出分时间：考后一个月\n（4）考试形式：纸考，每次仅限报名一个级别。\n满分均为180分，其中大学本科入学语言等级要求最低N2。', 'admin', '2025-02-11 11:40:32', 'admin', '2025-02-11 12:01:55', 0, 0);
INSERT INTO `consult_lang` VALUES (17, '高考', '普通高等学校招生全国统一考试', 'http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202502152136/84638202502152136.png', 'GAOKAO', '中国普通高等学校招生全国统一考试，简称“高考”，是合格的高中毕业生或具有同等学力的考生参加的选拔性考试。主要科目有：语文、数学、外语。其中，高考英语总分150分。中国香港地区部分高校和中国澳门地区高校，接受普高生使用高考英语成绩申请。', 'admin', '2025-02-11 11:56:09', 'admin', '2025-07-04 15:09:43', 0, 0);
