INSERT INTO `consult_major_course` VALUES (1, 6, '货币银行学', '货币银行学主要包含三大内容：货币、银行和利率。货币是交易的内容，银行是中介机构，利率是交易的价格。', 0, 0, 'admin', '2024-12-31 15:02:35', 'admin', '2025-02-05 13:46:07', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (2, 6, '公司金融', '资本性开支(Capital Budgeting, NPV IRR analysis)、分红政策(Dividend Policy)、资产负债结构(Capital Structure)、企业融资(Equity, Debt issue)', 0, 0, 'admin', '2024-12-31 15:02:35', 'admin', '2024-12-31 15:25:56', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (3, 6, '金融科技', '金融科技是基于大数据、云计算、人工智能、区块链等一系列技术创新，全面应用于支付清算、借贷融资、财富管理、零售银行、保险、交易结算等六大金融领域，是金融业未来的主流趋势。', 0, 0, 'admin', '2024-12-31 15:02:35', 'admin', '2024-12-31 15:25:56', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (4, 6, '线性代数', '线性代数是理解和应用高频交易与量化投资技术的基础，涉及向量、矩阵和线性方程组等概念，对于构建预测模型和优化交易策略至关重要。', 0, 0, 'admin', '2024-12-31 15:02:35', 'admin', '2024-12-31 15:25:56', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (5, 6, '微积分', '微积分在金融学中用于计算收益率、波动率等关键指标，帮助金融机构和投资者评估风险和收益，是金融决策和风险管理的核心工具。', 0, 0, 'admin', '2024-12-31 15:02:35', 'admin', '2024-12-31 15:25:56', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (6, 6, '概率论', '概率论是金融学研究中用于描述和处理金融市场中的随机现象，对金融产品定价、风险管理和投资决策具有重要意义。', 0, 0, 'admin', '2024-12-31 15:02:35', 'admin', '2024-12-31 15:25:56', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (7, 6, '宏观经济学', '宏观经济学为金融专业学生提供了分析整体经济环境和政策影响的工具，帮助他们理解经济周期、货币政策和财政政策对金融市场的影响。', 0, 0, 'admin', '2024-12-31 15:02:35', 'admin', '2024-12-31 15:25:56', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (8, 6, '微观经济学', '微观经济学关注个体经济单位的行为，为金融专业人士提供理解市场机制、价格形成和资源配置的框架，是金融决策的基础。', 0, 0, 'admin', '2024-12-31 15:02:35', 'admin', '2024-12-31 15:25:56', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (9, 6, '计量经济学', '计量经济学结合经济理论和统计方法，通过实证分析金融市场数据，为金融决策提供量化依据，是金融领域数据分析和预测的重要工具。', 0, 0, 'admin', '2024-12-31 15:02:35', 'admin', '2024-12-31 15:25:56', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (10, 6, '会计学', '会计学为金融专业人士提供财务报告和分析的基础，帮助他们评估企业的财务状况和经营成果，是金融投资和信贷决策的关键组成部分。', 0, 0, 'admin', '2024-12-31 15:02:35', 'admin', '2024-12-31 15:25:57', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (11, 13, '传播学概论', '深入分析人类传播行为的理论模型，探讨信息传播的过程、影响因素及其在社会互动中的作用，为学生提供传播领域的全面视角。', 0, 0, 'admin', '2024-12-31 15:25:30', 'admin', '2024-12-31 15:25:57', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (12, 9, '课程12update', '课程描述update', 0, 0, 'admin', '2024-12-31 15:25:30', 'admin', '2025-07-02 11:42:57', 3, 1);
INSERT INTO `consult_major_course` VALUES (13, 13, '传播研究方法与统计学', '系统学习传播研究的设计、实施和分析方法，包括定性和定量研究技巧，以及如何运用统计工具来解读数据和支持研究假设。', 0, 0, 'admin', '2024-12-31 15:25:30', 'admin', '2024-12-31 15:25:57', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (14, 13, '企业传播', '专注于企业如何通过有效的内部沟通、品牌管理、危机公关等策略来构建和维护其公共形象，以及这些策略如何影响企业的长期成功。', 0, 0, 'admin', '2024-12-31 15:25:30', 'admin', '2024-12-31 15:25:57', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (15, 13, '娱乐传播', '研究娱乐产业如何通过媒体内容创造和传播来吸引观众，以及这些内容如何塑造文化和社会价值观，同时探讨娱乐与商业的交叉点。', 0, 0, 'admin', '2024-12-31 15:25:30', 'admin', '2024-12-31 15:25:57', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (16, 13, '广告学概论', '全面介绍广告的创意过程、市场定位、媒介选择和效果评估，分析广告如何影响消费者行为和市场趋势，以及广告在社会文化中的角色。', 0, 0, 'admin', '2024-12-31 15:25:30', 'admin', '2024-12-31 15:25:57', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (17, 13, '广告策划与创意', '教授如何制定有效的广告策略和创意方案，包括市场分析、目标受众定位、创意概念发展以及广告文案和视觉设计的实施。', 0, 0, 'admin', '2024-12-31 15:25:30', 'admin', '2024-12-31 15:25:58', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (18, 6, '测试课程', '测试简介', 1, 1, 'admin', '2025-01-20 13:58:35', 'admin', '2025-01-20 14:00:05', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (19, 9, '测试课程', '测试简介', 1, 1, 'admin', '2025-01-20 14:24:34', 'admin', '2025-01-20 14:25:38', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (20, 14, '课程TEST', 'TEST', 1, 1, 'admin', '2025-01-24 14:13:18', 'admin', '2025-02-05 10:17:24', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (21, 14, '测试课程12', 'TEST12', 0, 1, 'admin', '2025-01-24 14:16:18', 'admin', '2025-01-24 14:32:16', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (22, 50, '护理人体解剖与生理', '融合人体解剖学和生理学知识，重点讲授与护理工作密切相关的人体结构和生理功能，帮助学生理解正常人体的运作机制，为后续学习疾病护理和评估患者健康状况提供基础。', 0, 0, 'admin', '2025-02-11 13:09:46', 'admin', '2025-02-11 13:35:06', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (23, 50, '母婴护理', '围绕女性妊娠期、分娩期、产褥期护理以及新生儿护理展开教学，包括孕期保健、分娩过程护理、产后母婴护理、新生儿常见问题处理等，为母婴健康提供专业支持。', 0, 0, 'admin', '2025-02-11 13:11:32', 'admin', '2025-02-11 13:35:06', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (24, 50, '儿科护理', '聚焦小儿生长发育规律、儿童保健以及儿科常见疾病的护理，使学生掌握儿童特殊的生理、心理特点，学会为儿童提供专业护理服务，保障儿童健康成长。', 0, 0, 'admin', '2025-02-11 13:12:04', 'admin', '2025-02-11 13:35:07', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (25, 50, '病理生理学', '研究疾病发生、发展过程中的功能和代谢变化，分析疾病的病因、发病机制、病理变化和转归。帮助学生理解疾病状态下人体的异常生理过程，以便在护理中更好地观察病情、实施护理措施。', 0, 0, 'admin', '2025-02-11 13:20:48', 'admin', '2025-02-11 13:35:08', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (26, 50, '药理学', '介绍各类药物的作用机制、临床应用、不良反应及护理要点。使学生掌握药物治疗的基本知识，学会正确给药、观察药物疗效和不良反应，确保患者用药安全。', 0, 0, 'admin', '2025-02-11 13:22:16', 'admin', '2025-02-11 13:35:08', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (27, 50, '内科护理学', '针对成人常见内科疾病，如心血管、呼吸、消化、泌尿等系统疾病，深入讲解疾病的护理评估、护理诊断、护理措施及健康教育。提升学生对内科患者的整体护理能力。', 0, 0, 'admin', '2025-02-11 13:22:48', 'admin', '2025-02-11 13:35:09', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (28, 50, '外科护理学', '围绕外科手术患者的护理，涵盖术前准备、术中配合、术后护理及并发症的预防和处理。让学生掌握不同外科手术患者的护理要点，保障手术治疗的顺利进行和患者的康复。', 0, 0, 'admin', '2025-02-11 13:23:03', 'admin', '2025-02-11 13:35:10', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (29, 50, '护理伦理学与法学', '探讨护理实践中的伦理问题和法律规范，如患者权利、医疗纠纷处理、护理职业道德等。培养学生的伦理和法律意识，使其在护理工作中能够遵循伦理原则和法律法规，保障患者和自身的合法权益。', 0, 0, 'admin', '2025-02-11 13:24:31', 'admin', '2025-02-11 13:35:11', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (30, 49, '人体解剖学', '研究人体器官、组织与系统的结构及其相互关系，为临床实践奠定形态学基础。', 0, 0, 'admin', '2025-02-11 15:40:27', 'admin', '2025-02-12 10:59:53', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (31, 49, '生理学', '探索人体各系统（如循环、呼吸、神经）的功能及其调节机制。', 0, 0, 'admin', '2025-02-11 15:40:38', 'admin', '2025-02-12 10:59:53', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (32, 49, '生物化学', '分析生物分子结构与代谢过程，揭示疾病发生的分子机制。', 0, 0, 'admin', '2025-02-11 15:40:53', 'admin', '2025-02-12 10:59:54', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (33, 49, '病理学', '研究疾病的发生、发展及病理变化，链接基础医学与临床医学。', 0, 0, 'admin', '2025-02-11 15:41:06', 'admin', '2025-02-12 10:59:54', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (34, 49, '药理学', '探讨药物作用机制、代谢途径及临床应用，指导合理用药。', 0, 0, 'admin', '2025-02-11 15:41:19', 'admin', '2025-02-12 10:59:55', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (35, 49, '内科学', '学习常见内科疾病的病因、诊断与治疗，培养临床思维。', 0, 0, 'admin', '2025-02-11 15:41:33', 'admin', '2025-02-12 10:59:56', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (36, 49, '外科学', '掌握外科手术原理、操作技巧及围手术期管理。', 0, 0, 'admin', '2025-02-11 15:41:45', 'admin', '2025-02-12 10:59:57', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (37, 49, '流行病学', '分析疾病分布与影响因素，制定公共卫生干预策略。 ', 0, 0, 'admin', '2025-02-11 15:41:55', 'admin', '2025-02-12 10:59:58', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (38, 49, '高级生物医学影像技术', '深度学习MRI、PET等成像技术的原理与临床应用。  ', 0, 0, 'admin', '2025-02-11 15:42:16', 'admin', '2025-02-12 10:59:58', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (39, 49, '精准医学与基因组学', '结合基因测序技术，开发个体化诊疗方案。', 0, 0, 'admin', '2025-02-11 15:42:31', 'admin', '2025-02-12 10:59:59', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (40, 49, '转化医学研究', '推动基础研究成果向临床应用的转化。', 0, 0, 'admin', '2025-02-11 15:42:46', 'admin', '2025-02-12 11:00:04', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (41, 49, '临床流行病学与生物统计学', '运用统计方法优化临床试验设计与数据分析。  ', 0, 0, 'admin', '2025-02-11 15:42:59', 'admin', '2025-02-12 11:00:04', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (42, 49, '医疗人工智能', '探索机器学习在疾病预测、影像诊断等领域的应用。', 0, 0, 'admin', '2025-02-11 15:43:19', 'admin', '2025-02-12 11:00:05', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (43, 49, '药物开发与临床试验', '涵盖新药研发流程、临床试验设计与伦理审查。  ', 0, 0, 'admin', '2025-02-11 15:43:37', 'admin', '2025-02-12 11:00:06', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (44, 48, '动物解剖学', '研究动物体的形态结构和组织器官的分布，为理解动物生理功能和疾病发生机制提供基础。课程通常包括骨骼、肌肉、内脏器官等的解剖知识。', 0, 0, 'admin', '2025-02-11 16:10:41', 'admin', '2025-02-12 10:59:40', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (45, 48, '动物生理学', '探讨动物体内各种生理过程及其相互关系，包括循环系统、呼吸系统、消化系统、内分泌系统等的功能。帮助学生理解动物生命活动的基本规律。', 0, 0, 'admin', '2025-02-11 16:10:52', 'admin', '2025-02-12 10:59:41', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (46, 48, '兽医微生物学', '研究与动物疾病相关的微生物，包括细菌、病毒、真菌和寄生虫等。课程内容涵盖微生物的形态结构、生理功能、致病机制以及实验室检测方法。', 0, 0, 'admin', '2025-02-11 16:11:04', 'admin', '2025-02-12 10:59:42', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (47, 48, '兽医药理学', '研究药物在动物体内的作用机制、药代动力学和药效学，以及药物的临床应用和不良反应。课程帮助学生掌握合理用药的原则和方法。', 0, 0, 'admin', '2025-02-11 16:11:19', 'admin', '2025-02-12 10:59:43', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (48, 48, '兽医病理学', '研究动物疾病发生的原因、发病机制、病理变化和转归规律。课程内容包括组织病理学、细胞病理学和分子病理学等，为疾病诊断和治疗提供理论支持。', 0, 0, 'admin', '2025-02-11 16:11:33', 'admin', '2025-02-12 10:59:44', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (49, 48, '兽医临床技能', '培养学生的基本临床操作技能，如动物保定、采血、注射、缝合等。课程通常结合实践教学，帮助学生掌握实际操作能力。', 0, 0, 'admin', '2025-02-11 16:11:48', 'admin', '2025-02-12 10:59:45', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (50, 48, '兽医公共卫生', '研究动物疾病对公共卫生的影响，包括人畜共患病的防控、食品安全、动物检疫等。课程内容强调动物健康与人类健康的紧密联系。', 0, 0, 'admin', '2025-02-11 16:12:01', 'admin', '2025-02-12 10:59:46', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (51, 48, '兽医流行病学', '研究动物疾病的分布规律、传播机制和防控策略。课程内容包括流行病学调查方法、数据分析和疾病监测等。', 0, 0, 'admin', '2025-02-11 16:12:18', 'admin', '2025-02-12 10:59:47', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (52, 48, '兽医免疫学', '研究动物免疫系统的结构与功能，以及免疫反应在疾病发生和防治中的作用。课程内容包括免疫细胞、抗体、疫苗等。', 0, 0, 'admin', '2025-02-11 16:12:40', 'admin', '2025-02-12 10:59:48', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (53, 47, '植物学', '研究植物的形态结构、分类、生理功能和生态适应，为后续深入学习农学专业课程奠定基础。', 0, 0, 'admin', '2025-02-11 16:32:04', 'admin', '2025-02-12 10:59:25', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (54, 47, '遗传学', '研究生物的遗传规律和变异机制，帮助学生了解植物遗传特性，为作物育种等工作提供理论支持。', 0, 0, 'admin', '2025-02-11 16:32:15', 'admin', '2025-02-12 10:59:25', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (55, 47, '土壤学', '研究土壤的形成、性质、分类和管理，使学生掌握土壤相关的知识，为合理利用土壤资源和提升土壤肥力提供依据。', 0, 0, 'admin', '2025-02-11 16:32:30', 'admin', '2025-02-12 10:59:27', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (56, 47, '农业气象学', '研究气象条件对农业生产的影响，帮助学生了解气象因素在农业生产中的作用，以便更好地制定生产计划。', 0, 0, 'admin', '2025-02-11 16:32:43', 'admin', '2025-02-12 10:59:28', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (57, 47, '作物生产学', '学习作物的栽培、种植制度设计等内容，提高农作物产量和质量。', 0, 0, 'admin', '2025-02-11 16:32:58', 'admin', '2025-02-12 10:59:28', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (58, 47, '植物病理学', '研究植物病害的发生机制和防治方法，为农作物病害防治提供科学依据。', 0, 0, 'admin', '2025-02-11 16:33:10', 'admin', '2025-02-12 10:59:29', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (59, 47, '农业经济学', '研究农业经济活动的规律和农村经济管理，使学生具备分析农业经济问题和参与农村经济管理的能力。', 0, 0, 'admin', '2025-02-11 16:34:22', 'admin', '2025-02-12 10:59:30', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (60, 47, '农业企业管理', '研究农业企业的经营和管理，培养学生从事农业企业管理工作的能力。', 0, 0, 'admin', '2025-02-11 16:34:34', 'admin', '2025-02-12 10:59:31', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (61, 47, '可持续农业', '研究如何在满足当前需求的同时不损害后代满足其需求的能力的农业生产方式，强调农业的可持续发展。', 0, 0, 'admin', '2025-02-11 16:34:49', 'admin', '2025-02-12 10:59:31', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (62, 47, '农业生物技术', '研究生物技术在农业中的应用，如转基因技术、分子育种等，培养学生的现代生物技术应用能力。', 0, 0, 'admin', '2025-02-11 16:35:02', 'admin', '2025-02-12 10:59:32', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (63, 46, '流行病学', '探讨疾病在人群中的分布规律及影响因素，指导公共卫生决策。', 0, 0, 'admin', '2025-02-11 17:08:34', 'admin', '2025-02-12 10:59:13', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (64, 46, '卫生统计学', '应用统计方法分析健康数据，支持疾病防控与政策制定。', 0, 0, 'admin', '2025-02-11 17:08:49', 'admin', '2025-02-12 10:59:14', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (65, 46, '生物化学', '研究生物分子结构与代谢过程，解析疾病分子机制。', 0, 0, 'admin', '2025-02-11 17:09:04', 'admin', '2025-02-12 10:59:15', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (66, 46, '康复评定学', '制定个性化康复计划，评估患者功能恢复进展。', 0, 0, 'admin', '2025-02-11 17:09:15', 'admin', '2025-02-12 10:59:16', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (67, 46, '健康信息系统', '设计与管理医疗信息系统，优化健康数据利用效率。', 0, 0, 'admin', '2025-02-11 17:10:16', 'admin', '2025-02-12 10:59:17', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (68, 46, '营养流行病学', '研究饮食与疾病关联，指导人群营养干预策略。', 0, 0, 'admin', '2025-02-11 17:20:44', 'admin', '2025-02-12 10:59:17', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (69, 46, '健康经济学', '评估医疗资源分配效率，优化卫生服务体系成本效益。', 0, 0, 'admin', '2025-02-11 17:20:57', 'admin', '2025-02-12 10:59:18', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (70, 46, '高级公共卫生', '研究生阶段课程，聚焦公共卫生政策制定与复杂健康问题应对。', 0, 0, 'admin', '2025-02-11 17:21:09', 'admin', '2025-02-12 10:59:18', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (71, 46, '健康数据科学', '结合机器学习与大数据技术，预测疾病趋势并优化健康服务。', 0, 0, 'admin', '2025-02-11 17:21:22', 'admin', '2025-02-12 10:59:19', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (72, 45, '运动生理学', '研究运动对人体心血管、代谢系统的影响，为运动员训练方案设计提供科学依据。', 0, 0, 'admin', '2025-02-12 10:45:58', 'admin', '2025-02-12 10:59:04', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (73, 45, '体育营销与赞助', '剖析品牌如耐克、红牛等巨头的品牌战略，掌握赛事IP运营、粉丝经济变现技能。', 0, 0, 'admin', '2025-02-12 10:47:46', 'admin', '2025-02-12 10:59:05', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (74, 45, '生物力学', '生物力学提供了有关最有效和最安全的运动模式、设备和相关练习的关键信息，以改善人类运动。', 0, 0, 'admin', '2025-02-12 10:55:15', 'admin', '2025-02-12 10:59:06', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (75, 45, '体育数据分析', '运用Python等数据分析软件处理比赛数据，构建球员或运动员价值评估模型。', 0, 0, 'admin', '2025-02-12 10:55:56', 'admin', '2025-02-12 10:59:06', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (76, 45, '运动损伤预防', '是运动损伤的预防、急救、处置与康复训练的总称，主要针对运动员在运动中或运动后的损伤做康复指导。', 0, 0, 'admin', '2025-02-12 10:58:35', 'admin', '2025-02-12 10:59:07', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (77, 45, '全球体育政策', '解读国际奥委会、FIFA政策制定逻辑，培养体育外交人才。', 0, 0, 'admin', '2025-02-12 10:59:03', 'admin', '2025-02-12 10:59:08', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (78, 44, '表演艺术', '系统学习表演基础理论与实践技巧，涵盖表演元素、方法、风格等，帮助学生掌握角色塑造、情感表达、舞台表现等能力，为戏剧表演、影视表演等方向奠定基础。', 0, 0, 'admin', '2025-02-12 11:23:25', 'admin', '2025-02-12 11:23:27', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (79, 44, '导演艺术', '深入探究导演的创作理念、工作流程与技巧方法。包括剧本分析、导演构思、演员指导、场面调度等内容，培养学生从整体上把控戏剧或影视作品的能力，使其能够独立完成作品的导演工作。', 0, 0, 'admin', '2025-02-12 11:23:43', 'admin', '2025-02-12 11:23:44', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (80, 44, '影视剧本创作', '授剧本创作的基本原则与技巧，涉及故事构思、人物塑造、情节发展、对白设计等方面。引导学生创作具有吸引力和艺术价值的剧本，为影视制作提供优秀的文本基础。', 0, 0, 'admin', '2025-02-12 11:24:04', 'admin', '2025-02-12 11:24:05', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (81, 44, '影视制作', '全面介绍影视作品的策划、制作与管理流程。包括项目策划、预算编制、拍摄计划、后期制作等环节，让学生了解影视制作的各个环节及其相互关系，培养学生的项目管理能力和团队协作精神。', 0, 0, 'admin', '2025-02-12 11:24:17', 'admin', '2025-02-12 11:24:19', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (82, 44, '影视美学', '研究影视作品的艺术风格与美学理论，探讨影视艺术的审美特征、表现形式与审美价值。帮助学生建立正确的审美观念，提高对影视作品的鉴赏能力和艺术品味，为创作具有美学价值的作品提供理论支持。', 0, 0, 'admin', '2025-02-12 11:24:35', 'admin', '2025-02-12 11:24:36', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (83, 44, '影视批评', '教授影视作品的分析与批评方法，培养学生对影视作品的批判性思维和分析能力。通过学习，学生能够从不同角度对作品进行深入剖析，提出有见地的批评和建议，为影视创作和产业发展提供参考。', 0, 0, 'admin', '2025-02-12 11:24:56', 'admin', '2025-02-12 11:24:58', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (84, 44, '影视法律与政策', '介绍影视产业的法律法规与政策，包括版权法、合同法、产业政策等内容。使学生了解影视行业的法律规范和政策环境，能够在合法合规的框架内开展创作和经营活动，为产业发展提供法律保障。', 0, 0, 'admin', '2025-02-12 11:25:11', 'admin', '2025-02-12 11:25:12', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (85, 44, '影视大数据分析', '教授如何挖掘和分析影视数据，包括观众喜好、市场趋势、作品传播效果等方面的数据。通过大数据分析，为影视创作、制作和发行提供决策依据，帮助学生了解市场需求和观众心理，提升作品的市场竞争力。', 0, 0, 'admin', '2025-02-12 11:25:32', 'admin', '2025-02-12 11:25:33', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (86, 44, '影视政策与管理', '研究影视政策的制定与实施，以及影视产业的管理策略。探讨如何通过政策引导和管理手段促进影视产业的发展，培养学生的政策分析能力和管理能力，使其能够在政府部门或文化机构从事影视政策制定和产业管理工作。', 0, 0, 'admin', '2025-02-12 11:25:47', 'admin', '2025-02-12 11:25:49', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (87, 44, '影视伦理学', '探讨影视领域的伦理问题与道德规范，涉及影视内容的道德审查、创作者的社会责任、观众的道德引导等方面。', 1, 0, 'admin', '2025-02-12 11:26:02', 'admin', '2025-02-12 11:26:02', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (88, 43, '素描与色彩基础', '学习形体结构、光影关系与色彩理论，通过静物、人物写生等实践掌握基础绘画技能。', 0, 0, 'admin', '2025-02-12 13:37:24', 'admin', '2025-02-12 13:37:26', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (89, 43, '艺术史导论', '从古希腊至当代艺术，分析主要艺术流派、代表艺术家及其作品，建立艺术史宏观框架。', 0, 0, 'admin', '2025-02-12 13:37:35', 'admin', '2025-02-12 13:37:37', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (90, 43, '绘画材料与技法', '研究油画、水彩、丙烯等材料的特性与技法，结合古典与现代绘画方法进行创作实验。', 0, 0, 'admin', '2025-02-12 13:37:51', 'admin', '2025-02-12 13:37:53', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (91, 43, '雕塑基础', '学习黏土塑造、金属焊接、木雕等基础工艺，掌握立体造型与空间表达的核心原理。', 0, 0, 'admin', '2025-02-12 13:38:04', 'admin', '2025-02-12 13:38:05', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (92, 43, '平面设计原理', '涵盖排版、字体设计、视觉符号系统等，运用Adobe系列工具完成品牌设计与视觉传达项目。', 0, 0, 'admin', '2025-02-12 13:38:16', 'admin', '2025-02-12 13:38:17', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (93, 43, '艺术理论与批评', '探讨美学、艺术哲学及批评方法论，培养对艺术作品的分析与理论建构能力。', 0, 0, 'admin', '2025-02-12 13:38:28', 'admin', '2025-02-12 13:38:42', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (94, 43, '数字艺术创作', '学习Photoshop、Illustrator、Blender等软件，进行数字绘画、3D建模与动画设计。', 0, 0, 'admin', '2025-02-12 13:38:40', 'admin', '2025-02-12 13:38:43', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (95, 43, '当代艺术实践', '探索装置艺术、行为艺术、新媒体艺术等前沿领域，结合社会议题进行批判性创作。', 0, 0, 'admin', '2025-02-12 13:38:59', 'admin', '2025-02-12 13:39:00', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (96, 43, '艺术市场与策展', '分析艺术市场运作规律，策划虚拟或实体展览，掌握艺术品推广与收藏管理策略。', 0, 0, 'admin', '2025-02-12 13:39:15', 'admin', '2025-02-12 13:39:17', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (97, 42, '音乐史', '学习中西方音乐的历史发展，了解不同历史时期的音乐风格、代表人物和作品。', 0, 0, 'admin', '2025-02-12 14:05:41', 'admin', '2025-02-12 14:05:43', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (98, 42, '音乐理论', '包括乐理、和声、曲式等，帮助学生理解和分析音乐作品的结构和表现手法。', 0, 0, 'admin', '2025-02-12 14:05:53', 'admin', '2025-02-12 14:06:14', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (99, 42, '作曲技术', '学习作曲的基本方法和技巧，培养学生创作音乐的能力。', 0, 0, 'admin', '2025-02-12 14:06:24', 'admin', '2025-02-12 14:06:25', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (100, 42, '音乐表演', '通过声乐、器乐等表演课程，提高学生的音乐表现力和演奏技巧。', 0, 0, 'admin', '2025-02-12 14:06:37', 'admin', '2025-02-12 14:06:38', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (101, 42, '高级音乐理论', '深入研究音乐理论的高级话题，如音乐分析、音乐美学等。', 0, 0, 'admin', '2025-02-12 14:07:09', 'admin', '2025-02-12 14:07:11', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (102, 42, '音乐研究方法', '学习音乐研究的方法和技巧，为开展独立的音乐研究项目做准备。', 0, 0, 'admin', '2025-02-12 14:07:24', 'admin', '2025-02-12 14:07:35', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (103, 42, '专业表演技巧', '进一步提高音乐表演的专业水平，培养学生的艺术表现力和创新能力。', 0, 0, 'admin', '2025-02-12 14:07:34', 'admin', '2025-02-12 14:07:36', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (104, 42, '音乐教育研究 ', '研究音乐教育的前沿问题，探索音乐教育的新方法和新途径。', 0, 0, 'admin', '2025-02-12 14:07:46', 'admin', '2025-02-12 14:07:47', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (105, 41, '设计史', '研究全球设计运动、流派及代表性作品，分析设计与社会文化的互动关系。', 0, 0, 'admin', '2025-02-12 14:25:28', 'admin', '2025-02-12 14:25:30', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (106, 41, '设计思维', '通过方法论训练，培养以用户为中心的创新问题解决能力，涵盖调研、原型制作与测试。', 0, 0, 'admin', '2025-02-12 14:25:42', 'admin', '2025-02-12 14:25:43', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (107, 41, '用户体验设计', '学习用户行为分析、界面交互逻辑、信息架构设计，应用Figma、Sketch等工具。', 0, 0, 'admin', '2025-02-12 14:25:55', 'admin', '2025-02-12 14:25:57', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (108, 41, '材料与工艺', '探索不同材料（如金属、纺织、3D打印）的特性及其在设计中的应用技术。', 0, 0, 'admin', '2025-02-12 14:26:41', 'admin', '2025-02-12 14:26:43', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (109, 41, '品牌视觉系统', '构建品牌标志、色彩规范、视觉语言，强化品牌认知与传播效果。', 0, 0, 'admin', '2025-02-12 14:26:53', 'admin', '2025-02-12 14:26:54', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (110, 41, '动态图形设计', '结合动画与视觉叙事，制作广告短片、动态LOGO、信息可视化等内容。', 0, 0, 'admin', '2025-02-12 14:27:11', 'admin', '2025-02-12 14:27:12', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (111, 41, '建筑制图与建模', '掌握AutoCAD、Rhino、Revit等软件，完成建筑方案的技术表达。', 1, 0, 'admin', '2025-02-12 14:27:23', 'admin', '2025-02-12 14:27:23', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (112, 41, '数字艺术编程', '使用Processing、TouchDesigner等工具，开发交互式艺术装置与生成艺术项目。', 1, 0, 'admin', '2025-02-12 14:27:40', 'admin', '2025-02-12 14:27:40', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (113, 40, '食品科学导论', '介绍食品科学的基本概念和原理，包括食品的组成、性质、分类以及食品在人类饮食中的作用等，为后续课程打下基础。', 0, 0, 'admin', '2025-02-12 15:20:45', 'admin', '2025-02-12 15:20:47', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (114, 40, '当代营养学', '研究食品从生产到消费的整个过程，包括种植、养殖、加工、运输、销售等环节，以及这些环节对食品质量和安全的影响。', 0, 0, 'admin', '2025-02-12 15:20:56', 'admin', '2025-02-12 15:20:58', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (115, 40, '食品系统、营养与健康研讨会', '通过研讨会的形式，深入探讨食品系统、营养和健康之间的相互关系，以及当前食品科学领域的热点问题和研究进展。', 0, 0, 'admin', '2025-02-12 15:21:08', 'admin', '2025-02-12 15:21:09', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (116, 40, '食品系统建模与分析', '学习如何运用数学模型和分析方法来研究食品系统，包括食品供应链的优化、食品加工过程的模拟等，以提高食品系统的效率和可持续性。', 0, 0, 'admin', '2025-02-12 15:21:19', 'admin', '2025-02-12 15:21:21', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (117, 40, '健康与疾病中的身体活动', '研究体育活动在健康和疾病预防中的作用，包括运动与营养的关系、运动对身体机能的影响等，为制定合理的运动和营养计划提供依据。', 0, 0, 'admin', '2025-02-12 15:21:36', 'admin', '2025-02-12 15:21:37', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (118, 40, '全球营养：挑战与机遇', '探讨全球范围内的营养问题和挑战，包括营养不良、肥胖、慢性病等，以及如何通过食品科学和营养干预来解决这些问题。', 0, 0, 'admin', '2025-02-12 15:22:12', 'admin', '2025-02-12 15:22:13', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (119, 40, '食品系统经济学专题', '研究食品系统的经济学问题，包括食品市场的运行机制、食品价格的形成、食品贸易等，以及如何运用经济学原理来优化食品系统的资源配置。', 0, 0, 'admin', '2025-02-12 15:22:23', 'admin', '2025-02-12 15:22:25', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (120, 40, '医学生物测量学', '学习医学生物测量学的基本理论和方法，包括生物数据的收集、整理、分析和解释，以及如何运用统计学方法来解决医学和生物科学中的实际问题。', 0, 0, 'admin', '2025-02-12 15:22:38', 'admin', '2025-02-12 15:22:41', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (121, 40, '食品与社会', '探讨食品与社会的关系，包括食品文化、食品消费行为、食品政策等，以及如何通过社会学视角来理解食品系统和营养问题。', 0, 0, 'admin', '2025-02-12 15:22:53', 'admin', '2025-02-12 15:22:55', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (122, 39, '环境化学', '研究环境中化学物质的来源、迁移、转化和归宿，以及它们对生态系统和人类健康的影响。通过学习，学生可以了解大气、水、土壤等环境介质中污染物的化学性质和反应机理，为污染治理和环境监测提供理论基础。', 0, 0, 'admin', '2025-02-12 15:59:49', 'admin', '2025-02-12 15:59:50', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (123, 39, '环境生物学', '探讨生物与环境之间的相互关系，包括生物对环境污染的响应、生物修复技术的原理和应用等。学生将学习如何利用微生物、植物等生物手段来降解污染物、修复受损生态系统。', 0, 0, 'admin', '2025-02-12 16:00:00', 'admin', '2025-02-12 16:00:02', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (124, 39, '环境工程原理', '介绍环境工程领域的基本原理和方法，如质量守恒、能量守恒在污染治理过程中的应用，以及各种污染控制单元操作的原理，帮助学生理解环境工程设施的运行机制。', 0, 0, 'admin', '2025-02-12 16:00:14', 'admin', '2025-02-12 16:00:16', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (125, 39, '水污染控制工程', '系统学习水体污染的控制和净化技术，涵盖污水处理工艺的设计、运行管理，以及水资源保护和管理策略。学生将掌握活性污泥法、生物膜法等常见污水处理技术的原理和应用。', 0, 0, 'admin', '2025-02-12 16:00:27', 'admin', '2025-02-12 16:00:28', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (126, 39, '大气污染控制工程', '研究大气污染物的来源、扩散规律和控制技术，包括除尘、脱硫、脱硝、挥发性有机物（VOCs）治理等方面的内容，培养学生设计和优化大气污染治理系统的能力。', 0, 0, 'admin', '2025-02-12 16:00:38', 'admin', '2025-02-12 16:01:02', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (127, 39, '固体废物处理与处置', '讲授固体废物的分类、收集、运输、处理和处置方法，如焚烧、填埋、堆肥以及资源回收利用技术，使学生能够根据不同类型的固体废物选择合适的处理方式。', 0, 0, 'admin', '2025-02-12 16:01:17', 'admin', '2025-02-12 16:01:18', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (128, 39, '环境监测', '学习环境监测的基本原理、方法和技术，包括大气、水、土壤等环境要素的采样、分析和数据处理。学生将掌握各类监测仪器的使用方法，能够准确获取环境质量数据。', 0, 0, 'admin', '2025-02-12 16:01:30', 'admin', '2025-02-12 16:01:32', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (129, 39, '环境影响评价', '了解如何对建设项目、规划方案等进行环境影响评估，预测其可能对环境产生的影响，并提出相应的预防和缓解措施，确保项目的环境可行性。\n', 0, 0, 'admin', '2025-02-12 16:01:44', 'admin', '2025-02-12 16:01:47', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (130, 39, '环境规划与管理', '探讨环境规划的制定方法和环境管理的策略，包括环境政策法规的解读与应用、环境管理体系的建立和运行等内容，培养学生的环境规划和管理能力。', 0, 0, 'admin', '2025-02-12 16:01:58', 'admin', '2025-02-12 16:02:00', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (131, 39, '生态工程', '运用生态学原理和工程学方法，设计和构建生态系统修复、生态保护和资源利用的工程技术。学生将学习生态恢复、生态农业、生态工业园区等方面的知识，推动可持续发展。', 1, 0, 'admin', '2025-02-12 16:02:10', 'admin', '2025-02-12 16:02:10', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (132, 30, '电路原理', '讲解电路的基本概念、定律和分析方法，如欧姆定律、基尔霍夫定律等。帮助学生掌握电路元件的特性和电路的等效变换，能够对简单电路进行分析和计算，为后续专业课程学习奠定基础。', 0, 0, 'admin', '2025-02-12 17:06:56', 'admin', '2025-02-12 17:06:58', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (133, 30, '模拟电子技术', '主要研究模拟信号的产生、放大、处理和变换。涵盖半导体器件（如二极管、三极管、场效应管）的工作原理，以及各种放大电路（如共射放大电路、差动放大电路）、集成运算放大器的应用等，培养学生设计和分析模拟电路的能力。', 0, 0, 'admin', '2025-02-12 17:07:09', 'admin', '2025-02-12 17:07:10', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (134, 30, '数字电子技术', '聚焦数字信号的处理和数字电路的设计。学习内容包括数字逻辑基础、组合逻辑电路、时序逻辑电路、半导体存储器、数字集成电路等，使学生掌握用数字电路实现逻辑功能的方法，能够设计数字系统。', 0, 0, 'admin', '2025-02-12 17:07:20', 'admin', '2025-02-12 17:07:21', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (135, 30, '信号与系统', '研究信号的特性和系统对信号的响应。课程包含信号的分类、描述、运算，以及连续时间系统和离散时间系统的时域分析、频域分析、复频域分析等方法，让学生学会对信号进行分析和处理，理解系统的性能和特性。', 0, 0, 'admin', '2025-02-12 17:07:32', 'admin', '2025-02-12 17:07:34', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (136, 30, '通信原理', '介绍通信系统的基本原理和技术。包括模拟通信系统（如调幅、调频、调相）和数字通信系统（如脉冲编码调制、数字调制技术）的原理，以及信道编码、同步技术等内容，使学生掌握通信系统的基本组成和工作方式，了解通信技术的发展趋势。', 0, 0, 'admin', '2025-02-12 17:07:48', 'admin', '2025-02-12 17:07:49', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (137, 30, '现代数字信号处理', '深入研究现代数字信号处理的理论和方法，如多速率信号处理、小波变换、时频分析、自适应信号处理等，使学生掌握先进的信号处理技术，能够解决复杂的信号处理问题。', 0, 0, 'admin', '2025-02-12 17:08:04', 'admin', '2025-02-12 17:08:05', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (138, 30, '高速通信网络与技术', '紧跟通信技术发展前沿，研究高速通信网络的架构、协议和关键技术，如 5G/6G 通信技术、软件定义网络（SDN）、网络功能虚拟化（NFV）等，让学生了解未来通信网络的发展方向，具备从事高速通信网络研究和开发的能力。', 0, 0, 'admin', '2025-02-12 17:08:16', 'admin', '2025-02-12 17:08:33', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (139, 30, '集成电路设计', '系统学习超大规模集成电路的设计方法和流程，从芯片架构设计、逻辑设计、物理设计到后端版图设计，全面掌握集成电路设计的各个环节，并涉及集成电路设计工具的使用和设计验证方法，培养学生独立设计集成电路的能力。', 0, 0, 'admin', '2025-02-12 17:08:31', 'admin', '2025-02-12 17:08:34', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (140, 31, '电路原理', '是电子电气类专业的基础课程，主要研究电路的基本定律、定理和分析方法。课程涵盖欧姆定律、基尔霍夫定律等基本原理，通过对电阻、电容、电感等基本电路元件的学习，让学生掌握电路的等效变换、网络分析等方法，为后续学习复杂的电子电气系统奠定基础。', 0, 0, 'admin', '2025-02-12 17:15:20', 'admin', '2025-02-12 17:15:22', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (141, 31, '模拟电子技术', '聚焦于模拟信号的处理和放大。课程内容包括半导体器件（如二极管、晶体管、场效应管）的工作原理，以及由这些器件组成的基本放大电路、集成运算放大器等。学生将学习如何设计和分析模拟电路，实现信号的放大、滤波、调制等功能，在通信、音频处理等领域应用广泛。', 0, 0, 'admin', '2025-02-12 17:15:34', 'admin', '2025-02-12 17:15:36', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (142, 31, '数字电子技术', '主要研究数字信号的处理和存储。讲解数字逻辑电路的基本概念、组合逻辑电路和时序逻辑电路的设计方法，以及数字集成电路（如计数器、寄存器、存储器）的工作原理和应用。该课程是现代数字系统设计的基础，在计算机、数字通信、自动化控制等领域发挥关键作用。', 0, 0, 'admin', '2025-02-12 17:15:46', 'admin', '2025-02-12 17:15:48', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (143, 31, '信号与系统', '探讨信号的描述、分析和处理，以及系统对信号的响应。课程涵盖连续时间信号与离散时间信号的分析方法，线性时不变系统的特性和求解，傅里叶变换、拉普拉斯变换和 Z 变换等数学工具在信号与系统分析中的应用。通过学习，学生能够掌握信号处理的基本理论和方法，理解系统的性能和行为。', 0, 0, 'admin', '2025-02-12 17:16:10', 'admin', '2025-02-12 17:16:11', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (144, 31, '自动控制原理', '介绍自动控制系统的基本原理和分析设计方法。包括控制系统的数学模型建立（如传递函数、状态空间表达式），稳定性分析（如劳斯判据、奈奎斯特判据），时域和频域分析方法，以及控制系统的校正和设计。该课程在工业自动化、机器人控制、航空航天等领域具有重要应用。', 0, 0, 'admin', '2025-02-12 17:16:21', 'admin', '2025-02-12 17:16:22', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (145, 31, '电机学', '研究各类电机的工作原理、结构和运行特性。主要内容包括直流电机、变压器、异步电机、同步电机等的电磁关系、运行原理、特性分析和控制方法。通过学习，学生能够掌握电机的设计、控制和应用，为电力系统、工业驱动等领域提供技术支持。', 0, 0, 'admin', '2025-02-12 17:16:32', 'admin', '2025-02-12 17:16:33', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (146, 31, '电力电子技术', '专注于电力电子器件的应用和电力变换技术。课程介绍电力二极管、晶闸管、IGBT 等电力电子器件的工作原理和特性，以及整流、逆变、斩波、变频等电力变换电路的分析和设计。电力电子技术在电力系统、电机调速、新能源发电等领域有广泛应用，可实现电能的高效转换和控制。', 0, 0, 'admin', '2025-02-12 17:16:43', 'admin', '2025-02-12 17:16:45', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (147, 31, '电磁场与电磁波', '研究电磁场和电磁波的基本理论和特性。课程涵盖麦克斯韦方程组、电磁场的边界条件、电磁波的传播特性（如反射、折射、极化）等内容。通过学习，学生能够理解电磁现象的本质，为天线设计、微波技术、电磁兼容等领域提供理论支持。', 0, 0, 'admin', '2025-02-12 17:16:55', 'admin', '2025-02-12 17:16:58', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (148, 32, '工程图学', '培养学生机械制图和识图能力，使学生掌握工程图纸绘制标准和规范。这是机械工程师表达设计意图、交流技术思想的重要工具。', 0, 0, 'admin', '2025-02-12 17:23:53', 'admin', '2025-02-12 17:23:54', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (149, 32, '机械设计基础', '讲授机械零部件设计原理、方法和标准。英美院校的学生在课程中学习齿轮、轴、轴承等零部件设计计算。', 0, 0, 'admin', '2025-02-12 17:24:05', 'admin', '2025-02-12 17:24:07', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (150, 32, '机械制造技术基础', '介绍切削加工、铸造、锻造、焊接等制造工艺和加工方法。', 0, 0, 'admin', '2025-02-12 17:24:19', 'admin', '2025-02-12 17:24:20', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (151, 32, '机械原理', '研究机械运动基本规律，分析机构运动特性和动力特性。', 0, 0, 'admin', '2025-02-12 17:24:31', 'admin', '2025-02-12 17:24:33', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (152, 32, '电工电子技术', '包含电路原理、模拟电子技术和数字电子技术。英美院校的课程为机械电气控制和智能化发展奠定基础，如电机驱动、传感器应用等。', 0, 0, 'admin', '2025-02-12 17:24:47', 'admin', '2025-02-12 17:24:48', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (153, 32, '控制工程基础', '教授机械系统控制理论和方法，包括自动控制原理、反馈控制系统设计等。', 0, 0, 'admin', '2025-02-12 17:24:59', 'admin', '2025-02-12 17:25:00', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (154, 32, '先进制造技术', '聚焦智能制造、增材制造（3D 打印）、高速切削等前沿制造技术。', 0, 0, 'admin', '2025-02-12 17:25:27', 'admin', '2025-02-12 17:25:41', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (155, 32, '机电系统智能控制', '专注于机械电子系统智能化控制策略，如机器人智能控制、数控机床自适应控制。', 0, 0, 'admin', '2025-02-12 17:25:40', 'admin', '2025-02-12 17:25:42', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (156, 33, '工程热力学', '研究热能与机械能之间的相互转换规律，为能源转化和动力系统设计提供理论基础。', 0, 0, 'admin', '2025-02-12 17:47:28', 'admin', '2025-02-12 17:47:29', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (157, 33, '传热学', '研究热量传递的基本规律，包括热传导、热对流和热辐射三种基本方式，对于能源设备的热设计和优化至关重要。', 0, 0, 'admin', '2025-02-12 17:47:42', 'admin', '2025-02-12 17:47:43', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (158, 33, '流体力学', '研究流体（液体和气体）的平衡和运动规律，在能源领域中，用于分析能源设备内部的流体流动，如管道输送、叶轮机械内部流动等。', 0, 0, 'admin', '2025-02-12 17:47:55', 'admin', '2025-02-12 17:47:56', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (159, 33, '新能源材料与器件', '针对新能源科学与工程专业，介绍新能源领域所涉及的各种材料及其器件，如太阳能电池材料、风力发电叶片材料等，以及它们的性能、制备工艺和应用。', 0, 0, 'admin', '2025-02-12 17:49:08', 'admin', '2025-02-12 17:49:10', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (160, 33, '新能源发电技术', '教授太阳能、风能、水能等新能源的发电原理、技术方法和系统集成，包括光伏电站和风力发电场的设计、运行和管理等内容。', 0, 0, 'admin', '2025-02-12 17:50:18', 'admin', '2025-02-12 17:50:26', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (161, 33, '能源化学', '能源化学工程专业课程，研究能源转化和储存过程中的化学原理和化学反应，如化石能源的化学转化、电池中的电化学反应等。', 0, 0, 'admin', '2025-02-12 17:50:41', 'admin', '2025-02-12 17:51:07', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (162, 33, '储能原理与技术', '介绍各类储能技术的基本原理，如电池储能、蓄热蓄冷储能、压缩空气储能等，以及储能系统的设计、运行和管理方法。', 0, 0, 'admin', '2025-02-12 17:51:21', 'admin', '2025-02-12 17:51:22', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (163, 33, '储能系统设计', '基于储能原理与技术，培养学生进行储能系统整体设计的能力，包括储能设备选型、系统集成、控制策略制定等，以满足不同应用场景的需求。', 0, 0, 'admin', '2025-02-12 17:51:36', 'admin', '2025-02-12 17:51:38', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (164, 7, '微观经济学', '研究消费者行为、厂商决策及市场结构，分析价格机制与资源配置效率。', 0, 0, 'admin', '2025-02-13 10:22:07', 'admin', '2025-02-13 10:27:25', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (165, 7, '宏观经济学', '探讨国民收入核算、经济增长、失业与通货膨胀，以及货币与财政政策对经济的影响。', 0, 0, 'admin', '2025-02-13 10:24:29', 'admin', '2025-02-13 10:27:25', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (166, 7, '微积分与线性代数方法', '提供数学工具支持经济模型推导与优化问题求解。', 0, 0, 'admin', '2025-02-13 10:25:00', 'admin', '2025-02-13 10:27:26', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (167, 7, '基础统计理论', '学习概率分布、假设检验及回归分析，为实证研究奠定基础。', 0, 0, 'admin', '2025-02-13 10:25:25', 'admin', '2025-02-13 10:27:27', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (168, 7, '计量经济学', '应用统计方法分析经济数据，构建因果推断与预测模型。', 0, 0, 'admin', '2025-02-13 10:25:38', 'admin', '2025-02-13 10:27:28', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (169, 7, '发展经济学', '研究贫困、不平等与发展中国家经济增长的驱动因素。', 0, 0, 'admin', '2025-02-13 10:25:53', 'admin', '2025-02-13 10:27:29', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (170, 7, '国际贸易', '分析比较优势、关税政策与全球价值链的经济效应。', 0, 0, 'admin', '2025-02-13 10:26:05', 'admin', '2025-02-13 10:27:29', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (171, 7, '公共经济学', '评估税收、社会保障与公共品供给的社会福利影响。', 0, 0, 'admin', '2025-02-13 10:26:22', 'admin', '2025-02-13 10:27:30', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (172, 7, '行为经济学', '结合心理学与实验方法，分析非理性决策行为的经济后果。', 0, 0, 'admin', '2025-02-13 10:26:45', 'admin', '2025-02-13 10:27:30', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (173, 7, '时间序列分析', '掌握ARIMA、VAR等模型，预测宏观经济与金融变量趋势。', 0, 0, 'admin', '2025-02-13 10:27:07', 'admin', '2025-02-13 10:27:31', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (174, 7, '环境与能源经济学', '设计碳定价机制，评估可再生能源政策的经济可行性。', 1, 0, 'admin', '2025-02-13 10:27:23', 'admin', '2025-02-13 10:27:23', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (175, 38, '生理学', '研究人体正常功能活动规律，涵盖细胞的基本功能、血液、血液循环、呼吸、消化、泌尿等生理过程，借助实验课程，让学生深入理解人体各系统如何协同工作，掌握人体功能的调节机制，是解释疾病状态下生理变化的重要依据。', 0, 0, 'admin', '2025-02-13 15:48:37', 'admin', '2025-02-13 15:48:41', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (176, 38, '生物化学', '聚焦生物分子的化学组成、结构、性质及其在生命过程中的化学变化规律，重点研究蛋白质、核酸、糖类、脂质等生物大分子的代谢途径及调控机制，为理解细胞的生理功能、疾病的发病机制以及药物的作用靶点提供理论基础。', 0, 0, 'admin', '2025-02-13 15:48:50', 'admin', '2025-02-13 15:48:51', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (177, 38, '细胞生物学', '探索细胞的结构、功能、代谢、遗传、分化、衰老与死亡等基本生命活动规律，运用显微镜技术、细胞培养技术等，帮助学生从细胞层面认识生命现象，是深入研究组织、器官功能和疾病机制的关键课程。', 0, 0, 'admin', '2025-02-13 15:49:04', 'admin', '2025-02-13 15:49:05', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (178, 38, '有机化学', '学习有机化合物的结构、性质、合成方法及反应机理，着重研究烃类、醇类、醛类、酮类、羧酸类等有机化合物，为药物化学、生物材料化学等课程提供有机化学知识和实验技能基础。', 0, 0, 'admin', '2025-02-13 15:49:14', 'admin', '2025-02-13 15:49:15', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (179, 38, '生物化学与分子生物学', '深入探讨生物分子的高级结构与功能关系，研究生物大分子的相互作用机制，如蛋白质 - 蛋白质、蛋白质 - 核酸相互作用，以及基因表达调控的分子机制，为攻克复杂疾病、开发新型诊断和治疗方法提供理论依据。', 0, 0, 'admin', '2025-02-13 15:50:48', 'admin', '2025-02-13 16:03:51', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (180, 38, '基因工程原理与技术', '系统学习基因工程的基本原理，涵盖基因克隆、载体构建、基因表达调控等核心技术，掌握基因编辑技术（如 CRISPR - Cas9）的应用，培养学生利用基因工程技术进行生物制药、疾病基因治疗等研究的能力。', 0, 0, 'admin', '2025-02-13 16:04:03', 'admin', '2025-02-13 16:04:04', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (181, 38, '生物医学成像技术', '全面介绍医学影像技术的原理、设备和临床应用，包括 X 射线成像、CT、MRI、超声成像、核医学成像等，深入探讨图像重建算法、图像后处理技术以及影像诊断的临床价值，培养学生在医学影像领域的研究和应用能力。', 0, 0, 'admin', '2025-02-13 16:04:17', 'admin', '2025-02-13 16:04:18', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (182, 38, '组织工程学', '研究组织和器官的构建与修复原理和技术，涉及生物材料的选择与设计、细胞培养与组织构建方法、组织工程产品的临床应用等内容，旨在培养学生开发新型组织工程产品，解决组织和器官缺损修复难题的能力。', 0, 0, 'admin', '2025-02-13 16:04:31', 'admin', '2025-02-13 16:04:33', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (183, 38, '生物信息学前沿', '聚焦生物信息学的最新研究进展，如高通量测序数据分析、蛋白质结构预测新算法、系统生物学中的生物信息学方法等，培养学生运用生物信息学工具和技术分析大规模生物数据，挖掘生命科学新知识的能力。', 1, 0, 'admin', '2025-02-13 16:04:51', 'admin', '2025-02-13 16:04:51', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (184, 37, '材料物理', '专注于材料的物理性能，如电学、磁学、热学、光学性能，研究这些性能与材料结构的关联，为开发新型功能材料提供理论支撑 。', 0, 0, 'admin', '2025-02-13 16:44:54', 'admin', '2025-02-13 16:44:55', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (185, 37, '高等数学', '提供微积分、线性代数等知识，用于材料性能数据处理、材料结构模型构建，辅助分析材料应力应变关系等复杂问题。', 0, 0, 'admin', '2025-02-13 16:45:05', 'admin', '2025-02-13 16:45:06', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (186, 37, '物理化学', '从化学热力学、动力学角度研究材料的化学变化与物理性质的关系，在材料合成、相转变、表面吸附等过程中起关键指导作用。', 0, 0, 'admin', '2025-02-13 16:45:19', 'admin', '2025-02-13 16:45:20', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (187, 37, '有机化学', '针对高分子材料等有机材料，讲解有机化合物结构、性质与反应机理，为高分子材料合成、改性和应用提供化学理论基础。', 0, 0, 'admin', '2025-02-13 16:45:31', 'admin', '2025-02-13 16:45:33', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (188, 37, '分析化学', '教授材料成分和结构的分析方法，如光谱分析、色谱分析、电化学分析等，用于材料质量检测、成分鉴定和性能评估。', 0, 0, 'admin', '2025-02-13 16:45:43', 'admin', '2025-02-13 16:45:44', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (189, 37, '材料科学基础', '系统介绍材料的晶体结构、缺陷、相图等基础理论，深入探讨材料结构与性能之间的本质联系。', 0, 0, 'admin', '2025-02-13 16:46:01', 'admin', '2025-02-13 16:46:03', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (190, 37, '材料工程基础', '侧重于材料加工工艺和工程应用，涵盖材料成型、加工技术以及材料在不同工程领域的应用特点，培养学生将材料科学知识转化为实际工程应用的能力。', 0, 0, 'admin', '2025-02-13 16:46:17', 'admin', '2025-02-13 16:46:19', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (191, 37, '材料研究方法', '介绍多种材料研究实验技术，如显微镜技术、X 射线衍射分析、热分析等，使学生掌握获取材料微观结构和性能信息的实验手段。', 0, 0, 'admin', '2025-02-13 16:46:32', 'admin', '2025-02-13 16:46:33', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (192, 37, '材料力学性能', '研究材料在各种外力作用下的力学响应，如强度、硬度、韧性等，为材料在工程结构中的安全可靠应用提供力学性能依据。', 0, 0, 'admin', '2025-02-13 16:46:46', 'admin', '2025-02-13 16:46:47', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (193, 37, '纳米技术与纳米材料', '聚焦纳米尺度下材料的特殊性能和制备技术，研究纳米材料在电子、医学、能源等前沿领域的应用，培养学生对前沿材料技术的掌握。', 0, 0, 'admin', '2025-02-13 16:46:59', 'admin', '2025-02-13 16:47:59', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (194, 36, '自动控制原理', '自动控制原理主要研究自动控制系统的基本原理、分析方法和设计理论。课程涵盖经典控制理论和现代控制理论两大部分。', 0, 0, 'admin', '2025-02-13 17:01:12', 'admin', '2025-02-13 17:01:14', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (195, 36, '电子电路基础', '包含模拟电子技术和数字电子技术。模拟电子技术研究半导体器件的特性和应用，如二极管、三极管、场效应管，以及由这些器件组成的放大电路、运算放大电路、电源电路等，理解模拟信号的处理和放大原理。', 0, 0, 'admin', '2025-02-13 17:01:27', 'admin', '2025-02-13 17:01:28', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (196, 36, '计算机控制系统', '介绍计算机在控制系统中的应用，包括计算机控制系统的组成结构，如硬件部分的主机、接口、输入输出通道，软件部分的系统软件和应用软件。', 0, 0, 'admin', '2025-02-13 17:01:42', 'admin', '2025-02-13 17:01:43', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (197, 36, '传感器与检测技术', '主要研究各类传感器的工作原理、特性和应用，如温度传感器、压力传感器、位移传感器、光电传感器等。课程包括传感器的选型与设计，信号调理与转换技术，将传感器采集到的微弱信号进行放大、滤波、调制等处理，以便后续的测量和控制。', 0, 0, 'admin', '2025-02-13 17:01:59', 'admin', '2025-02-13 17:02:00', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (198, 36, '电力电子技术', '电力电子技术研究电力电子器件的特性和应用，如晶闸管、功率晶体管、场效应晶体管等。学习由这些器件组成的各种电力变换电路，包括整流电路、逆变电路、斩波电路、交流调压电路等，实现电能的变换和控制，将交流电转换为直流电（整流）、直流电转换为交流电（逆变）等。', 0, 0, 'admin', '2025-02-13 17:02:39', 'admin', '2025-02-13 17:02:41', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (199, 36, '电机与拖动基础', '主要介绍各类电机的工作原理、结构和特性，如直流电机、交流异步电机、同步电机等。学习电机的拖动原理，即电机如何驱动生产机械运行，包括电机的启动、调速、制动等运行方式。', 0, 0, 'admin', '2025-02-13 17:02:55', 'admin', '2025-02-13 17:02:56', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (200, 36, '数字信号处理', '数字信号处理课程主要研究数字信号的采集、处理和分析方法。内容包括离散时间信号与系统的分析，如序列的运算、线性时不变系统的特性；数字滤波器的设计，包括有限冲激响应（FIR）滤波器和无限冲激响应（IIR）滤波器的设计方法；快速傅里叶变换（FFT）等信号变换技术，用于对信号进行频谱分析。', 0, 0, 'admin', '2025-02-13 17:03:12', 'admin', '2025-02-13 17:03:13', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (201, 36, '系统工程', '系统工程从整体出发，研究系统的规划、设计、开发、运行和管理。课程涵盖系统分析方法，如系统建模、系统评价等；系统优化技术，包括线性规划、非线性规划、动态规划等在系统设计中的应用；以及系统集成和项目管理的相关知识，培养学生从全局角度解决复杂系统问题的能力。', 0, 0, 'admin', '2025-02-13 17:03:25', 'admin', '2025-02-13 17:03:26', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (202, 35, '建筑设计基础', '是建筑学专业的入门课程，培养学生对建筑设计的基本认知和表达能力。课程涵盖建筑空间基本概念，通过模型制作、草图绘制让学生体验空间塑造；教授建筑设计流程，从场地分析到方案构思深化等。', 0, 0, 'admin', '2025-02-13 17:20:49', 'admin', '2025-02-13 17:20:50', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (203, 35, '建筑历史', '系统介绍古今中外建筑发展脉络，详细讲解不同历史时期、地域的建筑风格特点，分析风格形成的历史、文化和技术背景，通过建筑案例研究培养学生对建筑文化内涵的理解和历史批判性思维。', 0, 0, 'admin', '2025-02-13 17:21:05', 'admin', '2025-02-13 17:21:06', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (204, 35, '建筑力学', '教授建筑结构设计所需的力学基本原理，包括静力学、材料力学和结构力学知识。学习建筑结构受力分析方法，计算结构构件内力；了解常见建筑材料力学性能，根据设计需求选择合适材料和结构形式，确保建筑安全稳定。', 0, 0, 'admin', '2025-02-13 17:21:21', 'admin', '2025-02-13 17:21:23', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (205, 35, '建筑构造', '深入研究建筑各部分构造组成和连接方式，如墙体、屋顶、楼梯等构造做法，学习不同建筑材料在构造中的应用和施工工艺，掌握建筑防水、防潮、保温、隔热、防火、抗震等构造措施和安全要求。', 0, 0, 'admin', '2025-02-13 17:21:40', 'admin', '2025-02-13 17:21:41', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (206, 35, '建筑物理', '主要包含建筑热工、光学和声学知识。研究建筑与室内外热环境关系，掌握热工设计原理和方法；学习采光和照明设计，营造舒适光环境；了解声学原理，掌握控制噪声、改善音质的设计方法，提高建筑物理环境质量和舒适度。', 0, 0, 'admin', '2025-02-13 17:21:55', 'admin', '2025-02-13 17:21:56', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (207, 35, '建筑设计及其理论前沿', '关注当代建筑设计前沿理论和创新方法，研究绿色建筑、数字化建筑、参数化设计等新兴理念和技术在建筑设计中的应用，分析设计趋势与社会、环境、技术发展的关系，引导学生进行前瞻性设计研究和实践，培养创新研究能力和引领设计潮流的意识。', 0, 0, 'admin', '2025-02-13 17:22:15', 'admin', '2025-02-13 17:22:17', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (208, 35, '城市设计理论与实践', '深入探讨城市设计理论体系和实践方法，研究城市空间形态、功能布局、交通组织等设计原理，学习城市更新、可持续城市设计、智慧城市设计等热点领域的理论和案例。', 0, 0, 'admin', '2025-02-13 17:22:33', 'admin', '2025-02-13 17:22:34', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (209, 35, '建筑技术创新与应用', '聚焦建筑技术创新研究和应用，研究新型建筑材料性能和应用技术，探索先进建筑结构体系和施工技术，关注建筑节能与可持续发展技术，培养学生建筑技术创新应用能力。', 0, 0, 'admin', '2025-02-13 17:22:51', 'admin', '2025-02-13 17:22:53', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (210, 35, '建筑遗产保护与数字化技术', '研究建筑遗产保护理论、技术和方法，包括价值评估、保护规划制定、修复技术等，学习数字化技术在建筑遗产保护中的应用，如三维激光扫描、BIM 技术等，培养学生运用现代技术手段进行建筑遗产保护和管理的能力。', 0, 0, 'admin', '2025-02-13 17:23:10', 'admin', '2025-02-13 17:23:13', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (211, 34, '微积分', '用于求解土体变形和稳定性相关的复杂方程；在交通工程中，还可用于分析交通流量随时间的变化趋势。', 0, 0, 'admin', '2025-02-13 17:37:56', 'admin', '2025-02-13 17:38:04', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (212, 34, '微分方程', '用于描述土木工程项目中各种物理现象随时间或空间的变化规律。', 0, 0, 'admin', '2025-02-13 17:38:19', 'admin', '2025-02-13 17:38:20', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (213, 34, '流体力学', '研究流体（液体和气体）的力学性质和运动规律。在给排水工程中，依据流体力学原理计算管道内水流速度、压力损失，设计合理的给排水系统。', 0, 0, 'admin', '2025-02-13 17:38:35', 'admin', '2025-02-13 17:38:36', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (214, 34, '结构力学', '研究结构在各种荷载（如重力、风力、地震力等）作用下的内力和变形规律。', 0, 0, 'admin', '2025-02-13 17:38:51', 'admin', '2025-02-13 17:38:52', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (215, 34, '材料力学', '着重研究材料在各种外力作用下的力学性能和变形规律。', 0, 0, 'admin', '2025-02-13 17:39:06', 'admin', '2025-02-13 17:39:07', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (216, 34, '工程地质', '主要研究与工程建设有关的地质问题。', 0, 0, 'admin', '2025-02-13 17:39:22', 'admin', '2025-02-13 17:39:23', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (217, 34, '岩土工程', '专注于研究土壤和岩石的力学性质及其在工程中的应用。', 0, 0, 'admin', '2025-02-13 17:39:34', 'admin', '2025-02-13 17:39:35', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (218, 34, '结构设计', '基于结构力学和材料力学等知识，教授学生进行各类结构（如建筑结构、桥梁结构等）的设计方法。', 0, 0, 'admin', '2025-02-13 17:39:49', 'admin', '2025-02-13 17:39:50', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (219, 28, '地球系统科学', '研究地球各圈层（岩石圈、水圈、大气圈、生物圈）的相互作用及全球变化机制。', 0, 0, 'admin', '2025-02-14 16:15:54', 'admin', '2025-02-14 16:15:56', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (220, 28, '矿物学与岩石学', '学习矿物和岩石的物理化学性质、分类及形成过程，为资源勘探奠定基础。', 0, 0, 'admin', '2025-02-14 16:16:09', 'admin', '2025-02-14 16:16:10', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (221, 28, '构造地质学', '分析地壳变形机制（如断层、褶皱），应用于油气储层预测和地质灾害评估。', 0, 0, 'admin', '2025-02-14 16:16:41', 'admin', '2025-02-14 16:16:42', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (222, 28, '气候学基础', '探讨气候系统的驱动因素、气候变化模型及对生态系统的影响。', 0, 0, 'admin', '2025-02-14 16:16:51', 'admin', '2025-02-14 16:16:53', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (223, 28, '海洋动力学', '研究海流、潮汐、波浪的物理机制及其对气候和生态系统的作用。', 0, 0, 'admin', '2025-02-14 16:17:03', 'admin', '2025-02-14 16:17:05', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (224, 28, '遥感与地理信息系统', '掌握卫星影像解译和空间数据分析技术，用于环境监测与资源管理。', 0, 0, 'admin', '2025-02-14 16:17:16', 'admin', '2025-02-14 16:17:17', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (225, 28, '环境地球化学', '分析污染物在环境中的迁移转化规律，评估生态风险。', 0, 0, 'admin', '2025-02-14 16:17:27', 'admin', '2025-02-14 16:17:28', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (226, 28, '全球气候变化', '基于数值模型预测气候变化趋势及其社会经济影响。', 0, 0, 'admin', '2025-02-14 16:17:42', 'admin', '2025-02-14 16:17:44', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (227, 28, '地质灾害风险评估', '结合地质数据与统计模型，评估地震、滑坡等灾害的潜在风险。', 0, 0, 'admin', '2025-02-14 16:17:57', 'admin', '2025-02-14 16:17:59', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (228, 27, '生物化学', '研究生物大分子（蛋白质、核酸、酶）的结构与功能，分析代谢途径（糖酵解、三羧酸循环）及调控机制。', 0, 0, 'admin', '2025-02-14 16:27:02', 'admin', '2025-02-14 16:28:57', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (229, 27, '分子生物学', '学习基因克隆、PCR技术、基因编辑（CRISPR），探索基因表达调控与表观遗传学机制。', 0, 0, 'admin', '2025-02-14 16:27:13', 'admin', '2025-02-14 16:28:58', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (230, 27, '遗传学', '群体遗传学、基因组学，结合生物信息学工具分析遗传变异与疾病关联。\n', 0, 0, 'admin', '2025-02-14 16:27:25', 'admin', '2025-02-14 16:28:59', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (231, 27, '细胞生物学', '研究细胞器功能、细胞周期调控、细胞信号转导，利用荧光标记与活细胞成像技术观察动态过程。', 0, 0, 'admin', '2025-02-14 16:27:48', 'admin', '2025-02-14 16:28:59', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (232, 27, '微生物学', '解析细菌、病毒、真菌的生理特性与致病机制，应用于抗生素开发与微生物发酵技术。', 0, 0, 'admin', '2025-02-14 16:27:59', 'admin', '2025-02-14 16:29:00', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (233, 27, '免疫学', '学习先天与适应性免疫系统，研究疫苗设计原理、免疫检查点抑制剂及自身免疫疾病机制。', 0, 0, 'admin', '2025-02-14 16:28:13', 'admin', '2025-02-14 16:29:01', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (234, 27, '生物统计学', '运用统计模型分析生物学数据，掌握实验设计、假设检验及大数据处理技能。', 0, 0, 'admin', '2025-02-14 16:28:23', 'admin', '2025-02-14 16:29:02', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (235, 27, '生态与进化', '研究物种适应性进化、生态系统能量流动及气候变化对生物分布的影响。', 0, 0, 'admin', '2025-02-14 16:28:32', 'admin', '2025-02-14 16:29:03', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (236, 27, '生物信息学', '利用编程（Python/R）分析基因组、蛋白质组数据，构建系统发育树与基因调控网络。', 0, 0, 'admin', '2025-02-14 16:28:43', 'admin', '2025-02-14 16:29:03', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (237, 27, '发育生物学', '探究胚胎发育的分子机制，研究干细胞分化与组织再生技术。', 0, 0, 'admin', '2025-02-14 16:28:56', 'admin', '2025-02-14 16:29:04', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (238, 26, '无机化学', '研究元素周期律、配位化学及固态材料，涵盖过渡金属化合物、晶体结构与催化机理。', 0, 0, 'admin', '2025-02-14 16:37:27', 'admin', '2025-02-14 16:39:09', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (239, 26, '有机化学', '学习有机反应机理、光谱解析（如NMR、质谱）及合成策略（如不对称催化、多步合成）。', 0, 0, 'admin', '2025-02-14 16:37:39', 'admin', '2025-02-14 16:39:10', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (240, 26, '物理化学', '涵盖热力学定律、量子力学基础、化学动力学及电化学原理，应用于材料设计与能源系统建模。', 0, 0, 'admin', '2025-02-14 16:37:49', 'admin', '2025-02-14 16:39:11', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (241, 26, '化学工程原理', '学习质量与能量守恒、流体力学、传热传质及反应器设计，为化工流程优化奠定基础。', 0, 0, 'admin', '2025-02-14 16:37:59', 'admin', '2025-02-14 16:39:12', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (242, 26, '分析化学技术', '掌握色谱、质谱、光谱分析及电化学检测方法，用于复杂样品的定性与定量分析。', 0, 0, 'admin', '2025-02-14 16:38:10', 'admin', '2025-02-14 16:39:13', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (243, 26, '生物化学与分子生物学', '探索酶动力学、代谢途径及基因工程，结合结构生物学技术解析蛋白质功能。', 0, 0, 'admin', '2025-02-14 16:38:24', 'admin', '2025-02-14 16:39:14', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (244, 26, '高分子化学', '研究聚合物合成、结构与性能，应用于塑料、纤维及生物医用材料开发。', 0, 0, 'admin', '2025-02-14 16:38:35', 'admin', '2025-02-14 16:39:14', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (245, 26, '过程控制与优化', '利用数学模型与算法优化化工生产流程，提高效率并降低能耗。', 0, 0, 'admin', '2025-02-14 16:38:46', 'admin', '2025-02-14 16:39:15', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (246, 26, '环境化学', '分析污染物迁移转化机制，开发废水处理、空气净化及固废资源化技术。', 0, 0, 'admin', '2025-02-14 16:38:57', 'admin', '2025-02-14 16:39:16', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (247, 26, '计算化学', '运用分子模拟与量子计算预测分子性质，辅助药物设计与材料开发。', 0, 0, 'admin', '2025-02-14 16:39:08', 'admin', '2025-02-14 16:39:16', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (248, 25, '经典力学', '研究物体的机械运动规律，涵盖质点运动、牛顿运动定律、功和能、动量守恒等内容，是理解宏观物体运动的基础。', 0, 0, 'admin', '2025-02-14 16:46:55', 'admin', '2025-02-14 16:48:24', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (249, 25, '电磁学和静电学', '主要探讨电荷、电场、磁场的基本性质，以及它们之间的相互作用规律，包括库仑定律、安培定律、法拉第电磁感应定律等，为电学和磁学的深入学习奠基。', 0, 0, 'admin', '2025-02-14 16:47:07', 'admin', '2025-02-14 16:48:25', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (250, 25, '机械振动和波；光学等', '涉及机械振动和波的产生、传播特性，如简谐运动、叠加原理、衍射干涉现象；同时介绍光的传播、反射、折射等性质，以及麦克斯韦方程组对光的电磁本质的阐述。', 0, 0, 'admin', '2025-02-14 16:47:19', 'admin', '2025-02-14 16:48:26', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (251, 25, '相对论', '分为狭义相对论和广义相对论，狭义相对论主要讨论时间和空间的相对性、光速不变原理等；广义相对论则研究引力现象，揭示物质和时空的关系，是现代物理学的重要基石。', 0, 0, 'admin', '2025-02-14 16:47:35', 'admin', '2025-02-14 16:48:28', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (252, 25, '量子物理学', '研究微观世界的现象和规律，如量子态、波粒二象性、不确定性原理等，解释原子、分子等微观系统的行为，颠覆了传统物理学对微观世界的认知。', 0, 0, 'admin', '2025-02-14 16:47:50', 'admin', '2025-02-14 16:48:28', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (253, 25, '电磁学', '进一步深入探讨电磁相互作用，涵盖电动力学的基本理论，如电磁场的基本方程、电磁波的传播等，在现代通信、电子技术等领域有广泛应用。', 0, 0, 'admin', '2025-02-14 16:47:56', 'admin', '2025-02-14 16:48:29', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (254, 25, '统计物理学', '运用统计方法研究大量微观粒子组成的系统的宏观性质，通过对微观状态的统计平均，解释物质的热力学性质，如温度、压强、熵等概念。', 0, 0, 'admin', '2025-02-14 16:48:06', 'admin', '2025-02-14 16:48:30', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (255, 25, '微分方程与波', '着重讲解微分方程的求解方法及其在波动现象中的应用，如波动方程的推导和求解，加深学生对波动现象的数学理解。', 0, 0, 'admin', '2025-02-14 16:48:23', 'admin', '2025-02-14 16:48:31', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (256, 24, '微积分', '用于计算数据变化率、优化算法中的目标函数等，是许多数据科学模型和算法的数学基础。', 0, 0, 'admin', '2025-02-14 17:01:00', 'admin', '2025-02-14 17:02:24', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (257, 24, '线性代数', '为数据处理提供关键工具，涉及向量、矩阵和线性方程组等概念，对降维算法（如主成分分析）、数据变换等至关重要。', 0, 0, 'admin', '2025-02-14 17:01:14', 'admin', '2025-02-14 17:02:24', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (258, 24, '概率与统计', '用于描述和处理数据中的不确定性，是数据建模、假设检验、参数估计等数据科学任务的理论支撑。', 0, 0, 'admin', '2025-02-14 17:01:23', 'admin', '2025-02-14 17:02:26', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (259, 24, '编程与数据结构', '教授 Python 或 Java 等编程语言基础及数据结构知识，帮助学生掌握数据存储、操作和算法实现的编程技能。', 0, 0, 'admin', '2025-02-14 17:01:32', 'admin', '2025-02-14 17:02:26', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (260, 24, '机器学习', '深入学习各类机器学习算法，如决策树、支持向量机、神经网络等，掌握模型训练、评估和调优的方法。', 0, 0, 'admin', '2025-02-14 17:01:45', 'admin', '2025-02-14 17:02:27', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (261, 24, '数据库管理系统', '学习数据库的设计、操作和管理，包括数据存储、查询优化等，使学生能够高效管理和利用数据。', 0, 0, 'admin', '2025-02-14 17:01:57', 'admin', '2025-02-14 17:02:28', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (262, 24, '数据挖掘', '掌握关联规则挖掘、聚类分析、分类算法等数据挖掘技术及其在实际场景中的应用。', 0, 0, 'admin', '2025-02-14 17:02:05', 'admin', '2025-02-14 17:02:28', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (263, 24, '数据可视化', '学习数据可视化的技术和工具，如 Matplotlib、Seaborn 等，将数据以直观的图表形式呈现，辅助数据分析和决策。', 0, 0, 'admin', '2025-02-14 17:02:21', 'admin', '2025-02-14 17:02:29', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (264, 23, '概率论', '系统学习概率的基本概念、定理和方法，是描述和处理随机现象的基础，为后续的统计推断和分析提供理论基石，在金融产品定价、风险管理和投资决策等方面意义重大。', 0, 0, 'admin', '2025-02-14 17:05:28', 'admin', '2025-02-14 17:08:48', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (265, 23, '数理统计学', '深入研究统计推断、估计理论等数学基础，帮助学生理解如何从样本数据推断总体特征，为其他统计学分支提供严谨的理论支持，是统计学专业的核心理论课程。', 0, 0, 'admin', '2025-02-14 17:05:39', 'admin', '2025-02-14 17:08:49', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (266, 23, '应用统计学', '学习将统计方法应用于实际问题的解决，培养学生运用统计学知识处理不同领域实际数据的能力，让学生掌握如何根据具体问题选择合适的统计方法。', 0, 0, 'admin', '2025-02-14 17:05:48', 'admin', '2025-02-14 17:08:49', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (267, 23, '回归分析', '掌握线性回归、非线性回归等模型及其应用，通过建立变量之间的数学关系，分析一个或多个自变量对因变量的影响，广泛应用于经济预测、市场分析等领域。', 0, 0, 'admin', '2025-02-14 17:05:58', 'admin', '2025-02-14 17:08:50', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (268, 23, '方差分析与实验设计', '学习实验设计方法和方差分析技术，能够合理设计实验，控制实验误差，分析实验数据中不同因素的影响，常用于医学研究、工业生产优化等方面。', 0, 0, 'admin', '2025-02-14 17:06:07', 'admin', '2025-02-14 17:08:51', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (269, 23, '时间序列分析', '研究时间序列数据的建模和预测方法，用于分析随时间变化的数据，预测未来趋势，在经济、金融、气象等领域有重要应用，如预测股票价格走势、电力负荷变化等。\n', 0, 0, 'admin', '2025-02-14 17:07:55', 'admin', '2025-02-14 17:08:52', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (270, 23, '统计学研究方法', '学习如何开展统计学研究和撰写学术论文，包括研究选题、文献综述、研究设计、数据收集与分析、论文撰写等方面的知识和技能，提升研究生的科研素养和能力。', 0, 0, 'admin', '2025-02-14 17:08:06', 'admin', '2025-02-14 17:08:53', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (271, 22, '微积分', '单变量微积分侧重于函数导数、积分计算及相关定理，像通过求导判断函数单调性，积分计算曲线围成面积。多变量微积分则将概念拓展到多元函数，在物理计算物体质心、电磁学计算场通量等方面广泛应用，是后续分析类课程学习的基石。', 0, 0, 'admin', '2025-02-14 17:18:36', 'admin', '2025-02-14 17:20:23', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (272, 22, '线性代数', '围绕向量、矩阵和线性方程组展开，教授矩阵运算、向量空间、线性变换等知识。', 0, 0, 'admin', '2025-02-14 17:18:49', 'admin', '2025-02-14 17:20:24', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (273, 22, '抽象代数', '深入剖析这些结构性质和运算规则，群论在密码学非对称加密算法有应用；环和域理论为编码理论、数论研究提供理论支撑，培养学生抽象思维和逻辑推理能力。', 0, 0, 'admin', '2025-02-14 17:19:08', 'admin', '2025-02-14 17:20:25', NULL, NULL);
INSERT INTO `consult_major_course` VALUES (274, 22, '实分析', '研究实数集、函数极限、连续、可微和可积性等。', 0, 0, 'admin', '2025-02-14 17:19:29', 'admin', '2025-02-14 17:20:26', NULL, NULL);
