INSERT INTO `consult_major_echelon` VALUES (73, 38, '精准医疗', '分析患者的遗传信息、生物标志物等数据，制定个性化的治疗方案，提高治疗效果，减少不良反应。', 0, 'admin', '2025-02-13 16:07:39', 'admin', '2025-02-13 16:07:51', 0, NULL, NULL);
