INSERT INTO `consult_major_echelon` VALUES (93, 35, '历史建筑改造', '在商业开发中，对历史建筑进行改造时，既要确保安全性和功能性，又要保护其历史文化价值。', 0, 'admin', '2025-02-13 17:28:44', 'admin', '2025-02-13 17:28:46', 0, NULL, NULL);
