INSERT INTO `consult_major_echelon` VALUES (172, 24, '政府领域', '实现科学化、精准化的公共服务和资源配置，如智慧城市项目利用大数据提升城市服务质量。', 0, 'admin', '2025-02-14 16:59:30', 'admin', '2025-02-14 17:00:03', 0, NULL, NULL);
INSERT INTO `consult_major_echelon` VALUES (173, 24, '制造业', '优化生产过程、预测设备故障、提高生产效率和产品质量，如分析生产设备数据进行预防性维护。', 0, 'admin', '2025-02-14 16:59:45', 'admin', '2025-02-14 17:00:04', 0, NULL, NULL);
INSERT INTO `consult_major_echelon` VALUES (174, 24, '运输和物流业', '追踪和分析系统数据，优化交通和供应链运作，降低成本、提升客户满意度，如物流数据分析师通过数据分析优化配送路线。', 0, 'admin', '2025-02-14 17:00:00', 'admin', '2025-02-14 17:00:05', 0, NULL, NULL);
INSERT INTO `consult_major_echelon` VALUES (175, 23, '经济领域', '对经济数据进行收集、整理、分析和预测，为宏观经济分析、金融市场分析、投资风险评估等提供依据，助力经济决策的制定。', 0, 'admin', '2025-02-14 17:09:17', 'admin', '2025-02-14 17:11:24', 0, NULL, NULL);
INSERT INTO `consult_major_echelon` VALUES (176, 23, '金融领域', '用于分析金融市场的行为和风险，帮助投资者做出更明智的投资决策，例如通过统计分析历史数据预测股票未来价格走势。', 0, 'admin', '2025-02-14 17:09:29', 'admin', '2025-02-14 17:11:25', 0, NULL, NULL);
INSERT INTO `consult_major_echelon` VALUES (177, 23, '保险领域', '处理和分析保险业务数据，计算保费、评估风险和设计保险产品，确保保险企业的稳健运营。', 0, 'admin', '2025-02-14 17:09:48', 'admin', '2025-02-14 17:11:26', 0, NULL, NULL);
INSERT INTO `consult_major_echelon` VALUES (178, 23, '市场调查', '帮助企业收集、整理、分析和解释市场信息，了解市场趋势、消费者偏好等关键信息，为市场营销策略提供数据支持。', 0, 'admin', '2025-02-14 17:10:00', 'admin', '2025-02-14 17:11:27', 0, NULL, NULL);
INSERT INTO `consult_major_echelon` VALUES (179, 23, '社会科学 / 生物医药', '对社会现象、社会问题、生物医学数据进行量化研究，为社会政策的制定提供科学依据，支持医疗研究、药物开发和疾病控制等工作。', 0, 'admin', '2025-02-14 17:10:40', 'admin', '2025-02-14 17:11:28', 0, NULL, NULL);
INSERT INTO `consult_major_echelon` VALUES (180, 23, '工程领域', '应用于质量控制、工程设计优化、可靠性分析等方面，提高工程产品质量和生产效率。', 0, 'admin', '2025-02-14 17:11:09', 'admin', '2025-02-14 17:11:29', 0, NULL, NULL);
INSERT INTO `consult_major_echelon` VALUES (181, 23, '政府和公共政策', '政府部门利用统计数据进行人口统计、经济发展规划、资源分配等工作，推动社会的有序发展。', 0, 'admin', '2025-02-14 17:11:22', 'admin', '2025-02-14 17:11:30', 0, NULL, NULL);
INSERT INTO `consult_major_echelon` VALUES (182, 22, '自然科学领域', '在物理学中，数学用于描述物理现象、推导物理定律，如牛顿力学、量子力学都依赖大量数学公式和模型；天文学中，运用数学计算天体轨道、预测天文现象；化学领域，数学帮助分析化学反应过程、分子结构等。', 0, 'admin', '2025-02-14 17:17:06', 'admin', '2025-02-14 17:17:53', 0, NULL, NULL);
INSERT INTO `consult_major_echelon` VALUES (183, 22, '工程技术领域', '在计算机科学中，数学是算法设计、数据结构、人工智能、机器学习的基础，例如深度学习中的神经网络训练涉及大量矩阵运算和优化算法；在电子工程中，用于电路分析、信号处理；在机械工程中，进行力学分析、结构设计优化等都离不开数学。', 0, 'admin', '2025-02-14 17:17:17', 'admin', '2025-02-14 17:17:54', 0, NULL, NULL);
INSERT INTO `consult_major_echelon` VALUES (184, 22, '金融经济领域', '数学在金融市场分析、投资风险评估、资产定价等方面发挥关键作用。例如，通过数学模型预测股票价格走势、评估投资组合的风险与收益；在经济学中，用于构建经济模型，分析宏观经济趋势、微观经济主体行为，为政策制定提供依据。', 0, 'admin', '2025-02-14 17:17:29', 'admin', '2025-02-14 17:17:56', 0, NULL, NULL);
INSERT INTO `consult_major_echelon` VALUES (185, 22, '社会科学领域', '在社会学、心理学等学科中，运用统计学方法对社会现象、心理数据进行量化分析，以揭示社会规律、了解人群行为模式；在市场调研中，通过数据分析帮助企业了解消费者需求、市场趋势，制定营销策略。', 0, 'admin', '2025-02-14 17:17:42', 'admin', '2025-02-14 17:17:57', 0, NULL, NULL);
INSERT INTO `consult_major_echelon` VALUES (186, 22, '医学领域', '在医学研究中，利用数学和统计学方法进行疾病模型构建、药物疗效评估、医学图像处理等。例如，通过统计分析临床试验数据判断药物的有效性和安全性；利用数学模型模拟疾病传播过程，为疫情防控提供决策支持。\n', 0, 'admin', '2025-02-14 17:17:52', 'admin', '2025-02-14 17:17:57', 0, NULL, NULL);
INSERT INTO `consult_major_echelon` VALUES (187, 6, '测试梯队', '<h2>测试梯队描述</h2>', 1, 'admin', '2025-07-03 16:14:40', 'admin', '2025-07-03 16:23:41', 1, 28, 55);
INSERT INTO `consult_major_echelon` VALUES (188, 6, '2222', '<p>11111</p>', 0, 'admin', '2025-07-03 16:47:37', 'admin', '2025-07-03 16:47:37', 1, 28, 1);
INSERT INTO `consult_major_echelon` VALUES (189, 6, '梯队名称', '<p>梯队描述</p>', 0, 'admin', '2025-07-07 11:33:42', 'admin', '2025-07-07 11:33:42', 1, 3, 1);
INSERT INTO `consult_major_info` VALUES (1, 6, '金融学', 'Finance', '', '金融是研究资金的管理和运用，以及经济活动运行和发展的专业。它涉及到金融市场、金融机构、投资、货币、信贷、利率等各个方面，旨在培养具有良好金融理论知识和经济分析能力的人才，以满足社会对金融人才的需求。', '该类专业通常会设置国际金融、货币银行学、金融市场学、投资学、兼并与收购等主要专业课程，另外还会学习到如经济学原理、会计学、统计学等专业课程，帮助学生建立扎实的基础知识。', '金融类专业在商业领域有着广泛的应用，主要包括：', '金融类专业的应届生面临着多元化的职业道路，他们有机会涉猎包括贸易、市场营销和管理层等多种工作领域。对于想进入证券公司的学生来说，教育背景显得尤为重要，一般本科是入门的基本标准，若想跻身于顶尖的证券企业，则可能需要985/211，或是海外排名前100的院校背景。除了学历要求，相关的实习经历和持有行业认可的专业证书，例如特许金融分析师（CFA）或特许财富管理师（CWM），将会成为求职者的竞争优势。', 0, 'admin', '2024-12-27 17:49:35', 'admin', '2025-02-13 01:57:05', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (2, 7, '经济学', 'Economics', '', '经济学是研究资源有效配置、生产分配、市场运行规律及社会财富创造的学科，通过理论模型与实证分析，揭示个体、企业、政府等经济主体在稀缺性条件下的决策行为，旨在培养具备宏观经济洞察力与微观分析能力的复合型人才，服务于政策制定、产业规划、可持续发展等领域。', NULL, NULL, '经济学毕业生可进入政府部门、国际组织、咨询公司、能源企业及科技巨头，从事政策分析、市场咨询、数据建模与可持续发展研究；亦可投身学术机构或金融科技领域，聚焦经济理论创新、投资策略优化及人工智能驱动的决策支持。', 0, 'admin', '2024-12-27 17:49:35', 'admin', '2025-02-13 10:39:02', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (3, 8, '商业分析', 'Business Analytics', '', 'test2', NULL, NULL, NULL, 0, 'admin', '2024-12-27 17:49:35', 'admin', '2025-02-13 01:48:13', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (4, 9, '管理学', 'Management', NULL, NULL, NULL, NULL, NULL, 0, 'admin', '2024-12-27 17:49:35', 'admin', '2024-12-31 16:51:41', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (5, 10, '人力资源管理', 'Human Resource Management', NULL, NULL, NULL, NULL, NULL, 0, 'admin', '2024-12-27 17:49:35', 'admin', '2024-12-31 16:51:41', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (6, 11, '市场营销', 'Marketing', NULL, NULL, NULL, NULL, NULL, 0, 'admin', '2024-12-27 17:49:35', 'admin', '2024-12-31 16:51:41', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (7, 12, '财会类', 'Accounting and Finance', NULL, NULL, NULL, NULL, NULL, 0, 'admin', '2024-12-27 17:49:35', 'admin', '2024-12-31 16:51:41', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (8, 13, '传媒学', 'Communication', '传媒专业的核心课程通常包括传播学概论、新闻学、公共关系、广告学等，旨在培养学生在传媒领域的基础知识和技能。', '随着互联网和数字技术的飞速发展，新媒体平台如抖音、微信和小红书等迅速崛起，这不仅改变了信息的传播方式，也重塑了广告传媒行业的生态。这些平台提供了前所未有的互动性和用户参与度，使得内容创造、传播和消费变得更加快速和广泛。因此传媒专业的人才需求日益增长。企业和机构需要这些专业人才来适应市场的变化，创造有吸引力的内容，有效地与目标受众沟通，并在竞争激烈的市场中保持领先。', '该类专业通常会设置传媒专业的核心课程通常包括传播学概论、新闻学、广告学概论、广告策划与创意。', '传媒类专业在商业中具有广泛的应用，这些应用主要包括以下几个方面：', '传媒专业的毕业生在就业市场上有着广泛的选择，不仅局限于广告行业，还可以涉足其他多个领域。不过，由于广告和传媒行业的竞争激烈和快速变化，从业者需要不断更新知识和技能，以适应行业的发展需求。另外，随着数字化转型的加速，对于具备数字媒体运营能力的专业人才需求也在不断增长。', 0, 'admin', '2024-12-27 17:49:35', 'admin', '2024-12-31 16:57:38', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (9, 14, '语言与文学', 'Language and Literature', NULL, NULL, NULL, NULL, NULL, 0, 'admin', '2024-12-27 17:49:35', 'admin', '2024-12-31 16:51:42', NULL, NULL);
