INSERT INTO `consult_major_info` VALUES (16, 21, '心理学', 'Psychology', NULL, NULL, NULL, NULL, NULL, 0, 'admin', '2024-12-27 17:50:47', 'admin', '2024-12-31 16:51:43', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (17, 22, '数学', 'Mathematics', '', '数学是一门研究数量、结构、变化以及空间模型等概念的学科。它通过抽象化和逻辑推理的方法，对各种现象进行精确的描述和深入的分析，是自然科学、工程技术、社会科学等众多领域的重要基础。', NULL, NULL, '数学专业就业广泛，可在科研机构深耕理论研究、在教育领域培育人才，也能在金融、科技行业借助数学模型与算法助力量化分析、技术研发等工作。', 0, 'admin', '2024-12-27 17:50:47', 'admin', '2025-02-14 16:07:36', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (18, 23, '统计学', 'Statistics', '', '统计学是一门专注于数据的收集、处理、分析和解释，以及概率论基本理论和应用的学科。它通过对大量数据进行量化分析，总结经验规律，做出推断和预测，从而为各领域的决策提供依据和参考。', NULL, NULL, '统计学专业人才活跃于金融、互联网、市场调研、医药等多行业，负责数据收集、分析与解读，为决策制定、产品优化、市场洞察、药物评估等提供关键支撑。\n', 0, 'admin', '2024-12-27 17:50:47', 'admin', '2025-02-14 16:08:19', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (19, 24, '数据科学', 'Data Science', '', '数据科学是一门融合数学、统计学、计算机科学以及特定领域知识的交叉学科，聚焦于运用算法、数据分析、机器学习和统计方法，从大量复杂数据中挖掘有价值信息，以解决复杂问题，助力科学精准决策。', NULL, NULL, '数据科学专业人才在科技、金融、电商等领域发挥关键作用，承担数据挖掘、算法设计、业务分析等工作，驱动产品创新、风险管控与服务优化。', 0, 'admin', '2024-12-27 17:50:47', 'admin', '2025-02-14 16:08:45', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (20, 25, '物理', 'Physics', '', '物理学是一门研究物质、能量、空间和时间基本性质及其相互关系的学科，旨在揭示自然界的基本规律，探索物质的本质结构和宇宙的运行机制。它通过实验观测和理论推导，构建起对自然世界的深刻理解，为众多科学技术领域提供理论基础和研究方法，推动人类对世界认知的不断拓展。', NULL, NULL, '物理专业毕业生能在科研机构探索宇宙奥秘，在教育行业传播知识，也可在电子、能源、航空航天等领域参与技术研发与产品设计。', 0, 'admin', '2024-12-27 17:50:47', 'admin', '2025-02-14 16:09:20', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (21, 26, '化学化工', 'Chemistry', '', '化学化工是一门融合化学基础理论与工程技术应用的综合性学科，旨在通过研究物质的组成、结构、性质及变化规律，开发高效生产工艺并解决实际问题。化学侧重于基础理论与实验研究（如有机合成、材料分析），化工则聚焦于工业流程设计、优化与管理（如反应工程、过程控制）。两者共同推动能源、材料、医药等领域的创新与发展。', NULL, NULL, '化学化工专业人才在化工、材料、制药等行业从事产品研发、工艺优化、质量控制等工作，推动化工产业创新与可持续发展。', 0, 'admin', '2024-12-27 17:50:47', 'admin', '2025-02-14 16:09:51', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (22, 27, '生物科学', 'Biology', '', '生物科学是研究生命现象和生命活动规律的学科，涵盖从微观分子机制（如基因表达、细胞代谢）到宏观生态系统（如生物多样性、生态关系）的各个层次，旨在揭示生命本质、推动技术创新并解决人类面临的健康、环境、资源等重大问题。', NULL, NULL, '生物科学专业就业方向多元，可在科研与教育领域探索生命奥秘、培育专业人才，也能在医药、农业、环保等行业助力研发创新、产业升级。', 0, 'admin', '2024-12-27 17:50:47', 'admin', '2025-02-14 16:10:15', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (23, 28, '地球科学', 'Earth Sciences', '', '地球科学是研究地球系统及其各圈层（岩石圈、水圈、大气圈、生物圈）的结构、演化过程和相互作用的综合性学科，涵盖自然现象、资源开发、环境保护及灾害防治等领域。其目标是通过多学科交叉方法揭示地球运行规律，为可持续发展提供科学依据。', NULL, NULL, '地球科学专业人才在科研机构、政府部门、企业等从事地质勘探、环境监测、资源开发管理等工作，为地球资源利用与环境保护提供专业支持。', 0, 'admin', '2024-12-27 17:50:47', 'admin', '2025-02-14 16:10:38', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (24, 29, '计算机', 'Computer Science', '计算机专业是聚焦于计算机科学与技术的学术与应用领域，旨在培养具有扎实计算机理论基础、强大技术实践能力和良好创新精神的专业人才。专业课程通常涵盖算法与数据结构、操作系统、计算机网络、数据库系统、人工智能、软件工程等关键领域，同时注重学生的项目实践和科研能力的培养。', '随着科学技术的发展，”互联网+“ 正在深刻地改变人们的生活和工作方式，计算机专业成为了非常热门的专业，其就业岗位在各大公司都有极高的需求，因此就业竞争较大。这对计算机类专业的学生的要求，不仅仅是需要学习计算机的基本原理、基本结构、基本算法、基本设计等知识内容，还要学以致用。', NULL, '计算机专业的应用非常广泛，几乎渗透到现代社会的每一个角落。随着技术的不断进步，计算机专业的应用领域将会更加多样化和深入。', '计算机专业的就业方向非常广，主要取决于具体专业方向，据统计，近年来计算机专业的就业率将保持在90%左右的水平，并且各个领域的需求将有不同程度的增长，同时也是一个快速发展和变化的行业。', 0, 'admin', '2024-12-27 17:50:47', 'admin', '2024-12-31 16:57:49', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (25, 30, '电子信息类', 'Electronic Information Science and Technology', '', '电子信息类专业作为现代科技领域的关键学科，深度融合电子技术、信息技术、计算机技术等多学科知识，主要围绕电子设备、信息系统和通信网络展开研究、设计、开发与应用，致力于培养具备扎实理论基础、创新实践能力和广阔国际视野的高素质专业人才，为各行业的数字化转型和智能化升级提供有力支撑。', NULL, NULL, '电子信息类专业就业方向多元，可投身通信领域，参与 5G 乃至未来 6G 通信系统的研发与维护，助力信息高速传输；也能在半导体行业，从事芯片设计、制造与测试，推动集成电路的创新发展；还可进入人工智能领域，负责传感器数据处理、图像识别算法优化，为智能设备赋予 “智慧”，在信息时代的浪潮中发挥关键作用。', 0, 'admin', '2024-12-27 17:51:22', 'admin', '2025-02-13 17:48:34', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (26, 31, '电子电气类', 'Electrical & Electronic Engineering', '', '电子电气类专业是一门综合性学科，融合了电子技术、电气工程、计算机技术等多领域知识，旨在培养具备设计、开发、测试和维护各类电子电气设备及系统能力的专业人才。该专业覆盖范围广泛，从微小的电子元器件到大型的电力系统均有涉及，在现代科技和工业发展中占据关键地位。', NULL, NULL, '电子电气专业就业前景广阔，毕业生能在电力系统领域保障电网稳定运行，投身电子设备制造负责电路设计与产品研发，或在通信行业助力5G乃至未来通信技术的设施搭建与优化升级。 ', 0, 'admin', '2024-12-27 17:51:22', 'admin', '2025-02-13 17:49:21', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (27, 32, '机械类', 'Mechanical Engineering', '', '机械类专业作为工程技术领域的关键支柱，是一门融合多学科知识，专注于机械系统的设计、制造、运行、控制及维护的学科。它以力学、材料学、电子技术、计算机科学等为基础，通过理论与实践结合，培养具备扎实专业知识、创新能力和实践技能的综合性人才，在推动各行业技术进步和社会经济发展中发挥着不可替代的作用。', NULL, NULL, '机械类专业就业方向多元，可投身汽车制造领域负责整车及零部件设计与生产，或在智能装备行业从事工业机器人研发与调试，还能在航空航天领域参与飞行器关键机械部件的制造与维护。', 0, 'admin', '2024-12-27 17:51:22', 'admin', '2025-02-13 17:49:43', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (28, 33, '能源类', 'Energy', '', '能源类专业是一个多学科交叉的综合性工程领域，不仅包含对传统能源如化石燃料的研究，还涵盖新能源技术如风能、太阳能等的开发与应用。旨在培养能够在能源开发、转换、节约和管理等领域进行科学研究、技术开发和工程管理的专业人才。', NULL, NULL, '能源类专业就业前景良好，可在能源生产供应、设备研发制造、能源管理咨询、新能源汽车等领域，从事生产运行、设备维护、技术研发、工程设计、能源管理等工作，就业单位涵盖各类能源企业、制造公司、科研机构以及政府相关部门 。', 0, 'admin', '2024-12-27 17:51:22', 'admin', '2025-02-13 17:47:00', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (29, 34, '土木类', 'Civil Engineering', '', '土木类专业是一门古老而又不断创新发展的专业，广泛涉及各类土地工程设施的勘测、设计、建造、保养和维修等方面，旨在通过技术与知识的运用，创造安全、实用且美观的物理环境，是工学门类中的重要分支。', NULL, NULL, '土木类专业就业方向广泛，涵盖工程技术、设计规划、质量监督、公务员与科研教学、咨询等领域，可在建筑施工、设计、房地产、政府、科研、咨询等各类企业和机构，从事施工管理、结构设计、质量监督、教学科研、项目咨询等工作。', 0, 'admin', '2024-12-27 17:51:22', 'admin', '2025-02-13 17:33:31', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (30, 35, '建筑学', 'Architectural Studies', '', '建筑学从广义来说，是研究建筑及其环境的学科，横跨工程技术和人文艺术领域。它所涉及的建筑艺术与建筑技术，以及建筑艺术包含的美学与实用方面，既相互区别又紧密联系，在不同建筑中所占比重各异。', NULL, NULL, '建筑学专业就业方向广泛，毕业生可在设计单位从事建筑设计与研究，在高校开展教学与学术研究，于政府部门参与城市规划建设管理，在房地产行业负责项目开发运营，还能在咨询领域为建筑项目提供专业评估与规划建议。', 0, 'admin', '2024-12-27 17:51:22', 'admin', '2025-02-13 17:09:45', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (31, 36, '自动化', 'Automation', '', '自动化专业致力于研究自动控制的原理和方法、自动化单元技术和集成技术及其在各类控制系统中的应用。它以自动控制理论为基础，借助电子技术、电力电子技术、传感技术、计算机和网络信息技术等工具，实现对各种装置和系统的自动控制，广泛服务于工业、交通、家居、服务、能源、航天航空等众多领域。', NULL, NULL, '自动化专业就业方向广泛，毕业生可在工业制造企业负责自动化生产线的设计与维护，像西门子、ABB 等；也能投身研发公司，如大疆创新，参与自动化设备及智能控制系统的创新开发；在通信领域，像华为、中兴，从事信号处理和数据传输相关工作；还可在钢铁、工矿、化工行业优化自动化系统，或于铁路、航空等交通运输部门参与运输系统的自动化升级，甚至进入科研院所，如中科院自动化所，开展前沿技术研究推动行业进步。', 0, 'admin', '2024-12-27 17:51:22', 'admin', '2025-02-13 16:57:25', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (32, 37, '材料学', 'Materials Science', '', '材料学是一门综合性极强的工科学科，专注于各类材料的深入研究，涵盖金属材料、高分子材料、无机非金属材料以及复合材料等多个领域。它不仅致力于探索材料的成分、结构、性能以及加工工艺之间的内在联系，还注重将研究成果应用于实际生产和创新，对推动现代科技发展、工业转型升级以及满足社会多样化需求起着关键作用。', NULL, NULL, '材料学专业就业路径多元，可投身航空航天、汽车、电子、医疗、能源等行业从事研发、生产、质量管控工作，也能在科研院所开展前沿研究，还可凭借专业知识从事销售、技术支持与项目管理，推动材料创新应用。', 0, 'admin', '2024-12-27 17:51:22', 'admin', '2025-02-13 16:41:02', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (33, 38, '生物医学', 'Biomedical Sciences', '', '生物医学是一个综合性的交叉学科，融合医学、生命科学和生物学的理论与方法，通过生物工程技术手段解决医学和生命科学领域的相关问题。它致力于研究人体结构、功能、疾病发生发展机制，以及开发预防、诊断和治疗疾病的新方法、新技术和新产品 。', NULL, NULL, '生物医学专业就业方向涵盖医疗器械设计制造、临床工程、生物材料与药物研发、医学电子、生物医学光子学、咨询政策分析、生物统计学、工程管理、质量管理、市场销售以及健康科技创业等领域，在国内外众多医疗机构、科研院所、企业等都有广阔的就业机会。', 0, 'admin', '2024-12-27 17:51:22', 'admin', '2025-02-13 15:34:31', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (34, 39, '环境科学', 'Environmental Science', '', '环境工程是一门致力于解决环境问题、实现可持续发展的交叉学科。它融合了工程学、化学、生物学、物理学等多学科知识，旨在培养具备污染防治、环境规划、资源保护以及可持续发展理念的高级应用型人才。学生不仅要掌握扎实的理论知识，还需具备将其应用于实际项目的能力，以应对复杂多样的环境挑战。', NULL, NULL, '环境工程专业毕业生就业前景广阔，可在设计院、环保公司负责水环境治理、固废处理项目；在设备制造销售企业从事研发、销售工作；在环境监测与评价机构进行环境质量评估；在国企、研发机构、政府部门开展技术研发、政策制定与监管；还能在教育科研、国际组织、咨询服务及可持续发展领域，从事教学科研、国际环保合作、环境咨询和 ESG 研究等工作 。', 0, 'admin', '2024-12-27 17:51:22', 'admin', '2025-02-13 15:28:13', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (35, 40, '食品科学与工程', 'Food Science and Technology', '', '食品科学与工程是一门综合性学科，它结合了生命科学和工程科学的知识体系，旨在通过研究和应用于食品加工、贮藏、包装、检验以及食品安全等领域来提高食品的质量与安全，同时满足社会对营养健康食品的需求。该专业具有交叉性、实用性和创新性的特点，为学生提供了宽广的知识面和多领域的适应能力，培养学生的实践技能和创新思维。', NULL, NULL, '食品科学与工程专业就业方向广泛，可在食品生产加工企业负责工艺设计与产品开发，在监管检测机构从事质量把控，在科研院校开展研究工作等众多领域施展才能。', 0, 'admin', '2024-12-27 17:51:22', 'admin', '2025-02-13 15:25:45', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (36, 41, '艺术设计', 'Art and Design', '', '艺术设计是一门综合性、跨学科的学科，融合艺术、科技与实践，强调创意表达与技术实现的结合。其核心在于通过视觉、空间、材料等媒介解决实际问题，提升功能与美学的统一性，涵盖从产品开发到文化传播的广泛领域。', NULL, NULL, '艺术设计专业就业渠道多元，能在广告传媒行业，担任平面设计师、创意策划，打造吸睛视觉形象与宣传方案；投身室内设计领域，成为家装设计师、工装设计师，塑造舒适美观空间；在电商行业，作为电商设计师助力店铺视觉升级；还能在影视动漫产业，从事角色与场景设计，为作品赋予奇幻魅力。', 0, 'admin', '2024-12-27 17:51:22', 'admin', '2025-02-14 10:40:32', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (37, 42, '音乐', 'Music', '', '音乐是通过有组织的音符表达情感、思想和文化的一种艺术形式。它涵盖了作曲、演奏、演唱、音乐理论研究、音乐教育等多个方面，旨在培养学生的音乐感知能力、创造力和表现力，以满足社会对音乐艺术人才的需求。', NULL, NULL, '音乐专业就业选择丰富，可在音乐教育领域，担任中小学、高校音乐教师或私人音乐培训导师，传授音乐技艺与理论知识；投身表演艺术行业，成为乐团演奏员、独唱 / 独奏演员，活跃于舞台与音乐厅；在音乐制作领域，担任音乐制作人、编曲师，为影视作品、广告、游戏打造原创音乐；也可在文化艺术机构，从事音乐活动策划、音乐文化推广，助力音乐文化传播与发展。\n', 0, 'admin', '2024-12-27 17:51:59', 'admin', '2025-02-14 10:40:57', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (38, 43, '美术', 'Fine Art', '', '美术学是一门研究艺术创作、艺术理论与文化传承的综合性学科，涵盖绘画、雕塑、设计、美术教育、美术史论等多个领域。其目标是通过系统训练，培养学生掌握艺术创作技能、审美判断能力与创新思维，同时深入理解艺术的历史脉络与社会文化价值，为社会输送能够在艺术创作、教育、研究及文化产业中发挥作用的专业人才。', NULL, NULL, '美术专业就业前景广阔，在艺术创作领域，可成为自由画家、雕塑家，投身艺术表达与创新；设计行业中，担任平面设计师塑造品牌视觉形象，作为室内设计师打造理想生活与商业空间，或是成为 UI/UX 设计师优化用户交互体验；教育行业里，在中小学、高校或艺术培训机构担任美术教师，传承美术知识与技艺；还能在影视动漫产业，从事角色与场景设计、特效制作，助力影视作品呈现奇幻视觉盛宴。', 0, 'admin', '2024-12-27 17:51:59', 'admin', '2025-02-14 10:52:27', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (39, 44, '戏剧与影视', 'Drama and Theatre Arts', '', '戏剧与影视专业是一门综合性学科，主要研究戏剧、电影、电视等艺术形式的理论与实践，涵盖剧本创作、表演、导演、制作、影视技术、影视批评等多个领域。它旨在培养具备扎实戏剧与影视专业知识、实践能力和创新精神的人才，以满足社会对戏剧、影视创作、制作、传播和产业发展等方面的需求。戏剧与影视专业不仅关注艺术创作与表演，还致力于推动影视文化的传播与影视产业的发展。', NULL, NULL, '戏剧与影视专业就业路径多元，可投身影视制作，成为导演把控创作方向、编剧撰写精彩故事、摄影师定格绝美画面；在舞台演出领域，担任戏剧导演编排剧目、舞台美术设计师打造梦幻场景；在影视发行与放映行业，从事影视发行策划、影院运营管理；还能在新兴的短视频与网络影视领域，作为内容创作者、运营者，以创意和专业打造爆款作品。', 0, 'admin', '2024-12-27 17:51:59', 'admin', '2025-02-14 10:52:41', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (40, 45, '体育类', 'Sport Science', '', '体育类专业是一门综合性学科，主要研究体育运动的理论与实践，涵盖体育教学、训练、竞赛、管理、康复等多个领域。它旨在培养具备扎实体育专业知识、实践能力和创新精神的人才，以满足社会对体育教育、竞技体育、全民健身和体育产业发展等方面的需求。体育类专业不仅关注运动员的训练和比赛，还致力于提升全民体育素养，推动体育强国建设。', NULL, NULL, '体育类专业的就业方向广泛，涵盖体育教育领域，担任中小学及高校体育教师，传播体育知识与技能；投身竞技体育，成为专业教练、体能训练师助力运动员提升成绩；在全民健身浪潮中，作为健身教练、社区体育指导员引导大众科学健身；于体育产业，从事赛事策划、体育营销、体育场馆运营等工作，推动体育经济发展。', 0, 'admin', '2024-12-27 17:51:59', 'admin', '2025-02-14 10:35:35', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (41, 46, '大健康类', 'Health Sciences', '', '大健康类专业是一门综合性学科，聚焦于全方位维护和促进人类身心健康，涵盖健康维护、疾病预防、康复治疗、健康服务管理等领域。该领域不仅关注个体生理健康，还涉及心理健康、社会适应、环境健康及健康政策等维度，旨在培养具备医学知识、健康管理技能和创新能力的专业人才，以应对全球健康挑战，推动健康产业发展。', NULL, NULL, '大健康类专业就业面向多元，能在医疗服务领域成为临床医师、康复治疗师，为患者提供诊疗与康复服务；投身健康管理行业，担任健康管理师、营养师，为个人及群体定制健康方案；在医药研发与生产中，作为科研人员、药剂师参与新药研发与药品生产；还能在养老产业、健身休闲等领域，从事养老护理指导、运动健康指导等工作，全方位守护大众健康。', 0, 'admin', '2024-12-27 17:51:59', 'admin', '2025-02-14 10:36:05', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (42, 47, '农学', 'Agriculture', '', '农学是一门综合性学科，主要研究农作物的种植、培育、管理和利用，以及农业生态系统和农村经济的发展。它涵盖了植物学、遗传学、土壤学、生态学、农业经济学等多个学科领域，旨在培养具有扎实农业科学知识和实践能力的人才，以满足社会对粮食安全、农业可持续发展和乡村振兴的需求。', NULL, NULL, '农学专业就业途径丰富，既可以投身农业生产一线，成为农业技术员、种植大户，助力农作物优质高产；也能在农业科研领域，作为科研人员致力于新品种培育、新技术研发；还可在农业企业从事农产品加工、销售、农资推广，或在农业行政管理部门参与政策制定与执行，推动农业产业稳健发展。', 0, 'admin', '2024-12-27 17:51:59', 'admin', '2025-02-14 10:36:57', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (43, 48, '兽医学', 'Veterinary Medicine', '', '兽医学是一门综合性学科，主要致力于维护动物的生命健康，涵盖预防、诊断和治疗动物疾病等多个关键领域。它紧密结合生物学、医学、化学等多学科知识，深入探究动物的生理和病理机制，精准把握各类疾病的发生发展规律，进而运用一系列专业手段，保障动物健康，推动畜牧产业的稳定发展，同时也为公共卫生安全筑牢防线。', NULL, NULL, '兽医学专业就业前景多元，能在宠物医疗领域成为宠物医生，为萌宠健康护航；投身畜牧养殖行业，担任驻场兽医保障家畜家禽茁壮成长；在动物疫病防控机构，作为防疫专员阻击疫病传播；也可在兽药研发企业参与药品研发、质量把控，全方位守护动物健康，推动畜牧产业高质量发展。', 0, 'admin', '2024-12-27 17:51:59', 'admin', '2025-02-14 10:37:28', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (44, 49, '医学', 'Medicine', '', '医学是一门致力于维护人类生命健康、预防和治疗疾病的综合性学科。它融合了自然科学、社会科学与人文科学，涵盖基础医学、临床医学、预防医学、药学、护理学等领域，通过研究人体生理病理机制及疾病发展规律，运用诊断、治疗、康复等手段提升人类健康水平。', NULL, NULL, '医学专业就业面广泛，可在各级医院、专科医院担任临床医师，凭借专业知识与技能为患者精准诊疗；投身公共卫生领域，成为疾病预防控制专家、卫生监督专员，守护大众健康防线；在医学科研机构从事基础医学、临床医学研究，助力医学创新突破；于医药企业，参与新药研发、药品质量把控，推动医药产业发展。', 0, 'admin', '2024-12-27 17:51:59', 'admin', '2025-02-14 10:38:34', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (45, 50, '护理学', 'Nursing', '', '护理学是研究如何运用科学的护理方法和技能，促进、维护和恢复个体、家庭及社区健康的学科。它融合了基础护理、临床护理、社区护理、护理管理等多个领域，致力于培养具备扎实护理理论知识与熟练实践技能的专业人才，以满足社会对护理人才的多元需求。', NULL, NULL, '护理学专业就业选择多样，可在各级综合医院、专科医院及社区卫生服务中心担任临床护士，提供基础护理、专科护理与康复指导；投身养老机构，成为养老护理员、护理管理者，为老年人提供贴心照护；在护理教育领域，作为护理教师培养护理人才；于护理科研领域，参与护理科研项目，推动护理学科发展。', 0, 'admin', '2024-12-27 17:51:59', 'admin', '2025-02-14 10:39:14', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (46, 51, '金融学', 'Finance', NULL, '研究金融学、经济学、货币银行学、证券投资学、保险学等方面的基本知识和技能，在证券，投资、信托、保险等行业进行投资理财和风险控制等。', NULL, NULL, NULL, 0, 'admin', '2024-12-31 14:54:10', 'admin', '2024-12-31 16:55:44', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (47, 52, '金融工程', 'Financial Engineering', NULL, '研究经济学、金融学、金融工程和金融管理等方面的基本知识，接受理财、投融资、风险管理等方面的技能训练，主要运用计算机建立数学模型，从而解决金融相关的问题。', NULL, NULL, NULL, 0, 'admin', '2024-12-31 14:54:10', 'admin', '2024-12-31 16:55:53', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (48, 53, '投资学', 'Investment', NULL, '研究金融学、经济学、投资学、管理学、法学等方面的基本知识和技能，涉及金融投资、风险投资、国际投资、政府投资、企业投资、投资宏观调控等，进行个人或企业的投资项目的规划、分析与管理等。', NULL, NULL, NULL, 0, 'admin', '2024-12-31 14:54:10', 'admin', '2024-12-31 16:55:58', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (49, 54, '金融数学', 'Financial Mathematics', NULL, '研习数学、统计学、运筹学、金融学等方面的基本知识和技能，利用数学函数、数学公式等数学工具研究金融，进行数学建模、理论分析、数值计算等定量分析，从而找到金融学内在规律用以指导实践。', NULL, NULL, NULL, 0, 'admin', '2024-12-31 14:54:10', 'admin', '2024-12-31 16:56:25', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (50, 55, '金融科技', 'FinTech', NULL, '研究金融学、投资学、互联网金融等，将相关商业场景下计量分析原理及方法与大数据分析技术有机结合，进行金融产品设计与运营、金融大数据分析与管理。', NULL, NULL, NULL, 0, 'admin', '2024-12-31 14:54:10', 'admin', '2024-12-31 16:56:33', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (51, 56, '经济与金融', 'Economics and Finance', NULL, '研究经济学、金融学、投资学等方面的基本知识和技能，在银行、证券、投资保险等金融机构进行投资理财咨询、金融建模、金融数据分析、金融营销等。', NULL, NULL, NULL, 0, 'admin', '2024-12-31 14:54:10', 'admin', '2024-12-31 16:55:17', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (52, 57, '精算学', 'Actuarial Science', NULL, '研究数学、统计学、经济学、金融学等方面的基本知识和技能，利用回归分析、统计模型等现代数学方法和股票、期货、外汇等多种金融工具，对货物和服务交易、金融交易等经济活动进行预测、财务分析、估价和管理等。', NULL, NULL, NULL, 0, 'admin', '2024-12-31 14:54:10', 'admin', '2024-12-31 16:55:17', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (53, 58, '互联网金融', 'Internet Finance', NULL, '研究现代金融理论、金融科技及互联网金融、管理理论与电子商务技术，进行金融数据分析、金融信息系统分析和设计等。', NULL, NULL, NULL, 0, 'admin', '2024-12-31 14:54:10', 'admin', '2024-12-31 16:55:17', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (54, 59, '保险学', 'Insurance', NULL, '研究经济学、金融学、保险学、数学、统计学、金融投资等方面的基本知识和技能，进行商业性保险业务的咨询、营销与管理、社会保险基金的运作、保险行业的监管等。', NULL, NULL, NULL, 0, 'admin', '2024-12-31 14:54:10', 'admin', '2024-12-31 16:55:17', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (55, 60, '新闻学', 'Journalism', NULL, '主要学习新闻的传播、采集、写作、制作、编辑、器材使用、后期制作等。很多大学开设了基于不同媒体的新闻课程，包括广播、电视、网络等方向。', NULL, NULL, NULL, 0, 'admin', '2024-12-31 15:21:39', 'admin', '2024-12-31 16:50:48', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (56, 61, '传播学', 'Communication', NULL, 'Communication一般被称为传播学，是传媒领域的基础学科，研究的是人与人之间通过特定的一些媒介交流的各种问题。跟经济学、人类学、哲学、心理学、语言学、语义学等很多学科都有联系。', NULL, NULL, NULL, 0, 'admin', '2024-12-31 15:21:39', 'admin', '2024-12-31 16:50:48', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (57, 62, '公共关系（PR）', 'Public Relations', NULL, '研究社会公共关系活动和其规律，专业内容与媒体、市场有着紧密的关联。是一门以社会公共关系活动和其规律为研究对象的边缘性交叉学科。公共关系与媒体、市场有着紧密的关系。', NULL, NULL, NULL, 0, 'admin', '2024-12-31 15:21:39', 'admin', '2024-12-31 16:50:49', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (58, 63, '广告', 'Advertising', NULL, '广告方向研究的是广告产品的历史、理论、策略、制作和经营管理，偏向市场和策划，与商科密切联系。除了广告设计外，还包括广告的制作、投放，与营销上的结合和后期的监测及效果评估，偏重于商业上的应用。', NULL, NULL, NULL, 0, 'admin', '2024-12-31 15:21:39', 'admin', '2024-12-31 16:50:49', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (59, 64, '编辑出版', 'Editing and Publishing', NULL, '主要研究编辑学、出版学、汉语言文学、传播学等方面的基本知识和技能，在出版社、杂志社、报社等进行编辑、编务、出版和发行等。', NULL, NULL, NULL, 0, 'admin', '2024-12-31 15:21:39', 'admin', '2024-12-31 16:50:49', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (60, 65, '国际新闻与传播', 'International Journalism and Communication', NULL, '主要研究新闻现象和新闻活动规律、人类传播行为和过程发展规律、国际新闻传播发展现实需要和未来前景等，培养能够掌握现现代电子媒体、特别是网络多媒体传播等对外宣传及涉外新闻报道技能的国际传播应用型人才。', NULL, NULL, NULL, 0, 'admin', '2024-12-31 15:21:39', 'admin', '2024-12-31 16:50:49', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (61, 66, '计算机科学与技术', 'Computer Science and Technology', NULL, '计算机应用领域的基础学科，也是信息技术领域中的核心学科之一，主要研究计算机系统结构、计算机软件与理论、计算机应用技术、计算机网络与信息安全。', NULL, NULL, NULL, 0, 'admin', '2024-12-31 15:34:20', 'admin', '2024-12-31 16:50:49', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (62, 67, '软件工程', 'Software Engineering', NULL, '以软件开发和管理为主要内容的学科，涉及程序设计语言、数据库、软件开发工具、系统平台、设计模式等方面。', NULL, NULL, NULL, 0, 'admin', '2024-12-31 15:34:20', 'admin', '2024-12-31 16:50:49', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (63, 68, '网络工程', 'Network Engineering', NULL, '设计、建设、运维和管理各种规模和类型的计算机网络系统，满足社会对网络信息化的需求。', NULL, NULL, NULL, 0, 'admin', '2024-12-31 15:34:20', 'admin', '2024-12-31 16:50:49', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (64, 69, '信息安全', 'Information Security', NULL, '主要研究确保信息安全的科学与技术，培养能够从事计算机、通信、电子商务、电子政务、电子金融等领域的信息安全高级专门人才。', NULL, NULL, NULL, 0, 'admin', '2024-12-31 15:34:20', 'admin', '2024-12-31 16:50:49', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (65, 70, '物联网工程', 'Internet of Things Engineering', NULL, '主要研究物联网的体系结构、信息处理、安全技术、系统及其应用等方面的基本知识和技能，涉及通信技术、传感技术、网络技术以及RFID技术、嵌入式系统技术等多个方面。', NULL, NULL, NULL, 0, 'admin', '2024-12-31 15:34:20', 'admin', '2024-12-31 16:50:50', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (66, 71, '数字媒体技术', 'Digital Media Technology', NULL, '主要研究文字、图片、音频、视频等数字媒体的设计和应用开发等，将抽象的数字、作为实物的媒体以及计算机技术三者结合，更偏向于编程开发，常见于游戏、动漫类行业。', NULL, NULL, NULL, 0, 'admin', '2024-12-31 15:34:20', 'admin', '2024-12-31 16:50:50', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (67, 72, '智能科学与技术', 'Intelligent Science and Technology', NULL, '涉及人工智能、模式识别、智能控制、智能机器人等研究方向，以信息处理、模式识别与控制理论为核心，探索对各种数据信息进行处理、分类、理解。', NULL, NULL, NULL, 0, 'admin', '2024-12-31 15:34:20', 'admin', '2024-12-31 16:50:50', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (68, 73, '空间信息与数字技术', 'Spatial Information and Digital Technology', NULL, '一是研究遥感、地理信息系统，进行城市信息数字化、网络化、可视化和智能化管理，如GPS技术、手机上的数字地图等，二是研究外太空的空间信息系统，如卫星通信、探月工程等。', NULL, NULL, NULL, 0, 'admin', '2024-12-31 15:34:20', 'admin', '2024-12-31 16:50:50', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (69, 74, '电子与计算机工程', 'Electronic and Computer Engineering', NULL, '结合电气工程和计算机科学，主要研究现代电子、自动控制、电力工程及计算机技术等方向的基本知识和技能，进行现代电子系统的开发设计、工艺控制、智能设备的软硬件开发等。', NULL, NULL, NULL, 0, 'admin', '2024-12-31 15:34:20', 'admin', '2024-12-31 16:50:50', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (70, 75, '虚拟现实技术', 'Virtual Reality Technology', NULL, '融合三维显示、计算机图形学、三维建模和人机交互等领域的综合技术，掌握虚拟现实技术的核心理论和应用技能，从而能够独立进行虚拟现实系统的设计和开发。', NULL, NULL, NULL, 0, 'admin', '2024-12-31 15:34:20', 'admin', '2024-12-31 16:50:50', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (71, 76, '区块链工程', 'Blockchain Engineering', NULL, '新一代信息技术的重要组成部分，是分布式网络、加密技术、智能合约等多种技术集成的新型技术。', NULL, NULL, NULL, 0, 'admin', '2024-12-31 15:34:20', 'admin', '2024-12-31 16:50:50', NULL, NULL);
