INSERT INTO `consult_major_info` VALUES (80, 96, '基础护理学', 'Fundamental Nursing', NULL, '聚焦护理学基本理论、知识与技能，着重培养学生的基础护理操作能力与护理思维。', NULL, NULL, NULL, 0, 'admin', '2025-02-11 11:27:27', 'admin', '2025-02-11 11:27:27', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (81, 97, '内外科护理学', 'Medical and Surgical Nursing', NULL, '钻研内科和外科疾病的护理理论与技术，提升学生对内外科病人的护理能力。', NULL, NULL, NULL, 0, 'admin', '2025-02-11 11:29:51', 'admin', '2025-02-11 11:30:52', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (82, 98, '儿科护理学', 'Pediatric Nursing', NULL, '针对儿童生长发育特点及儿科疾病，开展护理理论与技术的研究，使学生具备护理儿科病人的专业能力。', NULL, NULL, NULL, 0, 'admin', '2025-02-11 11:30:43', 'admin', '2025-02-11 11:30:43', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (83, 99, '妇产科护理学', 'Obstetric and Gynecologic Nursing', NULL, '围绕女性生殖系统的生理和病理变化以及妇产科疾病，探索相应的护理理论与技术，培养护理妇产科病人的专业素养。', NULL, NULL, NULL, 0, 'admin', '2025-02-11 11:31:38', 'admin', '2025-02-11 11:31:38', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (84, 100, '社区护理学', 'Community Health Nursing', NULL, '专注于社区健康服务的理论与实践，让学生掌握在社区开展健康促进、疾病预防和慢性病管理的技能。', NULL, NULL, NULL, 0, 'admin', '2025-02-11 11:32:21', 'admin', '2025-02-11 11:32:21', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (85, 101, '护理管理学', 'Nursing Management', NULL, '研究护理管理的理论与实践，旨在培养学生的护理团队管理、护理质量控制和护理资源分配能力。', NULL, NULL, NULL, 0, 'admin', '2025-02-11 11:33:04', 'admin', '2025-02-11 11:33:04', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (86, 102, '基础医学', 'Basic Medicine', NULL, '研究人体正常结构与功能、疾病发生机制，为临床医学提供理论基础。', NULL, NULL, NULL, 0, 'admin', '2025-02-11 15:33:41', 'admin', '2025-02-11 15:33:41', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (87, 103, '临床医学', 'Clinical Medicine', NULL, '直接面向患者的疾病诊断、治疗与预防，培养临床诊疗能力。细分方向包括内科学、外科学、妇产科学等。', NULL, NULL, NULL, 0, 'admin', '2025-02-11 15:34:12', 'admin', '2025-02-11 15:34:12', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (88, 104, '口腔医学', 'Dental Medicine', NULL, '专注于口腔及颌面部疾病的预防、诊断与治疗，涉及口腔修复学、正畸学等技术。', NULL, NULL, NULL, 0, 'admin', '2025-02-11 15:35:06', 'admin', '2025-02-11 15:35:06', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (89, 105, '药学', 'Pharmacology', NULL, '研究药物研发、生产、质量控制及合理用药，涵盖药物化学、药理学、药剂学等方向。', NULL, NULL, NULL, 0, 'admin', '2025-02-11 15:35:54', 'admin', '2025-02-11 15:35:54', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (90, 106, '护理学', 'Nursing', NULL, '以自然科学和社会科学为基础，研究护理理论、技能及患者健康管理，培养临床护理与护理管理能力。', NULL, NULL, NULL, 0, 'admin', '2025-02-11 15:36:12', 'admin', '2025-02-11 15:36:12', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (91, 107, '预防医学', 'Preventive Medicine', NULL, '聚焦人群健康，通过流行病学、卫生统计学等方法制定疾病预防策略。  ', NULL, NULL, NULL, 0, 'admin', '2025-02-11 15:36:42', 'admin', '2025-02-11 15:36:42', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (92, 108, '医学影像学', 'Medical Imaging', NULL, '利用X线、CT、MRI等技术辅助疾病诊断，培养影像设备操作与图像分析能力。 ', NULL, NULL, NULL, 0, 'admin', '2025-02-11 15:37:31', 'admin', '2025-02-11 15:37:31', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (93, 109, '医学检验技术', 'Clinical Laboratory Technology', NULL, '通过生物化学、微生物学等技术分析人体标本，为临床诊断提供依据。', NULL, NULL, NULL, 0, 'admin', '2025-02-11 15:38:11', 'admin', '2025-02-11 15:38:11', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (94, 110, '康复治疗学', 'Rehabilitation Therapy Studies', NULL, '运用物理治疗、作业治疗等技术帮助患者恢复身体功能，提高生活质量。', NULL, NULL, NULL, 0, 'admin', '2025-02-11 15:38:49', 'admin', '2025-02-11 15:38:49', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (95, 111, '中医学', 'Traditional Chinese Medicine', NULL, '基于中医药理论，研究疾病预防、诊断与治疗，涵盖针灸、中药学等传统疗法。', NULL, NULL, NULL, 0, 'admin', '2025-02-11 15:39:54', 'admin', '2025-02-11 15:39:54', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (96, 112, '基础兽医学', 'Basic Veterinary Medicine', NULL, '基础兽医学是兽医学的理论基石，主要研究动物的正常生理结构和功能，以及疾病发生发展的基本机制。', NULL, NULL, NULL, 0, 'admin', '2025-02-11 16:07:58', 'admin', '2025-02-11 16:07:58', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (97, 113, '预防兽医学', 'Preventive Veterinary Medicine', NULL, '预防兽医学以动物群体为研究对象，旨在通过预防措施减少疾病的发生和传播。', NULL, NULL, NULL, 0, 'admin', '2025-02-11 16:08:22', 'admin', '2025-02-11 16:08:22', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (98, 114, '临床兽医学', 'Clinical Veterinary Medicine', NULL, '临床兽医学直接面向患病动物，开展疾病诊断、治疗和预防工作。', NULL, NULL, NULL, 0, 'admin', '2025-02-11 16:09:15', 'admin', '2025-02-11 16:09:15', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (99, 115, '兽医公共卫生学', 'Veterinary Public Health', NULL, '兽医公共卫生学聚焦于动物源性食品安全、人畜共患病防控以及动物卫生与公共卫生之间的紧密关系。', NULL, NULL, NULL, 0, 'admin', '2025-02-11 16:09:38', 'admin', '2025-02-11 16:09:38', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (100, 116, '兽医药学', 'Veterinary Pharmacology', NULL, '兽医药学专注于兽药的研发、生产、质量控制以及临床合理应用。', NULL, NULL, NULL, 0, 'admin', '2025-02-11 16:09:58', 'admin', '2025-02-11 16:09:58', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (101, 117, '作物学', 'Crop Science', NULL, '研究农作物的生长发育规律、遗传育种、栽培管理和病虫害防治。', NULL, NULL, NULL, 0, 'admin', '2025-02-11 16:29:35', 'admin', '2025-02-11 16:29:35', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (102, 118, '土壤学', 'Soil Science', NULL, '研究土壤的形成、性质、分类和管理。', NULL, NULL, NULL, 0, 'admin', '2025-02-11 16:29:54', 'admin', '2025-02-11 16:29:54', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (103, 119, '植物保护学', 'Plant Protection', NULL, '研究植物病虫害的监测、预警和防治技术。', NULL, NULL, NULL, 0, 'admin', '2025-02-11 16:30:11', 'admin', '2025-02-11 16:30:11', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (104, 120, '农业资源与环境', 'Agricultural Resources and Environment', NULL, '研究农业资源的合理利用和农业生态环境的保护。', NULL, NULL, NULL, 0, 'admin', '2025-02-11 16:30:29', 'admin', '2025-02-11 16:30:29', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (105, 121, '农业经济与管理', 'Agricultural Economics and Management', NULL, '研究农业经济活动的规律和农村经济管理。', NULL, NULL, NULL, 0, 'admin', '2025-02-11 16:30:52', 'admin', '2025-02-11 16:30:52', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (106, 122, '基础医学', 'Basic Medical Science', NULL, '研究人体正常结构、功能及疾病发生机制，核心课程包括人体解剖学、生理学、病理学等。', NULL, NULL, NULL, 0, 'admin', '2025-02-11 17:05:02', 'admin', '2025-02-11 17:05:02', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (107, 123, '预防医学', 'Preventive Medicine', NULL, '探索疾病预防、健康促进及公共卫生干预策略，核心领域为流行病学、环境卫生学等。', NULL, NULL, NULL, 0, 'admin', '2025-02-11 17:05:17', 'admin', '2025-02-11 17:05:17', NULL, NULL);
INSERT INTO `consult_major_info` VALUES (108, 124, '康复医学', 'Rehabilitation Medicine', NULL, '通过物理治疗、作业治疗等手段恢复患者身体功能，核心课程包括康复评定学、物理治疗学等。', NULL, NULL, NULL, 0, 'admin', '2025-02-11 17:05:35', 'admin', '2025-02-11 17:05:35', NULL, NULL);
