INSERT INTO `consult_major_info` VALUES (117, 133, '社会体育指导与管理', 'Social Sports Guidance and Management', NULL, '研究全民健身活动的组织与管理，培养能够在社区、体育俱乐部等场所开展体育活动指导与管理的专业人才。', NULL, NULL, NULL, 0, 'admin', '2025-02-12 10:44:05', 'admin', '2025-02-12 10:44:05', NULL, NULL);
