INSERT INTO `consult_major_job` VALUES (39, 48, '兽医学', '兽医科研人员', '探索动物疾病的发病机制和创新治疗方法，设计并实施科研项目，撰写科研论文，推动兽医学科学的进步与发展。', '兽医科研机构、高校科研实验室等', 0, 0, 'admin', '2025-02-11 16:16:57', 'admin', '2025-02-12 11:06:55', NULL, NULL);
