INSERT INTO `consult_major_job` VALUES (174, 23, '统计学', '风险管理与评估', '在金融机构负责风险评估和管理，包括信用评分模型的开发和市场风险分析。', '花旗银行、摩根大通', 0, 0, 'admin', '2025-02-14 17:13:22', 'admin', '2025-02-14 17:13:59', NULL, NULL);
INSERT INTO `consult_major_job` VALUES (175, 23, '统计学', '精算领域', '在保险公司及其他金融机构担任精算师，利用数学、统计学和财务理论分析风险，帮助企业制定策略以平衡风险和盈利。', '中国人寿、友邦保险', 0, 0, 'admin', '2025-02-14 17:13:37', 'admin', '2025-02-14 17:14:00', NULL, NULL);
INSERT INTO `consult_major_job` VALUES (176, 23, '统计学', '政策分析', '在国家统计局和中国疾病预防控制中心等机构担任政策分析师，评估和制定政策，特别是在公共卫生、经济发展和环境保护等领域。', '国家统计局、中国疾病预防控制中心', 0, 0, 'admin', '2025-02-14 17:13:56', 'admin', '2025-02-14 17:14:01', NULL, NULL);
INSERT INTO `consult_major_job` VALUES (177, 22, '数学', '教育领域', '在中小学担任数学教师，教授代数、几何、统计等基础数学知识；在高校从事数学教学与科研工作，向学生传授专业数学课程，开展前沿数学研究，发表学术成果，推动数学学科发展。', '各大中小院校、培训机构', 0, 0, 'admin', '2025-02-14 17:14:35', 'admin', '2025-02-14 17:16:38', NULL, NULL);
INSERT INTO `consult_major_job` VALUES (178, 22, '数学', '金融行业', '在银行、证券、保险等金融机构，担任风险分析师、精算师、量化投资分析师等职位。运用数学模型评估金融风险、设计金融产品、制定投资策略，如精算师为保险产品定价，量化分析师构建投资模型获取收益。', '高盛、摩根大通、平安保险', 0, 0, 'admin', '2025-02-14 17:15:09', 'admin', '2025-02-14 17:16:39', NULL, NULL);
INSERT INTO `consult_major_job` VALUES (179, 22, '数学', '算法工程师、数据分析师、机器学习工程师', '算法工程师利用数学原理优化算法性能；数据分析师处理和分析海量数据辅助决策；机器学习工程师借助数学知识训练模型，实现图像识别、智能推荐等功能。', '谷歌、微软、字节跳动', 0, 0, 'admin', '2025-02-14 17:15:39', 'admin', '2025-02-14 17:16:40', NULL, NULL);
INSERT INTO `consult_major_job` VALUES (180, 22, '数学', '科研机构', '在各类科研院所，从事数学相关的基础研究或跨学科研究，与物理、化学、生物等领域科研人员合作，解决交叉学科中的数学难题，推动多学科共同发展，如在生物数学领域研究生物种群增长模型。', '中国科学院数学与系统科学、普林斯顿高等研究院', 0, 0, 'admin', '2025-02-14 17:16:11', 'admin', '2025-02-14 17:16:40', NULL, NULL);
INSERT INTO `consult_major_job` VALUES (181, 22, '数学', '政府部门与公共事业', '在统计局、发改委等政府部门，负责数据收集、整理和分析，为政策制定提供数据支持和数学模型依据；在气象、环保等公共事业单位，运用数学模型进行气象预测、环境质量评估与预测等工作。', '国家统计局、中国气象局', 0, 0, 'admin', '2025-02-14 17:16:36', 'admin', '2025-02-14 17:16:41', NULL, NULL);
