INSERT INTO `consult_message` VALUES (1, '消息标题1', '<p style=\"text-indent: 2em; text-align: start;\"><span style=\"font-family: Alibaba PuHuiTi 2.0;\">2023，伴随着ChatGPT的“一夜爆火”， 也引发了人们对于其背后AIGC的巨大关注和讨论，2023年亦被称为“AIGC元年”。</span></p ><p style=\"text-indent: 21pt; text-align: start;\"><br></p ><p style=\"text-indent: 2em; text-align: start;\"> </p ><p style=\"text-indent: 2em; text-align: start;\"><span style=\"font-family: Alibaba PuHuiTi 2.0;\">在这一背景下，各大出国考试都在慢慢转型和使用AI工具：</span></p ><p style=\"text-indent: 21pt; text-align: start;\"><span style=\"font-family: Alibaba PuHuiTi 2.0;\"> </span></p ><p style=\"text-indent: 21pt; text-align: start;\"><span style=\"color: rgb(128, 128, 128);\">托福等支持远程参加的在线考试，其安全性变得更高、线上监考技术也愈发成熟；</span></p ><p style=\"text-indent: 21pt; text-align: start;\"><span style=\"color: rgb(128, 128, 128);\">数据类模型的大数据分析，使得 GRE、GMAT 等自适应考试有了更为精准的算法，从而能够在更短的考试时间与更少的题目内，完成对考生能力的检验；</span></p ><p style=\"text-indent: 21pt; text-align: start;\"><span style=\"color: rgb(128, 128, 128);\">托福 E-rater、Speech-rater 全面替代人工考官，Criterion 在线英文写作平台开放测试，PTE、Duolingo 等新兴考试更是完全没有人工考官介入...</span></p ><p style=\"text-indent: 21pt; text-align: start;\"><span style=\"color: rgb(128, 128, 0);\"> </span></p ><p style=\"text-indent: 21pt; text-align: start;\"><span style=\"font-family: Alibaba PuHuiTi 2.0;\">这一年，新通考培团队作为出国考试“破壁天团”，也走在时代前沿，抢先推出了「Smarter 智能学习平台」，并搭载最 新大语言模型，推出了智能伴学工具「新通 GPT」，助力考生智能备考、高效提分。</span></p ><p style=\"text-indent: 21pt; text-align: start;\"> </p ><p style=\"text-indent: 21pt; text-align: start;\"><span style=\"font-family: Alibaba PuHuiTi 2.0;\">基于此，我们做出了《2024年出国留学考试报告》（以下简称报告），不仅有往年常规的各大出国考试的分数涨跌分析、考情回顾、改革趋势等，还有全球名 校的录取分数分布，以及新通2023年在智能备考方面所取得的巨大成果展示。真正帮助各位考生做到：工具更智能、备考更高效、留学更清晰。</span></p ><p><img src=\"http://snjnsicxq.hd-bkt.clouddn.com/26.jpg\" alt=\"\" data-href=\"\" style=\"width: 100%;\"/></p ><p><br></p >', 2, 0, 0, '2024-12-24 14:23:15', 'admin', '2025-01-23 11:16:37', 'admin');
