INSERT INTO `consult_message` VALUES (37, '【西澳大学学院】【申请信息】2025年6月开学重要日期', '<p style=\"text-align: start;\"><span style=\"font-size: 19px; font-family: 微软雅黑;\"><strong>INTO 澳洲项目——西澳大学学院（UWA College）2025年6月开学重要日期</strong></span><span style=\"font-size: 19px;\"><strong> </strong></span></p><table style=\"width: auto; text-align: start;\"><tbody><tr><td colspan=\"2\" rowspan=\"1\" width=\"525\">针对2025年6月开学的课程</td></tr><tr><td colspan=\"1\" rowspan=\"1\" width=\"227\">最晚提交申请日期*</td><td colspan=\"1\" rowspan=\"1\" width=\"299\">2025年4月21日</td></tr><tr><td colspan=\"1\" rowspan=\"1\" width=\"227\">最晚接受录取日期*</td><td colspan=\"1\" rowspan=\"1\" width=\"299\">2025年4月28日</td></tr><tr><td colspan=\"1\" rowspan=\"1\" width=\"227\">U18最晚提交申请日期</td><td colspan=\"1\" rowspan=\"1\" width=\"299\">2025年3月31日</td></tr><tr><td colspan=\"1\" rowspan=\"1\" width=\"227\">U18最晚接受录取日期</td><td colspan=\"1\" rowspan=\"1\" width=\"299\">2025年4月14日</td></tr><tr><td colspan=\"1\" rowspan=\"1\" width=\"227\">最晚提交GS审核材料</td><td colspan=\"1\" rowspan=\"1\" width=\"299\">具体情况发给录取办做个案分析</td></tr><tr><td colspan=\"1\" rowspan=\"1\" width=\"227\">迎新周</td><td colspan=\"1\" rowspan=\"1\" width=\"299\">2025年6月9日至6月13日</td></tr><tr><td colspan=\"1\" rowspan=\"1\" width=\"227\">学期开始日期</td><td colspan=\"1\" rowspan=\"1\" width=\"299\">2025年6月16日</td></tr></tbody></table><p style=\"text-align: start;\"><span style=\"font-family: 微软雅黑;\"><strong>*针对在澳大利亚境内持有效签证的学生（满18周岁或以上），最晚提交申请日期是2025年5月26日，最晚接受录取日期是2025年6月2日。若您的学生是未满18周岁，请参考以上表格关于18周岁以下申请人的提交申请及接受录取日期。</strong></span></p><p style=\"text-align: start;\"><span style=\"font-family: 微软雅黑;\">另外，鉴于目前签证审理时间的不确定性，鼓励学生尽快确认入学名额以确保有充裕的时间准备签证申请。</span></p><p style=\"text-align: start;\"><span style=\"font-family: 微软雅黑;\"><em>👏INTO 澳洲项目2025年送生奖励火热进行中，详情请查看下方海报</em></span></p><p><img src=\"http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202502081013/%E8%93%9D%E9%87%91%E6%88%BF%E5%9C%B0%E4%BA%A7%E6%88%98%E6%8A%A5%E5%96%9C%E6%8A%A5%E6%89%8B%E6%9C%BA%E6%B5%B7%E6%8A%A5__2025-01-23%2B15_07_52.png\" alt=\"\" data-href=\"\" style=\"width: 342.00px;height: 607.94px;\"/></p>', 4, 0, 0, '2025-02-08 10:14:29', 'admin', '2025-02-08 15:32:33', 'admin');
INSERT INTO `consult_message` VALUES (38, '【坎特伯雷大学】25年2月intake的晚报道及延期申请', '<p><span style=\"font-size: 24px;\"><strong>坎特伯雷大学25年2月的晚报道及延期申请信息更新</strong></span><strong><br></strong>1. 如学生正在等待签证的话并担心无法及时到校，可以申请迟到Late Arrival。邮件可以发送至坎大中国区招生团队-Wilber.han@canterbury.ac.nz及Allen.huang@canterbury.ac.nz。针对可以接受迟到的课程，收到迟到Late Arrival申请后，大学会下发迟到信。<span style=\"background-color: rgb(255, 255, 0);\"><strong>针对大部分课程，最晚报道时间为2月28日</strong></span>。</p><p>需要留意：<strong>以下课程不接受迟到</strong>，请各位老师务必注意：<br>*所有Teaching类课程<br>*其他部分教育相关课程，需要单独与学院确认具体迟到日期<br>*护理课程<br>*语言病理学硕士<br><span style=\"color: rgb(255, 0, 0);\"><em>针对以上课程，如学生无法准时到校，建议学生申请延期；另外，需要注意，以上课程部分有名额限制，无法直接延期，需重新递交申请~<br><br></em></span>2. 学校针对迟到的学生，新增两场迎新活动，具体日期与时间如下：<br>*2月21日周五当地时间下午4:00-5:00<br>*2月28日周五当地时间下午4:00-5:00<br>迟到的同学可登陆以下链接注册参与活动： <a href=\"https://events.humanitix.com/international-orientation-for-late-arrivals-s1-2025\" target=\"\">https://events.humanitix.com/international-orientation-for-late-arrivals-s1-2025</a><br><br>3. <strong>申请迟到的同学务必需要在2月17日前完成线上Enroll流程</strong>。请各位老师务必提醒学生登陆MyUC进行操作。<br><br>4. 如还没有递交签证，或还没有满足offer条件的同学，建议申请延期。如要申请延期，请务必在offer开学时间前申请，否则offer会有被取消的风险。一旦offer被取消，无法直接做延期操作，后续需要重新递交申请。</p>', 4, 0, 0, '2025-02-10 13:33:21', 'admin', '2025-02-10 13:33:30', 'admin');
INSERT INTO `consult_message` VALUES (39, '【澳国立-申请信息】10周语言班（4月21日）申请截止时间更新', '<p><span style=\"color: rgb(0, 0, 0); background-color: rgb(255, 255, 255); font-size: 24px;\"><strong>澳大利亚国立大学10周语言班最新信息</strong></span></p><p style=\"line-height: 1;\"><span style=\"font-size: 14px;\">ANU语言班与UCC合作提供，</span><span style=\"font-size: 14px;\"><strong>现开放给所有符合申请资格的学生</strong></span><span style=\"font-size: 14px;\">，</span></p><p>课程名称： UC English Language Program  <br>语言班时长：10周<br>最新开课时间：<span style=\"color: rgb(255, 0, 0);\"><strong>2025 年 4 月 21 日至 6 月 27 日</strong></span></p><p><span style=\"color: rgb(255, 0, 0);\"><strong>申请截止时间：2月14日，请于DDL前尽快递交申请</strong></span></p><p><span style=\"color: rgb(255, 0, 0);\"><strong>语言班offer接受截止时间：2月28日<br></strong></span>上课地点为：堪培拉大学学院布鲁斯校区 <br>入学要求：雅思6.0（5.5）；托福60（W18，S16，R8，L7） ；<br>详情请查看：<a href=\"https://study.anu.edu.au/apply/international-applications/new-english-language-program\" target=\"\">https://study.anu.edu.au/apply/international-applications/new-english-language-program</a></p><p><span style=\"color: rgb(255, 0, 0);\"><strong>下一期语言班预计4 月 21 日开放申请</strong></span></p><p>申请流程：</p><p>Step 1. Complete the PDF application form attached and send to <a href=\"https://app.experience.anu.edu.au/e/er?utm_source=Eloqua&utm_medium=eDM&utm_campaign=&utm_content=JAN25-ELICOS-AGENT-ANU&s=2105158753&lid=3339&elqTrackId=137E6F6336DC29F6AF096FB82F341485&elq=a51bebb9b21a4e62a67ab846f41c44ad&elqaid=2724&elqat=1&elqak=8AF5E218322CB39F28BD6015A7545CEF50517276863C06667ADC822664E716CB9DD0\" target=\"_blank\"><u>ucc.admissions@canberra.edu.au</u></a>. Attach your English Language test result and ANU’s conditional offer in the application.</p><p>Step 2. Accept the UC English Language Program offer sent to you and pay the tuition fees as stated in your offer letter.</p><p>Step 3. Accept the ANU conditional offer and pay the deposit.</p><p>Step 4. ANU will send two Confirmations of Enrolment, encompassing both the UC English Language Program and ANU program.</p>', 4, 0, 0, '2025-02-10 13:39:25', 'admin', '2025-02-10 13:39:32', 'admin');
INSERT INTO `consult_message` VALUES (40, '【澳国立-申请更新】ANU系统与社会学院部分项目取消通知', '<p><span style=\"color: rgb(0, 0, 0); background-color: rgb(255, 255, 255); font-size: 24px;\"><strong>澳大利亚国立大学ANU系统与社会学院部分项目取消通知</strong></span></p><p><span style=\"color: rgb(0, 0, 0); background-color: rgb(255, 255, 255); font-size: 14px;\">澳大利亚国立大学系统与社会学院（ANU College of Systems and Society）以下项目将取消，具体信息如下：<br>👉应用数据分析研究生证书（Grad Cert Applied Data Analytics）<br>学制0.5年，最后招生学期：2025年S1。<br>👉应用数据分析研究生文凭（Grad Dip Applied Data Analytics）<br>学制1年，最后招生学期：2025年S1。<br>👉应用数据分析硕士（M Applied Data Analytics）<br>学制1.5年，最后招生学期：2025年S1。<br>👉能源系统工程硕士（M Engineering in Energy Systems）<br>工程机器人自动化与控制硕士（M Engineering Robotics Automation and Control）<br>以上两项学制2年，最后招生学期：2024年S2。<br><br>请相关申请者注意调整计划，具体安排可咨询学院官方。</span></p>', 4, 0, 0, '2025-02-11 15:41:18', 'admin', '2025-02-11 15:41:22', 'admin');
INSERT INTO `consult_message` VALUES (41, '【UNSW】招生流程等信息线上发布会2月20日13:00-13:45', '<p><span style=\"font-size: 24px;\"><strong>悉尼新南威尔士大学UNSW招生流程等信息</strong></span><span style=\"background-color: transparent; font-size: 24px;\"><strong>线上发布会</strong></span></p><p><span style=\"font-size: 13px;\"><strong>会议时间：2月20日13:00-13:45</strong></span></p><p><span style=\"font-size: 13px;\">会议平台：ZOOM</span></p><p><span style=\"font-size: 13px;\">注册链接：</span><a href=\"https://www.eventbrite.com.au/e/unsw-2025-admissions-webinar-tickets-1244279546619?aff=edmInvite\" target=\"_blank\"><span style=\"font-size: 13px;\">https://www.eventbrite.com.au/e/unsw-2025-admissions-webinar-tickets-1244279546619?aff=edmInvite</span></a></p><p><span style=\"font-size: 13px;\">会议内容包含如下</span></p><ul><li><span style=\"font-size: 13px;\">详细介绍全新招生流程，如审理时间，OFFER发放时间&amp;有效期，以及延期政策等</span></li><li><span style=\"font-size: 13px;\">针对2026年申请提供25T3选择</span></li><li><span style=\"font-size: 13px;\">MD111对申请以及签证处理的影响</span></li><li><span style=\"font-size: 13px;\">UNSW College最新资讯等</span></li></ul><p><span style=\"font-size: 13px;\">请各位老师及时注册，积极参加!</span></p>', 2, 0, 0, '2025-02-13 13:27:19', 'admin', '2025-02-13 13:27:23', 'admin');
