INSERT INTO `consult_plan` VALUES (1, '基本申请目标', 'http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202412311458/%E5%9F%BA%E6%9C%AC%E7%94%B3%E8%AF%B7%E7%9B%AE%E6%A0%87.png', '明确学生的留学目的，包括期望获得的学位、专业领域以及职业发展目标。设定具体的申请目标，如目标国家/地区、排名范围、特别需求等。', 'admin', '2024-12-11 14:31:17', 'admin', '2025-01-02 16:02:22', 0, 0);
INSERT INTO `consult_plan` VALUES (2, '学生申请条件', 'http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202412311459/%E5%AD%A6%E7%94%9F%E7%94%B3%E8%AF%B7%E6%9D%A1%E4%BB%B6.png', '评估学生的学术背景、语言能力、标准化考试成绩等硬性条件。分析学生的软实力，如领导力、科研能力、社区服务、实习经历等。', 'admin', '2024-12-11 14:31:17', 'admin', '2025-01-06 13:56:18', 0, 0);
INSERT INTO `consult_plan` VALUES (3, '专业规划', 'http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202412311458/%E9%80%89%E6%A0%A1%E8%A7%84%E5%88%92.png\n', '根据学生的兴趣和职业规划，选择合适的专业方向。考虑专业的市场需求、就业前景和发展潜力。', 'admin', '2024-12-11 14:31:17', 'admin', '2025-01-02 16:02:34', 0, 0);
INSERT INTO `consult_plan` VALUES (4, '选校规划', 'http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202412311459/%E5%AD%A6%E7%94%9F%E7%94%B3%E8%AF%B7%E6%9D%A1%E4%BB%B6.png', '基于学生条件和专业需求，筛选出适合的学校名单。同时考虑学校的地理位置、学术声誉、校园文化等因素。', 'admin', '2024-12-11 14:31:17', 'admin', '2025-01-02 16:02:40', 0, 0);
INSERT INTO `consult_plan` VALUES (5, '时间规划', 'http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202412311458/%E6%97%B6%E9%97%B4%E8%A7%84%E5%88%92.png', '制定详细的申请时间表，包括考试准备、材料准备、申请提交等关键时间点。规划整个留学申请流程，确保每个阶段都能按时完成，避免延误。', 'admin', '2024-12-11 14:31:17', 'admin', '2025-01-06 13:54:34', 0, 0);
