INSERT INTO `consult_region_info` VALUES (1, 50, 3, 'http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202501071041/image%20(1).png', '英格兰、威尔士和北爱尔兰地区：通常为三年制。经过三年学习可获“荣誉学士学位”或“普通学士学位”。&K&苏格兰地区：通常为四年制。学生用三年时间攻读“普通学士学位”，四年时间获得“荣誉学士学位”。&K&某些专业如医学类、法学类、工程类等特殊专业，需要四-五年或更长时间。', '院校世界排名高认可度高，学制相对短，申请要求客观友好，文化底蕴深厚，留学环境安全包容。', '通常本科3年制，苏格兰地区本科4年制，特殊专业4或5年以上。', '每年总预算约为20-35万人民币&K&*伦敦的生活成本高于其他城市', '每年总预算约为20-35万人民币', '高中学术成绩单&K&在读证明/毕业证书&K&A-Level或同等学历成绩&K&UCAS申请表&K&推荐信&K&雅思/托福成绩&K&财务证明&K&作品集（如适用）&K&面试（如适用）&K&其他补充材料（如适用）', NULL, '&k-topic-s&1.院校世界排名高：&k-topic-e&英国高等教育体系全球闻名，2025年QS世界大学排名，英国多所大学跻身前100位，排名仅次于美国，位列第二。&K&&k-topic-s&2.高等教育体制灵活：&k-topic-e&英国高等教育提供了多种入学途径，可以直入本科，如果不满足直入条件，可以就读预科或国际大一；如语言未达直入要求可搭配语言班。&K&&k-topic-s&3.最佳留学城市多：&k-topic-e&在2025QS全球最佳留学城市排名中，英国伦敦连续第六年蝉联榜首，爱丁堡位列全球第13。此外，英国共有16个城市进入全球最佳留学城市排名榜，其中8个城市进入全球TOP50。&K&&k-topic-s&4.文化和历史底蕴深厚：&k-topic-e&英国的城市如爱丁堡、曼彻斯特等不仅教育发达，还拥有丰富的历史遗迹和文化活动，为留学生提供了多彩的文化体验。&K&&k-topic-s&5.就业起点高机会多：&k-topic-e&英国大学的教育质量得到了国际认可，使得毕业生在全球范围内的就业竞争中占据有利地位，拥有更广阔的职业前景。\n', '', 'admin', '2024-01-01 10:00:00', 'admin', '2025-06-24 16:34:19', 0, 0);
INSERT INTO `consult_region_info` VALUES (2, 50, 2, 'http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202501071043/image%20(2).png', '授课型硕士通常为1年制&K&研究型硕士需1-2年&K&特定专业需更长时间', '院校世界排名高认可度高，学制相对短，申请要求客观友好，文化底蕴深厚，留学环境安全包容。', '授课型硕士通常为1年制', '每年总预算约为20-35万人民币&K&*伦敦的生活成本高于其他城市', '每年总预算约为20-35万人民币', '学术成绩单&K&在读证明/毕业证书&K&个人简历&K&个人陈述&K&研究计划（部分研究型硕士课程需要）&K&推荐信&K&雅思/托福成绩&K&GRE/GMAT等学术标化成绩（部分专业）&K&财务证明&K&作品集（如适用）&K&面试（如适用）&K&其他补充材料（如适用）', NULL, '&k-topic-s&1.院校世界排名高：&k-topic-e&英国高等教育体系全球闻名，2025年QS世界大学排名，英国多所大学跻身前100位，排名仅次于美国，位列第二。&K&&k-topic-s&2.高等教育体制灵活：&k-topic-e&英国高等教育提供了多种入学途径，可以直入本科，如果不满足直入条件，可以就读预科或国际大一；如语言未达直入要求可搭配语言班。&K&&k-topic-s&3.最佳留学城市多：&k-topic-e&在2025QS全球最佳留学城市排名中，英国伦敦连续第六年蝉联榜首，爱丁堡位列全球第13。此外，英国共有16个城市进入全球最佳留学城市排名榜，其中8个城市进入全球TOP50。&K&&k-topic-s&4.文化和历史底蕴深厚：&k-topic-e&英国的城市如爱丁堡、曼彻斯特等不仅教育发达，还拥有丰富的历史遗迹和文化活动，为留学生提供了多彩的文化体验。&K&&k-topic-s&5.就业起点高机会多：&k-topic-e&英国大学的教育质量得到了国际认可，使得毕业生在全球范围内的就业竞争中占据有利地位，拥有更广阔的职业前景。\n', '', 'admin', '2024-01-02 10:00:00', 'admin', '2025-02-13 14:10:34', 0, 0);
INSERT INTO `consult_region_info` VALUES (3, 57, 3, 'http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202501071044/image%20(3).png', '通常三年，荣誉学士学位为四年&K&特定专业如工程类、教育类需四年，特殊专业如牙医、医学需五年或以上', '院校世界排名高认可度高，学制短且灵活，申请要求客观友好，留学环境安全包容', '本科3年，荣誉学士学位为4年，特殊专业为4年或以上\r', '每年总预算约为25-45万人民币&K&悉尼、墨尔本的生活成本高于其他城市', '每年总预算约为25-45万人民币', '高中学术成绩单&K&在读证明/毕业证书&K&雅思/托福/PTE等成绩&K&作品集（如适用）&K&面试（如适用）&K&其他补充材料（如适用）', NULL, '&k-topic-s&1.院校世界排名高：&k-topic-e&澳大利亚高等教育体系全球闻名，2025年QS世界大学排名，澳大利亚9所大学跻身前100位，排名仅次于美国、英国，位列第三。&K&&k-topic-s&2.高等教育体制灵活：&k-topic-e&每年多次开学，申请要求客观友好；入学途径灵活多元，根据自身学术条件申请直入本科课程、国际大一课程或桥梁课程，根据语言成绩搭配语言课程。&K&&k-topic-s&3.最佳留学城市多：&k-topic-e&2024年QS最佳留学城市排名，澳大利亚6座城市跻身前50位；澳大利亚具有丰富的自然资源和独特的生态系统，城市大多位于沿海地区，气候宜人，拥有高质量、安全的生活环境；同时作为移民国家，文化环境多元且友好，留学生更易适应。&K&&k-topic-s&4.就业起点高机会多：&k-topic-e&澳大利亚QS前100院校多且全球认可度高，课程设置紧跟全球产业发展趋势，毕业生在中国更具职场竞争力，起薪高、机会多、晋升快。&K&&k-topic-s&5.留澳政策利好：&k-topic-e&澳大利亚对大学毕业生的需求量大，《2023年年度工作和技能报告》预计2033年就业人数新增约200万，澳政府为国际学生提供了毕业后工作签证（PSW），鼓励国际生毕业后留澳工作。\n', '', 'admin', '2024-01-03 10:00:00', 'admin', '2025-02-13 13:31:48', 0, 0);
INSERT INTO `consult_region_info` VALUES (4, 1, 3, 'http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202507021108/59701202507021108.webp', '通常四年，学制灵活，允许提前或延期毕业。&K&部分院校可提供三年加速学位。&K&工程、建筑等专业需五年时间。', '顶尖的教育资源，名校众多，体系灵活，文化多元，学历全球认可度高，就业前景广。', '通常为4年制', '公立大学每年总预算约为20万~50万人民币；&K&私立大学每年总预算约为30万~70万人民币。&K&纽约、波士顿、洛杉矶等大城市的生活成本高于其他城市。', '每年总预算约为20-70万人民币', '高中学术成绩单&K&中期报告&K&个人简历&K&个人陈述&K&补充文书&K&推荐信&K&托福/雅思成绩&K&其他标化成绩&K&财务证明&K&作品集（如适用）&K&面试（如适用）', NULL, '&k-topic-s&1.优质大学众多：&k-topic-e&2025QS世界大学排名前100中美国院校27所，2025U.S. News全球最佳院校排名中美国院校48所。&K&&k-topic-s&2.申请评估全面：&k-topic-e&美国大学采用整体审查（Holistic Review）不仅依据传统的学术成就指标（如成绩和标准化考试分数）来评估申请人，还会考量申请者的独特经历和个人特质。&K&&k-topic-s&3.教育体系灵活：&k-topic-e&文理学院及部分综合型大学允许学生不定专业入学，在大学学习过程中探索学术兴趣。美国大学允许学生自由更换专业（一般在大三前确定专业），甚至在不同学校之间转学，并提供夏季学期以加速学业。&K&&k-topic-s&4.就业前景广阔：&k-topic-e&美国本科学位在全球范围内认可度高，毕业生起薪高、潜力大、晋升快。53%中国企业招聘者更青睐美国留学背景学生*。*数据来源：2024中国学生出国留学发展报告。&K&&k-topic-s&5.留美就业机会：&k-topic-e&提供至少一年OPT（Optional Practical Training），STEM项目三年OPT；世界500强企业云集，毕业后留美工作机会多。&K&&k-topic-s&6.丰厚的奖学金：&k-topic-e&每年各类奖学金总额高达500亿美元，种类包括联邦政府奖学金、私人基金奖学金、学院内奖学金、助学金以及减免学费等。&K&&k-topic-s&7.申请要素：&k-topic-e&申请上需做到“早规划早准备”，合理规划并深度参与有个人特色的背景活动，科学安排各项标化考试的学习计划和出分节奏。9年级：启动托福/雅思学习、如有能力可开始AP课程学习；10年级：开始AP课程学习、启动SAT/ACT等标化考试学习；目标冲刺名校建议在10年级（最晚11年级）暑假参加夏校项目。补充到红框位置。', '', 'admin', '2024-01-04 10:00:00', 'admin', '2025-07-02 11:08:01', 0, 0);
INSERT INTO `consult_region_info` VALUES (5, 1, 2, 'http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202501071040/image.png', '授课型硕士通常为1-2年制，部分专业需要3年或以上，因专业和学校设置而不同。&K&学制多元且弹性大，允许提前修完学分毕业或延期。', '顶尖的教育资源，名校众多，体系灵活，文化多元，学历全球认可度高，就业前景广。', '通常为1-2年制', '公立大学每年总预算约为25万~50万人民币；&K&私立大学每年总预算约为30万~70万人民币。&K&纽约、波士顿、洛杉矶等大城市的生活成本高于其他城市。', '每年总预算约为25-70万', '学术成绩单&K&在读证明/毕业证和学位证&K&个人简历&K&个人陈述&K&补充文书&K&推荐信&K&托福/雅思成绩&K&GRE/GMAT学术标化成绩&K&作品集（如适用）&K&面试（如适用）&K&工作经历证明（如适用）', NULL, '&k-topic-s&1.优质大学众多：&k-topic-e&2025QS世界大学排名前100中美国院校27所，2025U.S. News全球最佳院校排名中美国院校48所。&K&&k-topic-s&2.教育与科研资源丰富：&k-topic-e&美国拥有世界顶尖的高等教育和研究机构，在众多学科领域中占据领先地位，不仅拥有卓越的教学质量，还提供丰富的学术和研究资源与机会。&K&&k-topic-s&3.申请评估全面：&k-topic-e&美国大学采用整体审查（Holistic Review）不仅依据传统的学术成就指标（如在校成绩和标准化考试分数）来评估申请人，还会考量申请者的学术能力、学术科研经历/工作或实习经历，以及个人特质。&K&&k-topic-s&4.就业竞争力强：&k-topic-e&持有美国硕士学位的毕业生在全球市场上竞争力普遍更高；美国当地硕士毕业生就业率高于本科，起薪普遍也高于本科毕业生；回国就业的毕业生中拥有美国硕士学位，其平均月薪比国内同等条件毕业生高出约20%-30%*。*数据来源：美国大学与雇主协会 (NACE) 最新数据；《2023年中国留学生回国就业调查报告》。&K&&k-topic-s&5.留美就业机会：&k-topic-e&提供至少一年OPT（Optional Practical Training），STEM项目三年OPT；世界500强企业云集，毕业后留美工作机会多。&K&&k-topic-s&6.丰厚的奖学金：&k-topic-e&每年各类奖学金总额高达500亿美元，种类包括助学金、助教奖学金、助研奖学金、联邦政府奖学金、私人基金奖学金、学院内奖学金以及减免学费等。\n', '', 'admin', '2024-01-05 10:00:00', 'admin', '2025-02-13 14:02:52', 0, 0);
INSERT INTO `consult_region_info` VALUES (6, 57, 2, 'http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202501071044/image%20(4).png', '学制灵活，授课型硕士通常有1年制、1.5年制、2年制\r\n特定专业需更长时间，研究型硕士需2-3年', '院校世界排名高认可度高，学制短且灵活，要求客观友好，留学环境安全包容', '授课型硕士通常有1年制、1.5年制、2年制', '每年总预算约为25-45万人民币\r\n悉尼、墨尔本的生活成本高于其他城市', '每年总预算约为25-45万人民币', '学术成绩单&K&在读证明/毕业证和学位证&K&雅思/托福/PTE等成绩&K&申请文书（如适用）&K&GRE/GMAT等学术标化成绩（如适用）&K&作品集（如适用）&K&面试（如适用）&K&其他补充材料（如适用）', NULL, '&k-topic-s&1.院校世界排名高：&k-topic-e&澳大利亚高等教育体系全球闻名，2025年QS世界大学排名，澳大利亚9所大学跻身前100位，排名仅次于美国、英国，位列第三。&K&&k-topic-s&2.高等教育体制灵活：&k-topic-e&每年多次开学，申请要求客观友好；入学途径灵活多元，根据自身学术条件申请直入硕士课程、硕士预科课程，根据语言条件搭配语言课程。&K&&k-topic-s&3.最佳留学城市多：&k-topic-e&2024年QS最佳留学城市排名，澳大利亚6座城市跻身世界排名前50；澳大利亚具有丰富的自然资源和独特的生态系统，城市大多位于沿海地区，气候宜人，拥有高质量、安全的生活环境；同时作为移民国家，文化环境多元且友好，留学生更易适应。&K&&k-topic-s&4.就业起点高机会多：&k-topic-e&澳大利亚QS前100院校多且认可度高，课程设置紧跟全球产业发展趋势，毕业生在中国更具竞争力，起薪高、机会多、晋升快。&K&&k-topic-s&5.留澳政策利好：&k-topic-e&澳大利亚对大学毕业生需求量大，政府发布的《2023年年度工作和技能报告》预计2033年就业人数新增约200万，澳政府为国际学生提供了毕业后工作签证（PSW），鼓励国际生本科毕业后留澳工作。\n', '', 'admin', '2024-01-06 10:00:00', 'admin', '2025-02-13 14:22:15', 0, 0);
INSERT INTO `consult_region_info` VALUES (7, 45, 3, 'http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202501071048/image%20(7).png', '公立大学：通常为4年，特殊专业如工程或法律需5年或以上&K&私立大学：学制灵活，一般为2-3年，部分专业需4年', '留学环境安全宜居，教育体系多元灵活，更高留学性价比', '本科2-4年，公立大学常为4年，私立大学2-3年', '每年总预算约为20-30万人民币&K&*备注：如申请新加坡公立大学政府助学金，可减免学费50%-80%，该助学金需学生毕业后需在新加坡工作一定年限。', '每年总预算约为20-30万人民币', '高考成绩/高中学术成绩单&K&在读证明/毕业证书&K&雅思/托福成绩&K&作品集（如适用）&K&面试（如适用）&K&其他补充材料（如适用）', NULL, '&k-topic-s&1.教育质量卓越：&k-topic-e&新加坡拥有世界一流的学府，如新加坡国立大学（2025QS世界大学排名第8位）、南洋理工大学（2025QS世界大学排名第15位）等。&K&&k-topic-s&2.教育体系多元：&k-topic-e&新加坡不仅拥有全球顶尖的公立大学，同时也有独具特色的私立大学，通过与国际知名大学建立合作关系，提升学位国际认可度。&K&&k-topic-s&3.环境安全宜居：&k-topic-e&新加坡社会安定，犯罪率低，适宜留学生活；且新政府十分欢迎中国留学生，留学签证获准率高且速度快。&K&&k-topic-s&4.中英双语氛围：&k-topic-e&新加坡采用英语教学，日常生活中广泛使用中文，中国学生能够更快地适应。&K&&k-topic-s&5.留新就业机会多：&k-topic-e&毕业后留新工作机会多，同时有机会申请新加坡永居（PR）。\n', '', 'admin', '2024-01-07 10:00:00', 'admin', '2025-02-13 13:34:20', 0, 0);
INSERT INTO `consult_region_info` VALUES (8, 45, 2, 'http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202501071050/image%20(8).png', '公立大学：授课型硕士通常有1年制、1.5年制、2年制&K&私立大学：学制较短，授课型硕士一般为1-1.5年，1年制居多', '留学环境安全宜居，教育体系多元灵活，更高留学性价比', '公立大学：1年制、1.5年制、2年制&K&私立大学：一般为1-1.5年，1年制居多', '每年总预算约为20-35万人民币', '每年总预算约为20-35万人民币', '学术成绩单&K&在读证明/毕业证和学位证&K&申请文书（如适用）&K&GRE/GMAT等学术标化成绩（如适用）&K&雅思/托福成绩&K&作品集（如适用）&K&面试（如适用）&K&其他补充材料（如适用）', NULL, '&k-topic-s&1.教育质量卓越：&k-topic-e&新加坡拥有世界一流的学府，如新加坡国立大学（2025QS世界大学排名第8位）、南洋理工大学（2025QS世界大学排名第15位）等。&K&&k-topic-s&2.教育体系多元：&k-topic-e&新加坡不仅拥有全球顶尖的公立大学，同时也有独具特色的私立大学，通过与国际知名大学建立合作关系，提升学位国际认可度。&K&&k-topic-s&3.环境安全宜居：&k-topic-e&新加坡社会安定，犯罪率低，适宜留学生活；且新政府十分欢迎中国留学生，留学签证获准率高且速度快。&K&&k-topic-s&4.中英双语氛围：&k-topic-e&新加坡采用英语教学，日常生活中广泛使用中文，中国学生能够更快地适应。&K&&k-topic-s&5.留新就业机会多：&k-topic-e&毕业后留新工作机会多，同时有机会申请新加坡永居（PR）。\n', '', 'admin', '2024-01-08 10:00:00', 'admin', '2025-02-13 14:27:18', 0, 0);
INSERT INTO `consult_region_info` VALUES (9, 56, 3, '\r\nhttp://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202501071055/image%20(9).png', '通常为4年制，双学位课程多数为5年制&K&特定专业如医科领域需5年或以上', '教育质量优质，离家近，环境易适应，政策利好就业机会丰富', '通常为4年制', '每年总预算约为20-30万人民币&K&如就读商科专业预算需提高', '每年总预算约为20-30万人民币', '针对高考生：&K&香港中文大学、香港城市大学、香港珠海学院这3所高校已被纳入内地高考统一招生计划，学生可通过高考志愿填报录取。其他香港高校采用自主招生方式，均需学生自行提交入学申请。&K&高中学术成绩单&K&会考成绩&K&高考成绩（总成绩、英语成绩）&K&在读证明/毕业证书&K&个人简历（非必须）&K&个人陈述&K&推荐信&K&面试（如适用）&K&*国际课程体系学生（无高考/会考成绩）提供国际课程考试成绩、雅思/托福成绩。', NULL, '&k-topic-s&1.教育质量优质：&k-topic-e&中国香港高校在全球范围内享有盛誉，“港前五”（香港大学、香港中文大学、香港科技大学、香港理工大学、香港城市大学）常年霸榜QS世界大学排名前100位；&K&&k-topic-s&2.地理和距离优势：&k-topic-e&对于中国内地学生来说，香港地理位置接近，交通便利，文化相似，更易于适应；&K&&k-topic-s&3.留学性价比相对较高：&k-topic-e&相较于其他海外留学目的地，如美国、英国、澳大利亚等，香港学费和生活成本较为适中。&K&&k-topic-s&4.高度认可高考成绩：&k-topic-e&中国香港绝大多数院校都认可高考成绩申请，同时也认可高考英语成绩，普高生无需再额外备考英语标准化考试 (如托福、雅思等)。&K&&k-topic-s&5.语言环境友好：&k-topic-e&香港语言是“两文三语”，两文是中英文，三语是英语、粤语、普通话；与内地相比，在港求学除了可以享受更好的英语学习环境之外，还能在潜移默化中掌握粤语。&K&&k-topic-s&6.政策利好就业机会多：&k-topic-e&港府鼓励毕业生留港就业，非本地毕业生留港/回港就业安排 (IANG签证) 允许本科毕业生无需事先获得工作邀请即可在香港工作，无名额限制；香港作为国际金融中心和商业枢纽，就业机会丰富，港前五院校毕业生平均起薪可达20,000港币及以上。\n', '', 'admin', '2024-01-09 10:00:00', 'admin', '2025-02-13 13:31:35', 0, 0);
INSERT INTO `consult_region_info` VALUES (10, 56, 2, 'http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202501071047/image%20(6).png', '授课型硕士通常为1年制，特定专业为2-3年制', '教育质量优质，离家近，环境易适应，政策利好就业机会多', '授课型硕士通常为1年制', '每年总预算约为20-30万人民币', '每年总预算约为20-30万人民币', '学术成绩单（包含绩点换算证明）&K&在读证明/毕业证和学位证&K&个人简历&K&个人陈述&K&推荐信&K&雅思/托福成绩&K&GRE/GMAT学术标化成绩&K&作品集（如适用）&K&面试（如适用）&K&其他补充材料（如适用）', NULL, '&k-topic-s&1.教育质量优质：&k-topic-e&中国香港高校在全球范围内享有盛誉，“港前五”（香港大学、香港中文大学、香港科技大学、香港理工大学、香港城市大学）常年霸榜QS世界大学排名前100位；&K&&k-topic-s&2.地理和距离优势：&k-topic-e&对于中国内地学生来说，香港地理位置接近，交通便利，文化相似，更易于适应；&K&&k-topic-s&3.留学性价比相对较高：&k-topic-e&相较于其他海外留学目的地，如美国、英国、澳大利亚等，香港学费和生活成本较为适中。&K&&k-topic-s&4.语言环境友好：&k-topic-e&香港语言是“两文三语”，两文是中英文，三语是英语、粤语、普通话；与内地相比，在港求学除了可以享受更好的英语学习环境之外，还能在潜移默化中掌握粤语。&K&&k-topic-s&5.政策利好就业机会多：&k-topic-e&港府鼓励毕业生留港就业，非本地毕业生留港/回港就业安排 (IANG签证) 允许毕业生无需事先获得工作邀请即可在香港工作，无名额限制；香港作为国际金融中心和商业枢纽，就业机会丰富，港前五院校毕业生平均起薪可达20,000港币及以上。\n', '', 'admin', '2024-01-10 10:00:00', 'admin', '2025-02-13 14:17:06', 0, 0);
INSERT INTO `consult_region_info` VALUES (13, 55, 3, 'http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202501201815/55555%20(1).png', '我是一般学制1&K&我是一般学制2', '测试对比优势1&K&测试对比优势2', '测试对比学制1&K&测试对比学制2', '测试预算1&K&测试预算2', '测试对比预算1&K&测试对比预算2', '测试预算申请材料1&K&测试预算申请材料2', NULL, '&k-topic-s&我是主题&k-topic-e&测试优势特点1&K&&k-topic-s&&k-topic-e&测试优势特点2', 'http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202501201815/55555.png', 'admin', '2025-01-20 17:48:42', 'admin', '2025-01-22 17:03:53', 1, 0);
INSERT INTO `consult_region_info` VALUES (14, 55, 3, 'http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202501231545/bg_top.webp', '测试学制&K&测试学制2', ' 顶尖的教育资源，名校众多，体系灵活，文化多元，学历全球认可度高，就业前景广。', '学制&K&学制2', '预算&K&测试预算2', '预算&K&预算2', '材料&K&材料2', NULL, '&k-topic-s&1.test&k-topic-e&内容&K&&k-topic-s&2.test&k-topic-e&内容2&K&&k-topic-s&&k-topic-e&内容3', '', 'admin', '2025-01-22 17:30:08', 'admin', '2025-02-11 10:47:43', 1, 1);
INSERT INTO `consult_region_info` VALUES (15, 125, 3, '', '通常四年，医学、牙医学、兽医学、部分药学类专业学制为6年。', '离家近、好适应、费用低、专业限制小、名校机会大、学历认可度高、发展前景广阔', '通常四年，医学、牙医学、兽医学、部分药学类专业学制为6年', '学费：国公立大学2~3万人民币/年，私立大学3~5万人民币/年居多。&K&生活费：8~10万/年（地区不同有所差异）。', '总预算10~15万人民币/年', '高中三年成绩单&K&毕业证&K&推荐信&K&个人简历&K&EJU成绩/日语成绩（日语授课项目）&K&托福/雅思成绩（SGU项目）&K&高考/SAT/ACT等标化成绩等（SGU项目）', NULL, '&k-topic-s&1. 距离近：&k-topic-e&与中国一衣带水，距离近，往返方便。&K&&k-topic-s&2. 生活习俗相似：&k-topic-e&生活习俗与中国相似度高，更容易适应。&K&&k-topic-s&3. 语言易学习：&k-topic-e&日语中汉字含量极高，语言互通性强，容易学习。&K&&k-topic-s&4. 升学机会多：&k-topic-e&更多升学可能性，普高、中专、职高、技校生同等升学机会；日语授课无需高考成绩，单独开设留学生升学通道，名校升学机会更多。&K&&k-topic-s&5. 性价比高：&k-topic-e&留学性价比高，学费低廉，奖学金丰富，还可合法打工。&K&&k-topic-s&6. 英文授课制：&k-topic-e&开设英文授课项目，无日语基础也可赴日留学。&K&&k-topic-s&7. 就业前景好：&k-topic-e&学历国际公认，回国可以认证，就业发展空间巨大；毕业后留日就业政策利好，可获工作签证。&K&&k-topic-s&8. 可申请永居：&k-topic-e&在日居留 10 年(部分高度人才 5 年，最快1年)，可申请永久居住权。', '', 'admin', '2025-02-11 10:46:35', 'admin', '2025-02-13 17:47:21', 0, 0);
INSERT INTO `consult_region_info` VALUES (16, 55, 7, '', '1', '3', '4', '2', '5', '6', NULL, '&k-topic-s&&k-topic-e&1.教育质量优质：中国香港高校在全球范围内享有盛誉，“港前五”（香港大学、香港中文大学、香港科技大学、香港理工大学、香港城市大学）常年霸榜QS世界大学排名前100位；&K&&k-topic-s&2.地理和距离优势：&k-topic-e&对于中国内地学生来说，香港地理位置接近，交通便利，文化相似，更易于适应；', '', 'admin', '2025-02-11 11:02:32', 'admin', '2025-02-12 10:38:15', 1, 0);
INSERT INTO `consult_region_info` VALUES (17, 130, 2, 'http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202502131649/%E6%97%B6%E9%97%B4%E8%BD%B4-%E6%AF%94%E5%88%A9%E6%97%B6-%E7%A1%95%E5%A3%AB.png', '通常两年，学制灵活，允许提前或延期毕业。', '优质教育、多语言环境、文化丰富、地理位置佳、研究机会、生活费用适中、就业前景好。', '2年', '学费: 公立1000欧-6000欧/年, 取决于专业和学校&K&住宿费: 300欧-800欧/月不等, 取决于地点和房屋类型&K&生活费: 10万RMB元/年起（包括住宿费）', '每年总预算约为15万人民币（包括学费和生活费）', '个人简历&K&动机信&K&APS证书&K&推荐信&K&大学本科相关资料', NULL, '&k-topic-s&1.高质量的教育：&k-topic-e&比利时有多所世界知名的大学，如鲁汶大学、根特大学、布鲁塞尔自由大学等，提供多样化的课程和高水平的教育。&K&&k-topic-s&2.多语言环境：&k-topic-e&比利时是多语言国家，官方语言包括荷兰语、法语和德语，留学生有机会学习和使用多种语言，增加自己的语言技能。&K&&k-topic-s&3.文化多样性：&k-topic-e&比利时位于欧洲心脏地带，拥有丰富的历史和文化遗产，留学生可以体验不同的文化和传统。&K&&k-topic-s&4.地理位置优越：&k-topic-e&比利时地处欧洲中心，与法国、德国、荷兰和卢森堡接壤，便于旅行和探索其他欧洲国家。', '', 'admin', '2025-02-13 10:38:57', 'admin', '2025-02-13 16:49:06', 0, 0);
INSERT INTO `consult_region_info` VALUES (18, 124, 3, 'http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202502131548/%E4%B8%AD%E5%9B%BD%E6%BE%B3%E9%97%A8-%E6%9C%AC%E7%A7%91-%E7%95%99%E5%AD%A6%E6%97%B6%E9%97%B4%E8%BD%B4.png', '学制一般为4年，私立大学有先修班学制1年', '学历认可度高、优质教学、费用低、专业多样、距离近、中西方文化融合', '本科通常4年制', '在澳门读书预算因学校和专业不同而有所差异。&K&本科学费约2.5万-8万人民币/年，生活费约4万-5万人民币/年，丰俭由人。', '本科学费约2.5万-8万人民币/年&K&生活费约4万-5万人民币/年', '身份证&K&高考成绩单&K&艺考类美术科统考成绩单（艺术类专业）&K&电子照片（二寸白底彩照）等', NULL, '&k-topic-s&1. 学历认可度高，升学便利：&k-topic-e&澳门学历文凭受国家教育部及全世界100多个国家认可。澳门院校也与美、英、欧等国的一些著名大学有签订分数互认协定。&K&&k-topic-s&2. 招生报名和录取名额不占用高考志愿：&k-topic-e&国内高中生可以凭借高考成绩直接申请澳门高校。而且，澳门高校招收内地学生为独立招生，并不属于全国普通高校统一招生计划内，考生于澳门学校的报名及录取不会影响其他内地高考的志愿录取。&K&&k-topic-s&3. 费用低：&k-topic-e&澳门读书最突出的一点就是花费少，虽然澳门香港紧邻，但澳门升学的费用比香港少将近一半。&K&&k-topic-s&4. 安全性高，回家方便：&k-topic-e&澳门的防疫和留学安全都可以得到保证，澳门在回归祖国后，联合国更是把澳门评为世界治安最好的地区之一。没有签证上的障碍，回家探亲也非常方便。', '', 'admin', '2025-02-13 10:43:21', 'admin', '2025-02-13 15:48:15', 0, 0);
INSERT INTO `consult_region_info` VALUES (19, 138, 3, 'http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202502131612/%E7%88%B1%E5%B0%94%E5%85%B0-%E6%9C%AC%E7%A7%91-%E7%95%99%E5%AD%A6%E6%97%B6%E9%97%B4%E8%BD%B4.png', '一般为3-4年：大部分商科、艺术和人文类专业为3年，而工程、计算机、科学等专业通常为4年。', '高质量教育体系、全英语学习环境、较低的学费和生活成本、宽松的签证政策、良好的工作签证、跨国公司总部聚集、友好安全的社会环境', '一般为3-4年', '首都都柏林地区&K&学费：约10万-16万人民币/年&K&住宿：约10万+/年，丰俭由人&K&饮食：约2.4万-3万/年&K&交通：约1.08万-1.5万/年&K&总预算：每年约24万-30万人民币&K&非首都地区&K&学费：约8万-14万人民币/年&K&住宿：约5万-7万，丰俭由人&K&饮食：约1.5万-3万/年&K&交通：约6000-9600元/年&K&总预算：每年约15万-25万人民币', '首都都柏林地区总预算：每年约24万-30万人民币；&K&非首都地区总预算：每年约15万-25万人民币', '高中成绩单原件或认证版扫描件&K&在读证明/毕业证扫描件&K&高考成绩（如适用，TCD/UCD需要）&K&学生本人护照扫描件&K&雅思或托福等语言成绩（2年内有效）&K&个人陈述/推荐信等文书等', NULL, '&k-topic-s&1. 较低的学费和生活成本：&k-topic-e&爱尔兰的学费和生活成本相对英国、美国等西方主流国家更低，是预算有限学生的理想选择。&K&&k-topic-s&2. 宽松的签证政策：&k-topic-e&爱尔兰签证申请过程简单透明，通过率高，为国际学生提供便利。&K&&k-topic-s&3. 毕业后工作签证：&k-topic-e&留学生在爱尔兰毕业后，本科有1年工签，硕士有2年工签时间，更有利于学生找到理想工作。&K&&k-topic-s&4. 跨国公司总部聚集：&k-topic-e&爱尔兰是谷歌、苹果、Facebook等跨国公司欧洲总部所在地，提供丰富的实习和就业机会。&K&&k-topic-s&5. 友好安全的社会环境：&k-topic-e&爱尔兰严格控制枪支，犯罪率低，社会友好热情，留学生容易融入当地社区。&K&&k-topic-s&6. 高质量教育体系：&k-topic-e&爱尔兰高等教育在多个学科领域具有全球领先水平，本科3-4年、硕士1年的学制节省时间和费用。&K&&k-topic-s&7. 全英语学习环境：&k-topic-e&爱尔兰官方语言为英语，学生可在全英语环境中快速提升语言能力。&K&&k-topic-s&8. 教育与产业紧密结合：&k-topic-e&大学与企业合作紧密，课程设置包含实习和实践环节，学生可积累工作经验，为未来职业发展打下基础。', '', 'admin', '2025-02-13 10:52:59', 'admin', '2025-02-13 16:12:57', 0, 0);
INSERT INTO `consult_region_info` VALUES (20, 124, 2, 'http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202502131548/%E4%B8%AD%E5%9B%BD%E6%BE%B3%E9%97%A8-%E7%A1%95%E5%A3%AB-%E7%95%99%E5%AD%A6%E6%97%B6%E9%97%B4%E8%BD%B4.png', '学制一般为2年&K&部分理工科专业3年', '学历认可度高、优质教学、费用低、专业多样、距离近、中西方文化融合', '硕士通常为2年', '在澳门读书预算因学校和专业不同而有所差异。&K&硕士学费约6万-12万人民币/年，生活费约4万-5万人民币/年，丰俭由人。', '硕士学费约6万-12万人民币/年&K&生活费约4万-5万人民币/年', '完整前置学历全套成绩&K&在读证明/毕业证/学位证&K&身份证复印本&K&户口簿复印本&K&学生本人照片&K&推荐表&K&英语能力证明（如有）等', NULL, '&k-topic-s&1. 学历认可度高，升学便利：&k-topic-e&澳门学历文凭受国家教育部及全世界100多个国家认可。澳门院校也与美、英、欧等国的一些著名大学有签订分数互认协定。&K&&k-topic-s&2. 招生报名和录取名额与内地考研不冲突：&k-topic-e&澳门高校招收内地学生为境外独立招生，与中国大陆地区考研不冲突。&K&&k-topic-s&3. 费用低：&k-topic-e&澳门读书最突出的一点就是花费少，虽然澳门香港紧邻，但澳门升学的费用比香港少将近一半。&K&&k-topic-s&4. 安全性高，回家方便：&k-topic-e&澳门的防疫和留学安全都可以得到保证，澳门在回归祖国后，联合国更是把澳门评为世界治安最好的地区之一。没有签证上的障碍，回家探亲也非常方便。', '', 'admin', '2025-02-13 14:30:15', 'admin', '2025-02-13 15:48:43', 0, 0);
