INSERT INTO `sys_oper_log` VALUES (239, '意向目的地基本要求', 2, 'com.xintong.controller.admin.RegionInfoAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/regionInfo/edit', '223.160.212.218', 'XX XX', '{\"advantages\":\"顶尖的教育资源，名校众多，体系灵活，文化多元，学历全球认可度高，就业前景广。\",\"appMaterial\":\"\\n推荐信，学术成绩单，中期报告，简历，个人陈述，补充文书，托福/雅思成绩，其他标化成绩，财务证明，作品集（如适用），面试（如适用）\",\"budgetDetail\":\"每年总预算约为20-70万\",\"budgetRange\":\"公立大学每年总预算约为20万~50万人民币；私立大学每年总预算约为30万~70万人民币。&K&此外，纽约、波士顿、洛杉矶等大城市的生活成本高于其他城市。\",\"countryFeat\":\"&k-topic-s&1.优质大学众多：&k-topic-e&2025QS世界大学排名前100中美国院校27所，2025U.S. News全球最佳院校排名中美国院校48所。&K&&k-topic-s&2.申请评估全面：&k-topic-e&美国大学采用整体审查（Holistic Review）不仅依据传统的学术成就指标（如成绩和标准化考试分数）来评估申请人，还会考量申请者的独特经历和个人特质。&K&&k-topic-s&3.教育体系灵活：&k-topic-e&文理学院及部分综合型大学允许学生不定专业入学，在大学学习过程中探索学术兴趣。美国大学允许学生自由更换专业（一般在大三前确定专业），甚至在不同学校之间转学，并提供夏季学期以加速学业。&K&&k-topic-s&4.就业前景广阔：&k-topic-e&美国本科学位在全球范围内认可度高，毕业生起薪高、潜力大、晋升快。53%中国企业招聘者更青睐美国留学背景学生*。*数据来源：2024中国学生出国留学发展报告。&K&&k-topic-s&5.留美就业机会：&k-topic-e&提供至少一年OPT（Optional Practical Training），STEM项目三年OPT；世界500强企业云集，毕业后留美工作机会多。&K&&k-topic-s&6.丰厚的奖学金：&k-topic-e&每年各类奖学金总额高达500亿美元，种类包括联邦政府奖学金、私人基金奖学金、学院内奖学金、助学金以及减免学费等。&K&&k-topic-s&7.申请要素：&k-topic-e&申请上需做到“早规划早准备”，合理规划并深度参与有个人特色的背景活动，科学安排各项标化考试的学习计划和出分节奏。9年级：启动托福/雅思学习、如有能力可开始AP课程学习；10年级：开始AP课程学习、启动SAT/ACT等标化考试学习；目标冲刺名校建议在10年级（最晚11年级）暑假参加夏校项目。补充到红框位置。\",\"createdAt\":\"2024-01-04 10:00:00\",\"createdBy\":\"admin\",\"eduSystem\":\"通常为4年制\",\"enrollTimeline\":\"\",\"id\":4,\"isActive\":0,\"isDeleted\":0,\"rankUrl\":\"\",\"regularProg\":\"通常四年，学制灵活，允许提前或延期毕业。\\r\\n部分院校可提供三年加速学位。\\r\\n工程、建筑等专业需五年时间。\",\"updatedAt\":\"2025-01-23 15:22:23\",\"updatedBy\":\"admin\"}', '{\"msg\":\"修改成功\",\"code\":200}', 0, NULL, '2025-01-23 15:24:50', 20);
