INSERT INTO `sys_oper_log` VALUES (246, '意向目的地基本要求', 2, 'com.xintong.controller.admin.RegionInfoAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/regionInfo/edit', '223.160.212.218', 'XX XX', '{\"advantages\":\" 顶尖的教育资源，名校众多，体系灵活，文化多元，学历全球认可度高，就业前景广。\",\"appMaterial\":\"材料&K&材料2\",\"budgetDetail\":\"预算&K&预算2\",\"budgetRange\":\"预算&K&测试预算2\",\"countryFeat\":\"&k-topic-s&1.test&k-topic-e&内容&K&&k-topic-s&2.test&k-topic-e&内容2&K&&k-topic-s&&k-topic-e&内容3\",\"createdAt\":\"2025-01-22 17:30:08\",\"createdBy\":\"admin\",\"eduSystem\":\"学制&K&学制2\",\"enrollTimeline\":\"http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202501231545/bg_top.webp\",\"id\":14,\"isActive\":1,\"isDeleted\":0,\"rankUrl\":\"\",\"regularProg\":\"测试学制&K&测试学制2\",\"updatedAt\":\"2025-01-22 17:40:53\",\"updatedBy\":\"admin\"}', '{\"msg\":\"修改成功\",\"code\":200}', 0, NULL, '2025-01-23 15:45:46', 15);
INSERT INTO `sys_oper_log` VALUES (247, '意向目的地基本要求', 2, 'com.xintong.controller.admin.RegionInfoAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/regionInfo/edit', '223.160.212.218', 'XX XX', '{\"advantages\":\"教育质量优质，离家近，环境易适应，政策利好就业机会丰富\",\"appMaterial\":\"针对高考生&K&香港中文大学，香港城市大学，香港珠海学院， 这3所高校已被纳入内地高考统一招生计划, 学生可通过高考志愿填报录取。&K&其他香港高校采用自主招生方式，均需学生自行提交入学申请，&K&高中在校成绩，会考成绩，高考成绩（总成绩、英语成绩），在读证明&高中毕业证， 面试（如适用），个人陈述，个人简历（非必须），推荐信\",\"budgetDetail\":\"每年总预算约为20-30万人民币\",\"budgetRange\":\"每年总预算约为20-30万人民币\\r\\n如就读商科专业预算需提高\",\"countryFeat\":\"&k-topic-s&1.教育质量优质：&k-topic-e&中国香港高校在全球范围内享有盛誉，“港前五”（香港大学、香港中文大学、香港科技大学、香港理工大学、香港城市大学）常年霸榜QS世界大学排名前100位；&K&&k-topic-s&2.地理和距离优势：&k-topic-e&对于中国内地学生来说，香港地理位置接近，交通便利，文化相似，更易于适应；&K&&k-topic-s&3.留学性价比相对较高：&k-topic-e&相较于其他海外留学目的地，如美国、英国、澳大利亚等，香港学费和生活成本较为适中。&K&&k-topic-s&4.高度认可高考成绩：&k-topic-e&中国香港绝大多数院校都认可高考成绩申请，同时也认可高考英语成绩，普高生无需再额外备考英语标准化考试 (如托福、雅思等)。&K&&k-topic-s&5.语言环境友好：&k-topic-e&香港语言是“两文三语”，两文是中英文，三语是英语、粤语、普通话；与内地相比，在港求学除了可以享受更好的英语学习环境之外，还能在潜移默化中掌握粤语。&K&&k-topic-s&6.政策利好就业机会多：&k-topic-e&港府鼓励毕业生留港就业，非本地毕业生留港/回港就业安排 (IANG签证) 允许本科毕业生无需事先获得工作邀请即可在香港工作，无名额限制；香港作为国际金融中心和商业枢纽，就业机会丰富，港前五院校毕业生平均起薪可达20,000港币及以上。\\n\",\"createdAt\":\"2024-01-09 10:00:00\",\"createdBy\":\"admin\",\"eduSystem\":\"通常为4年制\",\"enrollTimeline\":\"\\r\\nhttp://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202501071055/image%20(9).png\",\"id\":9,\"isActive\":0,\"isDeleted\":0,\"rankUrl\":\"\",\"regularProg\":\"通常为4年制\\r\\n双学位课程多数为5年制\\r\\n特定专业如医科领域需5年或以上\",\"updatedAt\":\"2025-01-23 15:55:09\",\"updatedBy\":\"admin\"}', '{\"msg\":\"修改成功\",\"code\":200}', 0, NULL, '2025-01-23 15:58:31', 17);
INSERT INTO `sys_oper_log` VALUES (248, '意向目的地基本要求', 2, 'com.xintong.controller.admin.RegionInfoAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/regionInfo/edit', '223.160.212.218', 'XX XX', '{\"advantages\":\"教育质量优质，离家近，环境易适应，政策利好就业机会丰富\",\"appMaterial\":\"针对高考生：&K&香港中文大学、香港城市大学、香港珠海学院这3所高校已被纳入内地高考统一招生计划，学生可通过高考志愿填报录取。&K&其他香港高校采用自主招生方式，均需学生自行提交入学申请。&K&高中在校成绩、会考成绩、高考成绩（总成绩、英语成绩）、在读证明&高中毕业证、面试（如适用）、个人陈述、个人简历（非必须）、推荐信&K&针对国际课程体系学生：&K&高中在校成绩、国际考试成绩、在读证明&高中毕业证、语言标化考试（雅思/托福）成绩、面试（如适用）、个人陈述、个人简历（非必须）、推荐信\",\"budgetDetail\":\"每年总预算约为20-30万人民币\",\"budgetRange\":\"每年总预算约为20-30万人民币\\r\\n如就读商科专业预算需提高\",\"countryFeat\":\"&k-topic-s&1.教育质量优质：&k-topic-e&中国香港高校在全球范围内享有盛誉，“港前五”（香港大学、香港中文大学、香港科技大学、香港理工大学、香港城市大学）常年霸榜QS世界大学排名前100位；&K&&k-topic-s&2.地理和距离优势：&k-topic-e&对于中国内地学生来说，香港地理位置接近，交通便利，文化相似，更易于适应；&K&&k-topic-s&3.留学性价比相对较高：&k-topic-e&相较于其他海外留学目的地，如美国、英国、澳大利亚等，香港学费和生活成本较为适中。&K&&k-topic-s&4.高度认可高考成绩：&k-topic-e&中国香港绝大多数院校都认可高考成绩申请，同时也认可高考英语成绩，普高生无需再额外备考英语标准化考试 (如托福、雅思等)。&K&&k-topic-s&5.语言环境友好：&k-topic-e&香港语言是“两文三语”，两文是中英文，三语是英语、粤语、普通话；与内地相比，在港求学除了可以享受更好的英语学习环境之外，还能在潜移默化中掌握粤语。&K&&k-topic-s&6.政策利好就业机会多：&k-topic-e&港府鼓励毕业生留港就业，非本地毕业生留港/回港就业安排 (IANG签证) 允许本科毕业生无需事先获得工作邀请即可在香港工作，无名额限制；香港作为国际金融中心和商业枢纽，就业机会丰富，港前五院校毕业生平均起薪可达20,000港币及以上。\\n\",\"createdAt\":\"2024-01-09 10:00:00\",\"createdBy\":\"admin\",\"eduSystem\":\"通常为4年制\",\"enrollTimeline\":\"\\r\\nhttp://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202501071055/image%20(9).png\",\"id\":9,\"isActive\":0,\"isDeleted\":0,\"rankUrl\":\"\",\"regularProg\":\"通常为4年制\\r\\n双学位课程多数为5年制\\r\\n特定专业如医科领域需5年或以上\",\"updatedAt\":\"2025-01-23 15:58:32\",\"updatedBy\":\"admin\"}', '{\"msg\":\"修改成功\",\"code\":200}', 0, NULL, '2025-01-23 16:02:27', 18);
