INSERT INTO `sys_oper_log` VALUES (332, '专业信息', 2, 'com.xintong.controller.admin.MajorAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/edit', '127.0.0.1', '内网IP', '{\"details\":\"1金融是研究资金的管理和运用，以及经济活动运行和发展的专业。它涉及到金融市场、金融机构、投资、货币、信贷、利率等各个方面，旨在培养具有良好金融理论知识和经济分析能力的人才，以满足社会对金融人才的需求。\",\"id\":6,\"level\":2,\"name\":\"金融学1\",\"nameEn\":\"Finance1\",\"pageNum\":1,\"pageSize\":10,\"parentId\":1,\"subTitle\":\"1金融类专业是一门研究金融资源有效配置的学科，学生将学习如何在不确定性条件下进行资金的跨时配置，以及如何降低金融风险，实现资产增值。\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-01-24 13:41:17', 203);
