INSERT INTO `sys_oper_log` VALUES (519, '消息', 1, 'com.xintong.controller.admin.MessageAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/message/add', '60.12.13.184', 'XX XX', '{\"content\":\"<p style=\\\"text-align: justify;\\\"><span style=\\\"background-color: rgb(255, 187, 150); font-size: 16px;\\\"><strong>一、理工学部截止申请专业</strong></span></p><p style=\\\"text-align: justify;\\\"><span style=\\\"color: black;\\\"><strong>截止2月7日，以下三个理工学部硕士项目已暂停接收国际学生申请。</strong></span></p><p style=\\\"text-align: justify;\\\"><span style=\\\"color: black;\\\"> &nbsp; &nbsp; &nbsp; ▸ 生物科技硕士 (MSc Biotechnology)<br> &nbsp; &nbsp; &nbsp; ▸ 分析化学硕士 (MSc Analytical Chemistry)<br> &nbsp; &nbsp; &nbsp; ▸ 药物化合物分析硕士 (MSc Analysis of Pharmaceutical Compounds)</span></p><p style=\\\"text-align: justify;\\\"><br></p><p style=\\\"text-align: justify;\\\"><strong>对于之前已递交上述专业申请的申请人不受影响，学校会继续进行审理。也欢迎老师们向学生推荐科克大学其他生物化学相关专业，专业详情可参考附件内容：</strong></p><p style=\\\"text-align: justify;\\\"> &nbsp; &nbsp; &nbsp; ▸ <span style=\\\"color: rgb(0, 0, 0); background-color: rgba(0, 0, 0, 0);\\\">生物信息学与计算生物学（</span><span style=\\\"background-color: transparent;\\\">MSc Bioinformatics &amp; Computational Biology）</span></p><p style=\\\"text-align: justify;\\\"> &nbsp; &nbsp; &nbsp; ▸ <span style=\\\"color: rgb(0, 0, 0); background-color: rgba(0, 0, 0, 0);\\\">微生物科学（</span><span style=\\\"background-color: transparent;\\\">MSc Microbiome Science）</span></p><p style=\\\"text-align: justify;\\\"> &nbsp; &nbsp; &nbsp; ▸ <span style=\\\"color: rgb(0, 0, 0); background-color: rgba(0, 0, 0, 0);\\\">工程-工业生物技术与生物制造（</span><span style=\\\"background-color: transparent;\\\">MEngSc Industrial Biotechnology and Biomanufacturing）</span></p><p style=\\\"text-align: justify;\\\"> &nbsp; &nbsp; &nbsp; ▸ <span style=\\\"color: rgb(0, 0, 0); background-color: rgba(0, 0, 0, 0);\\\">食品微生物学（</span><span style=\\\"background-color: transparent;\\\">MSc Food Microbiology）</span></p><p style=\\\"text-align: justify;\\\"> &nbsp; &nbsp; &nbsp; ▸ <span style=\\\"color: rgb(0, 0, 0); background-color: rgba(0, 0, 0, 0);\\\">海洋生物学（</span><span style=\\\"background-color: transparent;\\\">MSc Biology - Marine Biology）</span></p><p style=\\\"text-align: justify;\\\"><br></p><p style=\\\"text-align: justify;\\\"><span style', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-07 15:39:46', 17);
