INSERT INTO `sys_oper_log` VALUES (635, '消息', 1, 'com.xintong.controller.admin.MessageAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/message/add', '60.12.13.184', 'XX XX', '{\"content\":\"<p><span style=\\\"font-size: 24px;\\\"><strong>坎特伯雷大学25年2月的晚报道及延期申请信息更新</strong></span><strong><br></strong>1. 如学生正在等待签证的话并担心无法及时到校，可以申请迟到Late Arrival。邮件可以发送至坎大中国区招生团队-Wilber.han@canterbury.ac.nz及Allen.huang@canterbury.ac.nz。针对可以接受迟到的课程，收到迟到Late Arrival申请后，大学会下发迟到信。<span style=\\\"background-color: rgb(255, 255, 0);\\\"><strong>针对大部分课程，最晚报道时间为2月28日</strong></span>。</p><p>需要留意：<strong>以下课程不接受迟到</strong>，请各位老师务必注意：<br>*所有Teaching类课程<br>*其他部分教育相关课程，需要单独与学院确认具体迟到日期<br>*护理课程<br>*语言病理学硕士<br><span style=\\\"color: rgb(255, 0, 0);\\\"><em>针对以上课程，如学生无法准时到校，建议学生申请延期；另外，需要注意，以上课程部分有名额限制，无法直接延期，需重新递交申请~<br><br></em></span>2. 学校针对迟到的学生，新增两场迎新活动，具体日期与时间如下：<br>*2月21日周五当地时间下午4:00-5:00<br>*2月28日周五当地时间下午4:00-5:00<br>迟到的同学可登陆以下链接注册参与活动： <a href=\\\"https://events.humanitix.com/international-orientation-for-late-arrivals-s1-2025\\\" target=\\\"\\\">https://events.humanitix.com/international-orientation-for-late-arrivals-s1-2025</a><br><br>3. <strong>申请迟到的同学务必需要在2月17日前完成线上Enroll流程</strong>。请各位老师务必提醒学生登陆MyUC进行操作。<br><br>4. 如还没有递交签证，或还没有满足offer条件的同学，建议申请延期。如要申请延期，请务必在offer开学时间前申请，否则offer会有被取消的风险。一旦offer被取消，无法直接做延期操作，后续需要重新递交申请。</p>\",\"isActive\":0,\"title\":\"【坎特伯雷大学】25年2月intake的晚报道及延期申请\",\"type\":4}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-10 13:33:20', 23);
INSERT INTO `sys_oper_log` VALUES (636, '消息', 2, 'com.xintong.controller.admin.MessageAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/message/edit', '60.12.13.184', 'XX XX', '{\"content\":\"<p><span style=\\\"font-size: 24px;\\\"><strong>坎特伯雷大学25年2月的晚报道及延期申请信息更新</strong></span><strong><br></strong>1. 如学生正在等待签证的话并担心无法及时到校，可以申请迟到Late Arrival。邮件可以发送至坎大中国区招生团队-Wilber.han@canterbury.ac.nz及Allen.huang@canterbury.ac.nz。针对可以接受迟到的课程，收到迟到Late Arrival申请后，大学会下发迟到信。<span style=\\\"background-color: rgb(255, 255, 0);\\\"><strong>针对大部分课程，最晚报道时间为2月28日</strong></span>。</p><p>需要留意：<strong>以下课程不接受迟到</strong>，请各位老师务必注意：<br>*所有Teaching类课程<br>*其他部分教育相关课程，需要单独与学院确认具体迟到日期<br>*护理课程<br>*语言病理学硕士<br><span style=\\\"color: rgb(255, 0, 0);\\\"><em>针对以上课程，如学生无法准时到校，建议学生申请延期；另外，需要注意，以上课程部分有名额限制，无法直接延期，需重新递交申请~<br><br></em></span>2. 学校针对迟到的学生，新增两场迎新活动，具体日期与时间如下：<br>*2月21日周五当地时间下午4:00-5:00<br>*2月28日周五当地时间下午4:00-5:00<br>迟到的同学可登陆以下链接注册参与活动： <a href=\\\"https://events.humanitix.com/international-orientation-for-late-arrivals-s1-2025\\\" target=\\\"\\\">https://events.humanitix.com/international-orientation-for-late-arrivals-s1-2025</a><br><br>3. <strong>申请迟到的同学务必需要在2月17日前完成线上Enroll流程</strong>。请各位老师务必提醒学生登陆MyUC进行操作。<br><br>4. 如还没有递交签证，或还没有满足offer条件的同学，建议申请延期。如要申请延期，请务必在offer开学时间前申请，否则offer会有被取消的风险。一旦offer被取消，无法直接做延期操作，后续需要重新递交申请。</p>\",\"id\":38,\"isActive\":0,\"title\":\"【坎特伯雷大学】25年2月intake的晚报道及延期申请\",\"type\":4}', '{\"msg\":\"修改成功\",\"code\":200}', 0, NULL, '2025-02-10 13:33:30', 15);
INSERT INTO `sys_oper_log` VALUES (637, '消息', 1, 'com.xintong.controller.admin.MessageAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/message/add', '60.12.13.184', 'XX XX', '{\"content\":\"<p><span style=\\\"color: rgb(0, 0, 0); background-color: rgb(255, 255, 255); font-size: 24px;\\\"><strong>澳大利亚国立大学10周语言班最新信息</strong></span></p><p style=\\\"line-height: 1;\\\"><span style=\\\"font-size: 14px;\\\">ANU语言班与UCC合作提供，</span><span style=\\\"font-size: 14px;\\\"><strong>现开放给所有符合申请资格的学生</strong></span><span style=\\\"font-size: 14px;\\\">，</span></p><p>课程名称： UC English Language Program  <br>语言班时长：10周<br>最新开课时间：<span style=\\\"color: rgb(255, 0, 0);\\\"><strong>2025 年 4 月 21 日至 6 月 27 日</strong></span></p><p><span style=\\\"color: rgb(255, 0, 0);\\\"><strong>申请截止时间：2月14日，请于DDL前尽快递交申请</strong></span></p><p><span style=\\\"color: rgb(255, 0, 0);\\\"><strong>语言班offer接受截止时间：2月28日<br></strong></span>上课地点为：堪培拉大学学院布鲁斯校区 <br>入学要求：雅思6.0（5.5）；托福60（W18，S16，R8，L7） ；<br>详情请查看：<a href=\\\"https://study.anu.edu.au/apply/international-applications/new-english-language-program\\\" target=\\\"\\\">https://study.anu.edu.au/apply/international-applications/new-english-language-program</a></p><p><span style=\\\"color: rgb(255, 0, 0);\\\"><strong>下一期语言班预计4 月 21 日开放申请</strong></span></p><p>申请流程：</p><p>Step 1. Complete the PDF application form attached and send to <a href=\\\"https://app.experience.anu.edu.au/e/er?utm_source=Eloqua&utm_medium=eDM&utm_campaign=&utm_content=JAN25-ELICOS-AGENT-ANU&s=2105158753&lid=3339&elqTrackId=137E6F6336DC29F6AF096FB82F341485&elq=a51bebb9b21a4e62a67ab846f41c44ad&elqaid=2724&elqat=1&elqak=8AF5E218322CB39F28BD6015A7545CEF50517276863C06667ADC822664E716CB9DD0\\\" target=\\\"_blank\\\"><u>ucc.admissions@canberra.edu.au</u></a>. Attach your English Language test result and ANU’s conditional offer in the application.</p><p>Step 2. Accept the UC English Language Program offer sent to you and pay the tuition fees as stated in your offer letter.</p><p>Step 3. Accept the ANU conditional offer and pay the deposit.</p><p>Step 4. ANU will send two Confirmations of Enrolment, encompassing both the UC English Language Program and ANU program.</p>\",\"isActive\":0,\"title\":\"【澳国立-申请信息】10周语言班（4月21日）申请截止时间更新\",', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-10 13:39:25', 12);
