INSERT INTO `sys_oper_log` VALUES (663, '语言与标化', 2, 'com.xintong.controller.admin.LangAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/lang/edit', '60.12.13.184', 'XX XX', '{\"countryIds\":[1,125],\"details\":\"广泛用于美国及全球大学的本科入学评估。考试形式为机考，包含阅读与语法、数学。总分为1600分，其中阅读和语法800分，数学800分。总时长约为2小时14分钟。考试成绩无官方有效期限制。全年提供7个考试时间，出分时间为考试结束后两周(中国内地暂无考点)。\",\"eduIds\":[3],\"id\":9,\"isActive\":0,\"logo\":\"http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202412311731/SAT.png\",\"name\":\"SAT\",\"nameEn\":\"SAT\",\"subTitle\":\"Scholastic Assessment Test\"}', '{\"msg\":\"修改成功\",\"code\":200}', 0, NULL, '2025-02-11 10:58:18', 110);
INSERT INTO `sys_oper_log` VALUES (664, '语言与标化', 2, 'com.xintong.controller.admin.LangAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/lang/edit', '60.12.13.184', 'XX XX', '{\"countryIds\":[1,125],\"details\":\"美国广泛使用的大学入学标准化考试之一，考试形式为机考，包含英语、数学、阅读和科学推理四部分，总时长为2小时55分钟（不含写作）。考试总分为36分，各科单独计分后取平均值，成绩有效期为5年。全年提供7个考试时间，出分时间为考试结束后两周。\",\"eduIds\":[3],\"id\":8,\"isActive\":0,\"logo\":\"http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202412311731/ACT.png\",\"name\":\"ACT\",\"nameEn\":\"ACT\",\"subTitle\":\"American College Testing\"}', '{\"msg\":\"修改成功\",\"code\":200}', 0, NULL, '2025-02-11 10:58:34', 55);
INSERT INTO `sys_oper_log` VALUES (665, '语言与标化', 2, 'com.xintong.controller.admin.LangAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/lang/edit', '60.12.13.184', 'XX XX', '{\"countryIds\":[1,45,50,56,57,125],\"details\":\"考试形式分为机考或纸笔考，由听说读写四部分构成，每部分1-9分，最终得出平均总分。\\n总时长约2小时45分钟，成绩有效期2年。\\n机考场次较多，纸笔考每周末安排。机考考后3天出分，纸笔考考后10天出分。\\n建议参加雅思A类或UKVI A类，部分院校接受单项重考。\\n\",\"eduIds\":[2,3],\"id\":1,\"isActive\":0,\"logo\":\"http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202412311733/IELTS.png\",\"name\":\"雅思\",\"nameEn\":\"IELTS\",\"subTitle\":\"International English Language Testing System\"}', '{\"msg\":\"修改成功\",\"code\":200}', 0, NULL, '2025-02-11 10:58:48', 57);
INSERT INTO `sys_oper_log` VALUES (666, '语言与标化', 2, 'com.xintong.controller.admin.LangAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/lang/edit', '60.12.13.184', 'XX XX', '{\"countryIds\":[1,45,50,56,57,125],\"details\":\"由美国教育考试服务中心（ETS）开发，新托福网考（托福iBT）形式为机考，由听说读写4个部分构成，4个单项各30分，总分满分120分。考试总时长为2小时以内，成绩有效期为2年。每月安排多场考试，考试结束后4-8天内出分。\",\"eduIds\":[2,3],\"id\":2,\"isActive\":0,\"logo\":\"http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202412311733/tofel.png\\n\",\"name\":\"托福\",\"nameEn\":\"TOEFL\",\"subTitle\":\"Test of English as a Foreign Language\"}', '{\"msg\":\"修改成功\",\"code\":200}', 0, NULL, '2025-02-11 10:58:55', 57);
INSERT INTO `sys_oper_log` VALUES (667, '意向目的地基本要求', 1, 'com.xintong.controller.admin.RegionInfoAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/regionInfo/add', '10.10.110.37', '内网IP', '{\"advantages\":\"3\",\"appMaterial\":\"6\",\"budgetDetail\":\"5\",\"budgetRange\":\"2\",\"countryFeat\":\"&k-topic-s&&k-topic-e&1.教育质量优质：中国香港高校在全球范围内享有盛誉，“港前五”（香港大学、香港中文大学、香港科技大学、香港理工大学、香港城市大学）常年霸榜QS世界大学排名前100位；&K&&k-topic-s&2.地理和距离优势：&k-topic-e&对于中国内地学生来说，香港地理位置接近，交通便利，文化相似，更易于适应；\",\"eduId\":7,\"eduSystem\":\"4\",\"enrollTimeline\":\"\",\"rankUrl\":\"\",\"regionId\":55,\"regularProg\":\"1\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-11 11:02:33', 177);
