INSERT INTO `sys_oper_log` VALUES (669, '专业信息', 2, 'com.xintong.controller.admin.MajorAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/edit', '60.12.13.184', 'XX XX', '{\"details\":\"护理学是研究如何运用科学的护理方法和技能，促进、维护和恢复个体、家庭及社区健康的学科。它融合了基础护理、临床护理、社区护理、护理管理等多个领域，致力于培养具备扎实护理理论知识与熟练实践技能的专业人才，以满足社会对护理人才的多元需求。\",\"id\":50,\"level\":2,\"name\":\"护理学\",\"nameEn\":\"Nursing\",\"pageNum\":1,\"pageSize\":10,\"parentId\":5,\"subTitle\":\"知识守护生命，爱心传递健康\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-11 11:18:18', 42);
INSERT INTO `sys_oper_log` VALUES (670, '专业信息', 2, 'com.xintong.controller.admin.MajorAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/edit', '60.12.13.184', 'XX XX', '{\"details\":\"护理学是研究如何运用科学的护理方法和技能，促进、维护和恢复个体、家庭及社区健康的学科。它融合了基础护理、临床护理、社区护理、护理管理等多个领域，致力于培养具备扎实护理理论知识与熟练实践技能的专业人才，以满足社会对护理人才的多元需求。\",\"id\":50,\"level\":2,\"name\":\"护理学\",\"nameEn\":\"Nursing\",\"pageNum\":1,\"pageSize\":10,\"parentId\":5,\"subTitle\":\"护理学是一门聚焦于健康维护与促进的学科，学生将学习如何在复杂多变的健康情境下，运用专业知识和技能为个体、家庭及社区提供全方位的护理服务，以及如何通过科学护理手段预防疾病、缓解病痛、促进康复，实现人们身心健康水平的提升 。\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-11 11:21:06', 32);
INSERT INTO `sys_oper_log` VALUES (671, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"基础护理学深度聚焦护理学的基本理论、系统知识与核心技能。在理论层面，它详细阐述护理学的起源、发展历程、学科性质以及在现代医疗体系中的重要地位，使学生全面理解护理专业的内涵与价值。知识体系涵盖基础医学知识，如人体解剖学、生理学、病理学等在护理实践中的应用，以及护理专业独有的知识，如护理程序、护理评估方法等。在技能培养上，着重训练学生的基础护理操作能力，涵盖生命体征测量、无菌技术操作、静脉输液、导尿术等一系列临床常用且关键的操作技能。同时，通过案例分析、模拟场景训练等多样化教学方式，着重培养学生的护理思维。引导学生从整体护理的角度出发，思考患者的生理、心理、社会等多方面需求，学会在复杂的临床情境中运用批判性思维分析和解决问题，为后续专业课程的学习和临床实践奠定坚实基础。\",\"id\":90,\"level\":3,\"name\":\"基础护理学\",\"nameEn\":\"Fundamental Nursing\",\"pageNum\":1,\"pageSize\":10,\"parentId\":50}', NULL, 1, '\n### Error updating database.  Cause: com.mysql.cj.jdbc.exceptions.MysqlDataTruncation: Data truncation: Data too long for column \'details\' at row 1\n### The error may exist in com/xintong/mapper/MajorInfoMapper.java (best guess)\n### The error may involve com.xintong.mapper.MajorInfoMapper.insert-Inline\n### The error occurred while setting parameters\n### SQL: INSERT INTO consult_major_info  ( major_id, major_name, major_name_en,  details,    is_deleted, created_by, created_at, updated_by, updated_at )  VALUES  ( ?, ?, ?,  ?,    ?, ?, ?, ?, ? )\n### Cause: com.mysql.cj.jdbc.exceptions.MysqlDataTruncation: Data truncation: Data too long for column \'details\' at row 1\n; Data truncation: Data too long for column \'details\' at row 1; nested exception is com.mysql.cj.jdbc.exceptions.MysqlDataTruncation: Data truncation: Data too long for column \'details\' at row 1', '2025-02-11 11:24:31', 168);
