INSERT INTO `sys_oper_log` VALUES (683, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"专注于社区健康服务的理论与实践，让学生掌握在社区开展健康促进、疾病预防和慢性病管理的技能。\",\"id\":100,\"level\":3,\"name\":\"社区护理学\",\"nameEn\":\"Community Health Nursing\",\"pageNum\":1,\"pageSize\":10,\"parentId\":50}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-11 11:32:21', 38);
INSERT INTO `sys_oper_log` VALUES (684, '语言与标化', 1, 'com.xintong.controller.admin.LangAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/lang/add', '60.12.13.184', 'XX XX', '{\"countryIds\":[125],\"details\":\"针对报考日本大学的外国留学生考试。日本大学招生时会将这个成绩作为日语能力及基础学科能力的参考，设有分数线，每个学校对这一考试成绩的要求不一样。\\n\\n全部的日本国立、公立大学和超过半数的私立大学都要求外国留学生在申请入读大学本科时，首先要提交参加EJU（留考）成绩，作为基本审查条件。私立艺术类大部分需要EJU日语单科成绩。\\n\\n另外，留学生进入大学后如要申请政府奖学金或国公立大学的学费减免，是否参加过EJU和EJU成绩也是重要评定标准。\\n\\n该考试由独立行政法人日本学生支援机构实施，每年6月、11月举行两次。\",\"eduIds\":[3],\"isActive\":0,\"logo\":\"http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202502111132/EJU.jpg\",\"name\":\"EJU留考\",\"nameEn\":\"EJU\",\"subTitle\":\"Examination for Japanese University Admission for International Students\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-11 11:32:25', 41);
