INSERT INTO `sys_oper_log` VALUES (686, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"研究护理管理的理论与实践，旨在培养学生的护理团队管理、护理质量控制和护理资源分配能力。\",\"id\":101,\"level\":3,\"name\":\"护理管理学\",\"nameEn\":\"Nursing Management\",\"pageNum\":1,\"pageSize\":10,\"parentId\":50}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-11 11:33:04', 39);
INSERT INTO `sys_oper_log` VALUES (687, '语言与标化', 2, 'com.xintong.controller.admin.LangAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/lang/edit', '60.12.13.184', 'XX XX', '{\"countryIds\":[125],\"details\":\"全部的日本国立、公立大学和超过半数的私立大学都要求外国留学生在申请入读大学本科时，首先要提交参加EJU留考成绩，作为基本审查条件。私立艺术类大部分需要EJU日语单科成绩。另外，留学生进入大学后如要申请政府奖学金或国公立大学的学费减免，是否参加过EJU和EJU成绩也是重要评定标准。\\n该考试由独立行政法人日本学生支援机构实施，每年6月、11月举行两次。\",\"eduIds\":[3],\"id\":15,\"isActive\":0,\"logo\":\"http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202502111132/EJU.jpg\",\"name\":\"EJU留考\",\"nameEn\":\"EJU\",\"subTitle\":\"Examination for Japanese University Admission for International Students\"}', '{\"msg\":\"修改成功\",\"code\":200}', 0, NULL, '2025-02-11 11:36:33', 69);
INSERT INTO `sys_oper_log` VALUES (688, '语言与标化', 1, 'com.xintong.controller.admin.LangAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/lang/add', '60.12.13.184', 'XX XX', '{\"countryIds\":[125],\"details\":\"日语能力测试（JLPT）是对日本国内及海外以母语非日语学习者为对象进行的日语能力测试和认定。\\n• 语言等级：N5、N4、N3、N2、N1\\n• 考试地点：日本和国内均设有考点\\n• 出分时间：考后一个月\\n• 考试形式：纸考，每次仅限报名一个级别。\\nN5、N4考试分语言知识（文字、词汇、语法）、阅读&听力2个科目；N3、N2、N1考试分语言知识（文字、词汇）、语言知识（文字、词汇、语法）、阅读&听力3个科目，满分均为180分，其中大学本科入学语言等级要求最低N2。\",\"eduIds\":[3],\"isActive\":0,\"name\":\"日本语能力测试\",\"nameEn\":\"JLPT\",\"subTitle\":\"The Japanese-Language Proficiency Test\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-11 11:40:32', 51);
