INSERT INTO `sys_oper_log` VALUES (690, '语言与标化', 2, 'com.xintong.controller.admin.LangAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/lang/edit', '60.12.13.184', 'XX XX', '{\"countryIds\":[125],\"details\":\"日语能力测试（JLPT）是对日本国内及海外以母语非日语学习者为对象进行的日语能力测试和认定。\\n（1）语言等级：N5、N4、N3、N2、N1\\n（2）考试地点：日本和国内均设有考点\\n（3）出分时间：考后一个月\\n（4）考试形式：纸考，每次仅限报名一个级别。\\n满分均为180分，其中大学本科入学语言等级要求最低N2。\",\"eduIds\":[3],\"id\":16,\"isActive\":0,\"name\":\"日本语能力测试\",\"nameEn\":\"JLPT\",\"subTitle\":\"The Japanese-Language Proficiency Test\"}', '{\"msg\":\"修改成功\",\"code\":200}', 0, NULL, '2025-02-11 11:44:46', 58);
INSERT INTO `sys_oper_log` VALUES (691, '语言与标化', 1, 'com.xintong.controller.admin.LangAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/lang/add', '60.12.13.184', 'XX XX', '{\"countryIds\":[125],\"details\":\"中国普通高等学校招生全国统一考试，简称“高考”，是合格的高中毕业生或具有同等学力的考生参加的选拔性考试。主要科目有：语文、数学、外语。其中，高考英语总分150分。中国香港地区部分高校和中国澳门地区高校，接受普高生使用高考英语成绩申请。\",\"eduIds\":[3],\"isActive\":0,\"name\":\"高考\",\"nameEn\":\"普通高等学校招生全国统一考试\",\"subTitle\":\"GAOKAO\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-11 11:56:09', 46);
