INSERT INTO `sys_oper_log` VALUES (693, '语言与标化', 2, 'com.xintong.controller.admin.LangAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/lang/edit', '60.12.13.184', 'XX XX', '{\"countryIds\":[125],\"details\":\"日语能力测试（JLPT）是对日本国内及海外以母语非日语学习者为对象进行的日语能力测试和认定。\\n（1）语言等级：N5、N4、N3、N2、N1\\n（2）考试地点：日本和国内均设有考点\\n（3）出分时间：考后一个月\\n（4）考试形式：纸考，每次仅限报名一个级别。\\n满分均为180分，其中大学本科入学语言等级要求最低N2。\",\"eduIds\":[3],\"id\":16,\"isActive\":0,\"logo\":\"http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202502111201/JLPT.jpg\",\"name\":\"日本语能力测试\",\"nameEn\":\"JLPT\",\"subTitle\":\"The Japanese-Language Proficiency Test\"}', '{\"msg\":\"修改成功\",\"code\":200}', 0, NULL, '2025-02-11 12:01:55', 64);
INSERT INTO `sys_oper_log` VALUES (694, '专业信息', 2, 'com.xintong.controller.admin.MajorAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/edit', '60.12.13.184', 'XX XX', '{\"details\":\"护理学是研究如何运用科学的护理方法和技能，促进、维护和恢复个体、家庭及社区健康的学科。它融合了基础护理、临床护理、社区护理、护理管理等多个领域，致力于培养具备扎实护理理论知识与熟练实践技能的专业人才，以满足社会对护理人才的多元需求。\",\"id\":50,\"level\":2,\"name\":\"护理学\",\"nameEn\":\"Nursing\",\"pageNum\":1,\"pageSize\":10,\"parentId\":5,\"subTitle\":\"护理学是一门聚焦于健康维护与促进的学科，学生将学习如何在复杂多变的健康情境下，运用专业知识和技能为个体、家庭及社区提供全方位的护理服务，以及如何通过科学护理手段预防疾病、缓解病痛、促进康复，实现人们身心健康水平的提升 。\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-11 12:16:40', 32);
