INSERT INTO `sys_oper_log` VALUES (702, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"研究疾病发生、发展过程中的功能和代谢变化，分析疾病的病因、发病机制、病理变化和转归。帮助学生理解疾病状态下人体的异常生理过程，以便在护理中更好地观察病情、实施护理措施。\",\"isActive\":1,\"majorId\":50,\"name\":\"病理生理学\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-11 13:20:48', 12);
