INSERT INTO `sys_oper_log` VALUES (744, '专业行业就业方向', 1, 'com.xintong.controller.admin.MajorJobAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/job/add', '60.12.13.184', 'XX XX', '{\"company\":\"康复中心、医院康复科等。\",\"description\":\"康复护理\",\"majorId\":50,\"majorName\":\"护理学\",\"position\":\"帮助病人进行功能恢复训练，促进身体和心理康复。\"}', '{\"msg\":\"添加成功\",\"code\":200}', 0, NULL, '2025-02-11 15:11:08', 12);
INSERT INTO `sys_oper_log` VALUES (745, '专业信息', 2, 'com.xintong.controller.admin.MajorAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/edit', '60.12.13.184', 'XX XX', '{\"details\":\"医学是一门致力于维护人类生命健康、预防和治疗疾病的综合性学科。它融合了自然科学、社会科学与人文科学，涵盖基础医学、临床医学、预防医学、药学、护理学等领域，通过研究人体生理病理机制及疾病发展规律，运用诊断、治疗、康复等手段提升人类健康水平。\",\"id\":49,\"level\":2,\"name\":\"医学\",\"nameEn\":\"Medicine\",\"pageNum\":1,\"pageSize\":10,\"parentId\":5,\"subTitle\":\"医学类专业是一门研究人体健康维护与疾病防治的学科，学生将学习如何在复杂生理环境下进行病症的精准诊断，以及如何运用医疗手段，促进机体康复。\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-11 15:32:31', 29);
INSERT INTO `sys_oper_log` VALUES (746, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"研究人体正常结构与功能、疾病发生机制，为临床医学提供理论基础。\",\"id\":102,\"level\":3,\"name\":\"基础医学\",\"nameEn\":\"Basic Medicine\",\"pageNum\":1,\"pageSize\":10,\"parentId\":49}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-11 15:33:41', 39);
