INSERT INTO `sys_oper_log` VALUES (760, '消息', 1, 'com.xintong.controller.admin.MessageAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/message/add', '60.12.13.184', 'XX XX', '{\"content\":\"<p><span style=\\\"color: rgb(0, 0, 0); background-color: rgb(255, 255, 255); font-size: 24px;\\\"><strong>澳大利亚国立大学ANU系统与社会学院部分项目取消通知</strong></span></p><p><span style=\\\"color: rgb(0, 0, 0); background-color: rgb(255, 255, 255); font-size: 14px;\\\">澳大利亚国立大学系统与社会学院（ANU College of Systems and Society）以下项目将取消，具体信息如下：<br>👉应用数据分析研究生证书（Grad Cert Applied Data Analytics）<br>学制0.5年，最后招生学期：2025年S1。<br>👉应用数据分析研究生文凭（Grad Dip Applied Data Analytics）<br>学制1年，最后招生学期：2025年S1。<br>👉应用数据分析硕士（M Applied Data Analytics）<br>学制1.5年，最后招生学期：2025年S1。<br>👉能源系统工程硕士（M Engineering in Energy Systems）<br>工程机器人自动化与控制硕士（M Engineering Robotics Automation and Control）<br>以上两项学制2年，最后招生学期：2024年S2。<br><br>请相关申请者注意调整计划，具体安排可咨询学院官方。</span></p>\",\"isActive\":0,\"title\":\"【澳国立-申请更新】ANU系统与社会学院部分项目取消通知\",\"type\":4}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-11 15:41:17', 18);
