INSERT INTO `sys_oper_log` VALUES (806, '专业信息', 2, 'com.xintong.controller.admin.MajorAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/edit', '60.12.13.184', 'XX XX', '{\"details\":\"兽医学是一门综合性学科，主要致力于维护动物的生命健康，涵盖预防、诊断和治疗动物疾病等多个关键领域。它紧密结合生物学、医学、化学等多学科知识，深入探究动物的生理和病理机制，精准把握各类疾病的发生发展规律，进而运用一系列专业手段，保障动物健康，推动畜牧产业的稳定发展，同时也为公共卫生安全筑牢防线。\",\"id\":48,\"level\":2,\"name\":\"兽医学\",\"nameEn\":\"Veterinary Medicine\",\"pageNum\":1,\"pageSize\":10,\"parentId\":5,\"subTitle\":\"兽医学是一门研究动物机体健康维护的学科，学生将学习如何在复杂疫病环境下进行病情的准确判断，以及如何运用医疗技术，保障动物健康。\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-11 16:07:05', 28);
INSERT INTO `sys_oper_log` VALUES (807, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"基础兽医学是兽医学的理论基石，主要研究动物的正常生理结构和功能，以及疾病发生发展的基本机制。\",\"id\":112,\"level\":3,\"name\":\"基础兽医学\",\"nameEn\":\"Basic Veterinary Medicine\",\"pageNum\":1,\"pageSize\":10,\"parentId\":48}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-11 16:07:57', 38);
INSERT INTO `sys_oper_log` VALUES (808, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"预防兽医学以动物群体为研究对象，旨在通过预防措施减少疾病的发生和传播。\",\"id\":113,\"level\":3,\"name\":\"预防兽医学\",\"nameEn\":\"Preventive Veterinary Medicine\",\"pageNum\":1,\"pageSize\":10,\"parentId\":48}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-11 16:08:21', 42);
INSERT INTO `sys_oper_log` VALUES (809, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"临床兽医学直接面向患病动物，开展疾病诊断、治疗和预防工作。\",\"id\":114,\"level\":3,\"name\":\"临床兽医学\",\"nameEn\":\"Clinical Veterinary Medicine\",\"pageNum\":1,\"pageSize\":10,\"parentId\":48}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-11 16:09:15', 40);
INSERT INTO `sys_oper_log` VALUES (810, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"兽医公共卫生学聚焦于动物源性食品安全、人畜共患病防控以及动物卫生与公共卫生之间的紧密关系。\",\"id\":115,\"level\":3,\"name\":\"兽医公共卫生学\",\"nameEn\":\"Veterinary Public Health\",\"pageNum\":1,\"pageSize\":10,\"parentId\":48}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-11 16:09:38', 38);
INSERT INTO `sys_oper_log` VALUES (811, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"兽医药学专注于兽药的研发、生产、质量控制以及临床合理应用。\",\"id\":116,\"level\":3,\"name\":\"兽医药学\",\"nameEn\":\"Veterinary Pharmacology\",\"pageNum\":1,\"pageSize\":10,\"parentId\":48}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-11 16:09:57', 38);
INSERT INTO `sys_oper_log` VALUES (812, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"研究动物体的形态结构和组织器官的分布，为理解动物生理功能和疾病发生机制提供基础。课程通常包括骨骼、肌肉、内脏器官等的解剖知识。\",\"isActive\":1,\"majorId\":48,\"name\":\"动物解剖学\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-11 16:10:41', 11);
INSERT INTO `sys_oper_log` VALUES (813, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"探讨动物体内各种生理过程及其相互关系，包括循环系统、呼吸系统、消化系统、内分泌系统等的功能。帮助学生理解动物生命活动的基本规律。\",\"isActive\":1,\"majorId\":48,\"name\":\"动物生理学\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-11 16:10:52', 11);
INSERT INTO `sys_oper_log` VALUES (814, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"研究与动物疾病相关的微生物，包括细菌、病毒、真菌和寄生虫等。课程内容涵盖微生物的形态结构、生理功能、致病机制以及实验室检测方法。\",\"isActive\":1,\"majorId\":48,\"name\":\"兽医微生物学\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-11 16:11:04', 11);
INSERT INTO `sys_oper_log` VALUES (815, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"研究药物在动物体内的作用机制、药代动力学和药效学，以及药物的临床应用和不良反应。课程帮助学生掌握合理用药的原则和方法。\",\"isActive\":1,\"majorId\":48,\"name\":\"兽医药理学\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-11 16:11:19', 11);
INSERT INTO `sys_oper_log` VALUES (816, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"研究动物疾病发生的原因、发病机制、病理变化和转归规律。课程内容包括组织病理学、细胞病理学和分子病理学等，为疾病诊断和治疗提供理论支持。\",\"isActive\":1,\"majorId\":48,\"name\":\"兽医病理学\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-11 16:11:32', 11);
INSERT INTO `sys_oper_log` VALUES (817, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"培养学生的基本临床操作技能，如动物保定、采血、注射、缝合等。课程通常结合实践教学，帮助学生掌握实际操作能力。\",\"isActive\":1,\"majorId\":48,\"name\":\"兽医临床技能\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-11 16:11:48', 11);
INSERT INTO `sys_oper_log` VALUES (818, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"研究动物疾病对公共卫生的影响，包括人畜共患病的防控、食品安全、动物检疫等。课程内容强调动物健康与人类健康的紧密联系。\",\"isActive\":1,\"majorId\":48,\"name\":\"兽医公共卫生\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-11 16:12:01', 11);
