INSERT INTO `sys_oper_log` VALUES (831, '专业信息', 2, 'com.xintong.controller.admin.MajorAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/edit', '60.12.13.184', 'XX XX', '{\"details\":\"农学是一门综合性学科，主要研究农作物的种植、培育、管理和利用，以及农业生态系统和农村经济的发展。它涵盖了植物学、遗传学、土壤学、生态学、农业经济学等多个学科领域，旨在培养具有扎实农业科学知识和实践能力的人才，以满足社会对粮食安全、农业可持续发展和乡村振兴的需求。\",\"id\":47,\"level\":2,\"name\":\"农学\",\"nameEn\":\"Agriculture\",\"pageNum\":1,\"pageSize\":10,\"parentId\":5,\"subTitle\":\"农学是一门研究农作物生长发育规律与农业生产高效管理的学科，学生将学习如何在多变自然条件下进行农作物的科学种植，以及如何运用农业技术，提升作物产量与品质。\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-11 16:28:19', 31);
