INSERT INTO `sys_oper_log` VALUES (864, '专业信息', 2, 'com.xintong.controller.admin.MajorAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/edit', '60.12.13.184', 'XX XX', '{\"details\":\"大健康类专业是一门综合性学科，聚焦于全方位维护和促进人类身心健康，涵盖健康维护、疾病预防、康复治疗、健康服务管理等领域。该领域不仅关注个体生理健康，还涉及心理健康、社会适应、环境健康及健康政策等维度，旨在培养具备医学知识、健康管理技能和创新能力的专业人才，以应对全球健康挑战，推动健康产业发展。\",\"id\":46,\"level\":2,\"name\":\"大健康类\",\"nameEn\":\"Health Sciences\",\"pageNum\":1,\"pageSize\":10,\"parentId\":5,\"subTitle\":\"大健康类专业是一门研究全方位维护和促进人类身心健康的学科，学生将学习如何在多元生活场景下进行健康风险的有效评估，以及如何综合运用健康管理、营养干预和心理疏导等手段，提升个体和群体的健康水平。\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-11 17:04:08', 32);
