INSERT INTO `sys_oper_log` VALUES (930, '意向目的地基本要求', 2, 'com.xintong.controller.admin.RegionInfoAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/regionInfo/edit', '60.12.13.184', 'XX XX', '{\"advantages\":\"离家近、好适应、费用低、专业限制小、名校机会大、学历认可度高、发展前景广阔\",\"appMaterial\":\"日语授课项目：高中三年成绩单、毕业证、推荐信、简历、EJU成绩/日语成绩等&K&SGU项目：高中三年成绩单、毕业证、推荐信、简历、托福/雅思成绩、高考/SAT/ACT等标化成绩等\",\"budgetDetail\":\"总预算10~15万人民币/年\",\"budgetRange\":\"学费：国公立大学2~3万人民币/年，私立大学3~5万人民币/年居多。&K&生活费：8~10万/年（地区不同有所差异）。\",\"countryFeat\":\"&k-topic-s&【距离近】：&k-topic-e&与中国一衣带水，距离近，往返方便。&K&&k-topic-s&【生活习俗相似】：&k-topic-e&生活习俗与中国相似度高，更容易适应。&K&&k-topic-s&【语言易学习】：&k-topic-e&日语中汉字含量极高，语言互通性强，容易学习。&K&&k-topic-s&【升学机会多】：&k-topic-e&更多升学可能性，普高、中专、职高、技校生同等升学机会；日语授课无需高考成绩，单独开设留学生升学通道，名校升学机会更多。&K&&k-topic-s&【性价比高】：&k-topic-e&留学性价比高，学费低廉，奖学金丰富，还可合法打工。&K&&k-topic-s&【英文授课制】：&k-topic-e&开设英文授课项目，无日语基础也可赴日留学。&K&&k-topic-s&【就业前景好】：&k-topic-e&学历国际公认，回国可以认证，就业发展空间巨大；毕业后留日就业政策利好，可获工作签证。&K&&k-topic-s&【可申请永居】：&k-topic-e&在日居留 10 年(部分高度人才 5 年，最快1年)，可申请永久居住权。\",\"createdAt\":\"2025-02-11 10:46:35\",\"createdBy\":\"admin\",\"eduSystem\":\"通常四年，医学、牙医学、兽医学、部分药学类专业学制为6年\",\"id\":15,\"isActive\":0,\"isDeleted\":0,\"rankUrl\":\"\",\"regularProg\":\"通常四年，医学、牙医学、兽医学、部分药学类专业学制为6年。\",\"updatedAt\":\"2025-02-11 10:54:50\",\"updatedBy\":\"admin\"}', '{\"msg\":\"修改成功\",\"code\":200}', 0, NULL, '2025-02-12 10:38:22', 11);
INSERT INTO `sys_oper_log` VALUES (931, '专业信息', 2, 'com.xintong.controller.admin.MajorAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/edit', '60.12.13.184', 'XX XX', '{\"details\":\"体育类专业是一门综合性学科，主要研究体育运动的理论与实践，涵盖体育教学、训练、竞赛、管理、康复等多个领域。它旨在培养具备扎实体育专业知识、实践能力和创新精神的人才，以满足社会对体育教育、竞技体育、全民健身和体育产业发展等方面的需求。体育类专业不仅关注运动员的训练和比赛，还致力于提升全民体育素养，推动体育强国建设。\",\"id\":45,\"level\":2,\"name\":\"体育类\",\"nameEn\":\"Sport Science\",\"pageNum\":1,\"pageSize\":10,\"parentId\":5,\"subTitle\":\"体育类专业是以人体运动科学为核心，融合管理学、医学、心理学、数据分析等多学科的交叉领域，旨在培养能够推动竞技体育、大众健康、体育商业等全产业链发展的复合型人才。\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 10:38:35', 26);
