INSERT INTO `sys_oper_log` VALUES (1038, '专业信息', 2, 'com.xintong.controller.admin.MajorAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/edit', '60.12.13.184', 'XX XX', '{\"details\":\"戏剧与影视专业是一门综合性学科，主要研究戏剧、电影、电视等艺术形式的理论与实践，涵盖剧本创作、表演、导演、制作、影视技术、影视批评等多个领域。它旨在培养具备扎实戏剧与影视专业知识、实践能力和创新精神的人才，以满足社会对戏剧、影视创作、制作、传播和产业发展等方面的需求。戏剧与影视专业不仅关注艺术创作与表演，还致力于推动影视文化的传播与影视产业的发展。\",\"id\":44,\"level\":2,\"name\":\"戏剧与影视\",\"nameEn\":\"Drama and Theatre Arts\",\"pageNum\":1,\"pageSize\":10,\"parentId\":4,\"subTitle\":\"综合性学科，培养专业人才，推动文化与产业共荣\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 11:19:18', 28);
