INSERT INTO `sys_oper_log` VALUES (1052, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"研究影视作品的艺术风格与美学理论，探讨影视艺术的审美特征、表现形式与审美价值。帮助学生建立正确的审美观念，提高对影视作品的鉴赏能力和艺术品味，为创作具有美学价值的作品提供理论支持。\",\"isActive\":1,\"majorId\":44,\"name\":\"影视美学\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-12 11:24:34', 11);
