INSERT INTO `sys_oper_log` VALUES (1054, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"教授影视作品的分析与批评方法，培养学生对影视作品的批判性思维和分析能力。通过学习，学生能够从不同角度对作品进行深入剖析，提出有见地的批评和建议，为影视创作和产业发展提供参考。\",\"isActive\":1,\"majorId\":44,\"name\":\"影视批评\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-12 11:24:56', 11);
