INSERT INTO `sys_oper_log` VALUES (1056, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"介绍影视产业的法律法规与政策，包括版权法、合同法、产业政策等内容。使学生了解影视行业的法律规范和政策环境，能够在合法合规的框架内开展创作和经营活动，为产业发展提供法律保障。\",\"isActive\":1,\"majorId\":44,\"name\":\"影视法律与政策\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-12 11:25:10', 10);
