INSERT INTO `sys_oper_log` VALUES (1075, '专业信息', 2, 'com.xintong.controller.admin.MajorAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/edit', '60.12.13.184', 'XX XX', '{\"details\":\"美术学是一门研究艺术创作、艺术理论与文化传承的综合性学科，涵盖绘画、雕塑、设计、美术教育、美术史论等多个领域。其目标是通过系统训练，培养学生掌握艺术创作技能、审美判断能力与创新思维，同时深入理解艺术的历史脉络与社会文化价值，为社会输送能够在艺术创作、教育、研究及文化产业中发挥作用的专业人才。\",\"id\":43,\"level\":2,\"name\":\"美术\",\"nameEn\":\"Fine Art\",\"pageNum\":1,\"pageSize\":10,\"parentId\":4,\"subTitle\":\"美术专业研究视觉艺术表达与审美创造。学生学习多元语境下创意构思与技法实践，运用绘画、雕塑、设计等形式传递情感、塑造形象，推动文化艺术发展。\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 13:31:29', 32);
INSERT INTO `sys_oper_log` VALUES (1076, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"研究油画、国画、版画等绘画形式的材料、技法与风格演变，培养学生通过视觉语言表达个人艺术观念的能力。\",\"id\":141,\"level\":3,\"name\":\"绘画\",\"nameEn\":\"Painting\",\"pageNum\":1,\"pageSize\":10,\"parentId\":43}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 13:32:21', 37);
INSERT INTO `sys_oper_log` VALUES (1077, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"探索雕塑材料的运用（如石材、金属、木材等）、造型原理及空间艺术表达，涵盖传统雕塑与现代装置艺术的创作实践。\",\"id\":142,\"level\":3,\"name\":\"雕塑\",\"nameEn\":\"Sculpture\",\"pageNum\":1,\"pageSize\":10,\"parentId\":43}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 13:32:36', 36);
