INSERT INTO `sys_oper_log` VALUES (1113, '专业信息', 2, 'com.xintong.controller.admin.MajorAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/edit', '60.12.13.184', 'XX XX', '{\"details\":\"音乐是通过有组织的音符表达情感、思想和文化的一种艺术形式。它涵盖了作曲、演奏、演唱、音乐理论研究、音乐教育等多个方面，旨在培养学生的音乐感知能力、创造力和表现力，以满足社会对音乐艺术人才的需求。\",\"id\":42,\"level\":2,\"name\":\"音乐\",\"nameEn\":\"Music\",\"pageNum\":1,\"pageSize\":10,\"parentId\":4,\"subTitle\":\"音乐专业是一门研究音乐创作与表达的学科，学生将学习如何在多元音乐风格中进行旋律创作、和声运用，以及如何通过演唱、演奏等方式，展现音乐魅力、传递情感并传承音乐文化。\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 14:03:07', 80);
INSERT INTO `sys_oper_log` VALUES (1114, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"研究音乐的历史、理论和文化，包括中西方音乐史、民间音乐、音乐美学等内容，旨在深入理解音乐的发展脉络和文化内涵。\",\"id\":147,\"level\":3,\"name\":\"音乐学\",\"nameEn\":\"Musicology\",\"pageNum\":1,\"pageSize\":10,\"parentId\":42}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 14:03:49', 65);
INSERT INTO `sys_oper_log` VALUES (1115, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"结合音乐与管理知识，培养学生在艺术组织、市场推广、活动策划等方面的能力，为音乐产业的运营管理提供专业支持。\",\"id\":148,\"level\":3,\"name\":\"音乐艺术管理\",\"nameEn\":\"Music and Arts Management\",\"pageNum\":1,\"pageSize\":10,\"parentId\":42}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 14:04:04', 46);
