INSERT INTO `sys_oper_log` VALUES (1117, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"培养学生在音乐、器乐、舞蹈、表演、指挥等方面的能力，掌握不同风格及体裁音乐作品的分析方法和演绎技巧。\",\"id\":150,\"level\":3,\"name\":\"音乐教育学\",\"nameEn\":\"Musical Performances\",\"pageNum\":1,\"pageSize\":10,\"parentId\":42}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 14:04:38', 45);
