INSERT INTO `sys_oper_log` VALUES (1178, '专业信息', 2, 'com.xintong.controller.admin.MajorAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/edit', '60.12.13.184', 'XX XX', '{\"details\":\"食品科学与工程是一门综合性学科，它结合了生命科学和工程科学的知识体系，旨在通过研究和应用于食品加工、贮藏、包装、检验以及食品安全等领域来提高食品的质量与安全，同时满足社会对营养健康食品的需求。该专业具有交叉性、实用性和创新性的特点，为学生提供了宽广的知识面和多领域的适应能力，培养学生的实践技能和创新思维。\",\"id\":40,\"level\":2,\"name\":\"食品科学与工程\",\"nameEn\":\"Food Science and Technology\",\"pageNum\":1,\"pageSize\":10,\"parentId\":3,\"subTitle\":\"食品安全的最佳守卫者\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 15:17:53', 38);
INSERT INTO `sys_oper_log` VALUES (1179, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"研究化学、生物学、食品工程和食品技术等方面的基本知识和技能，在食品领域内进行食品生产技术管理、产品开发、工程设计、品质控制、科学研究等。\",\"id\":160,\"level\":3,\"name\":\"食品科学与工程\",\"nameEn\":\"Food Science and Engineering\",\"pageNum\":1,\"pageSize\":10,\"parentId\":40}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 15:18:21', 40);
INSERT INTO `sys_oper_log` VALUES (1180, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"以生命科学和食品科学为基础，专门研究食品营养保障、食品质量控制、食品安全管理的应用型学科，通过对食品生产、加工和储藏各个环节的管理和控制，保证食品的营养品质和卫生质量。\",\"id\":161,\"level\":3,\"name\":\"食品质量与安全\",\"nameEn\":\"Food Quality and Safety\",\"pageNum\":1,\"pageSize\":10,\"parentId\":40}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 15:18:38', 41);
INSERT INTO `sys_oper_log` VALUES (1181, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"研究生物学和食品工程学等方面的基本知识和技能，包括粮食与制品加工和储藏过程中所发生的化学、微生物、物理性等变化、粮油产品加工工艺与装备、粮食储藏与运输等。\",\"id\":162,\"level\":3,\"name\":\"粮食工程\",\"nameEn\":\"Grain Engineering\",\"pageNum\":1,\"pageSize\":10,\"parentId\":40}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 15:18:53', 42);
INSERT INTO `sys_oper_log` VALUES (1182, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"研究生物化学、乳品化学、乳品微生物、乳品加工、食品营养等方面的基本知识和技能，在乳品加工行业进行乳制品加工、研发、品质检测等。\",\"id\":163,\"level\":3,\"name\":\"乳品工程\",\"nameEn\":\"Dairy Engineering\",\"pageNum\":1,\"pageSize\":10,\"parentId\":40}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 15:19:08', 40);
INSERT INTO `sys_oper_log` VALUES (1183, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"研究葡萄酒的酿造工艺、质量检测、鉴赏艺术、营销管理等方面的基本知识和技能，涉及生物学、化学、微生物学、食品科学、工程学、文化艺术等多个领域，进行葡萄酒的生产、检测、鉴赏、推广、营销等。\",\"id\":164,\"level\":3,\"name\":\"酿酒工程\",\"nameEn\":\"Wine Engineering\",\"pageNum\":1,\"pageSize\":10,\"parentId\":40}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 15:19:22', 41);
INSERT INTO `sys_oper_log` VALUES (1184, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"研究食品科学与工程食品法规与标准、食品质量管理、食品安全检测等方面的基本知识和技能，对食品生产、加工的过程进行安全管理和质量控制，对食品的营养进行提高和合理配比等。\",\"id\":165,\"level\":3,\"name\":\"食品营养与检验教育\",\"nameEn\":\"Food Nutrition and Inspection Education\",\"pageNum\":1,\"pageSize\":10,\"parentId\":40}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 15:19:36', 41);
INSERT INTO `sys_oper_log` VALUES (1185, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"研究烹饪、营养、管理和教育等方面的基本知识和技能，进行食品营养的研究、餐饮企业的管理、高职高专院校的教学等。\",\"id\":166,\"level\":3,\"name\":\"烹饪与营养教育\",\"nameEn\":\"Culinary and Nutrition Education\",\"pageNum\":1,\"pageSize\":10,\"parentId\":40}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 15:19:53', 41);
