INSERT INTO `sys_oper_log` VALUES (1232, '专业信息', 2, 'com.xintong.controller.admin.MajorAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/edit', '60.12.13.184', 'XX XX', '{\"details\":\"环境工程是一门致力于解决环境问题、实现可持续发展的交叉学科。它融合了工程学、化学、生物学、物理学等多学科知识，旨在培养具备污染防治、环境规划、资源保护以及可持续发展理念的高级应用型人才。学生不仅要掌握扎实的理论知识，还需具备将其应用于实际项目的能力，以应对复杂多样的环境挑战。\",\"id\":39,\"level\":2,\"name\":\"环境科学\",\"nameEn\":\"Environmental Science\",\"pageNum\":1,\"pageSize\":10,\"parentId\":3,\"subTitle\":\"守护生态环境，开启可持续未来\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 15:56:39', 32);
INSERT INTO `sys_oper_log` VALUES (1233, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"聚焦自然资源的保护与合理利用，以及环境污染的防治和环境质量的提升。学生需掌握环境工程建设、环境监测、污染防治等方面的专业技能，如设计污水处理厂、监测大气污染物浓度等。\",\"id\":167,\"level\":3,\"name\":\"环境工程\",\"nameEn\":\"Environmental Engineering\",\"pageNum\":1,\"pageSize\":10,\"parentId\":39}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 15:57:05', 42);
INSERT INTO `sys_oper_log` VALUES (1234, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"着重研究水在社会循环过程中的水质变化规律与控制技术。该专业涉及化学、化工、材料、计算机等多个学科领域，培养学生在水净化、水质分析监测、水污染防治等方面的能力，例如设计高效的水处理系统。\",\"id\":168,\"level\":3,\"name\":\"水质科学与技术\",\"nameEn\":\"Water Quality Science and Technology\",\"pageNum\":1,\"pageSize\":10,\"parentId\":39}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 15:57:23', 44);
INSERT INTO `sys_oper_log` VALUES (1235, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"将环境学与生态学原理相结合，运用工程学手段进行污染防治和生态保护。学生通过学习，能够利用生态系统的自我修复能力，设计生态修复工程，恢复受损的生态环境。\",\"id\":169,\"level\":3,\"name\":\"环境生态工程\",\"nameEn\":\"Environmental Ecological Engineering\",\"pageNum\":1,\"pageSize\":10,\"parentId\":39}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 15:57:49', 40);
INSERT INTO `sys_oper_log` VALUES (1236, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"专注于环保设备的研究，涵盖设备的工作原理、结构设计、制造调试及维护等方面。学生毕业后可从事环保设备的研发、制造、操作维护等工作，如设计新型的脱硫脱硝设备。\",\"id\":170,\"level\":3,\"name\":\"环保设备工程\",\"nameEn\":\"Environmental Protection Equipment Engineering\",\"pageNum\":1,\"pageSize\":10,\"parentId\":39}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 15:58:11', 40);
INSERT INTO `sys_oper_log` VALUES (1237, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"从地理、物理、化学、生物等多个角度研究环境，进行环境的保护、监测、质量评价以及规划管理工作。学生需要具备综合分析环境问题的能力，为环境决策提供科学依据。\",\"id\":171,\"level\":3,\"name\":\"环境科学\",\"nameEn\":\"Environmental Science\",\"pageNum\":1,\"pageSize\":10,\"parentId\":39}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 15:58:35', 39);
INSERT INTO `sys_oper_log` VALUES (1238, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"致力于资源的高效利用、开发保护以及环境管理规划。学生要掌握资源与环境之间的相互关系，通过合理规划，实现资源的可持续利用和环境保护的协同发展。\",\"id\":172,\"level\":3,\"name\":\"资源环境科学\",\"nameEn\":\"Resource and Environmental Science\",\"pageNum\":1,\"pageSize\":10,\"parentId\":39}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 15:58:51', 46);
INSERT INTO `sys_oper_log` VALUES (1239, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"全面研究环境及其与人类的关系、环境改造工程以及环境污染问题。该专业培养学生在环境工程建设、环境质量监测评价和污染防治等方面的综合能力，以应对复杂的环境挑战。\",\"id\":173,\"level\":3,\"name\":\"环境科学与工程\",\"nameEn\":\"Environmental Science and Engineering\",\"pageNum\":1,\"pageSize\":10,\"parentId\":39}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 15:59:10', 46);
INSERT INTO `sys_oper_log` VALUES (1240, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"可持续发展专业关注经济增长、环境保护和社会福祉之间的平衡，探讨应对气候变化、资源枯竭和社会不平等的策略。ESG 专业则从环境、社会和公司治理三个维度评估企业的可持续发展能力，为企业和投资者提供决策参考。\",\"id\":174,\"level\":3,\"name\":\"可持续发展 & ESG\",\"nameEn\":\"Sustainable Development & Environmental, Social and Governance\",\"pageNum\":1,\"pageSize\":10,\"parentId\":39}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 15:59:29', 46);
INSERT INTO `sys_oper_log` VALUES (1241, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"研究环境中化学物质的来源、迁移、转化和归宿，以及它们对生态系统和人类健康的影响。通过学习，学生可以了解大气、水、土壤等环境介质中污染物的化学性质和反应机理，为污染治理和环境监测提供理论基础。\",\"isActive\":1,\"majorId\":39,\"name\":\"环境化学\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-12 15:59:48', 12);
