INSERT INTO `sys_oper_log` VALUES (1243, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"探讨生物与环境之间的相互关系，包括生物对环境污染的响应、生物修复技术的原理和应用等。学生将学习如何利用微生物、植物等生物手段来降解污染物、修复受损生态系统。\",\"isActive\":1,\"majorId\":39,\"name\":\"环境生物学\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-12 16:00:00', 11);
