INSERT INTO `sys_oper_log` VALUES (1270, '专业信息', 2, 'com.xintong.controller.admin.MajorAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/edit', '60.12.13.184', 'XX XX', '{\"details\":\"电子信息类专业作为现代科技领域的关键学科，深度融合电子技术、信息技术、计算机技术等多学科知识，主要围绕电子设备、信息系统和通信网络展开研究、设计、开发与应用，致力于培养具备扎实理论基础、创新实践能力和广阔国际视野的高素质专业人才，为各行业的数字化转型和智能化升级提供有力支撑。\",\"id\":30,\"level\":2,\"name\":\"电子信息类\",\"nameEn\":\"Electronic Information Science and Technology\",\"pageNum\":1,\"pageSize\":10,\"parentId\":3,\"subTitle\":\"引领数字时代的前沿力量\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 17:04:24', 87);
INSERT INTO `sys_oper_log` VALUES (1271, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"聚焦电子信息系统的设计、开发与应用。涉及利用电路设计软件搭建各类电子电路，研究信息的获取、处理和传输，如信号调制解调、数字信号处理算法实现等。广泛应用于通信设备制造、消费电子、智能交通等行业。\",\"id\":175,\"level\":3,\"name\":\"电子信息工程\",\"nameEn\":\"Electronic Information Engineering\",\"pageNum\":1,\"pageSize\":10,\"parentId\":30}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 17:04:47', 44);
INSERT INTO `sys_oper_log` VALUES (1272, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"围绕通信系统和通信网络进行研究，涵盖无线、有线、卫星等多种通信方式，深入探讨通信信号的传输、交换和组网技术。在通信运营商、通信设备制造商等领域占据重要地位。\",\"id\":176,\"level\":3,\"name\":\"通信工程\",\"nameEn\":\"Communication Engineering\",\"pageNum\":1,\"pageSize\":10,\"parentId\":30}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 17:05:03', 45);
INSERT INTO `sys_oper_log` VALUES (1273, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"专注于电子器件、集成电路的设计、制造与应用，从半导体材料特性研究出发，推动芯片技术向更高集成度、更低功耗方向发展，是半导体产业、集成电路设计公司的核心专业支撑。\",\"id\":177,\"level\":3,\"name\":\"电子科学与技术\",\"nameEn\":\"Electronic Science and Technology\",\"pageNum\":1,\"pageSize\":10,\"parentId\":30}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 17:05:17', 43);
INSERT INTO `sys_oper_log` VALUES (1274, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"融合信息获取、处理、传输和利用等多方面知识，涉及信息系统的设计与开发，强调通过信息技术实现对各类信息资源的有效管理和利用，广泛应用于金融、医疗、安防等行业的信息化建设。\",\"id\":178,\"level\":3,\"name\":\"信息工程\",\"nameEn\":\"Information Engineering\",\"pageNum\":1,\"pageSize\":10,\"parentId\":30}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 17:05:35', 47);
INSERT INTO `sys_oper_log` VALUES (1275, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"研究各种微电子器件和集成电路的基本原理、设计方法和基本技能，进行半导体器件、功能电子材料、集成电路的设计制造和微机电系统的设计开发。\",\"id\":179,\"level\":3,\"name\":\"微电子科学与工程\",\"nameEn\":\"Microelectronics Science and Engineering\",\"pageNum\":1,\"pageSize\":10,\"parentId\":30}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 17:05:53', 45);
INSERT INTO `sys_oper_log` VALUES (1276, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"涉及电子信息相关学科的多个领域，包括集成电路设计、芯片制造、嵌入式系统、计算机控制技术、通信、消费类电子等信息技术领域的研究与开发。\",\"id\":180,\"level\":3,\"name\":\"集成电路设计\",\"nameEn\":\"Integrated Circuit Design\",\"pageNum\":1,\"pageSize\":10,\"parentId\":30}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 17:06:14', 43);
INSERT INTO `sys_oper_log` VALUES (1277, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"研究光学、机械学、电子学及计算机科学等领域的基本知识和技能，学习光电信息领域内光电仪器的设计及制造方法，进行光电器件的研发应用、光加工技术的探索等。\",\"id\":181,\"level\":3,\"name\":\"光电信息科学与工程\",\"nameEn\":\"Optoelectronic Information Science and Engineering\",\"pageNum\":1,\"pageSize\":10,\"parentId\":30}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 17:06:31', 44);
INSERT INTO `sys_oper_log` VALUES (1278, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"讲解电路的基本概念、定律和分析方法，如欧姆定律、基尔霍夫定律等。帮助学生掌握电路元件的特性和电路的等效变换，能够对简单电路进行分析和计算，为后续专业课程学习奠定基础。\",\"isActive\":1,\"majorId\":30,\"name\":\"电路原理\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-12 17:06:56', 12);
