INSERT INTO `sys_oper_log` VALUES (1280, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"主要研究模拟信号的产生、放大、处理和变换。涵盖半导体器件（如二极管、三极管、场效应管）的工作原理，以及各种放大电路（如共射放大电路、差动放大电路）、集成运算放大器的应用等，培养学生设计和分析模拟电路的能力。\",\"isActive\":1,\"majorId\":30,\"name\":\"模拟电子技术\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-12 17:07:08', 12);
