INSERT INTO `sys_oper_log` VALUES (1282, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"聚焦数字信号的处理和数字电路的设计。学习内容包括数字逻辑基础、组合逻辑电路、时序逻辑电路、半导体存储器、数字集成电路等，使学生掌握用数字电路实现逻辑功能的方法，能够设计数字系统。\",\"isActive\":1,\"majorId\":30,\"name\":\"数字电子技术\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-12 17:07:19', 12);
INSERT INTO `sys_oper_log` VALUES (1283, '主要学习课程-禁/启用', 2, 'com.xintong.controller.admin.MajorCourseAdminController.active()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/active', '60.12.13.184', 'XX XX', '{\"id\":134,\"isActive\":0}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 17:07:21', 13);
INSERT INTO `sys_oper_log` VALUES (1284, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"研究信号的特性和系统对信号的响应。课程包含信号的分类、描述、运算，以及连续时间系统和离散时间系统的时域分析、频域分析、复频域分析等方法，让学生学会对信号进行分析和处理，理解系统的性能和特性。\",\"isActive\":1,\"majorId\":30,\"name\":\"信号与系统\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-12 17:07:32', 13);
INSERT INTO `sys_oper_log` VALUES (1285, '主要学习课程-禁/启用', 2, 'com.xintong.controller.admin.MajorCourseAdminController.active()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/active', '60.12.13.184', 'XX XX', '{\"id\":135,\"isActive\":0}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 17:07:33', 13);
INSERT INTO `sys_oper_log` VALUES (1286, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"介绍通信系统的基本原理和技术。包括模拟通信系统（如调幅、调频、调相）和数字通信系统（如脉冲编码调制、数字调制技术）的原理，以及信道编码、同步技术等内容，使学生掌握通信系统的基本组成和工作方式，了解通信技术的发展趋势。\",\"isActive\":1,\"majorId\":30,\"name\":\"通信原理\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-12 17:07:47', 11);
INSERT INTO `sys_oper_log` VALUES (1287, '主要学习课程-禁/启用', 2, 'com.xintong.controller.admin.MajorCourseAdminController.active()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/active', '60.12.13.184', 'XX XX', '{\"id\":136,\"isActive\":0}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 17:07:49', 13);
INSERT INTO `sys_oper_log` VALUES (1288, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"深入研究现代数字信号处理的理论和方法，如多速率信号处理、小波变换、时频分析、自适应信号处理等，使学生掌握先进的信号处理技术，能够解决复杂的信号处理问题。\",\"isActive\":1,\"majorId\":30,\"name\":\"现代数字信号处理\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-12 17:08:03', 12);
