INSERT INTO `sys_oper_log` VALUES (1290, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"紧跟通信技术发展前沿，研究高速通信网络的架构、协议和关键技术，如 5G/6G 通信技术、软件定义网络（SDN）、网络功能虚拟化（NFV）等，让学生了解未来通信网络的发展方向，具备从事高速通信网络研究和开发的能力。\",\"isActive\":1,\"majorId\":30,\"name\":\"高速通信网络与技术\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-12 17:08:16', 12);
