INSERT INTO `sys_oper_log` VALUES (1306, '专业信息', 2, 'com.xintong.controller.admin.MajorAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/edit', '60.12.13.184', 'XX XX', '{\"details\":\"电子电气类专业是一门综合性学科，融合了电子技术、电气工程、计算机技术等多领域知识，旨在培养具备设计、开发、测试和维护各类电子电气设备及系统能力的专业人才。该专业覆盖范围广泛，从微小的电子元器件到大型的电力系统均有涉及，在现代科技和工业发展中占据关键地位。\",\"id\":31,\"level\":2,\"name\":\"电子电气类\",\"nameEn\":\"Electrical & Electronic Engineering\",\"pageNum\":1,\"pageSize\":10,\"parentId\":3,\"subTitle\":\"创新能源系统和智能控制的学科\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 17:12:09', 35);
INSERT INTO `sys_oper_log` VALUES (1307, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"聚焦小型化电气设备，专注于计算机硬件、电子、微电子、集成电路等领域。需深入钻研晶体管、电容器等元器件的工作原理，并将其整合构建电子系统。\",\"id\":182,\"level\":3,\"name\":\"电子工程\",\"nameEn\":\"Electronic Engineering\",\"pageNum\":1,\"pageSize\":10,\"parentId\":31}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 17:13:16', 38);
INSERT INTO `sys_oper_log` VALUES (1308, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"侧重强电领域，主要研究电气系统和大型电气设备设计，像发电机、输电线路、变压器和电机等，例如国家电网铺设、特高压输电技术相关工作。\",\"id\":183,\"level\":3,\"name\":\"电气工程\",\"nameEn\":\"Electrical Engineering\",\"pageNum\":1,\"pageSize\":10,\"parentId\":31}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 17:13:32', 38);
INSERT INTO `sys_oper_log` VALUES (1309, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"涉及电力电子技术、自动化控制技术、计算机技术等知识技能，用于电力设备设计制造、自动控制技术开发及电力系统维护。比如家用电气生产、医用设备自动控制、高压电网维护管理。\",\"id\":184,\"level\":3,\"name\":\"电气工程及其自动化\",\"nameEn\":\"Electrical Engineering and Automation\",\"pageNum\":1,\"pageSize\":10,\"parentId\":31}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 17:13:48', 37);
INSERT INTO `sys_oper_log` VALUES (1310, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"学习电力电子、自动控制、微机控制技术，负责电气装备设计制造、运行控制以及电力系统设计研发，如家用冰箱变压器设计、工厂设备自动运行控制。\",\"id\":185,\"level\":3,\"name\":\"电气工程与智能控制\",\"nameEn\":\"Electrical Engineering and Intelligent Control\",\"pageNum\":1,\"pageSize\":10,\"parentId\":31}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 17:14:04', 38);
INSERT INTO `sys_oper_log` VALUES (1311, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"着重于电机电器操作及其智能化，培养从事电机与电器智能化设计、制造、控制的专业人才，涉及各类电气设备研发生产及智能监测、诊断等。\",\"id\":186,\"level\":3,\"name\":\"电机电器智能化\",\"nameEn\":\"Motor and Electrical Appliance Intelligence\",\"pageNum\":1,\"pageSize\":10,\"parentId\":31}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 17:14:21', 37);
INSERT INTO `sys_oper_log` VALUES (1312, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"研究传统光源、驱动电路、半导体光电等，涵盖照明产品设计、开发、制造、智能化控制和检测，如节能 LED 灯、光感路灯设计。\",\"id\":187,\"level\":3,\"name\":\"光源与照明\",\"nameEn\":\"Light Source and Lighting\",\"pageNum\":1,\"pageSize\":10,\"parentId\":31}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 17:14:38', 37);
INSERT INTO `sys_oper_log` VALUES (1313, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"专注电线电缆和光纤光缆运行设计原理、产品结构设计、材料改性及工艺原理，要求掌握相关运行设计原理和产品结构设计能力。\",\"id\":188,\"level\":3,\"name\":\"电缆工程\",\"nameEn\":\"Cable Engineering\",\"pageNum\":1,\"pageSize\":10,\"parentId\":31}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 17:14:53', 38);
INSERT INTO `sys_oper_log` VALUES (1314, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"是电子电气类专业的基础课程，主要研究电路的基本定律、定理和分析方法。课程涵盖欧姆定律、基尔霍夫定律等基本原理，通过对电阻、电容、电感等基本电路元件的学习，让学生掌握电路的等效变换、网络分析等方法，为后续学习复杂的电子电气系统奠定基础。\",\"isActive\":1,\"majorId\":31,\"name\":\"电路原理\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-12 17:15:20', 10);
INSERT INTO `sys_oper_log` VALUES (1315, '主要学习课程-禁/启用', 2, 'com.xintong.controller.admin.MajorCourseAdminController.active()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/active', '60.12.13.184', 'XX XX', '{\"id\":140,\"isActive\":0}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 17:15:21', 11);
INSERT INTO `sys_oper_log` VALUES (1316, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"聚焦于模拟信号的处理和放大。课程内容包括半导体器件（如二极管、晶体管、场效应管）的工作原理，以及由这些器件组成的基本放大电路、集成运算放大器等。学生将学习如何设计和分析模拟电路，实现信号的放大、滤波、调制等功能，在通信、音频处理等领域应用广泛。\",\"isActive\":1,\"majorId\":31,\"name\":\"模拟电子技术\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-12 17:15:34', 11);
INSERT INTO `sys_oper_log` VALUES (1317, '主要学习课程-禁/启用', 2, 'com.xintong.controller.admin.MajorCourseAdminController.active()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/active', '60.12.13.184', 'XX XX', '{\"id\":141,\"isActive\":0}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 17:15:35', 11);
INSERT INTO `sys_oper_log` VALUES (1318, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"主要研究数字信号的处理和存储。讲解数字逻辑电路的基本概念、组合逻辑电路和时序逻辑电路的设计方法，以及数字集成电路（如计数器、寄存器、存储器）的工作原理和应用。该课程是现代数字系统设计的基础，在计算机、数字通信、自动化控制等领域发挥关键作用。\",\"isActive\":1,\"majorId\":31,\"name\":\"数字电子技术\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-12 17:15:46', 10);
INSERT INTO `sys_oper_log` VALUES (1319, '主要学习课程-禁/启用', 2, 'com.xintong.controller.admin.MajorCourseAdminController.active()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/active', '60.12.13.184', 'XX XX', '{\"id\":142,\"isActive\":0}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 17:15:47', 12);
INSERT INTO `sys_oper_log` VALUES (1320, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"探讨信号的描述、分析和处理，以及系统对信号的响应。课程涵盖连续时间信号与离散时间信号的分析方法，线性时不变系统的特性和求解，傅里叶变换、拉普拉斯变换和 Z 变换等数学工具在信号与系统分析中的应用。通过学习，学生能够掌握信号处理的基本理论和方法，理解系统的性能和行为。\",\"isActive\":1,\"majorId\":31,\"name\":\"信号与系统\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-12 17:16:09', 10);
INSERT INTO `sys_oper_log` VALUES (1321, '主要学习课程-禁/启用', 2, 'com.xintong.controller.admin.MajorCourseAdminController.active()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/active', '60.12.13.184', 'XX XX', '{\"id\":143,\"isActive\":0}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 17:16:10', 12);
INSERT INTO `sys_oper_log` VALUES (1322, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"介绍自动控制系统的基本原理和分析设计方法。包括控制系统的数学模型建立（如传递函数、状态空间表达式），稳定性分析（如劳斯判据、奈奎斯特判据），时域和频域分析方法，以及控制系统的校正和设计。该课程在工业自动化、机器人控制、航空航天等领域具有重要应用。\",\"isActive\":1,\"majorId\":31,\"name\":\"自动控制原理\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-12 17:16:20', 10);
INSERT INTO `sys_oper_log` VALUES (1323, '主要学习课程-禁/启用', 2, 'com.xintong.controller.admin.MajorCourseAdminController.active()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/active', '60.12.13.184', 'XX XX', '{\"id\":144,\"isActive\":0}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 17:16:22', 11);
INSERT INTO `sys_oper_log` VALUES (1324, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"研究各类电机的工作原理、结构和运行特性。主要内容包括直流电机、变压器、异步电机、同步电机等的电磁关系、运行原理、特性分析和控制方法。通过学习，学生能够掌握电机的设计、控制和应用，为电力系统、工业驱动等领域提供技术支持。\",\"isActive\":1,\"majorId\":31,\"name\":\"电机学\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-12 17:16:32', 10);
INSERT INTO `sys_oper_log` VALUES (1325, '主要学习课程-禁/启用', 2, 'com.xintong.controller.admin.MajorCourseAdminController.active()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/active', '60.12.13.184', 'XX XX', '{\"id\":145,\"isActive\":0}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 17:16:33', 11);
INSERT INTO `sys_oper_log` VALUES (1326, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"专注于电力电子器件的应用和电力变换技术。课程介绍电力二极管、晶闸管、IGBT 等电力电子器件的工作原理和特性，以及整流、逆变、斩波、变频等电力变换电路的分析和设计。电力电子技术在电力系统、电机调速、新能源发电等领域有广泛应用，可实现电能的高效转换和控制。\",\"isActive\":1,\"majorId\":31,\"name\":\"电力电子技术\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-12 17:16:43', 10);
INSERT INTO `sys_oper_log` VALUES (1327, '主要学习课程-禁/启用', 2, 'com.xintong.controller.admin.MajorCourseAdminController.active()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/active', '60.12.13.184', 'XX XX', '{\"id\":146,\"isActive\":0}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 17:16:44', 11);
INSERT INTO `sys_oper_log` VALUES (1328, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"研究电磁场和电磁波的基本理论和特性。课程涵盖麦克斯韦方程组、电磁场的边界条件、电磁波的传播特性（如反射、折射、极化）等内容。通过学习，学生能够理解电磁现象的本质，为天线设计、微波技术、电磁兼容等领域提供理论支持。\",\"isActive\":1,\"majorId\":31,\"name\":\"电磁场与电磁波\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-12 17:16:55', 10);
