INSERT INTO `sys_oper_log` VALUES (1340, '专业信息', 2, 'com.xintong.controller.admin.MajorAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/edit', '60.12.13.184', 'XX XX', '{\"details\":\"机械类专业作为工程技术领域的关键支柱，是一门融合多学科知识，专注于机械系统的设计、制造、运行、控制及维护的学科。它以力学、材料学、电子技术、计算机科学等为基础，通过理论与实践结合，培养具备扎实专业知识、创新能力和实践技能的综合性人才，在推动各行业技术进步和社会经济发展中发挥着不可替代的作用。\",\"id\":32,\"level\":2,\"name\":\"机械类\",\"nameEn\":\"Mechanical Engineering\",\"pageNum\":1,\"pageSize\":10,\"parentId\":3,\"subTitle\":\"创新设计与工程实践交汇点的学科\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 17:20:26', 34);
INSERT INTO `sys_oper_log` VALUES (1341, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"融合机械设计、制造工艺与自动化控制技术。利用计算机辅助设计软件进行产品结构和外形设计，运用切削加工、铸造等制造工艺，实现生产过程智能化，广泛应用于汽车、航空航天等行业。\",\"id\":189,\"level\":3,\"name\":\"机械设计制造及其自动化\",\"nameEn\":\"Mechanical Design, Manufacturing and Automation\",\"pageNum\":1,\"pageSize\":10,\"parentId\":32}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 17:20:59', 44);
INSERT INTO `sys_oper_log` VALUES (1342, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"专注于材料成型工艺及过程控制，研究金属、塑料等材料在不同成型方法下的特性变化，优化成型工艺参数，保障产品精度和性能，在汽车零部件、电子设备外壳制造领域至关重要。\",\"id\":190,\"level\":3,\"name\":\"材料成型及控制工程\",\"nameEn\":\"Material Forming and Control Engineering\",\"pageNum\":1,\"pageSize\":10,\"parentId\":32}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 17:21:14', 41);
INSERT INTO `sys_oper_log` VALUES (1343, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"机械学与电子学深度交叉融合的专业，结合机械、电子、计算机和自动控制技术，实现机械产品智能化与机电一体化\",\"id\":191,\"level\":3,\"name\":\"机械电子工程\",\"nameEn\":\"Mechatronic Engineering\",\"pageNum\":1,\"pageSize\":10,\"parentId\":32}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 17:21:29', 43);
INSERT INTO `sys_oper_log` VALUES (1344, '专业信息', 2, 'com.xintong.controller.admin.MajorAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/edit', '60.12.13.184', 'XX XX', '{\"details\":\"机械学与电子学深度交叉融合的专业，结合机械、电子、计算机和自动控制技术，实现机械产品智能化与机电一体化。\",\"id\":191,\"isDeleted\":0,\"level\":3,\"name\":\"机械电子工程\",\"nameEn\":\"Mechatronic Engineering\",\"pageNum\":1,\"pageSize\":10,\"parentId\":32}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 17:21:35', 34);
INSERT INTO `sys_oper_log` VALUES (1345, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"围绕各类车辆的设计、制造、测试与研发，涵盖车辆动力学、发动机原理等知识，致力于提升车辆安全性、舒适性和环保性，为汽车产业发展提供技术支持。\",\"id\":192,\"level\":3,\"name\":\"车辆工程\",\"nameEn\":\"Vehicle Engineering\",\"pageNum\":1,\"pageSize\":10,\"parentId\":32}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 17:21:52', 43);
INSERT INTO `sys_oper_log` VALUES (1346, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"以自然科学和技术科学为理论基础，结合生产实践经验，研究解决机械开发、设计、制造等各环节实际问题，涉及家用电器维修、汽车改装等多个方面。\",\"id\":193,\"level\":3,\"name\":\"机械工程\",\"nameEn\":\"Mechanical Engineering\",\"pageNum\":1,\"pageSize\":10,\"parentId\":32}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 17:22:10', 42);
