INSERT INTO `sys_oper_log` VALUES (1379, '专业信息', 2, 'com.xintong.controller.admin.MajorAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/edit', '60.12.13.184', 'XX XX', '{\"details\":\"机械类专业作为一门历史悠久且不断创新发展的学科，是国民经济的基础性产业支柱，对推动各领域技术进步和社会发展起着关键作用。它以力学、材料学、电子技术等多学科知识为基础，致力于研究机械的设计、制造、运行、控制等环节，培养具备扎实专业知识和实践技能的综合性人才。\",\"id\":33,\"level\":2,\"name\":\"能源类\",\"nameEn\":\"Energy\",\"pageNum\":1,\"pageSize\":10,\"parentId\":3,\"subTitle\":\"驱动未来动力源泉的学科\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 17:33:38', 33);
INSERT INTO `sys_oper_log` VALUES (1380, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"聚焦能源的高效转化和动力系统的设计优化，围绕传统能源转化为所需能量展开，如传统火电、汽车发动机技术革新，提升能源利用效率。\",\"id\":198,\"level\":3,\"name\":\"能源与动力工程\",\"nameEn\":\"Energy and Power Engineering\",\"pageNum\":1,\"pageSize\":10,\"parentId\":33}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 17:44:48', 41);
INSERT INTO `sys_oper_log` VALUES (1381, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"主要研究风能、光伏能源转换为电能，以及可再生与新型能源的高效低成本转换利用、与之相匹配的动力系统及其自动化控制与运行，像建设光伏电站、运营风电场。\",\"id\":199,\"level\":3,\"name\":\"新能源科学与工程\",\"nameEn\":\"New Energy Science and Engineering\",\"pageNum\":1,\"pageSize\":10,\"parentId\":33}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 17:45:06', 38);
INSERT INTO `sys_oper_log` VALUES (1382, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"研究能源转化和储存中的化学过程，如电池材料研发和煤炭清洁利用技术，实现能源清洁高效利用。\",\"id\":200,\"level\":3,\"name\":\"能源化学工程\",\"nameEn\":\"Energy Chemical Engineering\",\"pageNum\":1,\"pageSize\":10,\"parentId\":33}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 17:45:22', 37);
INSERT INTO `sys_oper_log` VALUES (1383, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"专注于各类储能技术和系统，通过优化储能材料和系统设计，解决能源供需时空错配问题。\",\"id\":201,\"level\":3,\"name\":\"储能科学与工程\",\"nameEn\":\"Energy Storage Science and Engineering\",\"pageNum\":1,\"pageSize\":10,\"parentId\":33}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 17:45:36', 36);
INSERT INTO `sys_oper_log` VALUES (1384, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"研究热能的释放、转换和有效利用理论及技术问题，涉及热力学、流体力学、传热传质学和燃烧学等理论。\",\"id\":202,\"level\":3,\"name\":\"热能工程\",\"nameEn\":\"Thermal Energy Engineering\",\"pageNum\":1,\"pageSize\":10,\"parentId\":33}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 17:45:50', 38);
INSERT INTO `sys_oper_log` VALUES (1385, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"研究电能的产生、变换、输送、分配和控制理论，以及电力系统的规划设计、特性分析、运行管理和控制保护等。\",\"id\":203,\"level\":3,\"name\":\"电力能源\",\"nameEn\":\"Power Energy\",\"pageNum\":1,\"pageSize\":10,\"parentId\":33}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 17:46:06', 37);
INSERT INTO `sys_oper_log` VALUES (1386, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"研究能源的转换和利用及环境保护等基本知识和技能，包括一次能源转化为二次能源的过程、人工环境和制冷空调的技术问题、新能源的开发利用等，实现能源利用高效、清洁。\",\"id\":204,\"level\":3,\"name\":\"能源与环境系统工程\",\"nameEn\":\"Energy and Environmental System Engineering\",\"pageNum\":1,\"pageSize\":10,\"parentId\":33}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 17:46:23', 38);
INSERT INTO `sys_oper_log` VALUES (1387, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"融合制氢、运氢、储氢、用氢以及氢安全等氢能全产业链条，开展全方位跨学科人才培养。\",\"id\":205,\"level\":3,\"name\":\"氢能科学与工程\",\"nameEn\":\"Hydrogen Energy Science and Engineering\",\"pageNum\":1,\"pageSize\":10,\"parentId\":33}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 17:46:42', 36);
INSERT INTO `sys_oper_log` VALUES (1388, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"关注利用可再生资源替代传统化石能源，减少环境污染和资源消耗，涵盖物理、化学、生物、工程、经济和环境等多个领域。\",\"id\":206,\"level\":3,\"name\":\"可持续能源\",\"nameEn\":\"Sustainable Energy\",\"pageNum\":1,\"pageSize\":10,\"parentId\":33}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-12 17:46:59', 37);
