INSERT INTO `sys_oper_log` VALUES (1438, '专业信息', 2, 'com.xintong.controller.admin.MajorAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/edit', '60.12.13.184', 'XX XX', '{\"details\":\"土木类专业是一门古老而又不断创新发展的专业，广泛涉及各类土地工程设施的勘测、设计、建造、保养和维修等方面，旨在通过技术与知识的运用，创造安全、实用且美观的物理环境，是工学门类中的重要分支。\",\"id\":34,\"level\":2,\"name\":\"土木类\",\"nameEn\":\"Civil Engineering\",\"pageNum\":1,\"pageSize\":10,\"parentId\":3,\"subTitle\":\"构建现代世界的基石学科\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-13 09:40:11', 35);
