INSERT INTO `sys_oper_log` VALUES (1440, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"经济学是研究资源有效配置、生产分配、市场运行规律及社会财富创造的学科，通过理论模型与实证分析，揭示个体、企业、政府等经济主体在稀缺性条件下的决策行为，旨在培养具备宏观经济洞察力与微观分析能力的复合型人才，服务于政策制定、产业规划、可持续发展等领域。\",\"id\":209,\"jobDetails\":\"经济学毕业生可进入政府部门、国际组织、咨询公司、能源企业及科技巨头，从事政策分析、市场咨询、数据建模与可持续发展研究；亦可投身学术机构或金融科技领域，聚焦经济理论创新、投资策略优化及人工智能驱动的决策支持。\",\"level\":2,\"name\":\"经济学\",\"nameEn\":\"Economics\",\"pageNum\":1,\"pageSize\":10,\"parentId\":1,\"subTitle\":\"\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-13 10:15:25', 51);
