INSERT INTO `sys_oper_log` VALUES (1500, '意向目的地基本要求', 1, 'com.xintong.controller.admin.RegionInfoAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/regionInfo/add', '60.12.13.184', 'XX XX', '{\"advantages\":\"优质教育、多语言环境、文化丰富、地理位置佳、研究机会、生活费用适中、就业前景好。\",\"appMaterial\":\"简历&K&动机信&K&APS证书&K&推荐信&K&大学本科相关资料\",\"budgetDetail\":\"15万RMB起，包括学费和生活费\",\"budgetRange\":\"学费：公立：1000欧-6000欧/年，具体取决于专业和学校&K&住宿费：300欧-800欧/月不等，具体取决于地点和房屋类型。&K&生活费：10万RMB元/年起（包括住宿费）\",\"countryFeat\":\"&k-topic-s&高质量的教育&k-topic-e&比利时有多所世界知名的大学，如鲁汶大学、根特大学、布鲁塞尔自由大学等，提供多样化的课程和高水平的教育。&K&&k-topic-s&多语言环境&k-topic-e&比利时是多语言国家，官方语言包括荷兰语、法语和德语，留学生有机会学习和使用多种语言，增加自己的语言技能。&K&&k-topic-s&文化多样性&k-topic-e&比利时位于欧洲心脏地带，拥有丰富的历史和文化遗产，留学生可以体验不同的文化和传统。&K&&k-topic-s&地理位置优越&k-topic-e&比利时地处欧洲中心，与法国、德国、荷兰和卢森堡接壤，便于旅行和探索其他欧洲国家。\",\"eduId\":2,\"eduSystem\":\"两年\",\"enrollTimeline\":\"\",\"rankUrl\":\"\",\"regionId\":130,\"regularProg\":\"通常两年，学制灵活，允许提前或延期毕业。\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-13 10:38:57', 19);
INSERT INTO `sys_oper_log` VALUES (1501, '专业信息', 2, 'com.xintong.controller.admin.MajorAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/edit', '60.12.13.184', 'XX XX', '{\"details\":\"经济学是研究资源有效配置、生产分配、市场运行规律及社会财富创造的学科，通过理论模型与实证分析，揭示个体、企业、政府等经济主体在稀缺性条件下的决策行为，旨在培养具备宏观经济洞察力与微观分析能力的复合型人才，服务于政策制定、产业规划、可持续发展等领域。\",\"id\":7,\"jobDetails\":\"经济学毕业生可进入政府部门、国际组织、咨询公司、能源企业及科技巨头，从事政策分析、市场咨询、数据建模与可持续发展研究；亦可投身学术机构或金融科技领域，聚焦经济理论创新、投资策略优化及人工智能驱动的决策支持。\",\"level\":2,\"name\":\"经济学\",\"nameEn\":\"Economics\",\"pageNum\":1,\"pageSize\":10,\"parentId\":1,\"subTitle\":\"\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-13 10:39:01', 35);
INSERT INTO `sys_oper_log` VALUES (1502, '意向目的地基本要求', 1, 'com.xintong.controller.admin.RegionInfoAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/regionInfo/add', '60.12.13.184', 'XX XX', '{\"advantages\":\"学历认可度高、优质教学、费用低、专业多样、距离近、中西方文化融合\",\"appMaterial\":\"身份证、高考成绩单、艺考类美术科统考成绩单（艺术类专业）、电子照片（二寸白底彩照）等\",\"budgetDetail\":\"本科学费约2.5万-8万人民币/年&K&生活费约4万-5万人民币/年\",\"budgetRange\":\"在澳门读书预算因学校和专业不同而有所差异。本科学费约2.5万-8万人民币/年，生活费约4万-5万人民币/年，丰俭由人。\",\"countryFeat\":\"&k-topic-s&1. 学历认可度高，升学便利&k-topic-e&澳门学历文凭受国家教育部及全世界100多个国家认可。澳门院校也与美、英、欧等国的一些著名大学有签订分数互认协定。&K&&k-topic-s&2. 招生报名和录取名额不占用高考志愿&k-topic-e&国内高中生可以凭借高考成绩直接申请澳门高校。而且，澳门高校招收内地学生为独立招生，并不属于全国普通高校统一招生计划内，考生于澳门学校的报名及录取不会影响其他内地高考的志愿录取。&K&&k-topic-s&3. 费用低&k-topic-e&澳门读书最突出的一点就是花费少，虽然澳门香港紧邻，但澳门升学的费用比香港少将近一半。&K&&k-topic-s&4. 安全性高，回家方便&k-topic-e&澳门的防疫和留学安全都可以得到保证，澳门在回归祖国后，联合国更是把澳门评为世界治安最好的地区之一。没有签证上的障碍，回家探亲也非常方便。\",\"eduId\":3,\"eduSystem\":\"本科通常4年制\",\"enrollTimeline\":\"\",\"rankUrl\":\"\",\"regionId\":124,\"regularProg\":\"学制一般为4年，私立大学有先修班学制1年\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-13 10:43:20', 11);
