INSERT INTO `sys_oper_log` VALUES (1524, '入学要求信息', 2, 'com.xintong.controller.admin.CollegeRequireAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/collegeRequire/edit', '60.12.13.184', 'XX XX', '{\"content\":\"&k-topic-s&&k-topic-e&完成12年基础教育，正规高中或同等学历。&K&&k-topic-s&&k-topic-e&大多需提供留考成绩。\",\"eduId\":3,\"id\":33,\"isActive\":0,\"isDeleted\":0,\"regionId\":125,\"title\":\"日语授课项目\"}', '{\"msg\":\"修改成功\",\"code\":200}', 0, NULL, '2025-02-13 11:31:45', 13);
INSERT INTO `sys_oper_log` VALUES (1525, '意向目的地基本要求', 2, 'com.xintong.controller.admin.RegionInfoAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/regionInfo/edit', '60.12.13.184', 'XX XX', '{\"advantages\":\"顶尖的教育资源，名校众多，体系灵活，文化多元，学历全球认可度高，就业前景广。\",\"appMaterial\":\"学术成绩单&K&中期报告&K&个人简历&K&个人陈述&K&补充文书&K&推荐信&K&托福/雅思成绩&K&其他标化成绩&K&财务证明&K&作品集（如适用）&K&面试（如适用）\",\"budgetDetail\":\"每年总预算约为20-70万人民币\",\"budgetRange\":\"公立大学每年总预算约为20万~50万人民币；&K&私立大学每年总预算约为30万~70万人民币。&K&纽约、波士顿、洛杉矶等大城市的生活成本高于其他城市。\",\"countryFeat\":\"&k-topic-s&1.优质大学众多：&k-topic-e&2025QS世界大学排名前100中美国院校27所，2025U.S. News全球最佳院校排名中美国院校48所。&K&&k-topic-s&2.申请评估全面：&k-topic-e&美国大学采用整体审查（Holistic Review）不仅依据传统的学术成就指标（如成绩和标准化考试分数）来评估申请人，还会考量申请者的独特经历和个人特质。&K&&k-topic-s&3.教育体系灵活：&k-topic-e&文理学院及部分综合型大学允许学生不定专业入学，在大学学习过程中探索学术兴趣。美国大学允许学生自由更换专业（一般在大三前确定专业），甚至在不同学校之间转学，并提供夏季学期以加速学业。&K&&k-topic-s&4.就业前景广阔：&k-topic-e&美国本科学位在全球范围内认可度高，毕业生起薪高、潜力大、晋升快。53%中国企业招聘者更青睐美国留学背景学生*。*数据来源：2024中国学生出国留学发展报告。&K&&k-topic-s&5.留美就业机会：&k-topic-e&提供至少一年OPT（Optional Practical Training），STEM项目三年OPT；世界500强企业云集，毕业后留美工作机会多。&K&&k-topic-s&6.丰厚的奖学金：&k-topic-e&每年各类奖学金总额高达500亿美元，种类包括联邦政府奖学金、私人基金奖学金、学院内奖学金、助学金以及减免学费等。&K&&k-topic-s&7.申请要素：&k-topic-e&申请上需做到“早规划早准备”，合理规划并深度参与有个人特色的背景活动，科学安排各项标化考试的学习计划和出分节奏。9年级：启动托福/雅思学习、如有能力可开始AP课程学习；10年级：开始AP课程学习、启动SAT/ACT等标化考试学习；目标冲刺名校建议在10年级（最晚11年级）暑假参加夏校项目。补充到红框位置。\",\"createdAt\":\"2024-01-04 10:00:00\",\"createdBy\":\"admin\",\"eduSystem\":\"通常为4年制\",\"enrollTimeline\":\"http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202501231541/imageUSA.png\",\"id\":4,\"isActive\":0,\"isDeleted\":0,\"rankUrl\":\"\",\"regularProg\":\"通常四年，学制灵活，允许提前或延期毕业。&K&部分院校可提供三年加速学位。&K&工程、建筑等专业需五年时间。\",\"updatedAt\":\"2025-02-13 11:28:49\",\"updatedBy\":\"admin\"}', '{\"msg\":\"修改成功\",\"code\":200}', 0, NULL, '2025-02-13 11:34:55', 13);
INSERT INTO `sys_oper_log` VALUES (1526, '意向目的地基本要求', 2, 'com.xintong.controller.admin.RegionInfoAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/regionInfo/edit', '60.12.13.184', 'XX XX', '{\"advantages\":\"院校世界排名高认可度高，学制相对短，申请要求客观友好，文化底蕴深厚，留学环境安全包容。\",\"appMaterial\":\"学术成绩单&K&在读证明/毕业证书&K&A-Level或同等学历成绩&K&UCAS申请表&K&推荐信&K&雅思/托福成绩&K&财务证明&K&作品集（如适用）&K&面试（如适用）&K&其他补充材料（如适用）\",\"budgetDetail\":\"每年总预算约为20-35万人民币\",\"budgetRange\":\"每年总预算约为20-35万人民币&K&*伦敦的生活成本高于其他城市\",\"countryFeat\":\"&k-topic-s&1.院校世界排名高：&k-topic-e&英国高等教育体系全球闻名，2025年QS世界大学排名，英国多所大学跻身前100位，排名仅次于美国，位列第二。&K&&k-topic-s&2.高等教育体制灵活：&k-topic-e&英国高等教育提供了多种入学途径，可以直入本科，如果不满足直入条件，可以就读预科或国际大一；如语言未达直入要求可搭配语言班。&K&&k-topic-s&3.最佳留学城市多：&k-topic-e&在2025QS全球最佳留学城市排名中，英国伦敦连续第六年蝉联榜首，爱丁堡位列全球第13。此外，英国共有16个城市进入全球最佳留学城市排名榜，其中8个城市进入全球TOP50。&K&&k-topic-s&4.文化和历史底蕴深厚：&k-topic-e&英国的城市如爱丁堡、曼彻斯特等不仅教育发达，还拥有丰富的历史遗迹和文化活动，为留学生提供了多彩的文化体验。&K&&k-topic-s&5.就业起点高机会多：&k-topic-e&英国大学的教育质量得到了国际认可，使得毕业生在全球范围内的就业竞争中占据有利地位，拥有更广阔的职业前景。\\n\",\"createdAt\":\"2024-01-01 10:00:00\",\"createdBy\":\"admin\",\"eduSystem\":\"通常本科3年制，苏格兰地区本科4年制，特殊专业4或5年以上。\",\"enrollTimeline\":\"http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202501071041/image%20(1).png\",\"id\":1,\"isActive\":0,\"isDeleted\":0,\"rankUrl\":\"\",\"regularProg\":\"英格兰、威尔士和北爱尔兰地区：通常为三年制。经过三年学习可获“荣誉学士学位”或“普通学士学位”。&K&苏格兰地区：通常为四年制。学生用三年时间攻读“普通学士学位”，四年时间获得“荣誉学士学位”。&K&某些专业如医学类、法学类、工程类等特殊专业，需要四-五年或更长时间。\",\"updatedAt\":\"2025-02-13 11:12:39\",\"updatedBy\":\"admin\"}', '{\"msg\":\"修改成功\",\"code\":200}', 0, NULL, '2025-02-13 11:36:01', 13);
INSERT INTO `sys_oper_log` VALUES (1527, '意向目的地基本要求', 2, 'com.xintong.controller.admin.RegionInfoAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/regionInfo/edit', '60.12.13.184', 'XX XX', '{\"advantages\":\"高质量教育体系、全英语学习环境、较低的学费和生活成本、宽松的签证政策、良好的工作签证、跨国公司总部聚集、友好安全的社会环境\",\"appMaterial\":\"高中成绩单原件或认证版扫描件&K&在读证明/毕业证扫描件&K&高考成绩（如适用，TCD/UCD需要）&K&学生本人护照扫描件&K&雅思或托福等语言成绩（2年内有效）&K&个人陈述/推荐信等文书等\",\"budgetDetail\":\"首都都柏林地区总预算：每年约24万-30万人民币；&K&非首都地区总预算：每年约15万-25万人民币\",\"budgetRange\":\"首都都柏林地区&K&学费：约10万-16万人民币/年&K&住宿：约10万+/年，丰俭由人&K&饮食：约2.4万-3万/年&K&交通：约1.08万-1.5万/年&K&总预算：每年约24万-30万人民币&K&非首都地区&K&学费：约8万-14万人民币/年&K&住宿：约5万-7万，丰俭由人&K&饮食：约1.5万-3万/年&K&交通：约6000-9600元/年&K&总预算：每年约15万-25万人民币\",\"countryFeat\":\"&k-topic-s&1. 较低的学费和生活成本：&k-topic-e&爱尔兰的学费和生活成本相对英国、美国等西方主流国家更低，是预算有限学生的理想选择。&K&&k-topic-s&2. 宽松的签证政策：&k-topic-e&爱尔兰签证申请过程简单透明，通过率高，为国际学生提供便利。&K&&k-topic-s&3. 毕业后工作签证：&k-topic-e&留学生在爱尔兰毕业后，本科有1年工签，硕士有2年工签时间，更有利于学生找到理想工作。&K&&k-topic-s&4. 跨国公司总部聚集：&k-topic-e&爱尔兰是谷歌、苹果、Facebook等跨国公司欧洲总部所在地，提供丰富的实习和就业机会。&K&&k-topic-s&5. 友好安全的社会环境：&k-topic-e&爱尔兰严格控制枪支，犯罪率低，社会友好热情，留学生容易融入当地社区。&K&&k-topic-s&6. 高质量教育体系：&k-topic-e&爱尔兰高等教育在多个学科领域具有全球领先水平，本科3-4年、硕士1年的学制节省时间和费用。&K&&k-topic-s&7. 全英语学习环境：&k-topic-e&爱尔兰官方语言为英语，学生可在全英语环境中快速提升语言能力。&K&&k-topic-s&8. 教育与产业紧密结合：&k-topic-e&大学与企业合作紧密，课程设置包含实习和实践环节，学生可积累工作经验，为未来职业发展打下基础。\",\"createdAt\":\"2025-02-13 10:52:59\",\"createdBy\":\"admin\",\"eduSystem\":\"一般为3-4年\",\"enrollTimeline\":\"http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202502131142/%E7%88%B1%E5%B0%94%E5%85%B0-%E6%9C%AC%E7%A7%91-%E7%95%99%E5%AD%A6%E6%97%B6%E9%97%B4%E8%BD%B4.png\",\"id\":19,\"isActive\":0,\"isDeleted\":0,\"rankUrl\":\"\",\"regularProg\":\"一般为3-4年：大部分商科、艺术和人文类专业为3年，而工程、计算机、科学等专业通常为4年。\",\"updatedAt\":\"2025-02-13 10:56:13\",\"updatedBy\":\"admin\"}', '{\"msg\":\"修改成功\",\"code\":200}', 0, NULL, '2025-02-13 11:42:21', 10);
INSERT INTO `sys_oper_log` VALUES (1528, '意向目的地基本要求', 2, 'com.xintong.controller.admin.RegionInfoAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/regionInfo/edit', '60.12.13.184', 'XX XX', '{\"advantages\":\"学历认可度高、优质教学、费用低、专业多样、距离近、中西方文化融合\",\"appMaterial\":\"身份证&K&高考成绩单&K&艺考类美术科统考成绩单（艺术类专业）&K&电子照片（二寸白底彩照）等\",\"budgetDetail\":\"本科学费约2.5万-8万人民币/年&K&生活费约4万-5万人民币/年\",\"budgetRange\":\"在澳门读书预算因学校和专业不同而有所差异。&K&本科学费约2.5万-8万人民币/年，生活费约4万-5万人民币/年，丰俭由人。\",\"countryFeat\":\"&k-topic-s&1. 学历认可度高，升学便利：&k-topic-e&澳门学历文凭受国家教育部及全世界100多个国家认可。澳门院校也与美、英、欧等国的一些著名大学有签订分数互认协定。&K&&k-topic-s&2. 招生报名和录取名额不占用高考志愿：&k-topic-e&国内高中生可以凭借高考成绩直接申请澳门高校。而且，澳门高校招收内地学生为独立招生，并不属于全国普通高校统一招生计划内，考生于澳门学校的报名及录取不会影响其他内地高考的志愿录取。&K&&k-topic-s&3. 费用低：&k-topic-e&澳门读书最突出的一点就是花费少，虽然澳门香港紧邻，但澳门升学的费用比香港少将近一半。&K&&k-topic-s&4. 安全性高，回家方便：&k-topic-e&澳门的防疫和留学安全都可以得到保证，澳门在回归祖国后，联合国更是把澳门评为世界治安最好的地区之一。没有签证上的障碍，回家探亲也非常方便。\",\"createdAt\":\"2025-02-13 10:43:21\",\"createdBy\":\"admin\",\"eduSystem\":\"本科通常4年制\",\"enrollTimeline\":\"http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202502131124/%E4%B8%AD%E5%9B%BD%E6%BE%B3%E9%97%A8-%E6%9C%AC%E7%A7%91-%E6%97%B6%E9%97%B4%E8%BD%B4.png\",\"id\":18,\"isActive\":0,\"isDeleted\":0,\"rankUrl\":\"\",\"regularProg\":\"学制一般为4年，私立大学有先修班学制1年\",\"updatedAt\":\"2025-02-13 11:24:29\",\"updatedBy\":\"admin\"}', '{\"msg\":\"修改成功\",\"code\":200}', 0, NULL, '2025-02-13 11:42:43', 12);
INSERT INTO `sys_oper_log` VALUES (1529, '意向目的地基本要求', 2, 'com.xintong.controller.admin.RegionInfoAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/regionInfo/edit', '60.12.13.184', 'XX XX', '{\"advantages\":\"教育质量优质，离家近，环境易适应，政策利好就业机会丰富\",\"appMaterial\":\"针对高考生：&K&香港中文大学、香港城市大学、香港珠海学院这3所高校已被纳入内地高考统一招生计划，学生可通过高考志愿填报录取。其他香港高校采用自主招生方式，均需学生自行提交入学申请。&K&学术成绩单&K&会考成绩&K&高考成绩（总成绩、英语成绩）&K&在读证明/毕业证书&K&个人简历（非必须）&K&个人陈述&K&推荐信&K&面试（如适用）\",\"budgetDetail\":\"每年总预算约为20-30万人民币\",\"budgetRange\":\"每年总预算约为20-30万人民币\\r\\n如就读商科专业预算需提高\",\"countryFeat\":\"&k-topic-s&1.教育质量优质：&k-topic-e&中国香港高校在全球范围内享有盛誉，“港前五”（香港大学、香港中文大学、香港科技大学、香港理工大学、香港城市大学）常年霸榜QS世界大学排名前100位；&K&&k-topic-s&2.地理和距离优势：&k-topic-e&对于中国内地学生来说，香港地理位置接近，交通便利，文化相似，更易于适应；&K&&k-topic-s&3.留学性价比相对较高：&k-topic-e&相较于其他海外留学目的地，如美国、英国、澳大利亚等，香港学费和生活成本较为适中。&K&&k-topic-s&4.高度认可高考成绩：&k-topic-e&中国香港绝大多数院校都认可高考成绩申请，同时也认可高考英语成绩，普高生无需再额外备考英语标准化考试 (如托福、雅思等)。&K&&k-topic-s&5.语言环境友好：&k-topic-e&香港语言是“两文三语”，两文是中英文，三语是英语、粤语、普通话；与内地相比，在港求学除了可以享受更好的英语学习环境之外，还能在潜移默化中掌握粤语。&K&&k-topic-s&6.政策利好就业机会多：&k-topic-e&港府鼓励毕业生留港就业，非本地毕业生留港/回港就业安排 (IANG签证) 允许本科毕业生无需事先获得工作邀请即可在香港工作，无名额限制；香港作为国际金融中心和商业枢纽，就业机会丰富，港前五院校毕业生平均起薪可达20,000港币及以上。\\n\",\"createdAt\":\"2024-01-09 10:00:00\",\"createdBy\":\"admin\",\"eduSystem\":\"通常为4年制\",\"enrollTimeline\":\"\\r\\nhttp://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202501071055/image%20(9).png\",\"id\":9,\"isActive\":0,\"isDeleted\":0,\"rankUrl\":\"\",\"regularProg\":\"通常为4年制\\r\\n双学位课程多数为5年制\\r\\n特定专业如医科领域需5年或以上\",\"updatedAt\":\"2025-01-23 16:02:27\",\"updatedBy\":\"admin\"}', '{\"msg\":\"修改成功\",\"code\":200}', 0, NULL, '2025-02-13 11:46:38', 11);
