INSERT INTO `sys_oper_log` VALUES (1539, '意向目的地基本要求', 2, 'com.xintong.controller.admin.RegionInfoAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/regionInfo/edit', '60.12.13.184', 'XX XX', '{\"advantages\":\"院校世界排名高认可度高，学制短且灵活，申请要求客观友好，留学环境安全包容\",\"appMaterial\":\"高学术成绩单&K&在读证明/毕业证书&K&雅思/托福/PTE等成绩&K&作品集（如适用）&K&面试（如适用）&K&其他补充材料（如适用）\",\"budgetDetail\":\"每年总预算约为25-45万人民币\",\"budgetRange\":\"每年总预算约为25-45万人民币&K&悉尼、墨尔本的生活成本高于其他城市\",\"countryFeat\":\"&k-topic-s&1.院校世界排名高：&k-topic-e&澳大利亚高等教育体系全球闻名，2025年QS世界大学排名，澳大利亚9所大学跻身前100位，排名仅次于美国、英国，位列第三。&K&&k-topic-s&2.高等教育体制灵活：&k-topic-e&每年多次开学，申请要求客观友好；入学途径灵活多元，根据自身学术条件申请直入本科课程、国际大一课程或桥梁课程，根据语言成绩搭配语言课程。&K&&k-topic-s&3.最佳留学城市多：&k-topic-e&2024年QS最佳留学城市排名，澳大利亚6座城市跻身前50位；澳大利亚具有丰富的自然资源和独特的生态系统，城市大多位于沿海地区，气候宜人，拥有高质量、安全的生活环境；同时作为移民国家，文化环境多元且友好，留学生更易适应。&K&&k-topic-s&4.就业起点高机会多：&k-topic-e&澳大利亚QS前100院校多且全球认可度高，课程设置紧跟全球产业发展趋势，毕业生在中国更具职场竞争力，起薪高、机会多、晋升快。&K&&k-topic-s&5.留澳政策利好：&k-topic-e&澳大利亚对大学毕业生的需求量大，《2023年年度工作和技能报告》预计2033年就业人数新增约200万，澳政府为国际学生提供了毕业后工作签证（PSW），鼓励国际生毕业后留澳工作。\\n\",\"createdAt\":\"2024-01-03 10:00:00\",\"createdBy\":\"admin\",\"eduSystem\":\"本科3年，荣誉学士学位为4年，特殊专业为4年或以上\\r\",\"enrollTimeline\":\"http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202501071044/image%20(3).png\",\"id\":3,\"isActive\":0,\"isDeleted\":0,\"rankUrl\":\"\",\"regularProg\":\"通常三年，荣誉学士学位为四年&K&特定专业如工程类、教育类需四年，特殊专业如牙医、医学需五年或以上\",\"updatedAt\":\"2025-01-23 15:53:58\",\"updatedBy\":\"admin\"}', '{\"msg\":\"修改成功\",\"code\":200}', 0, NULL, '2025-02-13 13:27:04', 13);
INSERT INTO `sys_oper_log` VALUES (1540, '消息', 1, 'com.xintong.controller.admin.MessageAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/message/add', '60.12.13.184', 'XX XX', '{\"content\":\"<p><span style=\\\"font-size: 24px;\\\"><strong>悉尼新南威尔士大学UNSW招生流程等信息</strong></span><span style=\\\"background-color: transparent; font-size: 24px;\\\"><strong>线上发布会</strong></span></p><p><span style=\\\"font-size: 13px;\\\"><strong>会议时间：2月20日13:00-13:45</strong></span></p><p><span style=\\\"font-size: 13px;\\\">会议平台：ZOOM</span></p><p><span style=\\\"font-size: 13px;\\\">注册链接：</span><a href=\\\"https://www.eventbrite.com.au/e/unsw-2025-admissions-webinar-tickets-1244279546619?aff=edmInvite\\\" target=\\\"_blank\\\"><span style=\\\"font-size: 13px;\\\">https://www.eventbrite.com.au/e/unsw-2025-admissions-webinar-tickets-1244279546619?aff=edmInvite</span></a></p><p><span style=\\\"font-size: 13px;\\\">会议内容包含如下</span></p><ul><li><span style=\\\"font-size: 13px;\\\">详细介绍全新招生流程，如审理时间，OFFER发放时间&amp;有效期，以及延期政策等</span></li><li><span style=\\\"font-size: 13px;\\\">针对2026年申请提供25T3选择</span></li><li><span style=\\\"font-size: 13px;\\\">MD111对申请以及签证处理的影响</span></li><li><span style=\\\"font-size: 13px;\\\">UNSW College最新资讯等</span></li></ul><p><span style=\\\"font-size: 13px;\\\">请各位老师及时注册，积极参加!</span></p>\",\"isActive\":1,\"title\":\"【UNSW】招生流程等信息线上发布会2月20日13:00-13:45\",\"type\":2}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-13 13:27:18', 14);
INSERT INTO `sys_oper_log` VALUES (1541, '消息-禁/启用', 2, 'com.xintong.controller.admin.MessageAdminController.active()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/message/active', '60.12.13.184', 'XX XX', '{\"id\":41,\"isActive\":0}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-13 13:27:22', 13);
INSERT INTO `sys_oper_log` VALUES (1542, '意向目的地基本要求', 2, 'com.xintong.controller.admin.RegionInfoAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/regionInfo/edit', '60.12.13.184', 'XX XX', '{\"advantages\":\"院校世界排名高认可度高，学制短且灵活，申请要求客观友好，留学环境安全包容\",\"appMaterial\":\"学术成绩单&K&在读证明/毕业证书&K&雅思/托福/PTE等成绩&K&作品集（如适用）&K&面试（如适用）&K&其他补充材料（如适用）\",\"budgetDetail\":\"每年总预算约为25-45万人民币\",\"budgetRange\":\"每年总预算约为25-45万人民币&K&悉尼、墨尔本的生活成本高于其他城市\",\"countryFeat\":\"&k-topic-s&1.院校世界排名高：&k-topic-e&澳大利亚高等教育体系全球闻名，2025年QS世界大学排名，澳大利亚9所大学跻身前100位，排名仅次于美国、英国，位列第三。&K&&k-topic-s&2.高等教育体制灵活：&k-topic-e&每年多次开学，申请要求客观友好；入学途径灵活多元，根据自身学术条件申请直入本科课程、国际大一课程或桥梁课程，根据语言成绩搭配语言课程。&K&&k-topic-s&3.最佳留学城市多：&k-topic-e&2024年QS最佳留学城市排名，澳大利亚6座城市跻身前50位；澳大利亚具有丰富的自然资源和独特的生态系统，城市大多位于沿海地区，气候宜人，拥有高质量、安全的生活环境；同时作为移民国家，文化环境多元且友好，留学生更易适应。&K&&k-topic-s&4.就业起点高机会多：&k-topic-e&澳大利亚QS前100院校多且全球认可度高，课程设置紧跟全球产业发展趋势，毕业生在中国更具职场竞争力，起薪高、机会多、晋升快。&K&&k-topic-s&5.留澳政策利好：&k-topic-e&澳大利亚对大学毕业生的需求量大，《2023年年度工作和技能报告》预计2033年就业人数新增约200万，澳政府为国际学生提供了毕业后工作签证（PSW），鼓励国际生毕业后留澳工作。\\n\",\"createdAt\":\"2024-01-03 10:00:00\",\"createdBy\":\"admin\",\"eduSystem\":\"本科3年，荣誉学士学位为4年，特殊专业为4年或以上\\r\",\"enrollTimeline\":\"http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202501071044/image%20(3).png\",\"id\":3,\"isActive\":0,\"isDeleted\":0,\"rankUrl\":\"\",\"regularProg\":\"通常三年，荣誉学士学位为四年&K&特定专业如工程类、教育类需四年，特殊专业如牙医、医学需五年或以上\",\"updatedAt\":\"2025-02-13 13:27:05\",\"updatedBy\":\"admin\"}', '{\"msg\":\"修改成功\",\"code\":200}', 0, NULL, '2025-02-13 13:27:59', 13);
INSERT INTO `sys_oper_log` VALUES (1543, '意向目的地基本要求', 2, 'com.xintong.controller.admin.RegionInfoAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/regionInfo/edit', '60.12.13.184', 'XX XX', '{\"advantages\":\"顶尖的教育资源，名校众多，体系灵活，文化多元，学历全球认可度高，就业前景广。\",\"appMaterial\":\"高中学术成绩单&K&中期报告&K&个人简历&K&个人陈述&K&补充文书&K&推荐信&K&托福/雅思成绩&K&其他标化成绩&K&财务证明&K&作品集（如适用）&K&面试（如适用）\",\"budgetDetail\":\"每年总预算约为20-70万人民币\",\"budgetRange\":\"公立大学每年总预算约为20万~50万人民币；&K&私立大学每年总预算约为30万~70万人民币。&K&纽约、波士顿、洛杉矶等大城市的生活成本高于其他城市。\",\"countryFeat\":\"&k-topic-s&1.优质大学众多：&k-topic-e&2025QS世界大学排名前100中美国院校27所，2025U.S. News全球最佳院校排名中美国院校48所。&K&&k-topic-s&2.申请评估全面：&k-topic-e&美国大学采用整体审查（Holistic Review）不仅依据传统的学术成就指标（如成绩和标准化考试分数）来评估申请人，还会考量申请者的独特经历和个人特质。&K&&k-topic-s&3.教育体系灵活：&k-topic-e&文理学院及部分综合型大学允许学生不定专业入学，在大学学习过程中探索学术兴趣。美国大学允许学生自由更换专业（一般在大三前确定专业），甚至在不同学校之间转学，并提供夏季学期以加速学业。&K&&k-topic-s&4.就业前景广阔：&k-topic-e&美国本科学位在全球范围内认可度高，毕业生起薪高、潜力大、晋升快。53%中国企业招聘者更青睐美国留学背景学生*。*数据来源：2024中国学生出国留学发展报告。&K&&k-topic-s&5.留美就业机会：&k-topic-e&提供至少一年OPT（Optional Practical Training），STEM项目三年OPT；世界500强企业云集，毕业后留美工作机会多。&K&&k-topic-s&6.丰厚的奖学金：&k-topic-e&每年各类奖学金总额高达500亿美元，种类包括联邦政府奖学金、私人基金奖学金、学院内奖学金、助学金以及减免学费等。&K&&k-topic-s&7.申请要素：&k-topic-e&申请上需做到“早规划早准备”，合理规划并深度参与有个人特色的背景活动，科学安排各项标化考试的学习计划和出分节奏。9年级：启动托福/雅思学习、如有能力可开始AP课程学习；10年级：开始AP课程学习、启动SAT/ACT等标化考试学习；目标冲刺名校建议在10年级（最晚11年级）暑假参加夏校项目。补充到红框位置。\",\"createdAt\":\"2024-01-04 10:00:00\",\"createdBy\":\"admin\",\"eduSystem\":\"通常为4年制\",\"enrollTimeline\":\"http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202501231541/imageUSA.png\",\"id\":4,\"isActive\":0,\"isDeleted\":0,\"rankUrl\":\"\",\"regularProg\":\"通常四年，学制灵活，允许提前或延期毕业。&K&部分院校可提供三年加速学位。&K&工程、建筑等专业需五年时间。\",\"updatedAt\":\"2025-02-13 11:34:55\",\"updatedBy\":\"admin\"}', '{\"msg\":\"修改成功\",\"code\":200}', 0, NULL, '2025-02-13 13:31:01', 13);
INSERT INTO `sys_oper_log` VALUES (1544, '意向目的地基本要求', 2, 'com.xintong.controller.admin.RegionInfoAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/regionInfo/edit', '60.12.13.184', 'XX XX', '{\"advantages\":\"院校世界排名高认可度高，学制相对短，申请要求客观友好，文化底蕴深厚，留学环境安全包容。\",\"appMaterial\":\"高中学术成绩单&K&在读证明/毕业证书&K&A-Level或同等学历成绩&K&UCAS申请表&K&推荐信&K&雅思/托福成绩&K&财务证明&K&作品集（如适用）&K&面试（如适用）&K&其他补充材料（如适用）\",\"budgetDetail\":\"每年总预算约为20-35万人民币\",\"budgetRange\":\"每年总预算约为20-35万人民币&K&*伦敦的生活成本高于其他城市\",\"countryFeat\":\"&k-topic-s&1.院校世界排名高：&k-topic-e&英国高等教育体系全球闻名，2025年QS世界大学排名，英国多所大学跻身前100位，排名仅次于美国，位列第二。&K&&k-topic-s&2.高等教育体制灵活：&k-topic-e&英国高等教育提供了多种入学途径，可以直入本科，如果不满足直入条件，可以就读预科或国际大一；如语言未达直入要求可搭配语言班。&K&&k-topic-s&3.最佳留学城市多：&k-topic-e&在2025QS全球最佳留学城市排名中，英国伦敦连续第六年蝉联榜首，爱丁堡位列全球第13。此外，英国共有16个城市进入全球最佳留学城市排名榜，其中8个城市进入全球TOP50。&K&&k-topic-s&4.文化和历史底蕴深厚：&k-topic-e&英国的城市如爱丁堡、曼彻斯特等不仅教育发达，还拥有丰富的历史遗迹和文化活动，为留学生提供了多彩的文化体验。&K&&k-topic-s&5.就业起点高机会多：&k-topic-e&英国大学的教育质量得到了国际认可，使得毕业生在全球范围内的就业竞争中占据有利地位，拥有更广阔的职业前景。\\n\",\"createdAt\":\"2024-01-01 10:00:00\",\"createdBy\":\"admin\",\"eduSystem\":\"通常本科3年制，苏格兰地区本科4年制，特殊专业4或5年以上。\",\"enrollTimeline\":\"http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202501071041/image%20(1).png\",\"id\":1,\"isActive\":0,\"isDeleted\":0,\"rankUrl\":\"\",\"regularProg\":\"英格兰、威尔士和北爱尔兰地区：通常为三年制。经过三年学习可获“荣誉学士学位”或“普通学士学位”。&K&苏格兰地区：通常为四年制。学生用三年时间攻读“普通学士学位”，四年时间获得“荣誉学士学位”。&K&某些专业如医学类、法学类、工程类等特殊专业，需要四-五年或更长时间。\",\"updatedAt\":\"2025-02-13 11:36:01\",\"updatedBy\":\"admin\"}', '{\"msg\":\"修改成功\",\"code\":200}', 0, NULL, '2025-02-13 13:31:16', 13);
INSERT INTO `sys_oper_log` VALUES (1545, '意向目的地基本要求', 2, 'com.xintong.controller.admin.RegionInfoAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/regionInfo/edit', '60.12.13.184', 'XX XX', '{\"advantages\":\"教育质量优质，离家近，环境易适应，政策利好就业机会丰富\",\"appMaterial\":\"针对高考生：&K&香港中文大学、香港城市大学、香港珠海学院这3所高校已被纳入内地高考统一招生计划，学生可通过高考志愿填报录取。其他香港高校采用自主招生方式，均需学生自行提交入学申请。&K&高中学术成绩单&K&会考成绩&K&高考成绩（总成绩、英语成绩）&K&在读证明/毕业证书&K&个人简历（非必须）&K&个人陈述&K&推荐信&K&面试（如适用）&K&*国际课程体系学生（无高考/会考成绩）提供国际课程考试成绩、雅思/托福成绩。\",\"budgetDetail\":\"每年总预算约为20-30万人民币\",\"budgetRange\":\"每年总预算约为20-30万人民币&K&如就读商科专业预算需提高\",\"countryFeat\":\"&k-topic-s&1.教育质量优质：&k-topic-e&中国香港高校在全球范围内享有盛誉，“港前五”（香港大学、香港中文大学、香港科技大学、香港理工大学、香港城市大学）常年霸榜QS世界大学排名前100位；&K&&k-topic-s&2.地理和距离优势：&k-topic-e&对于中国内地学生来说，香港地理位置接近，交通便利，文化相似，更易于适应；&K&&k-topic-s&3.留学性价比相对较高：&k-topic-e&相较于其他海外留学目的地，如美国、英国、澳大利亚等，香港学费和生活成本较为适中。&K&&k-topic-s&4.高度认可高考成绩：&k-topic-e&中国香港绝大多数院校都认可高考成绩申请，同时也认可高考英语成绩，普高生无需再额外备考英语标准化考试 (如托福、雅思等)。&K&&k-topic-s&5.语言环境友好：&k-topic-e&香港语言是“两文三语”，两文是中英文，三语是英语、粤语、普通话；与内地相比，在港求学除了可以享受更好的英语学习环境之外，还能在潜移默化中掌握粤语。&K&&k-topic-s&6.政策利好就业机会多：&k-topic-e&港府鼓励毕业生留港就业，非本地毕业生留港/回港就业安排 (IANG签证) 允许本科毕业生无需事先获得工作邀请即可在香港工作，无名额限制；香港作为国际金融中心和商业枢纽，就业机会丰富，港前五院校毕业生平均起薪可达20,000港币及以上。\\n\",\"createdAt\":\"2024-01-09 10:00:00\",\"createdBy\":\"admin\",\"eduSystem\":\"通常为4年制\",\"enrollTimeline\":\"\\r\\nhttp://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202501071055/image%20(9).png\",\"id\":9,\"isActive\":0,\"isDeleted\":0,\"rankUrl\":\"\",\"regularProg\":\"通常为4年制，双学位课程多数为5年制&K&特定专业如医科领域需5年或以上\",\"updatedAt\":\"2025-02-13 11:52:56\",\"updatedBy\":\"admin\"}', '{\"msg\":\"修改成功\",\"code\":200}', 0, NULL, '2025-02-13 13:31:35', 12);
INSERT INTO `sys_oper_log` VALUES (1546, '意向目的地基本要求', 2, 'com.xintong.controller.admin.RegionInfoAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/regionInfo/edit', '60.12.13.184', 'XX XX', '{\"advantages\":\"院校世界排名高认可度高，学制短且灵活，申请要求客观友好，留学环境安全包容\",\"appMaterial\":\"高中学术成绩单&K&在读证明/毕业证书&K&雅思/托福/PTE等成绩&K&作品集（如适用）&K&面试（如适用）&K&其他补充材料（如适用）\",\"budgetDetail\":\"每年总预算约为25-45万人民币\",\"budgetRange\":\"每年总预算约为25-45万人民币&K&悉尼、墨尔本的生活成本高于其他城市\",\"countryFeat\":\"&k-topic-s&1.院校世界排名高：&k-topic-e&澳大利亚高等教育体系全球闻名，2025年QS世界大学排名，澳大利亚9所大学跻身前100位，排名仅次于美国、英国，位列第三。&K&&k-topic-s&2.高等教育体制灵活：&k-topic-e&每年多次开学，申请要求客观友好；入学途径灵活多元，根据自身学术条件申请直入本科课程、国际大一课程或桥梁课程，根据语言成绩搭配语言课程。&K&&k-topic-s&3.最佳留学城市多：&k-topic-e&2024年QS最佳留学城市排名，澳大利亚6座城市跻身前50位；澳大利亚具有丰富的自然资源和独特的生态系统，城市大多位于沿海地区，气候宜人，拥有高质量、安全的生活环境；同时作为移民国家，文化环境多元且友好，留学生更易适应。&K&&k-topic-s&4.就业起点高机会多：&k-topic-e&澳大利亚QS前100院校多且全球认可度高，课程设置紧跟全球产业发展趋势，毕业生在中国更具职场竞争力，起薪高、机会多、晋升快。&K&&k-topic-s&5.留澳政策利好：&k-topic-e&澳大利亚对大学毕业生的需求量大，《2023年年度工作和技能报告》预计2033年就业人数新增约200万，澳政府为国际学生提供了毕业后工作签证（PSW），鼓励国际生毕业后留澳工作。\\n\",\"createdAt\":\"2024-01-03 10:00:00\",\"createdBy\":\"admin\",\"eduSystem\":\"本科3年，荣誉学士学位为4年，特殊专业为4年或以上\\r\",\"enrollTimeline\":\"http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202501071044/image%20(3).png\",\"id\":3,\"isActive\":0,\"isDeleted\":0,\"rankUrl\":\"\",\"regularProg\":\"通常三年，荣誉学士学位为四年&K&特定专业如工程类、教育类需四年，特殊专业如牙医、医学需五年或以上\",\"updatedAt\":\"2025-02-13 13:28:00\",\"updatedBy\":\"admin\"}', '{\"msg\":\"修改成功\",\"code\":200}', 0, NULL, '2025-02-13 13:31:48', 13);
INSERT INTO `sys_oper_log` VALUES (1547, '意向目的地基本要求', 2, 'com.xintong.controller.admin.RegionInfoAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/regionInfo/edit', '60.12.13.184', 'XX XX', '{\"advantages\":\"留学环境安全宜居，教育体系多元灵活，更高留学性价比\",\"appMaterial\":\"高考成绩/高中学术成绩单&K&在读证明/毕业证书&K&雅思/托福成绩&K&作品集（如适用）&K&面试（如适用）&K&其他补充材料（如适用）\",\"budgetDetail\":\"每年总预算约为20-30万人民币\",\"budgetRange\":\"每年总预算约为20-30万人民币&K&*备注：如申请新加坡公立大学政府助学金，可减免学费50%-80%，该助学金需学生毕业后需在新加坡工作一定年限。\",\"countryFeat\":\"&k-topic-s&1.教育质量卓越：&k-topic-e&新加坡拥有世界一流的学府，如新加坡国立大学（2025QS世界大学排名第8位）、南洋理工大学（2025QS世界大学排名第15位）等。&K&&k-topic-s&2.教育体系多元：&k-topic-e&新加坡不仅拥有全球顶尖的公立大学，同时也有独具特色的私立大学，通过与国际知名大学建立合作关系，提升学位国际认可度。&K&&k-topic-s&3.环境安全宜居：&k-topic-e&新加坡社会安定，犯罪率低，适宜留学生活；且新政府十分欢迎中国留学生，留学签证获准率高且速度快。&K&&k-topic-s&4.中英双语氛围：&k-topic-e&新加坡采用英语教学，日常生活中广泛使用中文，中国学生能够更快地适应。&K&&k-topic-s&5.留新就业机会多：&k-topic-e&毕业后留新工作机会多，同时有机会申请新加坡永居（PR）。\\n\",\"createdAt\":\"2024-01-07 10:00:00\",\"createdBy\":\"admin\",\"eduSystem\":\"本科2-4年，公立大学常为4年，私立大学2-3年\",\"enrollTimeline\":\"http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202501071048/image%20(7).png\",\"id\":7,\"isActive\":0,\"isDeleted\":0,\"rankUrl\":\"\",\"regularProg\":\"公立大学：通常为4年，特殊专业如工程或法律需5年或以上&K&私立大学：学制灵活，一般为2-3年，部分专业需4年\",\"updatedAt\":\"2025-01-23 15:54:46\",\"updatedBy\":\"admin\"}', '{\"msg\":\"修改成功\",\"code\":200}', 0, NULL, '2025-02-13 13:34:19', 13);
