INSERT INTO `sys_oper_log` VALUES (1561, '入学要求信息', 1, 'com.xintong.controller.admin.CollegeRequireAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/collegeRequire/add', '60.12.13.184', 'XX XX', '{\"content\":\"&k-topic-s&学术要求：&k-topic-e&根据不同专业，学生需达到所在省份高考满分的68%、72%、80%，且高中平时成绩达到80%、85%、90%。同时，学生还需满足部分专业对具体科目的分数要求 (临床、牙医、哥大双学位除外)；或者其他考试（SAT等）。 未参加高考或高考不理想的学生，可通过AST考试申请，600分可申请band3专业，700分可申请band2，750分可申请band1。&K&&k-topic-s&语言要求：&k-topic-e&雅思：总分不低于 6.5 分，小分不低于 6 分；托福：总分不低于 90 分，写作不低于 21 分；多邻国：总分 120/160 分，小分不低于 105 分；PTE：总分 63，口语单项不低于 59。注：本科计算机专业名额有限，申请时需提交合格的语言成绩。\",\"eduId\":3,\"isActive\":0,\"regionId\":138,\"title\":\"圣三一大学（QS世界No.87）\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-13 13:56:40', 17);
INSERT INTO `sys_oper_log` VALUES (1562, '入学要求信息', 1, 'com.xintong.controller.admin.CollegeRequireAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/collegeRequire/add', '60.12.13.184', 'XX XX', '{\"content\":\"&k-topic-s&学术要求：&k-topic-e&中国高考成绩总分65%—90% (根据专业而定)；A-level/IB/美国高中成绩+SAT/ACT+AP，或其它认可的国际性考试学历均认可。&K&&k-topic-s&语言要求：&k-topic-e&文科类要求‌托福100或‌雅思6.5（小分不低于6.0）；理工类要求托福80或雅思6.0（小分不低于6.0）。PTE 63 ( 各项不低于59)\",\"eduId\":3,\"isActive\":0,\"regionId\":138,\"title\":\"都柏林大学（2025QS世界排名126）\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-13 14:01:32', 17);
