INSERT INTO `sys_oper_log` VALUES (1565, '入学要求信息', 2, 'com.xintong.controller.admin.CollegeRequireAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/collegeRequire/edit', '60.12.13.184', 'XX XX', '{\"content\":\"&k-topic-s&学术要求：&k-topic-e&根据不同专业，学生需达到所在省份高考满分的68%、72%、80%，且高中平时成绩达到80%、85%、90%。同时，学生还需满足部分专业对具体科目的分数要求 (临床、牙医、哥大双学位除外)；或者其他考试（SAT等）。 未参加高考或高考不理想的学生，可通过AST考试申请，600分可申请band3专业，700分可申请band2，750分可申请band1。&K&&k-topic-s&语言要求：&k-topic-e&雅思：总分不低于 6.5 分，小分不低于 6 分；托福：总分不低于 90 分，写作不低于 21 分；多邻国：总分 120/160 分，小分不低于 105 分；PTE：总分 63，口语单项不低于 59。注：本科计算机专业名额有限，申请时需提交合格的语言成绩。\",\"eduId\":3,\"id\":38,\"isActive\":0,\"isDeleted\":0,\"regionId\":138,\"title\":\"圣三一大学（2025QS世界排名87）\"}', '{\"msg\":\"修改成功\",\"code\":200}', 0, NULL, '2025-02-13 14:02:11', 12);
INSERT INTO `sys_oper_log` VALUES (1566, '意向目的地基本要求', 2, 'com.xintong.controller.admin.RegionInfoAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/regionInfo/edit', '60.12.13.184', 'XX XX', '{\"advantages\":\"顶尖的教育资源，名校众多，体系灵活，文化多元，学历全球认可度高，就业前景广。\",\"appMaterial\":\"学术成绩单&K&在读证明/毕业证和学位证&K&个人简历&K&个人陈述&K&补充文书&K&推荐信&K&托福/雅思成绩&K&GRE/GMAT学术标化成绩&K&作品集（如适用）&K&面试（如适用）&K&工作经历证明（如适用）\",\"budgetDetail\":\"每年总预算约为25-70万\",\"budgetRange\":\"公立大学每年总预算约为25万~50万人民币；&K&私立大学每年总预算约为30万~70万人民币。&K&纽约、波士顿、洛杉矶等大城市的生活成本高于其他城市。\",\"countryFeat\":\"&k-topic-s&1.优质大学众多：&k-topic-e&2025QS世界大学排名前100中美国院校27所，2025U.S. News全球最佳院校排名中美国院校48所。&K&&k-topic-s&2.教育与科研资源丰富：&k-topic-e&美国拥有世界顶尖的高等教育和研究机构，在众多学科领域中占据领先地位，不仅拥有卓越的教学质量，还提供丰富的学术和研究资源与机会。&K&&k-topic-s&3.申请评估全面：&k-topic-e&美国大学采用整体审查（Holistic Review）不仅依据传统的学术成就指标（如在校成绩和标准化考试分数）来评估申请人，还会考量申请者的学术能力、学术科研经历/工作或实习经历，以及个人特质。&K&&k-topic-s&4.就业竞争力强：&k-topic-e&持有美国硕士学位的毕业生在全球市场上竞争力普遍更高；美国当地硕士毕业生就业率高于本科，起薪普遍也高于本科毕业生；回国就业的毕业生中拥有美国硕士学位，其平均月薪比国内同等条件毕业生高出约20%-30%*。*数据来源：美国大学与雇主协会 (NACE) 最新数据；《2023年中国留学生回国就业调查报告》。&K&&k-topic-s&5.留美就业机会：&k-topic-e&提供至少一年OPT（Optional Practical Training），STEM项目三年OPT；世界500强企业云集，毕业后留美工作机会多。&K&&k-topic-s&6.丰厚的奖学金：&k-topic-e&每年各类奖学金总额高达500亿美元，种类包括助学金、助教奖学金、助研奖学金、联邦政府奖学金、私人基金奖学金、学院内奖学金以及减免学费等。\\n\",\"createdAt\":\"2024-01-05 10:00:00\",\"createdBy\":\"admin\",\"eduSystem\":\"通常为1-2年制\",\"enrollTimeline\":\"http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202501071040/image.png\",\"id\":5,\"isActive\":0,\"isDeleted\":0,\"rankUrl\":\"\",\"regularProg\":\"授课型硕士通常为1-2年制，部分专业需要3年或以上，因专业和学校设置而不同。&K&学制多元且弹性大，允许提前修完学分毕业或延期。\",\"updatedAt\":\"2025-02-13 11:00:58\",\"updatedBy\":\"admin\"}', '{\"msg\":\"修改成功\",\"code\":200}', 0, NULL, '2025-02-13 14:02:52', 12);
INSERT INTO `sys_oper_log` VALUES (1567, '入学要求信息', 1, 'com.xintong.controller.admin.CollegeRequireAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/collegeRequire/add', '60.12.13.184', 'XX XX', '{\"content\":\"&k-topic-s&学术要求：&k-topic-e&无需高考或会考成绩，高中均分至少不低于80分(不同等级专业要求不同，另部分专业对数学、Lab Science学科等有单科成绩要求)；或我校认可的其它高中课程类型对等成绩，如A-Level, IB, SAT等。&K&&k-topic-s&申请材料要求：&k-topic-e&申请人如高中在读，申请时提供高一至高三上学期5个学期成绩单与在读证明；如申请人已高中毕业，需提供完整成绩单与高中毕业证明。&K&&k-topic-s&最低语言要求：&k-topic-e&雅思6.5(6.0)或其它英语考试类型对等成绩。&K&&k-topic-s&护理专业（专升本）要求：&k-topic-e&接受全日制专科护理相关背景申请，均分不低于75%，具有注册护士资格，且具有不少于6个月注册后工作经验，语言要求雅思6.5(单项不低于6.5)或其它英语考试类型对等成绩。\",\"eduId\":3,\"isActive\":0,\"regionId\":138,\"title\":\"科克大学（2025QS世界排名273）\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-13 14:05:27', 16);
INSERT INTO `sys_oper_log` VALUES (1568, '入学要求信息', 1, 'com.xintong.controller.admin.CollegeRequireAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/collegeRequire/add', '60.12.13.184', 'XX XX', '{\"content\":\"&k-topic-s&学术要求：&k-topic-e&无需提供高考成绩，高中三年成绩单(平均分最好达80%)，但申请人必须在进入就读本科学习前获得高中毕业证书。&K&&k-topic-s&语言要求：&k-topic-e&文科/商学/法律/理工/工程：雅思总分不低于6.5分，单项不低于5.5分；医学相关：雅思总分不低于6.5分，单项不低于6.5分。\",\"eduId\":3,\"isActive\":0,\"regionId\":138,\"title\":\"高威大学（2025QS世界排名273）\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-13 14:08:40', 16);
