INSERT INTO `sys_oper_log` VALUES (1572, '入学要求信息', 1, 'com.xintong.controller.admin.CollegeRequireAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/collegeRequire/add', '60.12.13.184', 'XX XX', '{\"content\":\"&k-topic-s&学术要求：&k-topic-e&无需提供高考成绩，高中三年均分75%-80%，视所申院校及专业而定。&K&&k-topic-s&语言要求：&k-topic-e&雅思6-6.5分，部分院校有单项要求。\",\"eduId\":3,\"isActive\":0,\"regionId\":138,\"title\":\"其他大学\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-13 14:09:38', 12);
