INSERT INTO `sys_oper_log` VALUES (1574, '意向目的地基本要求', 2, 'com.xintong.controller.admin.RegionInfoAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/regionInfo/edit', '60.12.13.184', 'XX XX', '{\"advantages\":\"院校世界排名高认可度高，学制相对短，申请要求客观友好，文化底蕴深厚，留学环境安全包容。\",\"appMaterial\":\"学术成绩单&K&在读证明/毕业证书&K&个人简历&K&个人陈述&K&研究计划（部分研究型硕士课程需要）&K&推荐信&K&雅思/托福成绩&K&GRE/GMAT等学术标化成绩（部分专业）&K&财务证明&K&作品集（如适用）&K&面试（如适用）&K&其他补充材料（如适用）\",\"budgetDetail\":\"每年总预算约为20-35万人民币\",\"budgetRange\":\"每年总预算约为20-35万人民币&K&*伦敦的生活成本高于其他城市\",\"countryFeat\":\"&k-topic-s&1.院校世界排名高：&k-topic-e&英国高等教育体系全球闻名，2025年QS世界大学排名，英国多所大学跻身前100位，排名仅次于美国，位列第二。&K&&k-topic-s&2.高等教育体制灵活：&k-topic-e&英国高等教育提供了多种入学途径，可以直入本科，如果不满足直入条件，可以就读预科或国际大一；如语言未达直入要求可搭配语言班。&K&&k-topic-s&3.最佳留学城市多：&k-topic-e&在2025QS全球最佳留学城市排名中，英国伦敦连续第六年蝉联榜首，爱丁堡位列全球第13。此外，英国共有16个城市进入全球最佳留学城市排名榜，其中8个城市进入全球TOP50。&K&&k-topic-s&4.文化和历史底蕴深厚：&k-topic-e&英国的城市如爱丁堡、曼彻斯特等不仅教育发达，还拥有丰富的历史遗迹和文化活动，为留学生提供了多彩的文化体验。&K&&k-topic-s&5.就业起点高机会多：&k-topic-e&英国大学的教育质量得到了国际认可，使得毕业生在全球范围内的就业竞争中占据有利地位，拥有更广阔的职业前景。\\n\",\"createdAt\":\"2024-01-02 10:00:00\",\"createdBy\":\"admin\",\"eduSystem\":\"授课型硕士通常为1年制\",\"enrollTimeline\":\"http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202501071043/image%20(2).png\",\"id\":2,\"isActive\":0,\"isDeleted\":0,\"rankUrl\":\"\",\"regularProg\":\"授课型硕士通常为1年制&K&研究型硕士需1-2年&K&特定专业需更长时间\",\"updatedAt\":\"2025-02-13 11:15:16\",\"updatedBy\":\"admin\"}', '{\"msg\":\"修改成功\",\"code\":200}', 0, NULL, '2025-02-13 14:10:34', 12);
INSERT INTO `sys_oper_log` VALUES (1575, '入学要求信息', 2, 'com.xintong.controller.admin.CollegeRequireAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/collegeRequire/edit', '60.12.13.184', 'XX XX', '{\"content\":\"&k-topic-s&学术要求：&k-topic-e&根据不同专业，学生需达到所在省份高考满分的68%、72%、80%，且高中平时成绩达到80%、85%、90%。同时，学生还需满足部分专业对具体科目的分数要求 (临床、牙医、哥大双学位除外)；或者其他考试（SAT等）。 未参加高考或高考不理想的学生，可通过AST考试申请，600分可申请band3专业，700分可申请band2，750分可申请band1。&K&&k-topic-s&语言要求：&k-topic-e&雅思：总分不低于 6.5 分，小分不低于 6 分；托福：总分不低于 90 分，写作不低于 21 分；多邻国：总分 120/160 分，小分不低于 105 分；PTE：总分 63，口语单项不低于 59。注：本科计算机专业名额有限，申请时需提交合格的语言成绩。\",\"eduId\":3,\"id\":38,\"isActive\":0,\"isDeleted\":0,\"regionId\":138,\"title\":\"圣三一大学（2025QS世界排名87）\"}', '{\"msg\":\"修改成功\",\"code\":200}', 0, NULL, '2025-02-13 14:12:11', 16);
INSERT INTO `sys_oper_log` VALUES (1576, '意向目的地基本要求', 2, 'com.xintong.controller.admin.RegionInfoAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/regionInfo/edit', '60.12.13.184', 'XX XX', '{\"advantages\":\"教育质量优质，离家近，环境易适应，政策利好就业机会多\",\"appMaterial\":\"学术成绩单（包含绩点换算证明）&K&在读证明/毕业证和学位证&K&个人简历&K&个人陈述&K&推荐信&K&雅思/托福成绩&K&GRE/GMAT学术标化成绩&K&作品集（如适用）&K&面试（如适用）&K&其他补充材料（如适用）\",\"budgetDetail\":\"每年总预算约为20-30万人民币\",\"budgetRange\":\"每年总预算约为20-30万人民币\",\"countryFeat\":\"&k-topic-s&1.教育质量优质：&k-topic-e&中国香港高校在全球范围内享有盛誉，“港前五”（香港大学、香港中文大学、香港科技大学、香港理工大学、香港城市大学）常年霸榜QS世界大学排名前100位；&K&&k-topic-s&2.地理和距离优势：&k-topic-e&对于中国内地学生来说，香港地理位置接近，交通便利，文化相似，更易于适应；&K&&k-topic-s&3.留学性价比相对较高：&k-topic-e&相较于其他海外留学目的地，如美国、英国、澳大利亚等，香港学费和生活成本较为适中。&K&&k-topic-s&4.语言环境友好：&k-topic-e&香港语言是“两文三语”，两文是中英文，三语是英语、粤语、普通话；与内地相比，在港求学除了可以享受更好的英语学习环境之外，还能在潜移默化中掌握粤语。&K&&k-topic-s&5.政策利好就业机会多：&k-topic-e&港府鼓励毕业生留港就业，非本地毕业生留港/回港就业安排 (IANG签证) 允许毕业生无需事先获得工作邀请即可在香港工作，无名额限制；香港作为国际金融中心和商业枢纽，就业机会丰富，港前五院校毕业生平均起薪可达20,000港币及以上。\\n\",\"createdAt\":\"2024-01-10 10:00:00\",\"createdBy\":\"admin\",\"eduSystem\":\"授课型硕士通常为1年制\",\"enrollTimeline\":\"http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202501071047/image%20(6).png\",\"id\":10,\"isActive\":0,\"isDeleted\":0,\"rankUrl\":\"\",\"regularProg\":\"授课型硕士通常为1年制，特定专业为2-3年制\",\"updatedAt\":\"2025-01-23 15:55:20\",\"updatedBy\":\"admin\"}', '{\"msg\":\"修改成功\",\"code\":200}', 0, NULL, '2025-02-13 14:17:05', 11);
INSERT INTO `sys_oper_log` VALUES (1577, '入学要求信息', 2, 'com.xintong.controller.admin.CollegeRequireAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/collegeRequire/edit', '60.12.13.184', 'XX XX', '{\"content\":\"&k-topic-s&高考成绩：&k-topic-e&需达到本科一批录取分数线，择优录取&K&&k-topic-s&英语成绩：&k-topic-e&需达到110分以上（满分150分）&K&&k-topic-s&材料要求：&k-topic-e&需提交高考成绩、身份证、英语成绩证明等材料\",\"eduId\":3,\"id\":35,\"isActive\":0,\"isDeleted\":0,\"regionId\":124,\"title\":\"澳门大学（QS世界前300）\"}', '{\"msg\":\"修改成功\",\"code\":200}', 0, NULL, '2025-02-13 14:21:18', 12);
INSERT INTO `sys_oper_log` VALUES (1578, '入学要求信息', 2, 'com.xintong.controller.admin.CollegeRequireAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/collegeRequire/edit', '60.12.13.184', 'XX XX', '{\"content\":\"&k-topic-s&高考成绩：&k-topic-e&达一本线以上&K&&k-topic-s&部分专业要求：&k-topic-e&（如中药学、药学）需有理科综合或化学成绩\",\"eduId\":3,\"id\":36,\"isActive\":0,\"isDeleted\":0,\"regionId\":124,\"title\":\"澳门科技大学（QS世界前500）\"}', '{\"msg\":\"修改成功\",\"code\":200}', 0, NULL, '2025-02-13 14:21:40', 12);
INSERT INTO `sys_oper_log` VALUES (1579, '入学要求信息', 2, 'com.xintong.controller.admin.CollegeRequireAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/collegeRequire/edit', '60.12.13.184', 'XX XX', '{\"content\":\"&k-topic-s&高考成绩：&k-topic-e&达本科线以上&K&&k-topic-s&部分专业要求：&k-topic-e&英语单科成绩达到相应要求\",\"eduId\":3,\"id\":37,\"isActive\":0,\"isDeleted\":0,\"regionId\":124,\"title\":\"其他大学\"}', '{\"msg\":\"修改成功\",\"code\":200}', 0, NULL, '2025-02-13 14:21:50', 12);
INSERT INTO `sys_oper_log` VALUES (1580, '意向目的地基本要求', 2, 'com.xintong.controller.admin.RegionInfoAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/regionInfo/edit', '60.12.13.184', 'XX XX', '{\"advantages\":\"院校世界排名高认可度高，学制短且灵活，要求客观友好，留学环境安全包容\",\"appMaterial\":\"学术成绩单&K&在读证明/毕业证和学位证&K&雅思/托福/PTE等成绩&K&申请文书（如适用）&K&GRE/GMAT等学术标化成绩（如适用）&K&作品集（如适用）&K&面试（如适用）&K&其他补充材料（如适用）\",\"budgetDetail\":\"每年总预算约为25-45万人民币\",\"budgetRange\":\"每年总预算约为25-45万人民币\\r\\n悉尼、墨尔本的生活成本高于其他城市\",\"countryFeat\":\"&k-topic-s&1.院校世界排名高：&k-topic-e&澳大利亚高等教育体系全球闻名，2025年QS世界大学排名，澳大利亚9所大学跻身前100位，排名仅次于美国、英国，位列第三。&K&&k-topic-s&2.高等教育体制灵活：&k-topic-e&每年多次开学，申请要求客观友好；入学途径灵活多元，根据自身学术条件申请直入硕士课程、硕士预科课程，根据语言条件搭配语言课程。&K&&k-topic-s&3.最佳留学城市多：&k-topic-e&2024年QS最佳留学城市排名，澳大利亚6座城市跻身世界排名前50；澳大利亚具有丰富的自然资源和独特的生态系统，城市大多位于沿海地区，气候宜人，拥有高质量、安全的生活环境；同时作为移民国家，文化环境多元且友好，留学生更易适应。&K&&k-topic-s&4.就业起点高机会多：&k-topic-e&澳大利亚QS前100院校多且认可度高，课程设置紧跟全球产业发展趋势，毕业生在中国更具竞争力，起薪高、机会多、晋升快。&K&&k-topic-s&5.留澳政策利好：&k-topic-e&澳大利亚对大学毕业生需求量大，政府发布的《2023年年度工作和技能报告》预计2033年就业人数新增约200万，澳政府为国际学生提供了毕业后工作签证（PSW），鼓励国际生本科毕业后留澳工作。\\n\",\"createdAt\":\"2024-01-06 10:00:00\",\"createdBy\":\"admin\",\"eduSystem\":\"授课型硕士通常有1年制、1.5年制、2年制\",\"enrollTimeline\":\"http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202501071044/image%20(4).png\",\"id\":6,\"isActive\":0,\"isDeleted\":0,\"rankUrl\":\"\",\"regularProg\":\"学制灵活，授课型硕士通常有1年制、1.5年制、2年制\\r\\n特定专业需更长时间，研究型硕士需2-3年\",\"updatedAt\":\"2025-01-23 15:54:34\",\"updatedBy\":\"admin\"}', '{\"msg\":\"修改成功\",\"code\":200}', 0, NULL, '2025-02-13 14:22:15', 12);
INSERT INTO `sys_oper_log` VALUES (1581, '意向目的地基本要求', 2, 'com.xintong.controller.admin.RegionInfoAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/regionInfo/edit', '60.12.13.184', 'XX XX', '{\"advantages\":\"留学环境安全宜居，教育体系多元灵活，更高留学性价比\",\"appMaterial\":\"学术成绩单&K&在读证明/毕业证和学位证&K&申请文书（如适用）&K&GRE/GMAT等学术标化成绩（如适用）&K&雅思/托福成绩&K&作品集（如适用）&K&面试（如适用）&K&其他补充材料（如适用）\",\"budgetDetail\":\"每年总预算约为20-35万人民币\",\"budgetRange\":\"每年总预算约为20-35万人民币\",\"countryFeat\":\"&k-topic-s&1.教育质量卓越：&k-topic-e&新加坡拥有世界一流的学府，如新加坡国立大学（2025QS世界大学排名第8位）、南洋理工大学（2025QS世界大学排名第15位）等。&K&&k-topic-s&2.教育体系多元：&k-topic-e&新加坡不仅拥有全球顶尖的公立大学，同时也有独具特色的私立大学，通过与国际知名大学建立合作关系，提升学位国际认可度。&K&&k-topic-s&3.环境安全宜居：&k-topic-e&新加坡社会安定，犯罪率低，适宜留学生活；且新政府十分欢迎中国留学生，留学签证获准率高且速度快。&K&&k-topic-s&4.中英双语氛围：&k-topic-e&新加坡采用英语教学，日常生活中广泛使用中文，中国学生能够更快地适应。&K&&k-topic-s&5.留新就业机会多：&k-topic-e&毕业后留新工作机会多，同时有机会申请新加坡永居（PR）。\\n\",\"createdAt\":\"2024-01-08 10:00:00\",\"createdBy\":\"admin\",\"eduSystem\":\"公立大学：1年制、1.5年制、2年制&K&私立大学：一般为1-1.5年，1年制居多\",\"enrollTimeline\":\"http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202501071050/image%20(8).png\",\"id\":8,\"isActive\":0,\"isDeleted\":0,\"rankUrl\":\"\",\"regularProg\":\"公立大学：授课型硕士通常有1年制、1.5年制、2年制&K&私立大学：学制较短，授课型硕士一般为1-1.5年，1年制居多\",\"updatedAt\":\"2025-01-23 15:54:58\",\"updatedBy\":\"admin\"}', '{\"msg\":\"修改成功\",\"code\":200}', 0, NULL, '2025-02-13 14:27:17', 13);
INSERT INTO `sys_oper_log` VALUES (1582, '意向目的地基本要求', 1, 'com.xintong.controller.admin.RegionInfoAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/regionInfo/add', '60.12.13.184', 'XX XX', '{\"advantages\":\"学历认可度高、优质教学、费用低、专业多样、距离近、中西方文化融合\",\"appMaterial\":\"完整前置学历全套成绩&K&在读证明/毕业证/学位证&K&身份证复印本&K&户口簿复印本&K&学生本人照片&K&推荐表&K&英语能力证明（如有）等\",\"budgetDetail\":\"硕士学费约6万-12万人民币/年&K&生活费约4万-5万人民币/年\",\"budgetRange\":\"在澳门读书预算因学校和专业不同而有所差异。&K&硕士学费约6万-12万人民币/年，生活费约4万-5万人民币/年，丰俭由人。\",\"countryFeat\":\"&k-topic-s&1. 学历认可度高，升学便利：&k-topic-e&澳门学历文凭受国家教育部及全世界100多个国家认可。澳门院校也与美、英、欧等国的一些著名大学有签订分数互认协定。&K&&k-topic-s&2. 招生报名和录取名额与内地考研不冲突：&k-topic-e&澳门高校招收内地学生为境外独立招生，与中国大陆地区考研不冲突。&K&&k-topic-s&3. 费用低：&k-topic-e&澳门读书最突出的一点就是花费少，虽然澳门香港紧邻，但澳门升学的费用比香港少将近一半。&K&&k-topic-s&4. 安全性高，回家方便：&k-topic-e&澳门的防疫和留学安全都可以得到保证，澳门在回归祖国后，联合国更是把澳门评为世界治安最好的地区之一。没有签证上的障碍，回家探亲也非常方便。\",\"eduId\":2,\"eduSystem\":\"硕士通常为2年\",\"enrollTimeline\":\"\",\"rankUrl\":\"\",\"regionId\":124,\"regularProg\":\"学制一般为2年&K&部分理工科专业3年\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-13 14:30:15', 17);
