INSERT INTO `sys_oper_log` VALUES (1588, '意向目的地基本要求', 2, 'com.xintong.controller.admin.RegionInfoAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/regionInfo/edit', '60.12.13.184', 'XX XX', '{\"advantages\":\"优质教育、多语言环境、文化丰富、地理位置佳、研究机会、生活费用适中、就业前景好。\",\"appMaterial\":\"个人简历&K&动机信&K&APS证书&K&推荐信&K&大学本科相关资料\",\"budgetDetail\":\"每年总预算约为15万人民币（包括学费和生活费）\",\"budgetRange\":\"学费: 公立1000欧-6000欧/年, 取决于专业和学校&K&住宿费: 300欧-800欧/月不等, 取决于地点和房屋类型&K&生活费: 10万RMB元/年起（包括住宿费）\",\"countryFeat\":\"&k-topic-s&高质量的教育&k-topic-e&比利时有多所世界知名的大学，如鲁汶大学、根特大学、布鲁塞尔自由大学等，提供多样化的课程和高水平的教育。&K&&k-topic-s&多语言环境&k-topic-e&比利时是多语言国家，官方语言包括荷兰语、法语和德语，留学生有机会学习和使用多种语言，增加自己的语言技能。&K&&k-topic-s&文化多样性&k-topic-e&比利时位于欧洲心脏地带，拥有丰富的历史和文化遗产，留学生可以体验不同的文化和传统。&K&&k-topic-s&地理位置优越&k-topic-e&比利时地处欧洲中心，与法国、德国、荷兰和卢森堡接壤，便于旅行和探索其他欧洲国家。\",\"createdAt\":\"2025-02-13 10:38:57\",\"createdBy\":\"admin\",\"eduSystem\":\"2年\",\"enrollTimeline\":\"\",\"id\":17,\"isActive\":0,\"isDeleted\":0,\"rankUrl\":\"\",\"regularProg\":\"通常两年，学制灵活，允许提前或延期毕业。\",\"updatedAt\":\"2025-02-13 10:43:36\",\"updatedBy\":\"admin\"}', '{\"msg\":\"修改成功\",\"code\":200}', 0, NULL, '2025-02-13 14:40:51', 18);
INSERT INTO `sys_oper_log` VALUES (1589, '入学要求信息', 1, 'com.xintong.controller.admin.CollegeRequireAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/collegeRequire/add', '60.12.13.184', 'XX XX', '{\"content\":\"&k-topic-s&商学院学术要求：&k-topic-e&国内211/985以及上海软科排名前200大学，均分82%以上。其他大学优秀学生申请case by case。&K&&k-topic-s&计算机学院学术要求：&k-topic-e&国内211/985以及上海软科排名前200大学，均分82%以上； 若为非以上排名大学，需有优异的专业课成绩，优秀的PS和推荐信(奖学金或获奖经历也对申请有帮助)； Computer Science专业需要参加在线编程测试(C，C++或Java)。&K&&k-topic-s&非商学院与计算机学院：&k-topic-e&国内985大学均分78%以上，国内211/双一流大学均分80%以上，其他大学：建议82分以上，最低不低于80分。&K&&k-topic-s&语言要求：&k-topic-e&雅思总分6.5分，单项不低于6分；雅思6.5(6)-7分； 托福总分88-100分；PTE总分63分，单项不低于59分。计算机学院不接受学前语言课程，必须达到直入要求。部分专业语言要求会有所不同。&K&&k-topic-s&其他要求：&k-topic-e&如作品集，研究计划和面试情况，根据课程官网要求为准。\",\"eduId\":2,\"isActive\":0,\"regionId\":138,\"title\":\"圣三一大学（2025QS世界排名87）\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-13 14:41:06', 11);
