INSERT INTO `sys_oper_log` VALUES (1594, '入学要求信息', 2, 'com.xintong.controller.admin.CollegeRequireAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/collegeRequire/edit', '60.12.13.184', 'XX XX', '{\"content\":\"&k-topic-s&学术要求：&k-topic-e&GPA：3.9+； SAT/ACT：1550+/35+； AP：8门以上、或IB：41+（42）、或A-level：4A*&K&&k-topic-s&语言要求：&k-topic-e&托福：110+ 或 雅思：8.0+&K&&k-topic-s&学术背景：&k-topic-e&名校夏校、专业相关科研项目（建议≥2项）&K&&k-topic-s&活动背景：&k-topic-e&亮眼的个人特色活动、体现社会领导力的项目、体现社会影响力的项目、高含金量国际竞赛获奖\",\"eduId\":3,\"id\":3,\"isActive\":0,\"isDeleted\":0,\"regionId\":1,\"title\":\"常春藤联盟&HYPSM\"}', '{\"msg\":\"修改成功\",\"code\":200}', 0, NULL, '2025-02-13 15:06:23', 13);
