INSERT INTO `sys_oper_log` VALUES (1599, '入学要求信息', 2, 'com.xintong.controller.admin.CollegeRequireAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/collegeRequire/edit', '60.12.13.184', 'XX XX', '{\"content\":\"&k-topic-s&学术要求：&k-topic-e&根据不同专业，学生需达到所在省份高考满分的68%、72%、80%，且高中平时成绩达到80%、85%、90%。同时，学生还需满足部分专业对具体科目的分数要求 (临床、牙医、哥大双学位除外)；或者其他考试（SAT等）。 未参加高考或高考不理想的学生，可通过AST考试申请，600分可申请band3专业，700分可申请band2，750分可申请band1。&K&&k-topic-s&语言要求：&k-topic-e&雅思：总分不低于 6.5 分，小分不低于 6 分；托福：总分不低于 90 分，写作不低于 21 分；多邻国：总分 120/160 分，小分不低于 105 分；PTE：总分 63，口语单项不低于 59。&K&&k-topic-s&&k-topic-e&注：本科计算机专业名额有限，申请时需提交合格的语言成绩。\",\"eduId\":3,\"id\":38,\"isActive\":0,\"isDeleted\":0,\"regionId\":138,\"title\":\"圣三一大学（2025QS世界排名87）\"}', '{\"msg\":\"修改成功\",\"code\":200}', 0, NULL, '2025-02-13 15:17:36', 12);
