INSERT INTO `sys_oper_log` VALUES (1602, '专业信息', 2, 'com.xintong.controller.admin.MajorAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/edit', '60.12.13.184', 'XX XX', '{\"details\":\"食品科学与工程是一门综合性学科，它结合了生命科学和工程科学的知识体系，旨在通过研究和应用于食品加工、贮藏、包装、检验以及食品安全等领域来提高食品的质量与安全，同时满足社会对营养健康食品的需求。该专业具有交叉性、实用性和创新性的特点，为学生提供了宽广的知识面和多领域的适应能力，培养学生的实践技能和创新思维。\",\"id\":40,\"jobDetails\":\"食品科学与工程专业就业方向广泛，可在食品生产加工企业负责工艺设计与产品开发，在监管检测机构从事质量把控，在科研院校开展研究工作等众多领域施展才能。\",\"level\":2,\"name\":\"食品科学与工程\",\"nameEn\":\"Food Science and Technology\",\"pageNum\":1,\"pageSize\":10,\"parentId\":3,\"subTitle\":\"\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-13 15:25:44', 34);
INSERT INTO `sys_oper_log` VALUES (1603, '专业信息', 2, 'com.xintong.controller.admin.MajorAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/edit', '60.12.13.184', 'XX XX', '{\"details\":\"环境工程是一门致力于解决环境问题、实现可持续发展的交叉学科。它融合了工程学、化学、生物学、物理学等多学科知识，旨在培养具备污染防治、环境规划、资源保护以及可持续发展理念的高级应用型人才。学生不仅要掌握扎实的理论知识，还需具备将其应用于实际项目的能力，以应对复杂多样的环境挑战。\",\"id\":39,\"jobDetails\":\"环境工程专业毕业生就业前景广阔，可在设计院、环保公司负责水环境治理、固废处理项目；在设备制造销售企业从事研发、销售工作；在环境监测与评价机构进行环境质量评估；在国企、研发机构、政府部门开展技术研发、政策制定与监管；还能在教育科研、国际组织、咨询服务及可持续发展领域，从事教学科研、国际环保合作、环境咨询和 ESG 研究等工作 。\",\"level\":2,\"name\":\"环境科学\",\"nameEn\":\"Environmental Science\",\"pageNum\":1,\"pageSize\":10,\"parentId\":3,\"subTitle\":\"\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-13 15:28:12', 30);
INSERT INTO `sys_oper_log` VALUES (1604, '专业信息', 2, 'com.xintong.controller.admin.MajorAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/edit', '60.12.13.184', 'XX XX', '{\"details\":\"生物医学是一个综合性的交叉学科，融合医学、生命科学和生物学的理论与方法，通过生物工程技术手段解决医学和生命科学领域的相关问题。它致力于研究人体结构、功能、疾病发生发展机制，以及开发预防、诊断和治疗疾病的新方法、新技术和新产品 。\",\"id\":38,\"jobDetails\":\"生物医学专业就业方向涵盖医疗器械设计制造、临床工程、生物材料与药物研发、医学电子、生物医学光子学、咨询政策分析、生物统计学、工程管理、质量管理、市场销售以及健康科技创业等领域，在国内外众多医疗机构、科研院所、企业等都有广阔的就业机会。\",\"level\":2,\"name\":\"生物医学\",\"nameEn\":\"Biomedical Sciences\",\"pageNum\":1,\"pageSize\":10,\"parentId\":3,\"subTitle\":\"\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-13 15:34:31', 38);
INSERT INTO `sys_oper_log` VALUES (1605, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"培养从事生物与医药工程科研开发，熟练掌握各类生物与医药生产及加工的高级技术和管理人才。\",\"id\":217,\"level\":3,\"name\":\"生物与医药\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":38}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-13 15:40:12', 46);
INSERT INTO `sys_oper_log` VALUES (1606, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"以生物学（如微生物学、遗传学、生物化学和细胞学）理论和技术为基础，结合化工、机械、电子计算机等现代工程技术的学科。\",\"id\":218,\"level\":3,\"name\":\"生物技术与工程\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":38}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-13 15:40:23', 44);
INSERT INTO `sys_oper_log` VALUES (1607, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"涉及利用生物学知识和工程技术进行产品研发和技术应用，包含生物材料、生物反应器设计、生物过程工程等研究领域。\\n\",\"id\":219,\"level\":3,\"name\":\"生物工程\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":38}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-13 15:45:07', 49);
INSERT INTO `sys_oper_log` VALUES (1608, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"偏向化学背景，主要研究药物的设计、合成以及生产工艺的开发和优化，涵盖药物化学、药剂学、药物分析等领域。\\n\",\"id\":220,\"level\":3,\"name\":\"制药工程\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":38}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-13 15:45:18', 43);
INSERT INTO `sys_oper_log` VALUES (1609, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"侧重于生物分子的结构、功能和相互作用研究，是理解生命现象和疾病机理的基础学科。\",\"id\":221,\"level\":3,\"name\":\"生物化学与分子生物学\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":38}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-13 15:45:28', 44);
INSERT INTO `sys_oper_log` VALUES (1610, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"研究微生物的分类、生理、遗传、生态等，以及它们在环境、工业、农业、医学等领域的应用。\",\"id\":222,\"level\":3,\"name\":\"微生物学\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":38}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-13 15:45:59', 44);
INSERT INTO `sys_oper_log` VALUES (1611, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"关注细胞的结构、功能及其在生物体中的作用，是研究生命科学的基础学科之一。\",\"id\":223,\"level\":3,\"name\":\"细胞生物学\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":38}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-13 15:46:10', 43);
INSERT INTO `sys_oper_log` VALUES (1612, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"研究生物遗传和变异规律，探讨基因的表达调控机制，与医学、农业等领域紧密相关。\",\"id\":224,\"level\":3,\"name\":\"遗传学\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":38}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-13 15:46:20', 44);
INSERT INTO `sys_oper_log` VALUES (1613, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"结合生物学、计算机科学和信息技术，分析生物数据，如基因组序列分析、蛋白质结构预测等。\\n\",\"id\":225,\"level\":3,\"name\":\"生物信息学\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":38}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-13 15:46:29', 43);
INSERT INTO `sys_oper_log` VALUES (1614, '意向目的地基本要求', 2, 'com.xintong.controller.admin.RegionInfoAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/regionInfo/edit', '60.12.13.184', 'XX XX', '{\"advantages\":\"学历认可度高、优质教学、费用低、专业多样、距离近、中西方文化融合\",\"appMaterial\":\"身份证&K&高考成绩单&K&艺考类美术科统考成绩单（艺术类专业）&K&电子照片（二寸白底彩照）等\",\"budgetDetail\":\"本科学费约2.5万-8万人民币/年&K&生活费约4万-5万人民币/年\",\"budgetRange\":\"在澳门读书预算因学校和专业不同而有所差异。&K&本科学费约2.5万-8万人民币/年，生活费约4万-5万人民币/年，丰俭由人。\",\"countryFeat\":\"&k-topic-s&1. 学历认可度高，升学便利：&k-topic-e&澳门学历文凭受国家教育部及全世界100多个国家认可。澳门院校也与美、英、欧等国的一些著名大学有签订分数互认协定。&K&&k-topic-s&2. 招生报名和录取名额不占用高考志愿：&k-topic-e&国内高中生可以凭借高考成绩直接申请澳门高校。而且，澳门高校招收内地学生为独立招生，并不属于全国普通高校统一招生计划内，考生于澳门学校的报名及录取不会影响其他内地高考的志愿录取。&K&&k-topic-s&3. 费用低：&k-topic-e&澳门读书最突出的一点就是花费少，虽然澳门香港紧邻，但澳门升学的费用比香港少将近一半。&K&&k-topic-s&4. 安全性高，回家方便：&k-topic-e&澳门的防疫和留学安全都可以得到保证，澳门在回归祖国后，联合国更是把澳门评为世界治安最好的地区之一。没有签证上的障碍，回家探亲也非常方便。\",\"createdAt\":\"2025-02-13 10:43:21\",\"createdBy\":\"admin\",\"eduSystem\":\"本科通常4年制\",\"enrollTimeline\":\"http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202502131548/%E4%B8%AD%E5%9B%BD%E6%BE%B3%E9%97%A8-%E6%9C%AC%E7%A7%91-%E7%95%99%E5%AD%A6%E6%97%B6%E9%97%B4%E8%BD%B4.png\",\"id\":18,\"isActive\":0,\"isDeleted\":0,\"rankUrl\":\"\",\"regularProg\":\"学制一般为4年，私立大学有先修班学制1年\",\"updatedAt\":\"2025-02-13 11:42:43\",\"updatedBy\":\"admin\"}', '{\"msg\":\"修改成功\",\"code\":200}', 0, NULL, '2025-02-13 15:48:15', 13);
INSERT INTO `sys_oper_log` VALUES (1615, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"研究人体正常功能活动规律，涵盖细胞的基本功能、血液、血液循环、呼吸、消化、泌尿等生理过程，借助实验课程，让学生深入理解人体各系统如何协同工作，掌握人体功能的调节机制，是解释疾病状态下生理变化的重要依据。\",\"isActive\":1,\"majorId\":38,\"name\":\"生理学\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-13 15:48:37', 13);
