INSERT INTO `sys_oper_log` VALUES (1618, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"聚焦生物分子的化学组成、结构、性质及其在生命过程中的化学变化规律，重点研究蛋白质、核酸、糖类、脂质等生物大分子的代谢途径及调控机制，为理解细胞的生理功能、疾病的发病机制以及药物的作用靶点提供理论基础。\",\"isActive\":1,\"majorId\":38,\"name\":\"生物化学\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-13 15:48:49', 12);
