INSERT INTO `sys_oper_log` VALUES (1648, '入学要求信息', 2, 'com.xintong.controller.admin.CollegeRequireAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/collegeRequire/edit', '60.12.13.184', 'XX XX', '{\"content\":\"&k-topic-s&【学术要求】&k-topic-e&根据不同专业，学生需达到所在省份高考满分的68%、72%、80%，且高中平时成绩达到80%、85%、90%。同时，学生还需满足部分专业对具体科目的分数要求 (临床、牙医、哥大双学位除外)；或者其他考试（SAT等）。 未参加高考或高考不理想的学生，可通过AST考试申请，600分可申请band3专业，700分可申请band2，750分可申请band1。&K&&k-topic-s&【语言要求】&k-topic-e&雅思：总分不低于 6.5 分，小分不低于 6 分；托福：总分不低于 90 分，写作不低于 21 分；多邻国：总分 120/160 分，小分不低于 105 分；PTE：总分 63，口语单项不低于 59。&K&&k-topic-s&&k-topic-e&注：本科计算机专业名额有限，申请时需提交合格的语言成绩。\",\"eduId\":3,\"id\":38,\"isActive\":0,\"isDeleted\":0,\"regionId\":138,\"title\":\"圣三一大学（2025QS世界排名87）\"}', '{\"msg\":\"修改成功\",\"code\":200}', 0, NULL, '2025-02-13 16:08:44', 12);
INSERT INTO `sys_oper_log` VALUES (1649, '入学要求信息', 2, 'com.xintong.controller.admin.CollegeRequireAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/collegeRequire/edit', '60.12.13.184', 'XX XX', '{\"content\":\"&k-topic-s&【学术要求】&k-topic-e&中国高考成绩总分65%—90% (根据专业而定)；A-level/IB/美国高中成绩+SAT/ACT+AP，或其它认可的国际性考试学历均认可。&K&&k-topic-s&【语言要求】&k-topic-e&文科类要求‌托福100或‌雅思6.5（小分不低于6.0）；理工类要求托福80或雅思6.0（小分不低于6.0）。PTE 63 ( 各项不低于59)\",\"eduId\":3,\"id\":39,\"isActive\":0,\"isDeleted\":0,\"regionId\":138,\"title\":\"都柏林大学（2025QS世界排名126）\"}', '{\"msg\":\"修改成功\",\"code\":200}', 0, NULL, '2025-02-13 16:08:58', 12);
INSERT INTO `sys_oper_log` VALUES (1650, '入学要求信息', 2, 'com.xintong.controller.admin.CollegeRequireAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/collegeRequire/edit', '60.12.13.184', 'XX XX', '{\"content\":\"&k-topic-s&【GPA】&k-topic-e&80+&K&&k-topic-s&【语言要求】&k-topic-e&雅思（6.5小分不低于6）；C1（雅思7小分不低于6.5），具体要求取决于申请专业。&K&&k-topic-s&【其他标化】&k-topic-e&部分专业需要提供GRE或者GMAT成绩\",\"eduId\":2,\"id\":46,\"isActive\":0,\"isDeleted\":0,\"regionId\":130,\"title\":\"基本要求\"}', '{\"msg\":\"修改成功\",\"code\":200}', 0, NULL, '2025-02-13 16:09:20', 13);
INSERT INTO `sys_oper_log` VALUES (1651, '入学要求信息', 2, 'com.xintong.controller.admin.CollegeRequireAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/collegeRequire/edit', '60.12.13.184', 'XX XX', '{\"content\":\"&k-topic-s&【学术要求】&k-topic-e&无需高考或会考成绩，高中均分至少不低于80分(不同等级专业要求不同，另部分专业对数学、Lab Science学科等有单科成绩要求)；或我校认可的其它高中课程类型对等成绩，如A-Level, IB, SAT等。&K&&k-topic-s&【申请材料要求】&k-topic-e&申请人如高中在读，申请时提供高一至高三上学期5个学期成绩单与在读证明；如申请人已高中毕业，需提供完整成绩单与高中毕业证明。&K&&k-topic-s&【最低语言要求】&k-topic-e&雅思6.5(6.0)或其它英语考试类型对等成绩。&K&&k-topic-s&【护理（专升本）要求】&k-topic-e&接受全日制专科护理相关背景申请，均分不低于75%，具有注册护士资格，且具有不少于6个月注册后工作经验，语言要求雅思6.5(单项不低于6.5)或其它英语考试类型对等成绩。\",\"eduId\":3,\"id\":40,\"isActive\":0,\"isDeleted\":0,\"regionId\":138,\"title\":\"科克大学（2025QS世界排名273）\"}', '{\"msg\":\"修改成功\",\"code\":200}', 0, NULL, '2025-02-13 16:09:25', 13);
