INSERT INTO `sys_oper_log` VALUES (1657, '意向目的地基本要求', 2, 'com.xintong.controller.admin.RegionInfoAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/regionInfo/edit', '60.12.13.184', 'XX XX', '{\"advantages\":\"高质量教育体系、全英语学习环境、较低的学费和生活成本、宽松的签证政策、良好的工作签证、跨国公司总部聚集、友好安全的社会环境\",\"appMaterial\":\"高中成绩单原件或认证版扫描件&K&在读证明/毕业证扫描件&K&高考成绩（如适用，TCD/UCD需要）&K&学生本人护照扫描件&K&雅思或托福等语言成绩（2年内有效）&K&个人陈述/推荐信等文书等\",\"budgetDetail\":\"首都都柏林地区总预算：每年约24万-30万人民币；&K&非首都地区总预算：每年约15万-25万人民币\",\"budgetRange\":\"首都都柏林地区&K&学费：约10万-16万人民币/年&K&住宿：约10万+/年，丰俭由人&K&饮食：约2.4万-3万/年&K&交通：约1.08万-1.5万/年&K&总预算：每年约24万-30万人民币&K&非首都地区&K&学费：约8万-14万人民币/年&K&住宿：约5万-7万，丰俭由人&K&饮食：约1.5万-3万/年&K&交通：约6000-9600元/年&K&总预算：每年约15万-25万人民币\",\"countryFeat\":\"&k-topic-s&1. 较低的学费和生活成本：&k-topic-e&爱尔兰的学费和生活成本相对英国、美国等西方主流国家更低，是预算有限学生的理想选择。&K&&k-topic-s&2. 宽松的签证政策：&k-topic-e&爱尔兰签证申请过程简单透明，通过率高，为国际学生提供便利。&K&&k-topic-s&3. 毕业后工作签证：&k-topic-e&留学生在爱尔兰毕业后，本科有1年工签，硕士有2年工签时间，更有利于学生找到理想工作。&K&&k-topic-s&4. 跨国公司总部聚集：&k-topic-e&爱尔兰是谷歌、苹果、Facebook等跨国公司欧洲总部所在地，提供丰富的实习和就业机会。&K&&k-topic-s&5. 友好安全的社会环境：&k-topic-e&爱尔兰严格控制枪支，犯罪率低，社会友好热情，留学生容易融入当地社区。&K&&k-topic-s&6. 高质量教育体系：&k-topic-e&爱尔兰高等教育在多个学科领域具有全球领先水平，本科3-4年、硕士1年的学制节省时间和费用。&K&&k-topic-s&7. 全英语学习环境：&k-topic-e&爱尔兰官方语言为英语，学生可在全英语环境中快速提升语言能力。&K&&k-topic-s&8. 教育与产业紧密结合：&k-topic-e&大学与企业合作紧密，课程设置包含实习和实践环节，学生可积累工作经验，为未来职业发展打下基础。\",\"createdAt\":\"2025-02-13 10:52:59\",\"createdBy\":\"admin\",\"eduSystem\":\"一般为3-4年\",\"enrollTimeline\":\"http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202502131612/%E7%88%B1%E5%B0%94%E5%85%B0-%E6%9C%AC%E7%A7%91-%E7%95%99%E5%AD%A6%E6%97%B6%E9%97%B4%E8%BD%B4.png\",\"id\":19,\"isActive\":0,\"isDeleted\":0,\"rankUrl\":\"\",\"regularProg\":\"一般为3-4年：大部分商科、艺术和人文类专业为3年，而工程、计算机、科学等专业通常为4年。\",\"updatedAt\":\"2025-02-13 11:42:22\",\"updatedBy\":\"admin\"}', '{\"msg\":\"修改成功\",\"code\":200}', 0, NULL, '2025-02-13 16:12:56', 13);
