INSERT INTO `sys_oper_log` VALUES (1684, '专业信息', 2, 'com.xintong.controller.admin.MajorAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/edit', '60.12.13.184', 'XX XX', '{\"details\":\"材料学是一门综合性极强的工科学科，专注于各类材料的深入研究，涵盖金属材料、高分子材料、无机非金属材料以及复合材料等多个领域。它不仅致力于探索材料的成分、结构、性能以及加工工艺之间的内在联系，还注重将研究成果应用于实际生产和创新，对推动现代科技发展、工业转型升级以及满足社会多样化需求起着关键作用。\",\"id\":37,\"jobDetails\":\"材料学专业就业路径多元，可投身航空航天、汽车、电子、医疗、能源等行业从事研发、生产、质量管控工作，也能在科研院所开展前沿研究，还可凭借专业知识从事销售、技术支持与项目管理，推动材料创新应用。\",\"level\":2,\"name\":\"材料学\",\"nameEn\":\"Materials Science\",\"pageNum\":1,\"pageSize\":10,\"parentId\":3,\"subTitle\":\"\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-13 16:41:02', 30);
INSERT INTO `sys_oper_log` VALUES (1685, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"聚焦于金属、无机非金属、高分子等多种材料领域的基础知识学习，掌握材料制备、加工成型的核心技能，深入探究材料结构与性能的关系，进而实现对材料的高效利用与优化改性。例如在卫星制造中提升外壳材料强度，优化手机液晶面板材料以提高清晰度，增强医疗行业人造关节的耐用性等。\",\"id\":226,\"level\":3,\"name\":\"材料科学与工程\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":37}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-13 16:41:27', 40);
INSERT INTO `sys_oper_log` VALUES (1686, '意向目的地基本要求', 2, 'com.xintong.controller.admin.RegionInfoAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/regionInfo/edit', '60.12.13.184', 'XX XX', '{\"advantages\":\"优质教育、多语言环境、文化丰富、地理位置佳、研究机会、生活费用适中、就业前景好。\",\"appMaterial\":\"个人简历&K&动机信&K&APS证书&K&推荐信&K&大学本科相关资料\",\"budgetDetail\":\"每年总预算约为15万人民币（包括学费和生活费）\",\"budgetRange\":\"学费: 公立1000欧-6000欧/年, 取决于专业和学校&K&住宿费: 300欧-800欧/月不等, 取决于地点和房屋类型&K&生活费: 10万RMB元/年起（包括住宿费）\",\"countryFeat\":\"&k-topic-s&1.高质量的教育：&k-topic-e&比利时有多所世界知名的大学，如鲁汶大学、根特大学、布鲁塞尔自由大学等，提供多样化的课程和高水平的教育。&K&&k-topic-s&2.多语言环境：&k-topic-e&比利时是多语言国家，官方语言包括荷兰语、法语和德语，留学生有机会学习和使用多种语言，增加自己的语言技能。&K&&k-topic-s&3.文化多样性：&k-topic-e&比利时位于欧洲心脏地带，拥有丰富的历史和文化遗产，留学生可以体验不同的文化和传统。&K&&k-topic-s&4.地理位置优越：&k-topic-e&比利时地处欧洲中心，与法国、德国、荷兰和卢森堡接壤，便于旅行和探索其他欧洲国家。\",\"createdAt\":\"2025-02-13 10:38:57\",\"createdBy\":\"admin\",\"eduSystem\":\"2年\",\"enrollTimeline\":\"http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202502131641/%E6%97%B6%E9%97%B4%E8%BD%B4-%E6%AF%94%E5%88%A9%E6%97%B6-%E7%A1%95%E5%A3%AB.png\",\"id\":17,\"isActive\":0,\"isDeleted\":0,\"rankUrl\":\"\",\"regularProg\":\"通常两年，学制灵活，允许提前或延期毕业。\",\"updatedAt\":\"2025-02-13 14:43:55\",\"updatedBy\":\"admin\"}', '{\"msg\":\"修改成功\",\"code\":200}', 0, NULL, '2025-02-13 16:41:38', 12);
INSERT INTO `sys_oper_log` VALUES (1687, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"围绕材料的组成结构和物理性能展开研究，重点关注这些物理性能在各个领域的实际应用，半导体材料、信息功能材料、超弹性材料以及微电子器件等是其主要研究对象。\",\"id\":227,\"level\":3,\"name\":\"材料物理\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":37}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-13 16:41:43', 39);
