INSERT INTO `sys_oper_log` VALUES (1695, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"专注于金属材料及其复合材料的成分、结构、性能、生产工艺等方面知识与技能的学习，涉及冶金、复合材料、粉末冶金、材料热处理、材料腐蚀与防护等多个方向。\",\"id\":229,\"level\":3,\"name\":\"金属材料工程\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":37}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-13 16:42:22', 40);
