INSERT INTO `sys_oper_log` VALUES (1697, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"致力于高分子材料（如橡胶、纤维、塑料）的组成、结构、性能以及制备和加工应用等知识的钻研，根据工业生产需求进行高分子材料的合成与加工。\",\"id\":230,\"level\":3,\"name\":\"高分子材料与工程\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":37}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-13 16:42:37', 38);
INSERT INTO `sys_oper_log` VALUES (1698, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"着力研究复合材料的结构、性能和生产工艺，以结构复合材料和功能复合材料为重点，涉及无机材料、高分子材料、金属材料等多个领域。\",\"id\":231,\"level\":3,\"name\":\"复合材料与工程\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":37}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-13 16:42:53', 38);
INSERT INTO `sys_oper_log` VALUES (1699, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"专注于太阳能、风能、水能、核能、潮汐能等新能源材料组成、结构、性能的测试技术与分析方法研究，致力于开发新一代高性能绿色能源材料、技术和器件。\",\"id\":232,\"level\":3,\"name\":\"新能源材料与器件\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":37}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-13 16:43:06', 40);
INSERT INTO `sys_oper_log` VALUES (1700, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"以材料科学与工程、化学、物理学为基础，与电子、光子、集成电路、信息等学科深度交叉融合，主要研究与电子科学与工程、信息科学与工程相关的各类材料，如半导体材料、光子与电磁材料、功能与传感材料、量子信息材料等。\",\"id\":233,\"level\":3,\"name\":\"光电信息材料与器件\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":37}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-13 16:43:22', 39);
INSERT INTO `sys_oper_log` VALUES (1701, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"聚焦于功能材料的制备、改性、加工成型及应用等方面知识与技能的学习，常见的功能材料有超导材料、医用材料、能源材料、稀土材料等。\",\"id\":234,\"level\":3,\"name\":\"功能材料\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":37}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-13 16:43:39', 44);
