INSERT INTO `sys_oper_log` VALUES (1750, '专业信息', 2, 'com.xintong.controller.admin.MajorAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/edit', '60.12.13.184', 'XX XX', '{\"details\":\"自动化专业致力于研究自动控制的原理和方法、自动化单元技术和集成技术及其在各类控制系统中的应用。它以自动控制理论为基础，借助电子技术、电力电子技术、传感技术、计算机和网络信息技术等工具，实现对各种装置和系统的自动控制，广泛服务于工业、交通、家居、服务、能源、航天航空等众多领域。\",\"id\":36,\"jobDetails\":\"自动化专业就业方向广泛，毕业生可在工业制造企业负责自动化生产线的设计与维护，像西门子、ABB 等；也能投身研发公司，如大疆创新，参与自动化设备及智能控制系统的创新开发；在通信领域，像华为、中兴，从事信号处理和数据传输相关工作；还可在钢铁、工矿、化工行业优化自动化系统，或于铁路、航空等交通运输部门参与运输系统的自动化升级，甚至进入科研院所，如中科院自动化所，开展前沿技术研究推动行业进步。\",\"level\":2,\"name\":\"自动化\",\"nameEn\":\"Automation\",\"pageNum\":1,\"pageSize\":10,\"parentId\":3,\"subTitle\":\"\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-13 16:57:25', 30);
INSERT INTO `sys_oper_log` VALUES (1751, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"聚焦电子技术、自动控制、系统工程、信息处理等知识技术，着重对自动化系统进行分析、设计、开发与研究，实现各类装置和系统的自动控制，像大厦自动门控制系统设计、工业设备自动控制等都属于该领域范畴。\",\"id\":235,\"level\":3,\"name\":\"自动化\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":36}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-13 16:58:17', 45);
INSERT INTO `sys_oper_log` VALUES (1752, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"旨在培育契合国家现代制造业需求的复合型人才，让学生掌握复杂控制、智能感知、人工智能数据科学及优化决策等理论，能够设计、研制智能装备系统，服务于现代制造业和国家智能制造发展战略，例如工业机器人故障诊断与维护。\",\"id\":236,\"level\":3,\"name\":\"智能装备与系统\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":36}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-13 16:58:29', 44);
INSERT INTO `sys_oper_log` VALUES (1753, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"作为多学科交叉专业，融合人工智能与工业自动化前沿理论技术，涉及控制论、自动化、计算机、数学等学科，通过数字虚拟空间模拟工厂运行，优化产品生产全流程。\",\"id\":237,\"level\":3,\"name\":\"工业智能\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":36}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-13 16:58:51', 45);
INSERT INTO `sys_oper_log` VALUES (1754, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"专注于工业机器人的结构、设计、应用等知识技术，进行机器人工作站的设计、装调与改造，以提升工业生产效率，同时在医疗等领域也有应用，如协助手术和病人护理。\",\"id\":238,\"level\":3,\"name\":\"机器人工程\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":36}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-13 16:59:02', 45);
INSERT INTO `sys_oper_log` VALUES (1755, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"围绕轨道交通控制、传感器、电子技术等知识技能展开研究，为高速铁路、客运专线、地铁及城市轨道交通等领域输送信息和控制方面的专业人才，负责火车信号灯控制、列车调度等工作。\",\"id\":239,\"level\":3,\"name\":\"轨道交通信号与控制\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":36}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-13 17:00:31', 40);
INSERT INTO `sys_oper_log` VALUES (1756, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"自动控制原理主要研究自动控制系统的基本原理、分析方法和设计理论。课程涵盖经典控制理论和现代控制理论两大部分。\",\"isActive\":1,\"majorId\":36,\"name\":\"自动控制原理\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-13 17:01:12', 11);
