INSERT INTO `sys_oper_log` VALUES (1758, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"包含模拟电子技术和数字电子技术。模拟电子技术研究半导体器件的特性和应用，如二极管、三极管、场效应管，以及由这些器件组成的放大电路、运算放大电路、电源电路等，理解模拟信号的处理和放大原理。\",\"isActive\":1,\"majorId\":36,\"name\":\"电子电路基础\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-13 17:01:26', 11);
INSERT INTO `sys_oper_log` VALUES (1759, '主要学习课程-禁/启用', 2, 'com.xintong.controller.admin.MajorCourseAdminController.active()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/active', '60.12.13.184', 'XX XX', '{\"id\":195,\"isActive\":0}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-13 17:01:28', 12);
INSERT INTO `sys_oper_log` VALUES (1760, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"介绍计算机在控制系统中的应用，包括计算机控制系统的组成结构，如硬件部分的主机、接口、输入输出通道，软件部分的系统软件和应用软件。\",\"isActive\":1,\"majorId\":36,\"name\":\"计算机控制系统\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-13 17:01:42', 12);
INSERT INTO `sys_oper_log` VALUES (1761, '主要学习课程-禁/启用', 2, 'com.xintong.controller.admin.MajorCourseAdminController.active()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/active', '60.12.13.184', 'XX XX', '{\"id\":196,\"isActive\":0}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-13 17:01:43', 11);
INSERT INTO `sys_oper_log` VALUES (1762, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"主要研究各类传感器的工作原理、特性和应用，如温度传感器、压力传感器、位移传感器、光电传感器等。课程包括传感器的选型与设计，信号调理与转换技术，将传感器采集到的微弱信号进行放大、滤波、调制等处理，以便后续的测量和控制。\",\"isActive\":1,\"majorId\":36,\"name\":\"传感器与检测技术\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-13 17:01:59', 11);
INSERT INTO `sys_oper_log` VALUES (1763, '主要学习课程-禁/启用', 2, 'com.xintong.controller.admin.MajorCourseAdminController.active()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/active', '60.12.13.184', 'XX XX', '{\"id\":197,\"isActive\":0}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-13 17:02:00', 12);
INSERT INTO `sys_oper_log` VALUES (1764, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"电力电子技术研究电力电子器件的特性和应用，如晶闸管、功率晶体管、场效应晶体管等。学习由这些器件组成的各种电力变换电路，包括整流电路、逆变电路、斩波电路、交流调压电路等，实现电能的变换和控制，将交流电转换为直流电（整流）、直流电转换为交流电（逆变）等。\",\"isActive\":1,\"majorId\":36,\"name\":\"电力电子技术\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-13 17:02:39', 10);
INSERT INTO `sys_oper_log` VALUES (1765, '主要学习课程-禁/启用', 2, 'com.xintong.controller.admin.MajorCourseAdminController.active()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/active', '60.12.13.184', 'XX XX', '{\"id\":198,\"isActive\":0}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-13 17:02:41', 11);
INSERT INTO `sys_oper_log` VALUES (1766, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"主要介绍各类电机的工作原理、结构和特性，如直流电机、交流异步电机、同步电机等。学习电机的拖动原理，即电机如何驱动生产机械运行，包括电机的启动、调速、制动等运行方式。\",\"isActive\":1,\"majorId\":36,\"name\":\"电机与拖动基础\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-13 17:02:54', 12);
INSERT INTO `sys_oper_log` VALUES (1767, '主要学习课程-禁/启用', 2, 'com.xintong.controller.admin.MajorCourseAdminController.active()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/active', '60.12.13.184', 'XX XX', '{\"id\":199,\"isActive\":0}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-13 17:02:55', 11);
INSERT INTO `sys_oper_log` VALUES (1768, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"数字信号处理课程主要研究数字信号的采集、处理和分析方法。内容包括离散时间信号与系统的分析，如序列的运算、线性时不变系统的特性；数字滤波器的设计，包括有限冲激响应（FIR）滤波器和无限冲激响应（IIR）滤波器的设计方法；快速傅里叶变换（FFT）等信号变换技术，用于对信号进行频谱分析。\",\"isActive\":1,\"majorId\":36,\"name\":\"数字信号处理\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-13 17:03:11', 10);
