INSERT INTO `sys_oper_log` VALUES (1770, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"系统工程从整体出发，研究系统的规划、设计、开发、运行和管理。课程涵盖系统分析方法，如系统建模、系统评价等；系统优化技术，包括线性规划、非线性规划、动态规划等在系统设计中的应用；以及系统集成和项目管理的相关知识，培养学生从全局角度解决复杂系统问题的能力。\",\"isActive\":1,\"majorId\":36,\"name\":\"系统工程\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-13 17:03:24', 11);
