INSERT INTO `sys_oper_log` VALUES (1772, '专业行业应用', 1, 'com.xintong.controller.admin.MajorApplyAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/apply/add', '60.12.13.184', 'XX XX', '{\"description\":\"随着智能制造的发展，自动化技术使得生产线更加灵活智能，能够根据产品类型和市场需求自主调整生产流程，实现高效率、高质量的生产过程。在汽车制造领域，自动化生产线可完成汽车零部件的精确组装，提升生产效率和产品质量。\",\"industryLogo\":\"http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202412311545/icon_business%20management.png\",\"industryName\":\"工业制造\",\"majorId\":36,\"majorName\":\"自动化\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-13 17:04:37', 11);
