INSERT INTO `sys_oper_log` VALUES (1774, '专业行业应用', 1, 'com.xintong.controller.admin.MajorApplyAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/apply/add', '60.12.13.184', 'XX XX', '{\"description\":\"自动化技术的应用包括自动驾驶车辆的研发和智能交通管理系统的建立，有助于提高交通安全性和效率，减少交通拥堵。例如，一些城市的智能交通系统通过实时监测路况，自动调整信号灯时长，缓解交通压力。\",\"industryLogo\":\"http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202412311544/icon_risk%20management.png\",\"industryName\":\"智能交通\",\"majorId\":36,\"majorName\":\"自动化\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-13 17:04:55', 10);
