INSERT INTO `sys_oper_log` VALUES (1792, '专业信息', 2, 'com.xintong.controller.admin.MajorAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/edit', '60.12.13.184', 'XX XX', '{\"details\":\"建筑学从广义来说，是研究建筑及其环境的学科，横跨工程技术和人文艺术领域。它所涉及的建筑艺术与建筑技术，以及建筑艺术包含的美学与实用方面，既相互区别又紧密联系，在不同建筑中所占比重各异。\",\"id\":35,\"jobDetails\":\"建筑学专业就业方向广泛，毕业生可在设计单位从事建筑设计与研究，在高校开展教学与学术研究，于政府部门参与城市规划建设管理，在房地产行业负责项目开发运营，还能在咨询领域为建筑项目提供专业评估与规划建议。\",\"level\":2,\"name\":\"建筑学\",\"nameEn\":\"Architectural Studies\",\"pageNum\":1,\"pageSize\":10,\"parentId\":3,\"subTitle\":\"\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-13 17:09:45', 33);
INSERT INTO `sys_oper_log` VALUES (1793, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"作为建筑学专业的入门课程，主要培养学生对建筑设计的基础认知和表达能力。课程内容涵盖建筑空间基础概念，通过模型制作、草图绘制等实践方式，让学生初步感受和理解空间塑造。\",\"id\":240,\"level\":3,\"name\":\"建筑设计基础\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":35}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-13 17:11:32', 49);
INSERT INTO `sys_oper_log` VALUES (1794, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"该课程系统梳理从古至今、世界各地的建筑发展脉络，详细讲解不同历史时期、地域的建筑风格特征，如古埃及金字塔的建筑特色、中世纪哥特式教堂的结构与装饰风格等，并深入分析建筑风格形成背后的历史背景、社会文化因素以及技术条件。\",\"id\":241,\"level\":3,\"name\":\"建筑历史\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":35}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-13 17:12:41', 50);
INSERT INTO `sys_oper_log` VALUES (1795, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"教授建筑结构设计所需的静力学、材料力学和结构力学等基础力学原理。学生在课程中学习建筑结构的受力分析方法，掌握梁、板、柱等结构构件在不同荷载作用下内力的计算方式；了解混凝土、钢材、木材等常见建筑材料的力学性能，依据建筑设计需求合理选择建筑材料和结构形式，保障建筑的安全性与稳定性。\",\"id\":242,\"level\":3,\"name\":\"建筑力学\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":35}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-13 17:13:04', 45);
INSERT INTO `sys_oper_log` VALUES (1796, '专业信息', 2, 'com.xintong.controller.admin.MajorAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/edit', '60.12.13.184', 'XX XX', '{\"details\":\"教授建筑结构设计所需的静力学、材料力学和结构力学等基础力学原理。学生在课程中学习建筑结构的受力分析方法，掌握梁、板、柱等结构构件在不同荷载作用下内力的计算方式等内容。\",\"id\":242,\"isDeleted\":0,\"level\":3,\"name\":\"建筑力学\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":35}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-13 17:13:43', 30);
INSERT INTO `sys_oper_log` VALUES (1797, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"深入探究建筑各部分的构造组成和连接方式，如墙体、屋顶、楼梯等的具体构造做法，学习砖石结构、木结构、钢结构等不同建筑材料在构造中的应用和施工工艺。\",\"id\":243,\"level\":3,\"name\":\" 建筑构造\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":35}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-13 17:13:59', 40);
INSERT INTO `sys_oper_log` VALUES (1798, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"主要包含建筑热工、光学和声学三个方面的知识。研究建筑与室内外热环境的相互关系，让学生掌握建筑保温、隔热、通风等热工设计原理和方法；学习建筑采光和照明设计，学会利用自然采光和人工照明营造舒适的室内光环境；了解建筑声学原理，掌握控制建筑噪声、改善室内音质的设计方法，以此提高建筑的物理环境质量和舒适度。\",\"id\":244,\"level\":3,\"name\":\"建筑物理\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":35}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-13 17:14:29', 40);
INSERT INTO `sys_oper_log` VALUES (1799, '专业信息', 2, 'com.xintong.controller.admin.MajorAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/edit', '60.12.13.184', 'XX XX', '{\"details\":\"主要包含建筑热工、光学和声学三个方面的知识。研究建筑与室内外热环境的相互关系，让学生掌握建筑保温、隔热、通风等热工设计原理和方法；学习建筑采光和照明设计，学会利用自然采光和人工照明营造舒适的室内光环境等原理。\",\"id\":244,\"isDeleted\":0,\"level\":3,\"name\":\"建筑物理\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":35}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-13 17:14:45', 30);
INSERT INTO `sys_oper_log` VALUES (1800, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"聚焦当代建筑设计领域的前沿理论和创新方法，研究绿色建筑、数字化建筑、参数化设计等新兴设计理念和技术在建筑设计中的应用。\",\"id\":245,\"level\":3,\"name\":\"建筑设计及其理论前沿\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":35}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-13 17:15:02', 41);
INSERT INTO `sys_oper_log` VALUES (1801, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"深入探讨城市设计的理论体系和实践方法，研究城市空间形态、功能布局、交通组织等方面的设计原理。\",\"id\":246,\"level\":3,\"name\":\"城市设计理论与实践\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":35}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-13 17:15:18', 40);
