INSERT INTO `sys_oper_log` VALUES (1810, '专业信息', 2, 'com.xintong.controller.admin.MajorAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/edit', '60.12.13.184', 'XX XX', '{\"details\":\"钻研古建筑保护、建筑历史、设计、修缮技术等，对城市中具有特殊价值的历史建筑进行保护和修缮，像长城、故宫等历史建筑的维护工作。\",\"id\":243,\"isDeleted\":0,\"level\":3,\"name\":\"历史建筑保护工程\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":35}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-13 17:19:13', 29);
