INSERT INTO `sys_oper_log` VALUES (1815, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"是建筑学专业的入门课程，培养学生对建筑设计的基本认知和表达能力。课程涵盖建筑空间基本概念，通过模型制作、草图绘制让学生体验空间塑造；教授建筑设计流程，从场地分析到方案构思深化等。\",\"isActive\":1,\"majorId\":35,\"name\":\"建筑设计基础\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-13 17:20:48', 11);
