INSERT INTO `sys_oper_log` VALUES (1817, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"系统介绍古今中外建筑发展脉络，详细讲解不同历史时期、地域的建筑风格特点，分析风格形成的历史、文化和技术背景，通过建筑案例研究培养学生对建筑文化内涵的理解和历史批判性思维。\",\"isActive\":1,\"majorId\":35,\"name\":\"建筑历史\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-13 17:21:04', 11);
