INSERT INTO `sys_oper_log` VALUES (1819, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"教授建筑结构设计所需的力学基本原理，包括静力学、材料力学和结构力学知识。学习建筑结构受力分析方法，计算结构构件内力；了解常见建筑材料力学性能，根据设计需求选择合适材料和结构形式，确保建筑安全稳定。\",\"isActive\":1,\"majorId\":35,\"name\":\"建筑力学\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-13 17:21:21', 10);
