INSERT INTO `sys_oper_log` VALUES (1821, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"深入研究建筑各部分构造组成和连接方式，如墙体、屋顶、楼梯等构造做法，学习不同建筑材料在构造中的应用和施工工艺，掌握建筑防水、防潮、保温、隔热、防火、抗震等构造措施和安全要求。\",\"isActive\":1,\"majorId\":35,\"name\":\"建筑构造\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-13 17:21:40', 10);
