INSERT INTO `sys_oper_log` VALUES (1859, '专业信息', 2, 'com.xintong.controller.admin.MajorAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/edit', '60.12.13.184', 'XX XX', '{\"details\":\"土木类专业是一门古老而又不断创新发展的专业，广泛涉及各类土地工程设施的勘测、设计、建造、保养和维修等方面，旨在通过技术与知识的运用，创造安全、实用且美观的物理环境，是工学门类中的重要分支。\",\"id\":34,\"jobDetails\":\"土木类专业就业方向广泛，涵盖工程技术、设计规划、质量监督、公务员与科研教学、咨询等领域，可在建筑施工、设计、房地产、政府、科研、咨询等各类企业和机构，从事施工管理、结构设计、质量监督、教学科研、项目咨询等工作。\",\"level\":2,\"name\":\"土木类\",\"nameEn\":\"Civil Engineering\",\"pageNum\":1,\"pageSize\":10,\"parentId\":3,\"subTitle\":\"\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-13 17:33:30', 31);
INSERT INTO `sys_oper_log` VALUES (1860, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"专注于各类土地工程设施相关的基本知识和技术，涵盖工程建筑物新建、改建、扩建，以及配套设施的勘察、规划、设计、施工等工作。\",\"id\":248,\"level\":3,\"name\":\"土木工程\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":34}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-13 17:33:58', 40);
