INSERT INTO `sys_oper_log` VALUES (1909, '意向目的地基本要求', 2, 'com.xintong.controller.admin.RegionInfoAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/regionInfo/edit', '60.12.13.184', 'XX XX', '{\"advantages\":\"离家近、好适应、费用低、专业限制小、名校机会大、学历认可度高、发展前景广阔\",\"appMaterial\":\"日语授课项目：高中三年成绩单、毕业证、推荐信、简历、EJU成绩/日语成绩等&K&SGU项目：高中三年成绩单、毕业证、推荐信、简历、托福/雅思成绩、高考/SAT/ACT等标化成绩等\",\"budgetDetail\":\"总预算10~15万人民币/年\",\"budgetRange\":\"学费：国公立大学2~3万人民币/年，私立大学3~5万人民币/年居多。&K&生活费：8~10万/年（地区不同有所差异）。\",\"countryFeat\":\"&k-topic-s&1. 距离近：&k-topic-e&与中国一衣带水，距离近，往返方便。&K&&k-topic-s&2. 生活习俗相似：&k-topic-e&生活习俗与中国相似度高，更容易适应。&K&&k-topic-s&3. 语言易学习：&k-topic-e&日语中汉字含量极高，语言互通性强，容易学习。&K&&k-topic-s&4. 升学机会多：&k-topic-e&更多升学可能性，普高、中专、职高、技校生同等升学机会；日语授课无需高考成绩，单独开设留学生升学通道，名校升学机会更多。&K&&k-topic-s&5. 性价比高：&k-topic-e&留学性价比高，学费低廉，奖学金丰富，还可合法打工。&K&&k-topic-s&6. 英文授课制：&k-topic-e&开设英文授课项目，无日语基础也可赴日留学。&K&&k-topic-s&7. 就业前景好：&k-topic-e&学历国际公认，回国可以认证，就业发展空间巨大；毕业后留日就业政策利好，可获工作签证。&K&&k-topic-s&8. 可申请永居：&k-topic-e&在日居留 10 年(部分高度人才 5 年，最快1年)，可申请永久居住权。\",\"createdAt\":\"2025-02-11 10:46:35\",\"createdBy\":\"admin\",\"eduSystem\":\"通常四年，医学、牙医学、兽医学、部分药学类专业学制为6年\",\"id\":15,\"isActive\":0,\"isDeleted\":0,\"rankUrl\":\"\",\"regularProg\":\"通常四年，医学、牙医学、兽医学、部分药学类专业学制为6年。\",\"updatedAt\":\"2025-02-13 11:23:40\",\"updatedBy\":\"admin\"}', '{\"msg\":\"修改成功\",\"code\":200}', 0, NULL, '2025-02-13 17:44:24', 12);
INSERT INTO `sys_oper_log` VALUES (1910, '专业信息', 2, 'com.xintong.controller.admin.MajorAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/edit', '60.12.13.184', 'XX XX', '{\"details\":\"能源类专业是一个多学科交叉的综合性工程领域，不仅包含对传统能源如化石燃料的研究，还涵盖新能源技术如风能、太阳能等的开发与应用。旨在培养能够在能源开发、转换、节约和管理等领域进行科学研究、技术开发和工程管理的专业人才。\",\"id\":33,\"jobDetails\":\"能源类专业就业前景良好，可在能源生产供应、设备研发制造、能源管理咨询、新能源汽车等领域，从事生产运行、设备维护、技术研发、工程设计、能源管理等工作，就业单位涵盖各类能源企业、制造公司、科研机构以及政府相关部门 。\",\"level\":2,\"name\":\"能源类\",\"nameEn\":\"Energy\",\"pageNum\":1,\"pageSize\":10,\"parentId\":3,\"subTitle\":\"\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-13 17:46:59', 32);
INSERT INTO `sys_oper_log` VALUES (1911, '意向目的地基本要求', 2, 'com.xintong.controller.admin.RegionInfoAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/regionInfo/edit', '60.12.13.184', 'XX XX', '{\"advantages\":\"离家近、好适应、费用低、专业限制小、名校机会大、学历认可度高、发展前景广阔\",\"appMaterial\":\"高中三年成绩单&K&毕业证&K&推荐信&K&个人简历&K&EJU成绩/日语成绩（日语授课项目）&K&托福/雅思成绩（SGU项目）&K&高考/SAT/ACT等标化成绩等（SGU项目）\",\"budgetDetail\":\"总预算10~15万人民币/年\",\"budgetRange\":\"学费：国公立大学2~3万人民币/年，私立大学3~5万人民币/年居多。&K&生活费：8~10万/年（地区不同有所差异）。\",\"countryFeat\":\"&k-topic-s&1. 距离近：&k-topic-e&与中国一衣带水，距离近，往返方便。&K&&k-topic-s&2. 生活习俗相似：&k-topic-e&生活习俗与中国相似度高，更容易适应。&K&&k-topic-s&3. 语言易学习：&k-topic-e&日语中汉字含量极高，语言互通性强，容易学习。&K&&k-topic-s&4. 升学机会多：&k-topic-e&更多升学可能性，普高、中专、职高、技校生同等升学机会；日语授课无需高考成绩，单独开设留学生升学通道，名校升学机会更多。&K&&k-topic-s&5. 性价比高：&k-topic-e&留学性价比高，学费低廉，奖学金丰富，还可合法打工。&K&&k-topic-s&6. 英文授课制：&k-topic-e&开设英文授课项目，无日语基础也可赴日留学。&K&&k-topic-s&7. 就业前景好：&k-topic-e&学历国际公认，回国可以认证，就业发展空间巨大；毕业后留日就业政策利好，可获工作签证。&K&&k-topic-s&8. 可申请永居：&k-topic-e&在日居留 10 年(部分高度人才 5 年，最快1年)，可申请永久居住权。\",\"createdAt\":\"2025-02-11 10:46:35\",\"createdBy\":\"admin\",\"eduSystem\":\"通常四年，医学、牙医学、兽医学、部分药学类专业学制为6年\",\"id\":15,\"isActive\":0,\"isDeleted\":0,\"rankUrl\":\"\",\"regularProg\":\"通常四年，医学、牙医学、兽医学、部分药学类专业学制为6年。\",\"updatedAt\":\"2025-02-13 17:44:24\",\"updatedBy\":\"admin\"}', '{\"msg\":\"修改成功\",\"code\":200}', 0, NULL, '2025-02-13 17:47:21', 12);
INSERT INTO `sys_oper_log` VALUES (1912, '专业信息', 2, 'com.xintong.controller.admin.MajorAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/edit', '60.12.13.184', 'XX XX', '{\"details\":\"电子信息类专业作为现代科技领域的关键学科，深度融合电子技术、信息技术、计算机技术等多学科知识，主要围绕电子设备、信息系统和通信网络展开研究、设计、开发与应用，致力于培养具备扎实理论基础、创新实践能力和广阔国际视野的高素质专业人才，为各行业的数字化转型和智能化升级提供有力支撑。\",\"id\":30,\"jobDetails\":\"电子信息类专业就业方向多元，可投身通信领域，参与 5G 乃至未来 6G 通信系统的研发与维护，助力信息高速传输；也能在半导体行业，从事芯片设计、制造与测试，推动集成电路的创新发展；还可进入人工智能领域，负责传感器数据处理、图像识别算法优化，为智能设备赋予 “智慧”，在信息时代的浪潮中发挥关键作用。\",\"level\":2,\"name\":\"电子信息类\",\"nameEn\":\"Electronic Information Science and Technology\",\"pageNum\":1,\"pageSize\":10,\"parentId\":3,\"subTitle\":\"\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-13 17:48:34', 32);
INSERT INTO `sys_oper_log` VALUES (1913, '专业信息', 2, 'com.xintong.controller.admin.MajorAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/edit', '60.12.13.184', 'XX XX', '{\"details\":\"电子电气类专业是一门综合性学科，融合了电子技术、电气工程、计算机技术等多领域知识，旨在培养具备设计、开发、测试和维护各类电子电气设备及系统能力的专业人才。该专业覆盖范围广泛，从微小的电子元器件到大型的电力系统均有涉及，在现代科技和工业发展中占据关键地位。\",\"id\":31,\"jobDetails\":\"电子电气专业就业前景广阔，毕业生能在电力系统领域保障电网稳定运行，投身电子设备制造负责电路设计与产品研发，或在通信行业助力5G乃至未来通信技术的设施搭建与优化升级。 \",\"level\":2,\"name\":\"电子电气类\",\"nameEn\":\"Electrical & Electronic Engineering\",\"pageNum\":1,\"pageSize\":10,\"parentId\":3,\"subTitle\":\"\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-13 17:49:20', 32);
INSERT INTO `sys_oper_log` VALUES (1914, '专业信息', 2, 'com.xintong.controller.admin.MajorAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/edit', '60.12.13.184', 'XX XX', '{\"details\":\"机械类专业作为工程技术领域的关键支柱，是一门融合多学科知识，专注于机械系统的设计、制造、运行、控制及维护的学科。它以力学、材料学、电子技术、计算机科学等为基础，通过理论与实践结合，培养具备扎实专业知识、创新能力和实践技能的综合性人才，在推动各行业技术进步和社会经济发展中发挥着不可替代的作用。\",\"id\":32,\"jobDetails\":\"机械类专业就业方向多元，可投身汽车制造领域负责整车及零部件设计与生产，或在智能装备行业从事工业机器人研发与调试，还能在航空航天领域参与飞行器关键机械部件的制造与维护。\",\"level\":2,\"name\":\"机械类\",\"nameEn\":\"Mechanical Engineering\",\"pageNum\":1,\"pageSize\":10,\"parentId\":3,\"subTitle\":\"\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-13 17:49:43', 33);
