INSERT INTO `sys_oper_log` VALUES (1935, '入学要求信息', 2, 'com.xintong.controller.admin.CollegeRequireAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/collegeRequire/edit', '60.12.13.184', 'XX XX', '{\"content\":\"&k-topic-s&国际课程生&k-topic-e&高考生：牛津不直接接受中国高考成绩申请；剑桥大学接受高考成绩，要求高考各省TOP 0.1%，鼓励学生参加奥林匹克竞赛，SAT、AP等考试。&K&&k-topic-s&【学术要求】&k-topic-e&A-level（AAA至A*A*A，具体要求取决于所选课程）；IB（38至45分，包括核心课程分数，高级别科目分数要求通常为6至7分）&K&&k-topic-s&【语言要求】&k-topic-e&雅思总分7.0以上，单项不低于6.5。&K&&k-topic-s&【入学测试】&k-topic-e&需要参加特定的入学测试，如ELAT、STEP等。&K&&k-topic-s&【面试】&k-topic-e&通过初步筛选后，申请者将被邀请参加面试。&K&&k-topic-s&高考生&k-topic-e&牛津不直接接受中国高考成绩申请；剑桥大学接受高考成绩，要求高考各省TOP 0.1%，鼓励学生参加奥林匹克竞赛，SAT、AP等考试。\",\"eduId\":3,\"id\":7,\"isActive\":0,\"isDeleted\":0,\"regionId\":50,\"title\":\"牛剑入学要求\"}', '{\"msg\":\"修改成功\",\"code\":200}', 0, NULL, '2025-02-13 19:09:53', 18);
