INSERT INTO `sys_oper_log` VALUES (1959, '入学要求信息', 2, 'com.xintong.controller.admin.CollegeRequireAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/collegeRequire/edit', '60.12.13.184', 'XX XX', '{\"content\":\"&k-topic-s&【学术要求】&k-topic-e&根据不同专业，学生需达到所在省份高考满分的68%、72%、80%，且高中平时成绩达到80%、85%、90%。&K&&k-topic-s&&k-topic-e&同时，学生还需满足部分专业对具体科目的分数要求 (临床、牙医、哥大双学位除外)；&K&&k-topic-s&&k-topic-e&或者其他考试（SAT等）。 &K&&k-topic-s&&k-topic-e&未参加高考或高考不理想的学生，可通过AST考试申请，600分可申请band3专业，700分可申请band2，750分可申请band1。&K&&k-topic-s&【语言要求】&k-topic-e&雅思：总分不低于 6.5 分，小分不低于 6 分；&K&&k-topic-s&&k-topic-e&托福：总分不低于 90 分，写作不低于 21 分；&K&&k-topic-s&&k-topic-e&多邻国：总分 120/160 分，小分不低于 105 分；&K&&k-topic-s&&k-topic-e&PTE：总分 63，口语单项不低于 59。&K&&k-topic-s&&k-topic-e&注：本科计算机专业名额有限，申请时需提交合格的语言成绩。\",\"eduId\":3,\"id\":38,\"isActive\":0,\"isDeleted\":0,\"regionId\":138,\"title\":\"圣三一大学（2025QS世界排名87）\"}', '{\"msg\":\"修改成功\",\"code\":200}', 0, NULL, '2025-02-14 09:44:41', 18);
INSERT INTO `sys_oper_log` VALUES (1960, '入学要求信息', 2, 'com.xintong.controller.admin.CollegeRequireAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/collegeRequire/edit', '60.12.13.184', 'XX XX', '{\"content\":\"&k-topic-s&【学术要求】&k-topic-e&&K&&k-topic-s&&k-topic-e&根据不同专业，学生需达到所在省份高考满分的68%、72%、80%，且高中平时成绩达到80%、85%、90%。&K&&k-topic-s&&k-topic-e&同时，学生还需满足部分专业对具体科目的分数要求 (临床、牙医、哥大双学位除外)；或者其他考试（SAT等）。 &K&&k-topic-s&&k-topic-e&未参加高考或高考不理想的学生，可通过AST考试申请，600分可申请band3专业，700分可申请band2，750分可申请band1。&K&&k-topic-s&【语言要求】&k-topic-e&&K&&k-topic-s&&k-topic-e&雅思：总分不低于 6.5 分，小分不低于 6 分；&K&&k-topic-s&&k-topic-e&托福：总分不低于 90 分，写作不低于 21 分；&K&&k-topic-s&&k-topic-e&多邻国：总分 120/160 分，小分不低于 105 分；&K&&k-topic-s&&k-topic-e&PTE：总分 63，口语单项不低于 59。&K&&k-topic-s&&k-topic-e&注：本科计算机专业名额有限，申请时需提交合格的语言成绩。\",\"eduId\":3,\"id\":38,\"isActive\":0,\"isDeleted\":0,\"regionId\":138,\"title\":\"圣三一大学（2025QS世界排名87）\"}', '{\"msg\":\"修改成功\",\"code\":200}', 0, NULL, '2025-02-14 09:46:46', 16);
INSERT INTO `sys_oper_log` VALUES (1961, '专业信息', 2, 'com.xintong.controller.admin.MajorAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/edit', '60.12.13.184', 'XX XX', '{\"details\":\"体育类专业是一门综合性学科，主要研究体育运动的理论与实践，涵盖体育教学、训练、竞赛、管理、康复等多个领域。它旨在培养具备扎实体育专业知识、实践能力和创新精神的人才，以满足社会对体育教育、竞技体育、全民健身和体育产业发展等方面的需求。体育类专业不仅关注运动员的训练和比赛，还致力于提升全民体育素养，推动体育强国建设。\",\"id\":45,\"jobDetails\":\"体育类专业的就业方向广泛，涵盖体育教育领域，担任中小学及高校体育教师，传播体育知识与技能；投身竞技体育，成为专业教练、体能训练师助力运动员提升成绩；在全民健身浪潮中，作为健身教练、社区体育指导员引导大众科学健身；于体育产业，从事赛事策划、体育营销、体育场馆运营等工作，推动体育经济发展。\",\"level\":2,\"name\":\"体育类\",\"nameEn\":\"Sport Science\",\"pageNum\":1,\"pageSize\":10,\"parentId\":5,\"subTitle\":\"\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-14 10:35:34', 32);
INSERT INTO `sys_oper_log` VALUES (1962, '专业信息', 2, 'com.xintong.controller.admin.MajorAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/edit', '60.12.13.184', 'XX XX', '{\"details\":\"大健康类专业是一门综合性学科，聚焦于全方位维护和促进人类身心健康，涵盖健康维护、疾病预防、康复治疗、健康服务管理等领域。该领域不仅关注个体生理健康，还涉及心理健康、社会适应、环境健康及健康政策等维度，旨在培养具备医学知识、健康管理技能和创新能力的专业人才，以应对全球健康挑战，推动健康产业发展。\",\"id\":46,\"jobDetails\":\"大健康类专业就业面向多元，能在医疗服务领域成为临床医师、康复治疗师，为患者提供诊疗与康复服务；投身健康管理行业，担任健康管理师、营养师，为个人及群体定制健康方案；在医药研发与生产中，作为科研人员、药剂师参与新药研发与药品生产；还能在养老产业、健身休闲等领域，从事养老护理指导、运动健康指导等工作，全方位守护大众健康。\",\"level\":2,\"name\":\"大健康类\",\"nameEn\":\"Health Sciences\",\"pageNum\":1,\"pageSize\":10,\"parentId\":5,\"subTitle\":\"\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-14 10:36:04', 36);
INSERT INTO `sys_oper_log` VALUES (1963, '专业信息', 2, 'com.xintong.controller.admin.MajorAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/edit', '60.12.13.184', 'XX XX', '{\"details\":\"农学是一门综合性学科，主要研究农作物的种植、培育、管理和利用，以及农业生态系统和农村经济的发展。它涵盖了植物学、遗传学、土壤学、生态学、农业经济学等多个学科领域，旨在培养具有扎实农业科学知识和实践能力的人才，以满足社会对粮食安全、农业可持续发展和乡村振兴的需求。\",\"id\":47,\"jobDetails\":\"农学专业就业途径丰富，既可以投身农业生产一线，成为农业技术员、种植大户，助力农作物优质高产；也能在农业科研领域，作为科研人员致力于新品种培育、新技术研发；还可在农业企业从事农产品加工、销售、农资推广，或在农业行政管理部门参与政策制定与执行，推动农业产业稳健发展。\",\"level\":2,\"name\":\"农学\",\"nameEn\":\"Agriculture\",\"pageNum\":1,\"pageSize\":10,\"parentId\":5,\"subTitle\":\"\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-14 10:36:56', 40);
INSERT INTO `sys_oper_log` VALUES (1964, '专业信息', 2, 'com.xintong.controller.admin.MajorAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/edit', '60.12.13.184', 'XX XX', '{\"details\":\"兽医学是一门综合性学科，主要致力于维护动物的生命健康，涵盖预防、诊断和治疗动物疾病等多个关键领域。它紧密结合生物学、医学、化学等多学科知识，深入探究动物的生理和病理机制，精准把握各类疾病的发生发展规律，进而运用一系列专业手段，保障动物健康，推动畜牧产业的稳定发展，同时也为公共卫生安全筑牢防线。\",\"id\":48,\"jobDetails\":\"兽医学专业就业前景多元，能在宠物医疗领域成为宠物医生，为萌宠健康护航；投身畜牧养殖行业，担任驻场兽医保障家畜家禽茁壮成长；在动物疫病防控机构，作为防疫专员阻击疫病传播；也可在兽药研发企业参与药品研发、质量把控，全方位守护动物健康，推动畜牧产业高质量发展。\",\"level\":2,\"name\":\"兽医学\",\"nameEn\":\"Veterinary Medicine\",\"pageNum\":1,\"pageSize\":10,\"parentId\":5,\"subTitle\":\"\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-14 10:37:28', 34);
INSERT INTO `sys_oper_log` VALUES (1965, '专业信息', 2, 'com.xintong.controller.admin.MajorAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/edit', '60.12.13.184', 'XX XX', '{\"details\":\"医学是一门致力于维护人类生命健康、预防和治疗疾病的综合性学科。它融合了自然科学、社会科学与人文科学，涵盖基础医学、临床医学、预防医学、药学、护理学等领域，通过研究人体生理病理机制及疾病发展规律，运用诊断、治疗、康复等手段提升人类健康水平。\",\"id\":49,\"jobDetails\":\"医学专业就业面广泛，可在各级医院、专科医院担任临床医师，凭借专业知识与技能为患者精准诊疗；投身公共卫生领域，成为疾病预防控制专家、卫生监督专员，守护大众健康防线；在医学科研机构从事基础医学、临床医学研究，助力医学创新突破；于医药企业，参与新药研发、药品质量把控，推动医药产业发展。\",\"level\":2,\"name\":\"医学\",\"nameEn\":\"Medicine\",\"pageNum\":1,\"pageSize\":10,\"parentId\":5,\"subTitle\":\"\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-14 10:38:33', 32);
INSERT INTO `sys_oper_log` VALUES (1966, '专业信息', 2, 'com.xintong.controller.admin.MajorAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/edit', '60.12.13.184', 'XX XX', '{\"details\":\"护理学是研究如何运用科学的护理方法和技能，促进、维护和恢复个体、家庭及社区健康的学科。它融合了基础护理、临床护理、社区护理、护理管理等多个领域，致力于培养具备扎实护理理论知识与熟练实践技能的专业人才，以满足社会对护理人才的多元需求。\",\"id\":50,\"jobDetails\":\"护理学专业就业选择多样，可在各级综合医院、专科医院及社区卫生服务中心担任临床护士，提供基础护理、专科护理与康复指导；投身养老机构，成为养老护理员、护理管理者，为老年人提供贴心照护；在护理教育领域，作为护理教师培养护理人才；于护理科研领域，参与护理科研项目，推动护理学科发展。\",\"level\":2,\"name\":\"护理学\",\"nameEn\":\"Nursing\",\"pageNum\":1,\"pageSize\":10,\"parentId\":5,\"subTitle\":\"\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-14 10:39:14', 35);
INSERT INTO `sys_oper_log` VALUES (1967, '专业信息', 2, 'com.xintong.controller.admin.MajorAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/edit', '60.12.13.184', 'XX XX', '{\"details\":\"艺术设计是一门综合性、跨学科的学科，融合艺术、科技与实践，强调创意表达与技术实现的结合。其核心在于通过视觉、空间、材料等媒介解决实际问题，提升功能与美学的统一性，涵盖从产品开发到文化传播的广泛领域。\",\"id\":41,\"jobDetails\":\"艺术设计专业就业渠道多元，能在广告传媒行业，担任平面设计师、创意策划，打造吸睛视觉形象与宣传方案；投身室内设计领域，成为家装设计师、工装设计师，塑造舒适美观空间；在电商行业，作为电商设计师助力店铺视觉升级；还能在影视动漫产业，从事角色与场景设计，为作品赋予奇幻魅力。\",\"level\":2,\"name\":\"艺术设计\",\"nameEn\":\"Art and Design\",\"pageNum\":1,\"pageSize\":10,\"parentId\":4,\"subTitle\":\"\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-14 10:40:31', 34);
INSERT INTO `sys_oper_log` VALUES (1968, '专业信息', 2, 'com.xintong.controller.admin.MajorAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/edit', '60.12.13.184', 'XX XX', '{\"details\":\"音乐是通过有组织的音符表达情感、思想和文化的一种艺术形式。它涵盖了作曲、演奏、演唱、音乐理论研究、音乐教育等多个方面，旨在培养学生的音乐感知能力、创造力和表现力，以满足社会对音乐艺术人才的需求。\",\"id\":42,\"jobDetails\":\"音乐专业就业选择丰富，可在音乐教育领域，担任中小学、高校音乐教师或私人音乐培训导师，传授音乐技艺与理论知识；投身表演艺术行业，成为乐团演奏员、独唱 / 独奏演员，活跃于舞台与音乐厅；在音乐制作领域，担任音乐制作人、编曲师，为影视作品、广告、游戏打造原创音乐；也可在文化艺术机构，从事音乐活动策划、音乐文化推广，助力音乐文化传播与发展。\\n\",\"level\":2,\"name\":\"音乐\",\"nameEn\":\"Music\",\"pageNum\":1,\"pageSize\":10,\"parentId\":4,\"subTitle\":\"\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-14 10:40:56', 35);
INSERT INTO `sys_oper_log` VALUES (1969, '专业信息', 2, 'com.xintong.controller.admin.MajorAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/edit', '60.12.13.184', 'XX XX', '{\"details\":\"美术学是一门研究艺术创作、艺术理论与文化传承的综合性学科，涵盖绘画、雕塑、设计、美术教育、美术史论等多个领域。其目标是通过系统训练，培养学生掌握艺术创作技能、审美判断能力与创新思维，同时深入理解艺术的历史脉络与社会文化价值，为社会输送能够在艺术创作、教育、研究及文化产业中发挥作用的专业人才。\",\"id\":43,\"jobDetails\":\"美术专业就业前景广阔，在艺术创作领域，可成为自由画家、雕塑家，投身艺术表达与创新；设计行业中，担任平面设计师塑造品牌视觉形象，作为室内设计师打造理想生活与商业空间，或是成为 UI/UX 设计师优化用户交互体验；教育行业里，在中小学、高校或艺术培训机构担任美术教师，传承美术知识与技艺；还能在影视动漫产业，从事角色与场景设计、特效制作，助力影视作品呈现奇幻视觉盛宴。\",\"level\":2,\"name\":\"美术\",\"nameEn\":\"Fine Art\",\"pageNum\":1,\"pageSize\":10,\"parentId\":4,\"subTitle\":\"\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-14 10:52:26', 30);
INSERT INTO `sys_oper_log` VALUES (1970, '专业信息', 2, 'com.xintong.controller.admin.MajorAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/edit', '60.12.13.184', 'XX XX', '{\"details\":\"戏剧与影视专业是一门综合性学科，主要研究戏剧、电影、电视等艺术形式的理论与实践，涵盖剧本创作、表演、导演、制作、影视技术、影视批评等多个领域。它旨在培养具备扎实戏剧与影视专业知识、实践能力和创新精神的人才，以满足社会对戏剧、影视创作、制作、传播和产业发展等方面的需求。戏剧与影视专业不仅关注艺术创作与表演，还致力于推动影视文化的传播与影视产业的发展。\",\"id\":44,\"jobDetails\":\"戏剧与影视专业就业路径多元，可投身影视制作，成为导演把控创作方向、编剧撰写精彩故事、摄影师定格绝美画面；在舞台演出领域，担任戏剧导演编排剧目、舞台美术设计师打造梦幻场景；在影视发行与放映行业，从事影视发行策划、影院运营管理；还能在新兴的短视频与网络影视领域，作为内容创作者、运营者，以创意和专业打造爆款作品。\",\"level\":2,\"name\":\"戏剧与影视\",\"nameEn\":\"Drama and Theatre Arts\",\"pageNum\":1,\"pageSize\":10,\"parentId\":4,\"subTitle\":\"\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-14 10:52:41', 30);
