INSERT INTO `sys_oper_log` VALUES (2138, '专业信息', 2, 'com.xintong.controller.admin.MajorAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/edit', '60.12.13.184', 'XX XX', '{\"details\":\"数学是一门研究数量、结构、变化以及空间模型等概念的学科。它通过抽象化和逻辑推理的方法，对各种现象进行精确的描述和深入的分析，是自然科学、工程技术、社会科学等众多领域的重要基础。\",\"id\":22,\"jobDetails\":\"数学专业就业广泛，可在科研机构深耕理论研究、在教育领域培育人才，也能在金融、科技行业借助数学模型与算法助力量化分析、技术研发等工作。\",\"level\":2,\"name\":\"数学\",\"nameEn\":\"Mathematics\",\"pageNum\":1,\"pageSize\":10,\"parentId\":3,\"subTitle\":\"\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-14 16:07:35', 37);
INSERT INTO `sys_oper_log` VALUES (2139, '专业信息', 2, 'com.xintong.controller.admin.MajorAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/edit', '60.12.13.184', 'XX XX', '{\"details\":\"统计学是一门专注于数据的收集、处理、分析和解释，以及概率论基本理论和应用的学科。它通过对大量数据进行量化分析，总结经验规律，做出推断和预测，从而为各领域的决策提供依据和参考。\",\"id\":23,\"jobDetails\":\"统计学专业人才活跃于金融、互联网、市场调研、医药等多行业，负责数据收集、分析与解读，为决策制定、产品优化、市场洞察、药物评估等提供关键支撑。\\n\",\"level\":2,\"name\":\"统计学\",\"nameEn\":\"Statistics\",\"pageNum\":1,\"pageSize\":10,\"parentId\":3,\"subTitle\":\"\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-14 16:08:04', 31);
INSERT INTO `sys_oper_log` VALUES (2140, '专业信息', 2, 'com.xintong.controller.admin.MajorAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/edit', '60.12.13.184', 'XX XX', '{\"details\":\"统计学是一门专注于数据的收集、处理、分析和解释，以及概率论基本理论和应用的学科。它通过对大量数据进行量化分析，总结经验规律，做出推断和预测，从而为各领域的决策提供依据和参考。\",\"id\":23,\"jobDetails\":\"统计学专业人才活跃于金融、互联网、市场调研、医药等多行业，负责数据收集、分析与解读，为决策制定、产品优化、市场洞察、药物评估等提供关键支撑。\\n\",\"level\":2,\"name\":\"统计学\",\"nameEn\":\"Statistics\",\"pageNum\":1,\"pageSize\":10,\"parentId\":3,\"subTitle\":\"\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-14 16:08:19', 31);
INSERT INTO `sys_oper_log` VALUES (2141, '专业信息', 2, 'com.xintong.controller.admin.MajorAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/edit', '60.12.13.184', 'XX XX', '{\"details\":\"数据科学是一门融合数学、统计学、计算机科学以及特定领域知识的交叉学科，聚焦于运用算法、数据分析、机器学习和统计方法，从大量复杂数据中挖掘有价值信息，以解决复杂问题，助力科学精准决策。\",\"id\":24,\"jobDetails\":\"数据科学专业人才在科技、金融、电商等领域发挥关键作用，承担数据挖掘、算法设计、业务分析等工作，驱动产品创新、风险管控与服务优化。\",\"level\":2,\"name\":\"数据科学\",\"nameEn\":\"Data Science\",\"pageNum\":1,\"pageSize\":10,\"parentId\":3,\"subTitle\":\"\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-14 16:08:45', 31);
INSERT INTO `sys_oper_log` VALUES (2142, '专业信息', 2, 'com.xintong.controller.admin.MajorAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/edit', '60.12.13.184', 'XX XX', '{\"details\":\"物理学是一门研究物质、能量、空间和时间基本性质及其相互关系的学科，旨在揭示自然界的基本规律，探索物质的本质结构和宇宙的运行机制。它通过实验观测和理论推导，构建起对自然世界的深刻理解，为众多科学技术领域提供理论基础和研究方法，推动人类对世界认知的不断拓展。\",\"id\":25,\"jobDetails\":\"物理专业毕业生能在科研机构探索宇宙奥秘，在教育行业传播知识，也可在电子、能源、航空航天等领域参与技术研发与产品设计。\",\"level\":2,\"name\":\"物理\",\"nameEn\":\"Physics\",\"pageNum\":1,\"pageSize\":10,\"parentId\":3,\"subTitle\":\"\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-14 16:09:20', 31);
INSERT INTO `sys_oper_log` VALUES (2143, '专业信息', 2, 'com.xintong.controller.admin.MajorAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/edit', '60.12.13.184', 'XX XX', '{\"details\":\"化学化工是一门融合化学基础理论与工程技术应用的综合性学科，旨在通过研究物质的组成、结构、性质及变化规律，开发高效生产工艺并解决实际问题。化学侧重于基础理论与实验研究（如有机合成、材料分析），化工则聚焦于工业流程设计、优化与管理（如反应工程、过程控制）。两者共同推动能源、材料、医药等领域的创新与发展。\",\"id\":26,\"jobDetails\":\"化学化工专业人才在化工、材料、制药等行业从事产品研发、工艺优化、质量控制等工作，推动化工产业创新与可持续发展。\",\"level\":2,\"name\":\"化学化工\",\"nameEn\":\"Chemistry\",\"pageNum\":1,\"pageSize\":10,\"parentId\":3,\"subTitle\":\"\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-14 16:09:50', 31);
INSERT INTO `sys_oper_log` VALUES (2144, '专业信息', 2, 'com.xintong.controller.admin.MajorAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/edit', '60.12.13.184', 'XX XX', '{\"details\":\"生物科学是研究生命现象和生命活动规律的学科，涵盖从微观分子机制（如基因表达、细胞代谢）到宏观生态系统（如生物多样性、生态关系）的各个层次，旨在揭示生命本质、推动技术创新并解决人类面临的健康、环境、资源等重大问题。\",\"id\":27,\"jobDetails\":\"生物科学专业就业方向多元，可在科研与教育领域探索生命奥秘、培育专业人才，也能在医药、农业、环保等行业助力研发创新、产业升级。\",\"level\":2,\"name\":\"生物科学\",\"nameEn\":\"Biology\",\"pageNum\":1,\"pageSize\":10,\"parentId\":3,\"subTitle\":\"\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-14 16:10:15', 31);
INSERT INTO `sys_oper_log` VALUES (2145, '专业信息', 2, 'com.xintong.controller.admin.MajorAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/edit', '60.12.13.184', 'XX XX', '{\"details\":\"地球科学是研究地球系统及其各圈层（岩石圈、水圈、大气圈、生物圈）的结构、演化过程和相互作用的综合性学科，涵盖自然现象、资源开发、环境保护及灾害防治等领域。其目标是通过多学科交叉方法揭示地球运行规律，为可持续发展提供科学依据。\",\"id\":28,\"jobDetails\":\"地球科学专业人才在科研机构、政府部门、企业等从事地质勘探、环境监测、资源开发管理等工作，为地球资源利用与环境保护提供专业支持。\",\"level\":2,\"name\":\"地球科学\",\"nameEn\":\"Earth Sciences\",\"pageNum\":1,\"pageSize\":10,\"parentId\":3,\"subTitle\":\"\"}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-14 16:10:38', 31);
INSERT INTO `sys_oper_log` VALUES (2146, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"研究地球物质组成、内部结构及演化历史，聚焦矿产资源勘探、地质灾害监测（如地震、火山）及能源开发（石油、天然气）。\",\"id\":258,\"level\":3,\"name\":\"地质学\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":28}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-14 16:12:46', 45);
INSERT INTO `sys_oper_log` VALUES (2147, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"通过化学方法分析地球及天体的元素分布与迁移规律，应用于矿产勘探、环境污染评估及全球气候变化研究。\",\"id\":259,\"level\":3,\"name\":\"地球化学\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":28}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-14 16:12:56', 41);
INSERT INTO `sys_oper_log` VALUES (2148, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"利用物理方法研究地球内部构造、地震波传播及能源探测，服务于地震预测、油气勘探和工程地质评估。\",\"id\":260,\"level\":3,\"name\":\"地球物理学\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":28}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-14 16:14:14', 44);
