INSERT INTO `sys_oper_log` VALUES (2296, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"运用物理法则研究宇宙中各种现象，如宇宙起源、行星探索等，核心是广义相对论的应用，致力于揭开宇宙的神秘面纱，了解天体的形成、演化和相互作用。\",\"id\":280,\"level\":3,\"name\":\"天体物理\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":25}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-14 16:44:28', 51);
INSERT INTO `sys_oper_log` VALUES (2297, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"借助流体力学和热力学原理，解释气候和洋流变化，关注气候变化、臭氧层空洞等问题，为地球环境研究和气候预测提供理论支持。\",\"id\":281,\"level\":3,\"name\":\"气候、洋流及行星物理\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":25}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-14 16:44:38', 42);
INSERT INTO `sys_oper_log` VALUES (2298, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"聚焦原子和分子的量子特性，研究物质与射线的相互作用，当前主要研究方向为量子计算机等前沿技术，探索微观世界的奥秘并推动量子技术发展。\",\"id\":282,\"level\":3,\"name\":\"原子和激光物理\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":25}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-14 16:45:04', 43);
INSERT INTO `sys_oper_log` VALUES (2299, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"深入探究固体在微观层面的基本性质，研究原子和电子在不同环境下的变化与反应，如超导现象，广泛应用于高科技材料研发，促进材料科学的进步。\",\"id\":283,\"level\":3,\"name\":\"凝聚态物理\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":25}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-14 16:45:15', 42);
INSERT INTO `sys_oper_log` VALUES (2300, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"专注于物质最微观组成部分 —— 粒子（如电子、中微子和夸克）之间的反应，探寻新粒子，揭示物质的深层次结构和基本相互作用规律。\",\"id\":284,\"level\":3,\"name\":\"亚原子物理\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":25}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-14 16:45:25', 45);
INSERT INTO `sys_oper_log` VALUES (2301, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"侧重于数学在物理法则领域的应用，像爱因斯坦的相对论、经典场理论等，通过数学模型和理论推导，为物理学发展提供理论框架和方向指引。\",\"id\":285,\"level\":3,\"name\":\"理论物理\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":25}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-14 16:45:35', 43);
INSERT INTO `sys_oper_log` VALUES (2302, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"不仅研究物理学基本理论与方法，还涵盖电子技术、计算机技术、光纤通信技术等应用基础知识和实验技术，注重将物理理论转化为实际应用。\",\"id\":286,\"level\":3,\"name\":\"应用物理学\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":25}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-14 16:45:45', 42);
INSERT INTO `sys_oper_log` VALUES (2303, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"专门研究原子核结构及其反应变化规律，是粒子物理学在原子核层面的深入探索，在核能利用、核技术应用等方面具有重要意义。\",\"id\":287,\"level\":3,\"name\":\"核物理\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":25}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-14 16:45:54', 42);
INSERT INTO `sys_oper_log` VALUES (2304, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"作为现代物理学的重要理论基础之一，研究物质世界微观粒子的运动规律，涉及原子、分子、凝聚态物质以及原子核和基本粒子的结构与性质。\",\"id\":288,\"level\":3,\"name\":\"量子力学\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":25}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-14 16:46:09', 43);
INSERT INTO `sys_oper_log` VALUES (2305, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"融合力学基本理论与实际应用，解决建筑工程等领域的设计、施工、管理问题，如复杂建筑结构设计和力学分析，实现理论与实践的紧密结合。\",\"id\":289,\"level\":3,\"name\":\"理论与应用力学\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":25}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-14 16:46:20', 41);
INSERT INTO `sys_oper_log` VALUES (2306, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"研究物体的机械运动规律，涵盖质点运动、牛顿运动定律、功和能、动量守恒等内容，是理解宏观物体运动的基础。\",\"isActive\":1,\"majorId\":25,\"name\":\"经典力学\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-14 16:46:55', 11);
INSERT INTO `sys_oper_log` VALUES (2307, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"主要探讨电荷、电场、磁场的基本性质，以及它们之间的相互作用规律，包括库仑定律、安培定律、法拉第电磁感应定律等，为电学和磁学的深入学习奠基。\",\"isActive\":1,\"majorId\":25,\"name\":\"电磁学和静电学\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-14 16:47:07', 11);
INSERT INTO `sys_oper_log` VALUES (2308, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"涉及机械振动和波的产生、传播特性，如简谐运动、叠加原理、衍射干涉现象；同时介绍光的传播、反射、折射等性质，以及麦克斯韦方程组对光的电磁本质的阐述。\",\"isActive\":1,\"majorId\":25,\"name\":\"机械振动和波；光学等\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-14 16:47:18', 11);
INSERT INTO `sys_oper_log` VALUES (2309, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"分为狭义相对论和广义相对论，狭义相对论主要讨论时间和空间的相对性、光速不变原理等；广义相对论则研究引力现象，揭示物质和时空的关系，是现代物理学的重要基石。\",\"isActive\":1,\"majorId\":25,\"name\":\"相对论\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-14 16:47:35', 12);
INSERT INTO `sys_oper_log` VALUES (2310, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"研究微观世界的现象和规律，如量子态、波粒二象性、不确定性原理等，解释原子、分子等微观系统的行为，颠覆了传统物理学对微观世界的认知。\",\"isActive\":1,\"majorId\":25,\"name\":\"量子物理学\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-14 16:47:49', 13);
INSERT INTO `sys_oper_log` VALUES (2311, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"进一步深入探讨电磁相互作用，涵盖电动力学的基本理论，如电磁场的基本方程、电磁波的传播等，在现代通信、电子技术等领域有广泛应用。\",\"isActive\":1,\"majorId\":25,\"name\":\"电磁学\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-14 16:47:55', 11);
INSERT INTO `sys_oper_log` VALUES (2312, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"运用统计方法研究大量微观粒子组成的系统的宏观性质，通过对微观状态的统计平均，解释物质的热力学性质，如温度、压强、熵等概念。\",\"isActive\":1,\"majorId\":25,\"name\":\"统计物理学\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-14 16:48:05', 11);
INSERT INTO `sys_oper_log` VALUES (2313, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"着重讲解微分方程的求解方法及其在波动现象中的应用，如波动方程的推导和求解，加深学生对波动现象的数学理解。\",\"isActive\":1,\"majorId\":25,\"name\":\"微分方程与波\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-14 16:48:22', 11);
