INSERT INTO `sys_oper_log` VALUES (2322, '专业行业应用', 1, 'com.xintong.controller.admin.MajorApplyAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/apply/add', '60.12.13.184', 'XX XX', '{\"description\":\"在汽车、航空航天、体育器材等行业，利用物理和力学知识进行新材料研发、产品结构设计优化，提升产品性能和安全性，如汽车安全系统设计、新型体育器材的力学性能改进。\",\"industryLogo\":\"http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202412311544/icon_merchant%20bank.png\",\"industryName\":\"产品开发与创新\",\"majorId\":25,\"majorName\":\"物理\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-14 16:48:51', 13);
