INSERT INTO `sys_oper_log` VALUES (2382, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"运用机器学习算法、统计分析等技术，从海量数据中探寻潜在的、有价值的信息和模式，广泛应用于电商用户购买模式挖掘、医疗数据分析等领域。\",\"id\":290,\"level\":3,\"name\":\"数据挖掘\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":24}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-14 17:02:59', 40);
INSERT INTO `sys_oper_log` VALUES (2383, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"致力于让计算机从数据中学习规律，实现对未知数据的预测和决策，涵盖监督学习、无监督学习、强化学习等范式，在图像识别、语音识别等方面发挥关键作用。\",\"id\":291,\"level\":3,\"name\":\"机器学习\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":24}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-14 17:03:07', 40);
INSERT INTO `sys_oper_log` VALUES (2384, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"作为机器学习的分支，借助深度神经网络自动学习数据的复杂特征表示，推动了计算机视觉、自然语言处理等领域的突破性进展。\",\"id\":292,\"level\":3,\"name\":\"深度学习\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":24}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-14 17:03:14', 40);
INSERT INTO `sys_oper_log` VALUES (2385, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"专注于研究处理海量、高速、多样数据的技术和架构，如分布式存储、分布式计算技术，利用 Hadoop、Spark 等框架解决大数据存储和处理难题。\",\"id\":293,\"level\":3,\"name\":\"大数据技术\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":24}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-14 17:03:30', 41);
INSERT INTO `sys_oper_log` VALUES (2386, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"运用数据科学方法研究社会现象和行为，通过分析社交媒体、人口统计等数据，探索社会网络结构、群体行为模式等。\",\"id\":294,\"level\":3,\"name\":\"计算社会科学\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":24}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-14 17:04:04', 41);
INSERT INTO `sys_oper_log` VALUES (2387, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"侧重于运用数学理论和方法构建统计学基础，借助概率论、数学分析等工具，研究统计推断、估计理论、假设检验等问题，为其他统计学分支提供理论支撑。\",\"id\":295,\"level\":3,\"name\":\"数理统计学\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":23}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-14 17:04:23', 40);
INSERT INTO `sys_oper_log` VALUES (2388, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"将统计学方法应用于各个领域以解决实际问题。依据不同应用场景，又细分为生物统计学、经济统计学、社会统计学等。\",\"id\":296,\"level\":3,\"name\":\"应用统计学\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":23}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-14 17:04:32', 41);
INSERT INTO `sys_oper_log` VALUES (2389, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"聚焦于数据的收集、整理、分析和解释，结合现代信息技术处理大规模复杂数据，运用数据挖掘、机器学习等技术提取有价值信息。\",\"id\":297,\"level\":3,\"name\":\"数据统计学\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":23}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-14 17:04:42', 41);
INSERT INTO `sys_oper_log` VALUES (2390, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"基于样本数据对总体特征进行推断和预测。利用抽样技术获取样本，通过参数估计、假设检验等方法，推断总体的分布特征、参数值等信息。\",\"id\":298,\"level\":3,\"name\":\"推断统计学\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":23}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-14 17:04:50', 44);
INSERT INTO `sys_oper_log` VALUES (2391, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"借助计算机技术解决统计学问题，涵盖开发数值计算算法、运用统计软件进行数据分析、实现模拟实验等。\",\"id\":299,\"level\":3,\"name\":\"计算统计学\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":23}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-14 17:05:00', 41);
INSERT INTO `sys_oper_log` VALUES (2392, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"以贝叶斯定理为基础，将先验信息与样本数据相结合进行统计推断。在不确定情况下，根据新的数据不断更新先验概率，得到后验概率，从而进行决策和预测。\",\"id\":300,\"level\":3,\"name\":\"贝叶斯统计学\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":23}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-14 17:05:09', 41);
INSERT INTO `sys_oper_log` VALUES (2393, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"系统学习概率的基本概念、定理和方法，是描述和处理随机现象的基础，为后续的统计推断和分析提供理论基石，在金融产品定价、风险管理和投资决策等方面意义重大。\",\"isActive\":1,\"majorId\":23,\"name\":\"概率论\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-14 17:05:28', 11);
INSERT INTO `sys_oper_log` VALUES (2394, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"深入研究统计推断、估计理论等数学基础，帮助学生理解如何从样本数据推断总体特征，为其他统计学分支提供严谨的理论支持，是统计学专业的核心理论课程。\",\"isActive\":1,\"majorId\":23,\"name\":\"数理统计学\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-14 17:05:38', 11);
INSERT INTO `sys_oper_log` VALUES (2395, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"学习将统计方法应用于实际问题的解决，培养学生运用统计学知识处理不同领域实际数据的能力，让学生掌握如何根据具体问题选择合适的统计方法。\",\"isActive\":1,\"majorId\":23,\"name\":\"应用统计学\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-14 17:05:48', 11);
INSERT INTO `sys_oper_log` VALUES (2396, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"掌握线性回归、非线性回归等模型及其应用，通过建立变量之间的数学关系，分析一个或多个自变量对因变量的影响，广泛应用于经济预测、市场分析等领域。\",\"isActive\":1,\"majorId\":23,\"name\":\"回归分析\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-14 17:05:57', 11);
INSERT INTO `sys_oper_log` VALUES (2397, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"学习实验设计方法和方差分析技术，能够合理设计实验，控制实验误差，分析实验数据中不同因素的影响，常用于医学研究、工业生产优化等方面。\",\"isActive\":1,\"majorId\":23,\"name\":\"方差分析与实验设计\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-14 17:06:07', 11);
INSERT INTO `sys_oper_log` VALUES (2398, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"研究时间序列数据的建模和预测方法，用于分析随时间变化的数据，预测未来趋势，在经济、金融、气象等领域有重要应用，如预测股票价格走势、电力负荷变化等。\\n\",\"isActive\":1,\"majorId\":23,\"name\":\"时间序列分析\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-14 17:07:54', 15);
INSERT INTO `sys_oper_log` VALUES (2399, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"学习如何开展统计学研究和撰写学术论文，包括研究选题、文献综述、研究设计、数据收集与分析、论文撰写等方面的知识和技能，提升研究生的科研素养和能力。\",\"isActive\":1,\"majorId\":23,\"name\":\"统计学研究方法\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-14 17:08:05', 11);
