INSERT INTO `sys_oper_log` VALUES (2443, '专业行业应用', 1, 'com.xintong.controller.admin.MajorApplyAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/apply/add', '60.12.13.184', 'XX XX', '{\"description\":\"在物理学中，数学用于描述物理现象、推导物理定律，如牛顿力学、量子力学都依赖大量数学公式和模型；天文学中，运用数学计算天体轨道、预测天文现象；化学领域，数学帮助分析化学反应过程、分子结构等。\",\"industryLogo\":\"http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202412311544/icon_Tax%20planning.png\",\"industryName\":\"自然科学领域\",\"majorId\":22,\"majorName\":\"数学\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-14 17:17:05', 11);
INSERT INTO `sys_oper_log` VALUES (2444, '专业行业应用', 1, 'com.xintong.controller.admin.MajorApplyAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/apply/add', '60.12.13.184', 'XX XX', '{\"description\":\"在计算机科学中，数学是算法设计、数据结构、人工智能、机器学习的基础，例如深度学习中的神经网络训练涉及大量矩阵运算和优化算法；在电子工程中，用于电路分析、信号处理；在机械工程中，进行力学分析、结构设计优化等都离不开数学。\",\"industryLogo\":\"http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202412311544/icon_merchant%20bank.png\",\"industryName\":\"工程技术领域\",\"majorId\":22,\"majorName\":\"数学\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-14 17:17:16', 10);
INSERT INTO `sys_oper_log` VALUES (2445, '专业行业应用', 1, 'com.xintong.controller.admin.MajorApplyAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/apply/add', '60.12.13.184', 'XX XX', '{\"description\":\"数学在金融市场分析、投资风险评估、资产定价等方面发挥关键作用。例如，通过数学模型预测股票价格走势、评估投资组合的风险与收益；在经济学中，用于构建经济模型，分析宏观经济趋势、微观经济主体行为，为政策制定提供依据。\",\"industryLogo\":\"http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202412311544/icon_risk%20management.png\",\"industryName\":\"金融经济领域\",\"majorId\":22,\"majorName\":\"数学\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-14 17:17:28', 11);
INSERT INTO `sys_oper_log` VALUES (2446, '专业行业应用', 1, 'com.xintong.controller.admin.MajorApplyAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/apply/add', '60.12.13.184', 'XX XX', '{\"description\":\"在社会学、心理学等学科中，运用统计学方法对社会现象、心理数据进行量化分析，以揭示社会规律、了解人群行为模式；在市场调研中，通过数据分析帮助企业了解消费者需求、市场趋势，制定营销策略。\",\"industryLogo\":\"http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202412311544/icon_commercial%20bank.png\",\"industryName\":\"社会科学领域\",\"majorId\":22,\"majorName\":\"数学\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-14 17:17:41', 11);
INSERT INTO `sys_oper_log` VALUES (2447, '专业行业应用', 1, 'com.xintong.controller.admin.MajorApplyAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/apply/add', '60.12.13.184', 'XX XX', '{\"description\":\"在医学研究中，利用数学和统计学方法进行疾病模型构建、药物疗效评估、医学图像处理等。例如，通过统计分析临床试验数据判断药物的有效性和安全性；利用数学模型模拟疾病传播过程，为疫情防控提供决策支持。\\n\",\"industryLogo\":\"http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202412311544/icon_financial%20planning.png\",\"industryName\":\"医学领域\",\"majorId\":22,\"majorName\":\"数学\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-14 17:17:52', 12);
