INSERT INTO `sys_oper_log` VALUES (2453, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"单变量微积分侧重于函数导数、积分计算及相关定理，像通过求导判断函数单调性，积分计算曲线围成面积。多变量微积分则将概念拓展到多元函数，在物理计算物体质心、电磁学计算场通量等方面广泛应用，是后续分析类课程学习的基石。\",\"isActive\":1,\"majorId\":22,\"name\":\"微积分\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-14 17:18:35', 10);
INSERT INTO `sys_oper_log` VALUES (2454, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"围绕向量、矩阵和线性方程组展开，教授矩阵运算、向量空间、线性变换等知识。\",\"isActive\":1,\"majorId\":22,\"name\":\"线性代数\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-14 17:18:49', 10);
INSERT INTO `sys_oper_log` VALUES (2455, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"深入剖析这些结构性质和运算规则，群论在密码学非对称加密算法有应用；环和域理论为编码理论、数论研究提供理论支撑，培养学生抽象思维和逻辑推理能力。\",\"isActive\":1,\"majorId\":22,\"name\":\"抽象代数\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-14 17:19:08', 11);
INSERT INTO `sys_oper_log` VALUES (2456, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"研究实数集、函数极限、连续、可微和可积性等。\",\"isActive\":1,\"majorId\":22,\"name\":\"实分析\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-14 17:19:29', 11);
INSERT INTO `sys_oper_log` VALUES (2457, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"讲解复变函数解析性、柯西积分定理、留数定理等。在流体力学模拟流体流动、信号处理分析周期信号、电气工程计算交流电路等领域广泛应用。\",\"isActive\":1,\"majorId\":22,\"name\":\"复分析\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-14 17:19:41', 10);
INSERT INTO `sys_oper_log` VALUES (2458, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"研究几何图形或空间连续变形不变性质。\",\"isActive\":1,\"majorId\":22,\"name\":\"拓扑学\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-14 17:19:56', 11);
INSERT INTO `sys_oper_log` VALUES (2459, '主要学习课程', 1, 'com.xintong.controller.admin.MajorCourseAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/course/add', '60.12.13.184', 'XX XX', '{\"courseSummary\":\"包括常微分方程和偏微分方程：常微分方程研究含有一个自变量的微分方程，用于描述物体运动、电路中电流变化等；偏微分方程处理多个自变量的情况，在热传导、波动方程等物理问题以及工程领域的结构力学分析中广泛应用 。\",\"isActive\":1,\"majorId\":22,\"name\":\"微分方程\"}', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-02-14 17:20:22', 11);
