INSERT INTO `sys_oper_log` VALUES (2467, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"又称纯粹数学，专注于数学结构本身内在规律的研究，以纯粹形式探究事物的数量关系和空间形式。研究方向涵盖代数学、函数论、拓扑学、微分方程、组合与优化等。\",\"id\":301,\"level\":3,\"name\":\"基础数学\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":22}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-14 17:21:22', 39);
INSERT INTO `sys_oper_log` VALUES (2468, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"该专业将数学与计算机紧密结合，在培养学生扎实数学基础和数学思维能力的同时，使其能够熟练运用计算机，以高效算法解决复杂数学问题。\",\"id\":302,\"level\":3,\"name\":\"信息与计算科\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":22}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-14 17:21:31', 38);
INSERT INTO `sys_oper_log` VALUES (2469, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"既研究数学基本理论与发展规律，又注重运用数学知识解决现实生活、其他学科以及科学技术中遇到的实际问题。\",\"id\":303,\"level\":3,\"name\":\"数学与应用数学\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":22}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-14 17:21:40', 39);
INSERT INTO `sys_oper_log` VALUES (2470, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"也叫数值计算方法或数值分析，主要内容包括代数方程、线性代数方程组、微分方程的数值解法，函数的数值逼近，矩阵特征值的求解，最优化计算以及概率统计计算等问题，还涉及解的存在性、唯一性、收敛性和误差分析等理论研究。\",\"id\":304,\"level\":3,\"name\":\"计算数学\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":22}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-14 17:21:49', 43);
INSERT INTO `sys_oper_log` VALUES (2471, '专业信息', 1, 'com.xintong.controller.admin.MajorAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/major/add', '60.12.13.184', 'XX XX', '{\"details\":\"是应用目的明确的数学理论和方法的总称，研究如何将数学知识应用到其他领域，特别是科学领域。\",\"id\":305,\"level\":3,\"name\":\"应用数学\",\"nameEn\":\"\",\"pageNum\":1,\"pageSize\":10,\"parentId\":22}', '{\"msg\":\"操作成功\",\"code\":200}', 0, NULL, '2025-02-14 17:22:02', 39);
