INSERT INTO `sys_oper_log` VALUES (2523, '消息', 1, 'com.xintong.controller.admin.MessageAdminController.add()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/message/add', '60.12.13.184', 'XX XX', '{\"content\":\"<h3><span style=\\\"font-size: 29px;\\\">悉尼新南威尔士大学金融硕士课程更新</span><span style=\\\"color: rgb(6, 6, 7);\\\"><br></span></h3><h3><span style=\\\"color: rgb(6, 6, 7); font-family: 微软雅黑;\\\">商学院将于</span><span style=\\\"background-color: rgb(255, 255, 255); font-size: 14px; font-family: 微软雅黑;\\\"><strong>2026 年第一学期推出新的金融硕士（8476）课程。这个为期两年的课程包括第一年的入门金融概念和第二年的高级金融课程。拥有金融本科学位的学生有资格申请学分减免RPL，将学习时长缩短至一年。更多信息请点击Master of Finance degree finder page</strong></span></h3><p><span style=\\\"font-size: 14px;\\\"><strong>1. 金融硕士课程（8476）现已开放2026年入学的在线申请。</strong></span></p><p><span style=\\\"font-size: 14px;\\\">2. 已申请2026年金融硕士课程（8406）的学生将很快收到通知关于是否愿意被考虑转入新的金融硕士课程（8476），并发放相应的学分减免（RPL）如适用。不愿转入新课程的学生，其申请将被撤回并退还申请费（如适用）。</span></p><p><span style=\\\"font-size: 14px;\\\"><strong>3. 金融硕士课程（8406）将不再接受2025年第二学期和第三学期的新申请。已提交2025年申请的学生将很快收到通知，并提供以下选择：</strong></span></p><p><span style=\\\"background-color: transparent; font-size: 14px;\\\">将申请转为新课程，但保留2025年入学学期；</span></p><p><span style=\\\"background-color: transparent; font-size: 14px;\\\">将申请转为金融硕士课程（8476），并将申请移至2026年；</span></p><p><span style=\\\"background-color: transparent; font-size: 14px;\\\">撤回申请并退还申请费（如适用）。</span></p><p><span style=\\\"font-size: 14px;\\\"><strong>4. 已收到2025年第二学期和第三学期金融硕士课程（8406）offer的学生将收到通知，要求在截止日期前接受录取并支付押金，否则offer将失效。</strong></span><span style=\\\"color: rgb(64, 64, 64); background-color: transparent; font-size: 14px; font-family: 微软雅黑;\\\">这些学生将在稍后阶段收到关于金融硕士课程（8406）替代课程注册模式的说明。</span></p><p><span style=\\\"font-size: 14px;\\\"><strong>5. 已收到2025年第二学期和第三学期金融硕士课程（8406）有条件录取通知的学生将收到通知，要求在截止日期前上传补件，否则录取通知将失效。</strong></span></p><p><span style=\\\"font-size: 14px;\\\"><strong>6. 已获批2025年第二学期和第三学期金融硕士课程（8406）延期的学生将收到通知，要求在截止日期前完全接受延期，否则延期offer将失效。</strong></span></p><p><span style=\\\"font-size: 14px;\\\"><strong>7. 已申请2025年第二学期和第三学期金融硕士课程（8406）延期的学生将收到通知，可选择保留延期学期但更改课程，或将延期申请转为2026年金融硕士课程（8476）。</strong></span></p><p><span style=\\\"font-size: 14px;\\\"><strong>8. 已接受2025年第二学期和第三学期金融硕士课程（8406）正式录取通知的学生将收到关于替代课程注册模式的说明。</strong></span></p><p><span style=\\\"font-size: 1', '{\"msg\":\"新增成功\",\"code\":200}', 0, NULL, '2025-03-03 15:30:43', 143);
