INSERT INTO `sys_oper_log` VALUES (2789, '意向目的地基本要求', 2, 'com.xintong.controller.admin.RegionInfoAdminController.edit()', 'POST', 1, 'admin', '研发部门', '/xt-consult/admin/regionInfo/edit', '10.10.109.6', '内网IP', '{\"advantages\":\"院校世界排名高认可度高，学制相对短，申请要求客观友好，文化底蕴深厚，留学环境安全包容。\",\"appMaterial\":\"高中学术成绩单&K&在读证明/毕业证书&K&A-Level或同等学历成绩&K&UCAS申请表&K&推荐信&K&雅思/托福成绩&K&财务证明&K&作品集（如适用）&K&面试（如适用）&K&其他补充材料（如适用）\",\"budgetDetail\":\"每年总预算约为20-35万人民币\",\"budgetRange\":\"每年总预算约为20-35万人民币&K&*伦敦的生活成本高于其他城市\",\"countryFeat\":\"&k-topic-s&1.院校世界排名高：&k-topic-e&英国高等教育体系全球闻名，2025年QS世界大学排名，英国多所大学跻身前100位，排名仅次于美国，位列第二。&k-link-s&不懂问AI|https://www.deepseek.com/&k-link-e&&K&&k-topic-s&2.高等教育体制灵活：&k-topic-e&英国高等教育提供了多种入学途径，可以直入本科，如果不满足直入条件，可以就读预科或国际大一；如语言未达直入要求可搭配语言班。&K&&k-topic-s&3.最佳留学城市多：&k-topic-e&在2025QS全球最佳留学城市排名中，英国伦敦连续第六年蝉联榜首，爱丁堡位列全球第13。此外，英国共有16个城市进入全球最佳留学城市排名榜，其中8个城市进入全球TOP50。&K&&k-topic-s&4.文化和历史底蕴深厚：&k-topic-e&英国的城市如爱丁堡、曼彻斯特等不仅教育发达，还拥有丰富的历史遗迹和文化活动，为留学生提供了多彩的文化体验。&K&&k-topic-s&5.就业起点高机会多：&k-topic-e&英国大学的教育质量得到了国际认可，使得毕业生在全球范围内的就业竞争中占据有利地位，拥有更广阔的职业前景。\\n\",\"createdAt\":\"2024-01-01 10:00:00\",\"createdBy\":\"admin\",\"eduSystem\":\"通常本科3年制，苏格兰地区本科4年制，特殊专业4或5年以上。\",\"enrollTimeline\":\"http://xt-xc-video-test.oss-cn-hangzhou.aliyuncs.com/upload/202501071041/image%20(1).png\",\"id\":1,\"isActive\":0,\"isDeleted\":0,\"rankUrl\":\"\",\"regularProg\":\"英格兰、威尔士和北爱尔兰地区：通常为三年制。经过三年学习可获“荣誉学士学位”或“普通学士学位”。&K&苏格兰地区：通常为四年制。学生用三年时间攻读“普通学士学位”，四年时间获得“荣誉学士学位”。&K&某些专业如医学类、法学类、工程类等特殊专业，需要四-五年或更长时间。\",\"updatedAt\":\"2025-02-13 19:39:01\",\"updatedBy\":\"admin\"}', '{\"msg\":\"修改成功\",\"code\":200}', 0, NULL, '2025-06-24 16:31:04', 28);
